  ('f', 's.', NULL, 'Cl. 12', 'abacería: abacería, s. f sáppi) , la - e sáppo; -s tuáppo (el. 13), las -s o tuáppo; hay una - en el pueblo he sáppo sé sillé e eriia wela [he sappo sé sillé eria wella], tengo una - n okkí sáppo [nokí sáppo], voy a la - n la hella o sáppo [n la helóo sáppo).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('onno', 'adv.', NULL, NULL, 'abajo: abajo, adv. onno, oke, onnotyé; voy hacia - n la hella onno [na hellónno], n la hella oke [na heló oke]; los muchachos están - a baseseppe bá lé onno [a basesepe bá lónno], a baseseppe bá lé oke [a basesepe bá ló oke], ni estoy arriba ni estoy n tyí oOO''ó n tyí onnotyé [n tJóOO''ó n tJónnotJé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bototto', 's.', 'm.', 'Cl. 3', 'abalorio: bototto , - grande OOtotto (el. 3), el - grande o botottO, - pequeño sipopótto (el. 12), el- pequeño e sipopótto; -s grandes betotto (el. 4), los - grandes e betottO; -s pequeños topopótto (el. 13), los - pequeños o topopótto; la joven casadera de mi pueblo lle va muchos -s grandes o bulla 00 á e eriia m bo oríi betotto bikébíke [o bula buériam bórí bétotto bikébíke]; el bebé lleva -s pequeños en sus muñecas e sine''e si oríi topopótto a abbó bossó báí [e sine'' e sórí tópopótto abbó OOssó báí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'abandonar: abandonar, v. inf o tyí''a, o sOlla; preso yo aban dono n la tyí''a, tú abandonas o la tyí''a, él abando na a la tyí''a, etc., paso punto yo abandoné n tyí''i, tú abandonaste o tyí''i, él abandonó a tyí''i, etc., paso duro yo abandonaba n tyí''essi, tú abandona bas o tyí''essi, él abandonaba a tyí''essi, etc. Ej . E xpr.: mi gente me abandonó en la plaza a batyo m ba le tyí''i o riossa [a batJom bá le tJi''i o riossa], abandono mi trabajo n la solla e elakó m [n la sOleelakóm ).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'abanicar: abanicar, V. ir¡{. o bólláa; yo abanico al niño por que hace calor n la bólláa o bóllá kóri obotyo bo e húé [n la bóló bollá kóri obotJo wé huué]; -se o bóléa; yo me abanico con helechos n la bóléa la ketya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eOOllá', 'S.', 'm.', 'Cl. 7', 'abanico: eOOllá , el- e ebollá , el - está sobre el asiento ebollá e lá e empa puá [ebollá é lémpa puá]; -s mOOllá (el. 8), ibollá (el. 8), los -s e mbollá; quiero tres -s na na''a mbollá bié bittá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'abarcar: abarcar, v. inf o okanna, o okalla; preso yo abar co n la okanna [n lokanna], tú abarcas o la okan na [o lokanna], él abarca a la okanna [a 10 kanna], etc., paso punto yo abarqué n okari [nokari], tú abarcaste 00 okari [bookari], él abarcó e okari [ookari], etc., paso duro yo abar caba n okanessi [nokanessi], tú abarcabas 00 okanessi [OOokanessi], él abarcaba a okanessi [ookanessi], etc. Ej . Expr.: mi finca abarca toda la plantación de cacao o buáám m 00 okanna e epattá emmaa e bimmáloto [o buámm bókanne patemmaa e bímmáloto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'abastecer: abastecer, v. inf 1. o heráa, o íhórera, o háa;pres. yo abastezco n la íhórera [n líhórera], tú abaste ces o la íhórera [o líhórera], él abastece a la íhó rera [a líhórera], etc., paso punto yo abastecí n íhóreriia, tú abasteciste o íhóreriia, él abasteció a íhóreriia, etc., paso duro yo abastecia n íhórere siia, tú abastecías o íhóreresiia, él abastecía a 34() / abatimiento íhóreresiia, Ej . Expr.: el dueño de la tienda abastece de pan a los vecinos o boie e okkí e sáppo a la íhórera basoppo a batyo ba e epatto [o boie okkí é sappo a la ihórera basoppo a batSo bépatto]. 2. -se o háella; el hombre me abaste ció mi tienda o boie a le háeri e sáppo IÍI [o boie a le haeré sapp5oIÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riotta', 's.', 'm.', 'Cl. 5', 'abatimiento: riotta , bootta , obóttó (el. 3), el - e riotta, o bootta; -s baotta (el. 6), beotta (el. 4), los -s a baotta; e beotta; el - proviene del duro trabajo o bootta bó la puel la o á e elakó [o bootta bó la puelo élakkó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'abatir: abatir, v. inf. o oHáa; preso yo abato n la olláa [n 10Háa], tú abates o la olláa [o 101láa], él abate a la olláa [a 10Háa], etc.,pas. punto yo abatí n oríi [noríi], tú abatiste bO oríi [bOríi], él abatió a oríi [Mi], etc., p a so duro yo abatía n olessi [nOlessi], tú abatías bO olessi [bOlessi], él abatía a olessi [olessi], etc. Ej . E xpr.: el cazador abatió el venado o obébá orí e so''í [obébá óré so''i], llevo veinte días abatiendo cuervos ne''a billótyilla ná n la olláa ka''á [ne''a bílo tSilla ná n 100á ka''á].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buellá', 's.', 'm.', 'Cl. 3', 'abdomen: buellá , el - o buellá; -es biellá (el. 8), los -es e biellá; el - del niño está duro o buellá bO a o bOllá bo e to''ú [o buelá bó bóla bué to''ú], me duele el- o buelláIÍI bo e rop pá [o bueláIÍI bué roppá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonkinki', 's.', 'm.', 'Cl. 3', 'abejorro: bonkinki , enkinki , el - o bonkinki, e enkinki [eenkinkki] el - negro o bOnkinki builló; -s benkinki (el. 4), binkinki (el. 8), los -s e benkinki, e binkinki; hay muchos -s en la casa he benkinki bikébíke o tyóbbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bono''u', 's.', 'm.', 'Cl. 3', 'abismo: bono''u , el - o bono''u; -s beno''u (el. 4), los -s e beno''u; el río Cope está en un - e ríe rá Koppé ré bono''u wela.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'ablandar: ablandar, v. irif. 1. o bótánna, o botóbia; preso yo ablando n la bótánna, tú ablandas o la bótánna, él ablanda a la bótánna, etc.,pas. punto yo ablan dé n bótam [m bótam], tú ablandaste o bótam, él ablandó a botam, etc., paso duro yo ablandaba n botanessi [m bOtanessi], tú ablandabas o bOta nessi, él ablandaba a bótanessi, etc. Ex. Expr.: ablando la caña de azúcar n la bOtánna o bo''ó [n la bótánno bo''ó], el agua caliente ablanda la atanga a boppé bá e húé bá la bótánna e obbé [a boppé bé húe bá la bótánne obbé]. 2. -se o sálla; ¡no te ablandes! we sálIe!', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('seké', 'adj.', NULL, 'Cl. 12', 'abobado: abobado, adj. seké , ekakká ; el- e seké, e ekakká [ekakká]; -s tueké (el. 13), bikak ká (el. 8), los -s o tueké, e bikakká; estas - , eres un - we seké, we ekakká.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abobar: abobar, v. in! o ekébbia; estoy abobado ne ekébbi [nekébbi], esta persona está totalmente aboba da 010 bOtyo a séri o ekébba [oló bOtSo sero ékébba], 010 bOtyo a séri o sá seké [oló botSo seró sa seké].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abofetear: abofetear, v. in! o oppá lopatta, o oppá losá. Ej . Expr.: yo abofeteo a alguien n la oppá bOtyo lopatta [n IOpá bOtSo lopatta], abofeteé al policía ne oppí lopatta e eporoporo [ne opí lópatta eepo roporo], no me abofetees we le oppe lopatta [we lope lopatta].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obulaella', 's.', 'm.', 'Cl. 1', 'abogado: obulaella , oburí , el - o obulaella , o oburí , este es mi - ólo ká o obulaella IÍ1 [oló kóbulaelaaIÍl]; -s abulaella (el. 2), aburí (eI.2), los -s a abulael la, a aburí; los -s asisten a los ladrones a abu laella ba bulaella i húbbé [a abulaela ba lá bulae Ji húbbé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abogar: abogar, v. in! o bulaella,o ekella; preso yo abogo n la bulaeHa, n la ekella [n lekella], tú abogas o la bulaella, o la ekella [o lekella], él aboga a la bulaella, a la ekella [a lekella], etc.,pas. punto yo abogué n bulaeri, n ekeri [nekeri], tú abogaste o bulaeri, o ekeri [wekeri], él abogó a bulaeri, a ekeri [ekeri], etc., paso duro yo abogaba n bulae lessi [m bulaelessi], n ekelessi [nekelessi], tú abo gabas o bulaelessi, o ekelessi [wekelessi], él abogaba a bulaelessi, a ekelessi [ekelessi], etc. Ej . Expr.: el extranjero abogó por el anciano o boribáa a bulaeri e obéolla [o bOribá a buláeré obéolla], abogo por tu salud na ekella a lelle ó [nekela leleo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abolir: abolir, v. in! o kakkia; se han abolido las leyes e biette bi''a kakkio [e biette bi''a kákkio]. abrir / 347', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abominar: abominar, v. in! o kooa; a un familiar no está bien o kooa botyo a rihuee la tyi lelle [o koa botSo a ríhue la tSí lelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'abonar: abonar, v. in! o obba, o obella;pres. yo abono n la obba, tú abonas o la obba, él abona a la obba, etc., paso punto yo aboné n obbi, tú abonaste o obbi, él abonó a obbi, etc., paso duro yo abonaba n obessi, t ú abonabas o obessi, él abonaba a obessi, etc. Ej . E xpr.: le abono su trabajo n la bo obella e elakó á í [n la bO óbe1eeJakó áí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'aborrecer: aborrecer, V. in! o kooa; preso yo aborrezco n la kooa, tú aborreces o la kooa, él aborrece a la kooa, etc., paso punto yo aborrecí n kooi, tú aborrecis te o kooi, él aborreció a kooi, etc., paso duro yo aborrecía n koessi, tú aborrecias o koessi, él abo rrecía a koessi, Ej . Expr. : aborrezco el trabajo nocturno ne kooi e elakó a botyíó [ne kói eelakó á bótSió], n kooi e elako a botyíó [n koyélako á bótSió].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'abortar: abortar, V. in! o sokobba; la mujer tenía quince hijos y abortó su último embarazo o waísso a okkí bollá be ó ebéló e rebbe risubbá a ri sokob bi [sokobbi]. 2. hacer - o sokobbia; el médico hizo - a mi hermana e rokítta a sokobiia o wet ta m [e rokítta a sokobió wettaam].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esokobbi', 's.', 'm.', 'Cl. 7', 'aborto: esokobbi , ebitabitta , el - e esokobbi ; -s bisokobbi , mbitabitta (el. 8), los -s e bisokobbi, e mbitabit ta; la ley ya no castiga el - e eette e tyá la akka e esokobbi [eette tSá la akesokobbi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

