  ('ityaribba', 'S.', 'm.', 'Cl. 5', 'abril: ityaribba ; el mes de - tiene muchos tormentas o buéá wá ityaribba bo okkí pullá hNkehNke [o buéá wá itSaribba bokí púlla hNkehNke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
