  ('f', 's.', NULL, 'Cl. 1', 'abstinente: abstinente, s. f bOiIla , el - o boilla; -s bailla (el. 2), los -s a bailla. abuela, bOnánna (CI. 1), bonoolá (el. 1), la - o bonánna, o bonoolá; la - de mi madre o bonán na ó oberíi m [o bonánna-ó oberíim]; -s banánna (el. 2), banoolá (el. 2), las -s a banánna, a banoolá; las -s presiden el convite a banánna ba takeri o lorá [a banánna bá tákero lorá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
