  ('inf', 'v.', NULL, NULL, 'abultar: abultar, v. inf o ulla, o hulla; este envoltorio abulta con el frio rilo rihúo ri la ulla la e sille [rilo rihúo rí lá ulla le sílle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
