  ('bíke', 'adj.', NULL, NULL, 'abundante: abundante, adj. bíke (els. 2,4, 6, 8), Jíke (el. 6b), IíkeIíke (el. 6b), hNke (el. 10), túke (el. 13); - gente batyo (el. 2) bíke, -s plátanos bekobbe (el. 4) bíke, -s camas baatyé (el. 6) bíke; -s asuntos labba (el. 6b) Iíke, - poblados biriia (el. 8) bíke, -s sardinas kollo (el. 10) hÑke, -s pájaros tOnorí (el. 13) túke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'abundar: abundar, v. inf o bukká; este año abundan las f rutas 1010 loa e bihMrna bi bukkí [Ió loa e bihl\Í!ma bi búkkíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
