  ('f', 'S.', NULL, 'Cl. 5', 'academia: academia, S. f re''eri , la - e re''eri; - de policia e re''eri rá e iporosía [e re''eri re íporosía], - de inglés e re''eri rá e enkeléssi [e re''eri rénke léssi], - de la lengua bubi e re''eri rá o lot611ó luá e etyo [e re''eri ró lotóIló luétJo]; -s be''eri (el. 6), las -s a be''eri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'acaecer: acaecer, v. inf. o héttáa; los hechos acaecieron durante la noche e bilabba bí''a hétyíi botyíó [e bilaba bí''a hetJí bótJió], todo acaecerá en la guerra a labba lammaa lá''a héttá''á e bittá wela [a labba lammaa lá''a hetá''é bitta wéla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'acallar: acallar, V. ir¡[. o te''a; el jefe de poblado acalla a la gente o botúkku a la te''a a batyo [o botukú la aclimatar I 349 te''á batSo], hay que - las voces disidentes to tori o te''a a batyo ba lá tyipóbia bá [to toro te''á batSo ba lá tSipóbia bá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boello', 's.', 'm.', 'Cl. 3', 'acantilado: boello , el - o boello, -s beello (el. 4), los -s e beello; los -s no son bue nos en época de lluvia e beello be tyi biebie e esubba [e beello be tSí bíebie eesubba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'acarrear: acarrear, v. ir¡¡: o haóra, o olláa; yo acarreo agua n la haóra boppé, ayer acarreé agua para mi madre mpári n haweria o oberii tÍ1 boppé [mpári n haweri óberiIÍl boppé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'acatar: acatar, v. inf o ebbia, o ebbiera; acato las leyes n la ebbiera e biette [n la ebbiere biette], si no aca tas las leyes serás castigado na o ta ebbieria e biette o la akkio [na ó ta ebbíerié biere o la akkio].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'acceder: acceder, v. inj: 1. o ebbiera, o ebbia; accedo a ir contigo n ebbieria o sá o hNná [n ebbierio sá o hNná]. 2. o bella; no tuve tiempo para - a la cabaña sagrada n ta bessi o okkáa ebéló o bella e rohiáa wela [n ta bessi o okke ebéló o hellé rohiá wela]. acceso, n. m. telle (el. 9), el - e telle; -s telle (el. 10), los -s i telle; el - está cerrado e telle e ribei [e telle é ribei], los -s están cerrados i telle i ribei [i telle í ribei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, NULL, 'acción: acción, s. j : boosallo (el. 3), pohá (el. 9), la - o boosallo, e pohá; - de paz IObétto (el. 1 1), una mala - esomme (el. 7); acciones beosallo, pohá (el. 10), acciones crueles bisornme (el. 8), las acciones e beosallo, i pohá; no cometáis malas ac ciones lue palie o sá i pohá [Iue palio sa pohá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

