INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('ir', 'v.', NULL, NULL, 'accionar: accionar, v. ir¡¡: o bitella; acciono el mando para ver la televisión n la bitella o lobbo loto ka ekkáa o bokíssi bue birikiriki [n la bitello 10bM loto kekkó bokíssi bue bírikiriki]; he accionado el mando n ka biteri o lobbo loto [n ka bítero lobbo loto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'acechar: acechar, v. inj: o lotta, o notella; el vigilante me acecha con la mirada o bolotta a la le lotta la e ebOó [o bOlota la le lotta lebOó]. aceite, biitá (el. 6), butá (el. 6), bahNtá (el. 6), mitá (el. 6), matyátya (el. 6), - de palma, biitá bá ribOtyo, - de oliva biitá bá apottO; el - a biitá, a butá, a bahNtá, a mitá, a matyátya; el - se fun dió a biitá ba tyatyori [a biitá bá tSátSori], quiero comprar - na na''a o olla biitá [na na''o ola biitá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 9', 'aceitera: aceitera, s. j: pussa , la - e pussa; -s pussa (el. lO), las -s i pussa; busco una - n la utya pussa; la - grande e pussa koree. aceituna, s''¡: pillá (el. 9), nammo (el. 9), la - e pillá, e nammo; -s pillá (el. 10), narnmo (el. 10), las -s i pillá, i nammo; quiero dos -s n la na''a pillá yé mpa; no quiero dos -s n tyá na''a pillá yé mpa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'acelerar: acelerar, v. ir¡¡: o kasebia, o pélla bakasso; tene mos que - el paso para llegar to okkí ná to kase bia to palle [tokí á ná tó kasebi ia to pálle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'aceptación: aceptación, s. f ritáperi , la - e ritáperi; hemos recibido la -de la gente to táperi e ritápe ri ri a batyo [to taperé ritáperi rá bátSo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'aceptar: aceptar, v. inj: o tápella; acepto la comida n la tápella o bora''o [n la tapello bora''o], no acepto tus palabras n tyá la tápella a ballá o [n tSá tape la baláa o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 3', 'acequia: acequia, s. j: boakká , la - o boakká, -s beakká (el. 4), las -s e beakká; el pueblo tiene muchas -s e eriia okkí beakká bíkebíke [eeria okkí béakká bíkebíke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 5', 'acera: acera, s. j: riesso , la - e riessO i, -s baesso (el. 6), las -s a baesso; las -s son para las perso nas a baesso ká ba a batyo [a baesso ká ba bátSo]. inj: o e''era; acércame el pan e''era le', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'acezar: acezar, v. ir¡[. o hebella; los trabajadores acezan mucho a balakoláko ba la hebella likélíke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'acicalar: acicalar, v. inj: o pippa; acicalo a mi hija n la pip pa o bollá IÍl [n la pipo bolááÓ1]. 2. -se o pipea; me acicalo para ir a la fiesta n la pipea o bella o e ripelló [n la pipea o helló e ripelló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'aclamar: aclamar, v. inj: o bekolla; los ancianos aclaman al muchacho a bayolla ba lá bekolla o bOseseppe [a bayolla ba lá bekolo boseseppe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'aclarar: aclarar, v. inj: 1. o wera; la luna aclara la noche e r eeá ri lá wera o botyíó [e reá TÍ lá wero botSíÓ]. 2. o tukolla; aclara el agua porque tengo sed tukolla M a Mppé kóri ne noberí . 3. o tó''ia; por favor, aclárame lo que dices tyuíi, tó''ia le [tSuíi, tó''iálee].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'aclimatar: aclimatar, v. ir¡[. o ehiara, o ahuara; el hombre aclimata al extranjero o boie a la ahuara o bOri 350 I acoger báa [o boie a lahuaro boríbáa]. 2. -se o ehia, o ahualla; el niño se aclimata pronto o bollá a la ahualla bakasso [o bolá á lahualla bakasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'acoger: acoger, v. inf. o tápella; el jefe del pueblo acoge a la gente o botúkku a la tápella a batyo [o bOtukú la tapela batyo]; acojo a mi hermano n la tápella o bobelle ro [n la tapelo bobeleero].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ritutera', 'adj.', NULL, 'Cl. 5', 'acogida: acogida, adj. ritutera , la - e ritutera; -s batutera (el. 6), las -s a batutera; la doncella tuvo una buena - o bulla a okkí ritutera rere [o bula a okkí rítutera rere].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'acogotar: acogotar, v. in! o sára; las siluetas de los árbo les me acogotan e birikiriki biá batté bi la le sára [e birikiriki biá batté bí la le sara].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('m', 's.', NULL, 'Cl. 1', 'acompañante: acompañante, s. m/f. buéso''o , eso''o (el. 7), bOso''o (el. 3), esoko (el. 7), bOsábi''o (el. 1), - de cama bolokalla (el. 1), el - o buéso''o, e eso''o [eso'' o], o boso''o, e esoko [esoko], o bOsá bi''o; -s béso''o (el. 2), biso''o (el. 8), beso''o (el. 4), bisoko (el. 8); los -s a béso''o, e biso''o, e beso''o, e bisoko; los malos -s e biso''o ibé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'acompañar: acompañar, v. ini o ekkáa hNná , o fála; mi amigo me acompaña o wéso''o ro a la le ekka hNná [o wéso''oro a la lekka hNná], no me acompañes we le ekke hNná.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'aconsejar: aconsejar, v. in! o huella; preso yo aconsejo n la huella, tú aconsejas ola huella, él aconseja a la huella, etc., paso punto yo aconsejé n huem, n hueri, tú aconsejaste o huem, o hueri, él aconse jó a huem, a hueri, etc., paso duro yo aconsejaba n huelessi, tú aconsejabas o huelessi, él aconse jaba a huelessi, etc. Ej . Expr.: aconsejo a los niños n la huella a bOlIá [n la huella bollá], mi abuelo me aconsejó bien o boyolla ro a le huem lelle [o boyolla ro a le hue ro lelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eseríi', 'S.', 'm.', 'Cl. 7', 'acontecimiento: eseríi , elabba (el. 7), sokko (el. 12); el- e eserii [eeseríi], e elabba [eelabba], e sokko; -s biseríi (el. 8), bilabba (el. 8), tokko (el. 13), los -s e biseríi, e bilabba, o tokko; los -s de ayer e bilabba bia mpári [e bilab ba bia ropári].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'V.', NULL, NULL, 'acordar: acordar, V. il''!i o pélla ehattá. 2. -se o lebólea; no me he acordado n ta lebólei [n ta léb6leeí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribósekka', 'S.', 'm.', 'Cl. 5', 'acordeón: ribósekka , el - e ribósekka; acordeones abósekka (el. 6), los acordeones a abó sekka; el anciano toca bien el- e obéolla é la óppa e ribósekka lelle [e obéolla e lópé ribósekka lelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'acostar: acostar, V. inf. o lokkia; acuesto al niño n la lok kia o bollá [n la lokio bollá]. 2. -se o lokka, me acuesto pronto n la lokka bakasso; -se con alguien o lokanna, o lokalla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'V.', NULL, NULL, 'acostnmbrar: acostnmbrar, V. ini o ehiara, o ahuara; el hom bre acostumbra al extranjero a comer ñame o bOie a la ehiara o boríbáa o ráa biI10 [o bOie a lehiaro boribo ra bíIIO]. 2. -se o ehia, o ahualla; el niño se acostumbra pronto o bOllá a la ahual la bakasso [o bolá á lahuala bakasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'acrecentar: acrecentar, V. in! o bukkiáa; la lluvia acrecentó las ardillas i kóllá i bukkíia e besoppé [i kolá í búkkí é besoppé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

