INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('in', 'V.', NULL, NULL, 'activar: activar, V. in! o bityora, o kóbba; activo a las per sonas para que trabajen mucho n la kóbba a batyo ba bókobie IíkeIíke [n la kobbá batJo ba bókobie likélíke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elabba', 'S.', 'm.', 'Cl. 7', 'acto: elabba , ronno , el- e elab ba [elabba], e ronno; -s bilabba (el. 8), honno (el. 6), los -s e bilabba; el- se deja para maña na e elabba e tyieri o obari [elabba e tJiero óbari].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('S', 'adj.', NULL, NULL, 'actual: actual, adj. S. lello; este es un acto - elo elabba a lello [15110 elabba á lello]. 2. -mente, adv. lello, nkuáaó; vivo - en Basakato lello m péém isa katoo [lello mpééro ísakatoo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'actuar: actuar, v. inf. o sá, o báa, o pénna; he actuado durante mucho tiempo n ka pénn a ebéló etoeto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'V.', NULL, NULL, 'acudir: acudir, V. il''!l o hella, o tótta, o bekalla, o tóbba; yo acudo na MUa; persona que acude botótta (el. 1), personas que acuden batótta (el. 2); o bekalla, mi jefe acudió a la cita o mmásam a be kari o e etyiáeri [o rnmásaro a bekaró etJiáeri]; al biitéribbo o bó''a ebari; - a la casa de alguien con regalos u otros presentes o ipuera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehattá', 's.', 'm.', 'Cl. 7', 'acuerdo: ehattá , ehuáeri , buane r í (el. 3), 10''0 (el. 1 1), el - e ehattá [eehattá], e ehuáeri [eehuáeri], o buanerí; -s bihattá (el. 8), bianerí (el. 8); los -s e bihattá, e bianerí; de - 1515, eée, áelé; estoy de - 1515, n ka ebbia [n ká ébbia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'acusar: acusar, v. inj: o rikora; te acuso ante el pueblo n la o rikora e eriia alo [n lo ríkora eriaa alo), me acu saba sin hacer yo nada a le rikoresiia na ó ta pén na ollé ále [a le ríkoresiia na ó ta penna ollé ále].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyakaké', 's.', 'm.', 'Cl. 7', 'adefesio: etyakaké , el- e etyakaké [ee tSakaké); -s bityakaké (el. 8), los -s e bityakaké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inI', 'v.', NULL, NULL, 'adelantar: adelantar, v. inI o okátta, o okátella; me adelan ta siempre a la le okátella tyommaa [a la lokatel la tSommaa). 2. -se o okátta; me adelanto por que tengo prisa n la okátta kóri n la horibia [n nokátta kóri n na hOribia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obosso', 'adv.', NULL, NULL, 'adelante: adelante, adv. obosso, voy hacia - na hella obosso, ¡-! to etta''e [to etta''e, to eta''arÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inI', 'v.', NULL, NULL, 'adelgazar: adelgazar, v. inI o sikkáa; estos tres meses he adelgazado bié biéá bettá n ka sikkí [bié biea bettá n ka síkkíi), cuando no como adelgazo na n tyí''a ráa n la sikkáa [ná n tSá ráa n la sikkáa).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('borillo', 's.', 'm.', 'Cl. 3', 'ademán: borillo , epOlo , el - o borillo, e epolo [eepolo), ademanes berilio (el. 4), ipolo (el. 8), mpolo (el. 8), los ademanes e berilio, e ipOlo, e mpolo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'adiestrar: adiestrar, v. il''!f o é''ia; tienes que - a tu perro úwe bO okkí o é''ia e puá o [úwe bokio e''ie puM].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 3', 'adinamia: adinamia, s. j: boele , la - o bOele, -s bee le (el. 4), las -s e beele. adinerado, bori (el. 1), botyú''u (el. 1), boorí (el. 1), -s baori (el. 2), batyú''u (el. 2), los -s a baori, a batyú''u; los -s de la ciudad viven bien todos a baori bá ripotto ba péém lelle sóté [a bao rí bá ripotto bá péém lelle soté).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('o', 'adv.', NULL, NULL, 'adiós: adiós, adv. o sá úwe, n tyi aho [n tSí áho).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'adjudicar: adjudicar, v. il''!f o e''era; al abuelo le adjudica ron la palmera o bOyolla ba bo e''eriia o obílla [o bOyolla ba wé''eriobílla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 5', 'administración: administración, s. j: rekeri , la - e rekeri; administraciones bekeri (el. 6), las administra ciones a bekeri, las administraciones públicas a bekeri ba e eriia [a bekeri bériia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'administrar: administrar, v. il''!f o ekella; el español adminis tra las fincas del anciano o opanná a la ekella e mpattá bi e obéolla [opanná a lekelle mpattá bié óbeolla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'admirar: admirar, v. il''!f o bekolla; admiro a los hombres valientes n la bekolla a baie ba okkí ba to''ú [n la bekolla baie bokkí bó to''ú). 2. -se o bekolea, o atyánalelea; me admiro de mí mismo n la atyá nalelea [n latSánalelea].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 5', 'admisión: admisión, s. j: ritaperi , la - e ritaperi; admisiones bataperi (el. 6), las admisiones a bataperi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'admitir: admitir, v. inj: o tápella, o ebbia; admito que he faltado el respeto al maestro n ka ebbia ná n kuppia o bue''iáa [n ká ébbia ná n kupí ó bue''iáa), se admiten botellas ha lá tápella o epoteri [ha lá tapello époteri).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 7', 'adolescencia: adolescencia, s. j: esoko , la - e esoko [eesoko); -s bisoko (el. 8), las -s e bisoko; la es muy difícil e esoko é to''ú sóté [esokó é to''ú sóté].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosoko', 's.', 'm.', 'Cl. 1', 'adolescente: bosoko , el- o bosoko; -s basoko , los -s a basoko; los - s llenan la ciudad el día de la fiesta a basoko ba eri e ripottO ello á e ripelló [a basokó bá ére ripottO ello é rípelló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ké', 'adv.', NULL, NULL, 'adónde: adónde, adv. ké tye?; ¿- vas? ké tyé o la bella é?, voy - me da la gana n la bella e tyé n la na''a é [n la hellé tSe n la na''a él.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'adoptar: adoptar, v. inf o tápella, o bó''a ; he adoptado un niño n tápcri bollá [n taperi bOlla).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

