) VALUES
  ('ite', 's.', 'm.', 'Cl. 7', 'adoquín: ite , el - e ite; adoquines bate (el. 6), los adoquines a bate.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mpessó', 's.', 'm.', 'Cl. 3', 'adoquinado: mpessó , el- o mpessó; -s ipessó , los -s e ipessó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'adormecer: adormecer, v. inj: o lokkia; adormezco al niño n la lokkia o bollá [n la lokio bOlIá). 2. -se o lekél la; me adormecía en el coche n lekélessi o motóo wela [n lekélessi o motó wela].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'adornar: adornar, v. il''!f l. o pippa; adorno mi casa porque tengo una fiesta hoy n la pippa e tyóbbom kóri n ka okkí ripelló lello [n la pippe tS óbboom kóri kokí ]52 / lldorno rípi.mó lelló]. 2. -se o pipea, el jefe se adorna para recibir a los invitados o botúkku a la pipea o tápella a batyo a hekkíi bá [o botukkú a la pi pea o tapella batSo a hekki bá]. 3. -se para o pipel la, adorno la casa para el año nuevo n la pi pella e tyóbbo o lóa lo he [n la pipeUe tSóbbo o luá lo he].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('looppo', 's.', 'm.', NULL, 'adorno: looppo (el. 1 1), lopippo (el. 1 1), el o looppo, o lopippo; -s koppo (el. ID), pippo (el. 10), los -s i koppo, i pippo, los -s de Navidad i koppo yá e kirisiméssi [i koppo ye kírisiméssi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'adquirir: adquirir, v. irif. o oUa; yo adquiero un terreno n la oUa bobba [n noUa bobba], he adquirido un coche n ka ori motóo [n ka óri motóo], mañana adquiérete un yate obaam n ka oUa''á wattóo [obaam n ka ua''á wátto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riori', 's.', 'f.', 'Cl. 5', 'adquisición: riori , la - e riori; adqui siciones baori (el. 6), las adquisiciones a baori; la - del terreno fue ayer e riori ri o bobba ri séi mpári [e riori ró bóbba ri séí rÍlpári].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eosso', 'adv.', NULL, 'Cl. 7', 'adrede: adrede, adv. eosso , la muchacha me abrazó - o boláwáarí a le hátyibianna e eosso [o boláwáarí a le hatSibbíánéosso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obotyíbótyi', 'adj.', NULL, 'Cl. 1', 'adulador: adulador, adj. obotyíbótyi , el- o obotyi bótyi; -es abotyibótyi (el. 2), los -es a abOtyibó tyi; los -es mienten a abOtyibótyi ba lá sooa bisoí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'adular: adular, v. inf. o bekolla, o sooa; no me adules tanto we le bekoUe líkelíke [we le bekolle liké Iíke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyo', 's.', 'm.', 'Cl. 1', 'adversario: botyo ésappá , el - o botyo ésappá; -s batyo bésappa (el. 2), los -s a batyo bésappá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('wewe', 'adj.', NULL, 'Cl. 1', 'afable: afable, adj. wewe , -s bebe; una persona botyo wewe, unas personas -s batyo bebe; es una persona -, no le falta al respeto a nadie e bOtyo wewe sóté, ata pukiia botyo bulále [e bOtSo wewe sóté, ata púkia bótSo bulále].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebotyera', 's.', 'm.', 'Cl. 7', 'afecto: ebotyera , sibotyera , el - e ebotyera ; -s bibotyera , los -s e bibotyera, gesto de - ebotyera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'afeitar: afeitar, v. inf o booa, o booa. 2. -se o boea; me afeito todos los días n la ba booa elló ebba [n la ba bóo elló ebba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'afilar: afilar, v. inf. o bassáa; - el cuchillo o bassáa o lo''obbá [o bassó lo''obbá], - el machete o bassáa e isaké [o bassé isaké]. a f " I r', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'afirmar: afirmar, v. ini 1. o ebbia, me afirmo ñ la ebbia. 2. -se o ebiera, me afirmo en mis palabras n ebieriia a balláa rÍl [n ebieriá ballám].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'afligir: afligir, v. inf. o batyáa; esta vida me aflige riló ribOtyo ri lá le batyáa [riló ribotSo ri lá le bátS áa] . 2. -se o batyábi'' o; mi abuelo se aflige siempre o boyólla rÍl a la batyábi''o tyommaa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'aflojar: aflojar, v. irif. o hora, o nekekia, o topólla; quiero - mis cordones n la na'' a o hora e besori rÍl [n la na'' o hore besorírÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ríe', 's.', 'm.', 'Cl. 5', 'afluente: ríe , el- e ríe; -s bíe , los -s a bíe; todos los -s van al mar a bíe barnmaa ba lá hella e elo''állo [a bié barnmaa ba lá hellélo''állo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('pe''o', 's.', 'm.', 'Cl. 9', 'aforismo: pe''o , el - e pe''o; -s pe''o (el. 10), los -s i pe''o. afrenta, s''¡: rikupí (el. 5), la - e rikupí; -s baku pi (el. 6), las -s a bakupí; todos sufrimos la del gobierno túe arnmaa to la o''áa e roppá rá e rikupí rá e kóbinna [tue ammaa to lo''é roppa re rÍ kupi ré kóbinna].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'afouía: afouía, s. f esibbbé , la - e esibbé [eesib bé]; -s bisibbé (el. 8), las -s e bisibbé; tiene una fuerte - ee esibbé obóobó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('walállo', 'adv.', NULL, 'Cl. 8', 'afuera: afuera, adv. walállo (CI. 3), las -s e bialállo .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'agacharse: agacharse, v. inf o kokotta, o sokuera; me aga cho cuando veo al rey n la kokotta ná n la elláa o bohítáari [n la kokotta ná n lelló bOhítáari], ¡no te agaches! we kokotte!', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebalabala', 's.', 'f.', 'Cl. 7', 'agalla: ebalabala , la - e ebalabala [eeba labala]; -s ibalabala (el. 8), las -s e ibalabala; este chico tiene -s oló boseseppe okkí rálló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lorá', 's.', 'm.', NULL, 'ágape: lorá (el. 1 1), el- o lorá; -s berá (el. 4), los -s e berá; plato en un - elobbo (el. 7), platos en un - bilobbo (el. 8).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 6 (entradas 126 a 150)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'agarrar: agarrar, v. inf 1. o bityalla, o hMmóta, o itya; agarro el pez na hMmóta e tyué [na hMmóte tSué], he agarrado el pez n ka hMmótyi e tyué [n ka hMmótSé tSue], agarraba la manta de mi hermano m hMmótessi o bokutta bo bobelle rÍl [m hMmótessó bokutta bO bóbellerÍl], voy a aga rrar tu brazo n ka hMmótá''á o lobbó ó [n ka hMmótá''ó lobbóoó], la cosa familiar no se aga rra e ollé é rihuee e tyi itya ó [e oUé é ríhue e tSí ítSo]. 2. -se o hMmótta; el incienso natural se agarra e behollá be lá hMmótta. agrupar / 353', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolotta', 's.', 'm.', 'Cl. 1', 'agente: bolotta , el - o bolotta, - de policía eporoporo (el. 7), el - de policía e epo roporo [eporoporo]; -s balotta (el. 2), los -s a balotta, los -s de policía e iporoporo; los -s salu dan a las personas e iporoporo bi lá bóállo a batyo [e iporoporo bi lá boábatSoallo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekasso', 'adj.', NULL, 'Cl. 7', 'ágil: ágil, adj. ekasso , sitárityí (el. (2); eres muy - we ekasso sóté.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('wikíra', 'adj.', NULL, 'Cl. 1', 'agitador: wikíra , el- o wikíra; -es bikíra (el. 2), los -es a bikíra; el - se sube a la palmera o wikíra a la obba o obílla [o wikíra a 10bbObílla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agitar: agitar, v. in! 1. o hótella, o ikíra. 2. -se o ikílla; la tempestad agita los árboles e pullá é la ikíra a batté [e pullá é Iíkíra batté]; el niño agita el fras co de colonia o bóllá a la ikíra e sitó'' o sá e senti [o bóllá a líkíre sitó''o sé sénti].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'aglutinar: aglutinar, v. irif. o okkáa; tenemos que - nues tros esfuerzos to okkíi á to okke o to''ú tuáó [tokiá tókko to''ú tuáó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agobiar: agobiar, v. in! 1. o tyibbia; este trabajo me ago bia eló elakó e lá le tyibbia [e lélakó é la le tSíbbia], ¡no me agobies! we le tyibbie, we le tyipóbie! 2. -se o tyibba, o okka; estoy agobiado n serí o tyibba [n seró tSibba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agonizar: agonizar, v. in! 1. o sélla; el enfermo agoniza o bOloari a la sélla. 2. -se o selélla; el enfermo agoniza en la cama o bOloari a la selélla e raatyé wela [o boloari la selélle raatyé wéla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('maityi', 's.', 'm.', 'Cl. 6', 'agosto: maityi ; el mes de - o buéá buá maityi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtyibíi', 's.', 'm.', 'Cl. 3', 'agotamiento: bOtyibíi , el - o bOtyi bíi; -s betyibíi (el. 4), los -s e betyibíi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agotar: agotar, v. in! t. o tyibbia, o okkiá, o tuppia, 2. -se o tyibbáa, o okka, o tuppa; el trabajo agota a los empleados e elakó e lá tyibbia a balakóláko, estoy agotado n serí o tyibbáa [n séró tSibba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agraciar: agraciar, v. in! 1. o tyuhela, o e''éra; el jefe me agració con su poder o botúkku a le e''ériia o to''ú tuáí [o botukkú a le''érió to''u tuáí]. 2. -se o sokalla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buébué', 'adj.', NULL, NULL, 'agradable: agradable, adj. buébué (els. 1, 3), biébié (els. 4 y 8), réré (el. 5); una persona - botyo (el. 1) buébué, una historia - boatta (el. 3) buébué, una ciudad - ripottó (el. 5) rere [ripotto rére], una prenda - luua (el. 1 1) luélué, un cuento - siat ta (el. 12) sésé; -s bébé (els. 2 y 6) unas perso nas -s batyo (el. 2) bébé; biébié (els. 4 y 8), unas mantas -s bekutta (el. 4) biébié; unos poblados -s biriia (el. 8) biébié; tuétué (el. 13) unos cuentos -s toatta (el. 13) tuétué.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agradar: agradar, v. in! o hMmiabi''o, o ó''ia boróo; me agrada escucharte na n la o batóbiera n la ó''a bOróo [na n lo bátobiera n lo''á boróo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agradecer: agradecer, v. in! o potObiera; te agradezco lo que haces por nosotros n la o potobiera a lo o la e báella lá [no pótobiera a lo o lé baella lá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosákko', 's.', 'm.', 'Cl. 3', 'agradecimiento: bosákko , epotópo too (el. 7), bOsakóo (el. 3), bosa''ó (el. 3), el- o bOsákko, e epotópotóo [epotópotóo], o bosakóo, o bosa''ó; -s besákko (el. 4), mpotópotoo (el. 8), besakóo (el. 4), besa''ó (el. 4); los -s e besákko, e mpotópotóo, o bOsakóo, o bosa''ó; son buenos los -s de las personas del pueblo bié biébié e besákko biá batyo bá e eriia [bié biébié e besák ko biá bátSo bériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopéllo', 's.', 'm.', NULL, 'agravio: lopéllo (el. (1), el - o lopéllo; -s péllo (el. 10), los -s i péllo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'agredir: agredir, v. inj: o tóbbia, o óppa; me agredes con lo que dices o la le tóbbia la lo o la to''ólla lá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agriar: agriar, v. in! o pétyáa; no quiero - la carne n tyí''a na''a o pétyáa o borhmua [n tSá na''o petSó bÓrÍlmua]. 2. -se o péttáa; la leche se ha agriado a abélle ba lá péttáa [abellé la pettáa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('káké', 'adj.', NULL, NULL, 'agrio: agrio, adj. káké, pettáa; el plátano está - o bokobbé bo e e káké [o bOkobbé bué káké]; la comida está agria o bOra''ó bo láa pettáa [o bOra''ó bó la péttáa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 5', 'agrupación: agrupación, s. j: rokko , la - e rokko; agrupaciones bokko (el. 6), las agrupacíones a bokko; la - de los vecínos e rokko ra batyo ba e epatto [e rokko ra bátSo bépatto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'agrupar: agrupar, v. in! 1. o kokkáa, o kótta; agrupo los ñames na kótta e billo, el soldado agrupa a todas las personas delante de la casa del pueblo e só tya sí la kótta a batyo ba ammaa e tyóbbo alo a e eriia [e sótSa sí láa kóttá batSo bammaa e tSóbbo alo ériia]. 2. -se o kótélla, nos agrupamos afue ra tO la kótélla o walállo [to la kotélo walállo]. 354 / agu�l', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 6', 'agua: agua, s. f boppé , moópé , - boni ta boppé bebe, - salada bo''á (el. 6), - estan cada boppé bá ebo''u [boppe bebo''u], - de casca da tyenó (el. 9), salto de - tyello (el. 9); quiero - n la na''a boppé [na na''a bóppé]; no quie ro - n tyá la na''a boppé [n tJá na'' a bóppé]. 2. agüita, dim. toppé (el. 13); quiero un poco de -, quiero - n la na''a toppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epiiá', 's.', 'm.', 'Cl. 7', 'aguacate: epiiá , el- e epiiá ; -s mpiiá , los -s e mpiiá; los -s se pueden comer con plátano asado e mpiiá bi pá''e o rálla ó bekobbe be nooe [e mpía bí pá''o rállo bekobbe bénooe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aguantar: aguantar, v. inf o biálla, o hMmótea; los trabaja dores aguantan su trabajo todos los días a balakóláko (el. 2) bá la biálla e elakó ábó elló eba. 2. -se o hMmótea, o biálla; si alguien te molesta, aguántate na botyo o tyipóbia, hMmotéá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 7 (entradas 151 a 175)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'aguardar: aguardar, v. inf o betella, o oyáera; aguárdame un momento betella le lakóokóo [betelá le lakóokóo], yo aguardo que cese la lluvia nne n la betella ná o lóllá ló eppe [nne n la betella ná o lollá luéppe], aguardo mi momento n la oyáera e ebélló ro [noyáerebellóro].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('koróko', 's.', 'm.', 'Cl. 10', 'aguardiente: koróko , el- i koróko; el - perjudica a las personas i koróko i lá kap pa a batyo [i koróko i lá kapa batJO].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehokko', 's.', 'm.', 'Cl. 7', 'aguijón: ehokko , el - e ehokko [eehokko]; aguijones bihokko (el. 8), los agui jones e biehokko; los aguijones del puercoespín se clavaron en su pierna e biehokko bi á e epa''á be bó tyoppíi o loponná lo ái [e biehoko biépa''á bé bó tJoppi o loponná luáí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'aguja: aguja, s. f 1. níbOlIo , la - e níbollo; -s nibollo (el. 10), las -s i nibollo; las -s están en la tienda i níbOllo i lé o sáppo [i níbOlo i lóo sáppo], me han clavado las -s i níbollo i le tyop píi [i níbollo í le tJoppi]. 2. - grande pe''e (el. 9), la - grande e pe''e; -s grandes pe''e (el. 10), las -s grandes i pe''e.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'agujerear: agujerear, v. inl o butólla, o bulláa; agujereo la pared na bulláa e eteppe [na bulléteppe]; man dar - o buráa, he mandado - el cubilete m buríi e akákka [m burí é akákka].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolló', 's.', 'm.', 'Cl. 3', 'agujero: bolló , bu''a , bukká (el. 3), pi''í (el. 9), el - o bOlló, o bu''a, o bukká; -s beolló (el. 4), yu''a (el. 8), biukká (el. 8), pi''í (el. 10); los -s e beolló, e yu''á, e biukká, i pi''í; hay muchos -s en la casa he beolló bíkebíke o tyóbbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('aho', 'adv.', NULL, NULL, 'ahí: ahí, adv. aho; hay gente - aho be batyo; - estare mos cuando lleguéis to la sá aho 10 la poallá [to la sáho lo la poallá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'ahogar: ahogar, v. inf o kóbbia, o oppia; el sobrino aho gó a su tío e neppó e kóbbia o boióppé áe [e nep pó é kóbbíó boióppáe]. 2. -se o kóbba, o oppa; se ahogó bebiendo agua a oppi a ressi lá boppé [oppi a ressí lá boppé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nkuáaó', 'adv.', NULL, NULL, 'ahora: ahora, adv. nkuáaó, tyútyulé, dyíto, láOlé, lála; ven - mismo púllóo nkuáaó wete.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'ahorcar: ahorcar, v. inf o heñkalla, o sora; el bubi no ahorca a las personas o obobée a tyá la hehkalla a batyo [obObé tJá la heñkalla batJo], el goberna dor ahorcó a cinco personas e kóbinna a soriia batyo be battó [e kóbinna a soria bátJo be battó]. 2. -se o heñkalea.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
