  ('in', 'v.', NULL, NULL, 'alojar: alojar, v. in! o lokkia; cuando llegué al pueblo me alojó mi abuelo ne le pelle obessé o bOyólla r n a le lokkiia [né le pellobessé o boyóllarn le lok kiia]. 2. -se o tyiálla; me alojo en el hotel Sás Ebuera n tyián e rilokko wela rá Esáasi Eweera [n tJiáné rilokko wela ré esáasi eweera].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('wettya', 's.', 'm.', 'Cl. 3', 'alquería: wettya , la - o wettya; -s biettya (el. 8), las -s e biettya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'alquilar: alquilar, v. inf. o bóra, o relÍ.tibbia; alquilo mi casa n la bóra e tyóbbo rn [n la boré tJoboorn], n la relÍ.tibbia e tyóbbo rn [n la rentibbie tJóboorn].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('renti', 's.', 'm.', 'Cl. 5', 'alquiler: renti , el - e renti; -es benti (el. 6), los -es a benti; ¿cuánto cuesta el -? e renti ré la be''e?, no he pagado el - n te obella e renti [n te óbele renti].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kolottá', 's.', 'm.', 'Cl. 10', 'alquitrán: kolottá ; la carretera se hace con - e telle e lá pénera o kolottá [e tele é la pénero kólottáa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bi''o', 'adv.', NULL, NULL, 'alrededor: alrededor, adv. bi''o; - de mi casa e tyóbbo rn bi''o [e tJooorn bí''o], estoy - del oratorio n la e róhiáa bi''o [n le rohiá bi''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosalelle', 'adj.', NULL, 'Cl. 1', 'altruista: altruista, adj. bosalelle , persona - bOsa lelle (el. 1), el- o bOsalelle, la persona - o bosalel le; -s basalelle (el. 2), personas -s basal elle, los -s a basal elle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

