  ('bue''á', 's.', 'm.', 'Cl. 1', 'alumno: bue''á , wanapana , el o bue''á, o wanapana; -s be''á (el. 2), banapana (el. 2), los -s a bé''a, a banapana; los -s de la escuela a banapana bá o sikuella [a banapana bó sikuella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('baoppó', 's.', 'm.', 'Cl. 6', 'aluvión: baoppó , el - a baoppó; alu viones baoppó (el. 6); el- arrastró las casas del pueblo a baoppó ba arí i tyóbbo yá e eriia [a baopó bárí i tJóbbo yériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'alzar: alzar, v. in! o atya; a17A1 mis brazos para supli car al maestro de ceremonias n la atya a abbórn o helella e eebí [n la atJ aoornó helelleebí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 5', 'amabilidad: amabilidad, s. l rihóle , la - e rihóle; -es bahóle (el. 6), el pescador tiene mucha - o boobbe okkí rihóle rikéríke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebotyera', 'adj.', NULL, 'Cl. 7', 'amable: amable, adj. ebotyera , persona - bOhOlátyo (el. 1), obotyera (el. 1); -s bibotyera (el. 8), bahOlátyo (el. 2), abotyera (el. 2), las personas -s llevan la paz al pueblo a bahOlátyo bá la poal la e ehOíhoí e eríia wela [a bahOlátJo ba lá poale hoihoyéria wella]. amado, a, s. m. buelello (el. 1), ríhólle (el. 5), mohóle (el. 1), bOpaoséla (el. 1), paoséla (el. 9), ellla - a o bueJello, e rihólle, o mohóle, o bOpaosé la, e paoséla; -s, as belello (el. 2), bahólle (el. 6), mahóle (el. 2), bapaoséla (el. 2), paoséla (el. lO), los -s, las -as a belello, a bahólle, a mahóle; bus co a alguien para que me enseñe a mi - n la utya botyo a le tappe e rihólle lÍ1 [n la utJa botJo a le tappe ríholenné].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'amaestrar: amaestrar, v. inj: o é''ia, o bOtya; tengo que - a mi perro n tori o é''ia e puá lÍ1 [n toro e''ie puáálÍ1], no se puede - esta cabra e tá pa''e o é''ia (botya) o elo póríi [e tá pa''o é''io é le pori].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sehehí', 's.', 'm.', 'Cl. 12', 'amaine: sehehí , el- e sehehí; -s tue hehí (el. 13), los -s o tuehehí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'amamantar: amamantar, v. inl o náppia, o áppia; la madre amamanta al niño o oberíi a la náppia o bollá [oberí la napió bOllá], si el niño llora, amamán tale na o bollá a la bé''a, áppia bo [na ó bola la bé''a appiá bO].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mil', 's.', NULL, 'Cl. 1', 'amante: amante, s. mil bohólláa . - de la gente boholátyo (el. 1), wanatyo (el. 1), ekokonno (el. 7), epomporo (el. 7), pa''á (el. 9), el - o bohól láa, o wanatyo, e ekokonno [ekokonno], e epomporo [eepomporo], e pa''á; -s bahólláa (el. 2), - de la gente baholátyo (el. 2), banatyo (el. 2), bikokonno (el. 8), ipomporo (el. 8), los -s a bahól láa, a banatyo, e bikokonno, e epomporo, los -s de la gente a baholátyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'amar: amar, v. inf. o hOlláa; amo a una chica n hoom boláwáarí [n hOm bOlawarí], creo que te amo nsiá ko hOríi. 2. -se o holláno; nos amamos to ba holláno [to ba hólláno]. 3. hacer - o hOránna; las personas se presentan pero no se hacen amar (depende de ellas amarse) batyo e tapánna o wáae a tyi e horánna o [batJo e tapánno, wáae a tJe horanno].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopetyípetyíi', 'adj.', NULL, NULL, 'amargo: amargo, adj. lopetyípetyíi (el. 1 1), epetyíi (el. 7), káké, pettáa; el plátano está - o bokobbe bo lá pettáa [o bokobe bó la pettáa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopetyíi', 's.', 'm.', NULL, 'amargor: lopetyíi (el. 1 1), el o lopetyíi; -es epetyíi (el. 4), los -es e epetyíi [epetyíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, NULL, 'amargura: amargura, s. j : lopetyíi (el. 1 1), opetyíi (el. 3); murió con mucha - a wéi la lopetyíi lobó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('s', 'adj.', NULL, 'Cl. 9', 'amarillo: amarillo, adj. s. oboobbo ; el papel es - e sipéppa sé oboobbo, el vestido es - o lohétya lué oboobbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'amarrar: amarrar, v. inj: o tóppa; amarro los leños con una cuerda n la tóppa i kóólÍ1 la opetté [n la topí i kóóm lá opetté], no amarres sus piernas we tóppe a aponná be áí [we topá aponná báí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 's.', NULL, 'Cl. 7', 'ambigüedad: ambigüedad, s. j: ebotúbotu , la - e ebo túbOtu; -es bibotúbotu (el. 8); la - no es buena e ebotúbotu e tyí ee [eebotubotu e tJí ee].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebotúbotu', 'adj.', NULL, 'Cl. 7', 'ambiguo: ambiguo, adj. ebotúbotu , ebottu ; eres - we ebotúbotu [we ebottu].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'amedrentar: amedrentar, v. inj: o sára; esta estatua ame drenta a los pájaros bolo bOtebótyo bo lá sára o tonorí [bólo bOtébótJo bO láa saró tonorí]. 2. -se o salláa; me amedrenta la oscuridad n la salláa e ehMma [n la sallé ehMma].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('alo', 's.', 'm.', NULL, 'amén: alo se, ee, eelé, alo le.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 7', 'amenaza: amenaza, s. l eb�Heri , la - e ebeleri [eebéleri]; -s mbeleri (el. 8), las -s e mbeleri; el trabajador me lanzó muchas -s o bolakoláko a le mperi mbeleri bikébíke [o bOlakoláko a le mperí mbeleri bikébíke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 3', 'amistad: amistad, s. l booko , esaká , la o booko, e esaká [eesaká]; -es beoko (el. 4), bisa ká (el. 8), las -es e beoko, e bisaká; tengo muchas -es n ka okkí bisaká bikébíke [kokí bísa 360 / amnistía ka bikébíke], no tengo muchas -es n ta okkí bisaká bikébíke [n tókki bisaká bíkebíke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmása', 's.', 'm.', 'Cl. 1', 'amo: mmása , el- o rnmása; -s ammá sa (el. 2), los -s a ammása; yo soy el - nné n le o rnmása [né n lo rÍlmása].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'amolar: amolar, v. inf o bassáa; tengo que - este machete n tori o bassáa riló isaké [n toró bassa riló isaké]. inf o okanna, o kótta; los hom bres amontonan las piñas de cacao a baié ba lá kótta e birnmáloto [a baié bá lá kotté birnmáloto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

