  ('rihólé', 's.', 'm.', NULL, 'amor: rihólé (Cl. 5), el - e rihólé; -es bahólé (el. 6), los -es a bahólé; el - malo e rihólé ribé [e rihOle nb e]; eres mi - wé o lé rihólé rÍl [wé o le rího leerÍ1], mal de -es roppá rá rihólé [roppa ra rihOlé]; -es reñidos -es queridos bi tébbi yé ba bié bi lé''a kokótya [bi tebbi yéba bié bí lé''a kokótSa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('io', 's.', 'm.', 'Cl. 1', 'amorcito: io ; buenos días tue''a obari é io [tue''a óbari é io].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eburi', 's.', 'm.', 'Cl. 7', 'amparo: eburi , el - e eburi ; -s mburi , los -s e mburi; estoy al - de la ley n la e eburi atá á e eette [n leburiatá éette]. amplio, a, adj. botée (el. 3) una manta - bokutta botée; lotée (Cl. 11) un vestído -Iuua loree; biotee (el. 8) unas mantas -s bekutta biotee; kotee (el. 10) unos vestidos -s kuua kotee, etc.; quiero una chaqueta - n la na''a kótte kotee.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 7', 'ampolla: ampolla, s. l ehul0 , ehNná , la - e ehulo [eehulo]; -s bihulo (el. 8), las -s e bihulo; su cuerpo está lleno de -s o lottó lo áí lo eem bihulo [o lotó luáí ló''ém bihulo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'amputar: amputar, v. i''!l o epólla; el médico amputó la pierna de la chica e rokútta epóri o IOponná lo a o boláwáari [e rokútta epóró lopónná ló bolawari].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('robbo', 's.', 'm.', 'Cl. 5', 'amuleto: robbo , el- e robbo; -5 bob bo (el. 6), los -s a bobbo; el - es para la fiebre e robbo ké re a bi''ó [e robbo ké ra bi''ó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epanapénne', 's.', 'm.', 'Cl. 7', 'ananás: epanapénne , el - e epana pénne [eepanapénne]; - mpanapénne (el. 8), los - e mpanapénne; mi padre tiene una plantación de - o boie rÍl okkíi epátta a mpanapénne [o boierÍl okiepata a rÍlpanapénne].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'anca: anca, s. f ebebelo , el - e ebebelo [eebebe lo]; -s mbebelo (el. 8), las -s e mbebelo; un tierna ebebelo ebotóébotó, unas -s tiernas mbe belo mbotórÍlbotó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtyílé', 's.', 'm.', 'Cl. 1', 'ancestro: bOtyílé , boyólla , motyílé (el. 1), el - o botyílé, o boyólla, o mo tyílé; -s batyílé (el. 2), bayólla (el. 2), matyílé (el. 2), los -s a batyílé, a bayólla, a matyílé; nuestros -s hacían hechos asombrosos a bayól la báó ba sessi i pohá [a bayólla báó bá sessi i pohá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 7', 'anciana: anciana, s. l ariólla , bOnánna , la e aríólla, o bOnánna; -s biaríólla (el. 8), banánna (el. 2), las -s e biariólla, a banánna; las -s están en el consejo de ancianos e biariólla bi lé e inooá wela rá e biobéolla [e biariólla bí lé inoá wéla re bióbéolla]. ancianito, dim. m. sobetyityi (el. 12), sobéolla (el. 12), el - e sobetyityi, e sobéolla; -s tobetyi tyi (el. 13), tobéolla (el. 13), los -s o tobetyityi, o tobéolla. 2. dim. f sarítyityi (el. 12), sariólla (el. 12), la -a e sarítyityi, e saríólla; -as tuari tyityi (el. 13), tuariólla (el. 13), las -as o tua rítyityi, o tuariólla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boyólla', 's.', 'm.', 'Cl. 1', 'anciano: boyólla , obéolla , obétyityi (Cl. 7), el - o boyólla, e obéolla, e obe tyityi; -s bayólla (el. 2), biobéolla (el. 8), biobetyityi (el. 8), los -s a bayólla, e biobéolla, e biobetyityi; consejo de -s e inoOá rá e biobéol la [e inoa re bíóbéolla]. ancho, a, adj. bote (els. 1 y 3) persona - botyo bOte, cara - bOssó bote; bote (els. 2 y 6) perso nas -s batyo bote, camas -s baatyé bote [baatSé bóote], beote (el. 4) caras - bessó Mote, roté (el. 5) cama - raatyé rote [raatSé róote], ote (el. 7) muslo - epasso ote, biote (el. 8) muslos -s mpasso biote, kote (els. 9 y 10) aguja - pe''e antena / 361 kote, agujas -s pe''e kote, lote (el. 11) palma losalla lote, sote (el. 12) pinza - ( de cangrejo) silappa sote, pinzas -s tOlappa tote.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'ancla: ancla, s. f ri''o , el- e ri''o; -s bi''o , las -s a bi''o; el- del barco e ri''o rá o wattoo [e ri''o ró wáttoo], las -s están averiadas a bi''o bá kapei [a bi''o bá kápei]. andadura, s1 loetto (el. 1 1), 10ettyi (el. 1 1), la - o loetto, o loettyi; -s beettyi (el. 4), las -s e beettyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'anegar: anegar, v. inf o uánna; la calle está anegada o bokoo bo uáán [o boko búáan].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOhekkáa', 's.', 'm.', 'Cl. 1', 'anfitrión: bOhekkáa , el - o bOhek káa; anfitriones bahekkáa (el. 2), los anfitrio nes a bahékkáa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'anguila: anguila, s. f boeppe , boseppe , bo heppe (el. 3), pellá (el. 9); la - o boeppe, boseppe, boheppe, pellá; -s beeppe (el. 4), beseppe (el. 4), beheppe (el. 4), pellá (el. 10); las -s e beeppe, e beseppe, e beheppe, i pellá; en las pozas de la playa hay anguilas e biribba wela biá e eloállo he beseppe [e biribba wela biéloállo be beseppe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boatyo', 's.', 'm.', 'Cl. 3', 'anguilero: boatyo , el - o boatyo; -s beatyo (el. 4), los -s e beatyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'anhelar: anhelar, v. inf o elella; no anheles lo que no es tuyo we elelle ollé ná tyi''é ao [we elelle ol1é ná tJí''é aao].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eeleri', 's.', 'm.', 'Cl. 7', 'anhelo: eeleri , el- e eeleri ; -s bieleri (el. 8), los -s e bieleri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ríín', 's.', 'm.', 'Cl. 5', 'aniDo: ríín , el - e ríín; -s bíín , los -s a bíín; los -s se compran en la tienda a bíín ba lá olla o o sáppo [a bíín ba lá 0110 o sáppo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'animación: animación, s. f rikélékélée , la - e rikélé kélée; animaciones bakélékélée (el. 6), las ani maciones a bakélékélée; la - del coche e rikélé kélée ri o motóo wela [e rikélékélé ró motó wel1a].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmetya', 'adj.', NULL, 'Cl. 1', 'animador: animador, adj. mmetya , el - o rnmetya; de jóvenes bosókkó (el. 1); -es ametya (el. 2), -es de jóvenes basókkó (el. 2); los -es se ríen a ametya bá la nooa tooa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nabba', 's.', 'm.', 'Cl. 9', 'animal: nabba , el - e nabba; -s nab ba (el. 10), los -s i nabba, los -s malos i nabba bé, aquellos -es son del jefe de poblado ile nab ba kí o botúkku, el - blanco e nabba hótóttó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'animar: animar, v. irif. o tyútya, o sokka; el cazador ani ma a los perros o obébá a la tyútya i puá [o obe bá láa tJutJí i puáa]. 2. -se o hMmabi''o, o bera riokkó, o sokalla; el trabajo anima a las perso nas e elako e lá bera a batyo riokkó [elako é láa herá batJo riokkó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehaé', 's.', 'm.', 'Cl. 7', 'ánimo: ehaé , etébbá , etémá (el. 7), el - e ehaé [ehaé], e etébbá [etébbá], e etémá [etémá]; -s bihaé (el. 8), los -s e bihaé, e bitébbá, e rnitémá,', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOambó', 'adj.', NULL, 'Cl. 1', 'annobonés: annobonés, adj. bOambó , el- o boambó; annoboneses baambó (el. 2), los annoboneses a baambó; los annoboneses son de Annobón a baambó ba púríi e annobóon [a baambó bá púré annobóon].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

