  ('itoMri', 's.', 'm.', 'Cl. 5', 'ano: itoMri , eosó , losóo (el. 1 1), el - e itoMri, e eosó [eeosó], o 10sóo; -s batoberi (el. 6), biosó (el. 8), kosóO (el. 1 0), los -8 a batoberi, e biosó, i kosóo. anochecer, 1. s. m. buatotyio (el. 3), el - o buatotyio; -es biatotyio (el. 8), los -es e biato tyio; mi padre llegó al - o boie ID a pooi o buatotyio [o boiem a poi buátotJio]. 2. v. o ko''a, o sílla; anochece pronto hoy o bokó bO lá ko''a bakasso lel10 [o bokó lá ko''a bakasso lello].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'anona: anona, s. f rapápísso , la - e rapápísso; -s bapápísso (el. 6), las -s a bapápísso; las -s están en la finca a bapápísso ba lé obáám [a bapápísso bá lobáám].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'anotar: anotar, v. inf o irera; anoto lo que dice el maestro n la irera alo a la oháa lá o bue''iáa [n lireralo a lóha lá o bué''ia], no anotes nada we irere ollé á mmuae. inf o elella; ansío tener paz n la elella', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmalé', 'adv.', NULL, NULL, 'antaño: antaño, adv. mmalé, aotya, aossa; los hombres de - a baie bá mmalé, las cosas de - e bilabba biá aotya [e bilaba biáOtJa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
