  ('inf', 'v.', NULL, NULL, 'anteponer: anteponer, v. inf. o okátya; el jefe del pueblo antepone los problemas o bOtúkku a la okátya e belláa. 2. -se o okátta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('aotya', 'adv.', NULL, NULL, 'antes: antes, adv. aotya; - vivía aquí aotya n ka péém hállo [aotJa n ka pém hál1o]. 2. morf ha; lláma me - de que llegue tu madre elélla lé na a té pooa ba o obéríi o [eléllá lé ná á te poa ba oberíio].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmalé', 'adv.', NULL, NULL, 'antiguamente: antiguamente, adv. mmalé, aotya; - llovía mu cho en el poblado de Belebú aotya ha séssi kól1á e Belebú [aotJa ha sess! kólla e belebbú]. antiguo, adf. m. bOlólló, molOlO, moló (els. 1 y 3), bololló, moló, meOlóló, meOló (els. 2, 4 Y 6), rOlólló (el. 5), lololló (el. 6b), olólló (el. 7), bio lólló (el. 8), kolólló (els. 9 y 10), lolólló (el. 11), solólló (el. 12), tolólló (el. 13), hololló (el. 16); una persona antigua botyo (el. 1) bolólló, un árbol antiguo botté bolól1ó [bOi l i bólolló], unas personas antiguas batyo bololló, unos árboles antiguos batté bolol1ó [bate bOlolló], las antiguas casas de la ciudad i tyóbbo kolólló ya ripotto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sétyi', 's.', 'm.', 'Cl. 12', 'antílope: sétyi , sibelo , el e sétyi, e sibelo; -s tuétyi (el. 13), tobelo (el. 13), los -s o tuétyi; el cazador vende cinco -s o obébá a la ótta tuétyi tué toto [o obébá a lottá tuetJi tué toto]; es - y no lo es sétyi tyí sét yi sé; los -s corren mucho o tobelo to lá húbbia lobó [o tobelo to láa húbbia lobó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'antipatía: antipatía, s. f bonokoa , bosurí , ribolló (el. 5), la - o bonokoa, o bosur!, e ribol ló; -s benokoa (el. 4), besurí (el. 4), abolló (el. 6), las -s e benokoa, e besuri, a abolló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonokoa', 'adj.', NULL, 'Cl. 3', 'antipático: antipático, adj. bonokoa ; este niño es 010 bollá e bOnokoa [010 bolle bonokóoa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekulekulé', 's.', 'm.', 'Cl. 7', 'antro: ekulekulé , elekúléku , el - e ekulekulé , e elekúléku [eelekú léku]; -s bikulekulé (el. 8), bilekúléku (el. 8), los -s e bikulekulé, e bilekúléku.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'anular: anular, v. inf o sétyanna; o kakkia; o kibbia; anu lo mi viaje de mañana n la kibbia o loetto m lo a obaam [na kibbio loettom luá óbaam].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obélló', 'adj.', NULL, 'Cl. 1', 'anunciador: anunciador, adj. obélló , el - o obélló [oobélló]; -es abélló (el. 2), los -es a abél1ó; los -es llegan del mar a abélló ba lá púl1áa e eloál1o [a abél1ó bá la púlleloállo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'anunciar: anunciar, v. inf o belélla, o bél1a, o opálla; yo anuncio el peligro n la belélla e bittá [n la belélle bittá], el alguacil anunció el peligro a los hom bres e eporoporo e beléri e rioppo a baié [eporo poro e beléré rioppo a baié]; la radio anuncia tres días de descanso e riberí ri lá bélla IOhebbO lua billo bié bittá [e riberí ri láa bellá IOhebbO luá bíllo bié bittá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribélla', 's.', 'm.', NULL, 'anuncio: ribélla (el. 1 1), el - e ribélla; -s abélla (el. 6), los -s a abélla; escucho el - de la radio n la batóbiera e ribélla rá e riberí [n la bató biere ribellá ré riberi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sihúku', 's.', 'm.', 'Cl. 12', 'anzuelo: sihúku , silobbo , el - e sihúku, e silobbó; -s tohúku (el. 13), tolobbo (el. 13), los -s o tohúku, o tOlobbo; con mi - pesco mucho la e sihúku m n la sellá o lobbáa sóté [le sihúkum n la sello lobbá sóté], voy al mercado a buscar -s n la hélla o mma kétte o utya tOlobbo [na helló mmakétte o utJa tolobboo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'añadir: añadir, v. inf o heráa bi''o, o tolaella; he añadido dos ñames a los tuyos n hería e billo o mma bi''o [n herié billo o TÍlma bi''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loa', 's.', 'm.', 'Cl. 11', 'año: loa , el- o loa, el- Nuevo o loa lo hé, Feliz - Nuevo o''a loa lo hé [o''a luá lo hé], Feliz - Nuevo a todos lO''a loa lo hé; -s báa (el. 6), diez -s báa bé bó, tengo sesenta y seis -s ne báa batyílla battá la ra''a.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'añoranza: añoranza, s. f 1. bOheru ebákké , la - o boheru, e ebákké ; -s beheru (el. 4), ibákké (el. 8), las -s e beheru, e ibákké. 2. ribetéri (el. 5), la - e ribetéri; - s abetéri (el. 6), las -s a abetéri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohuláhúlla', 'adj.', NULL, 'Cl. 1', 'apaciguador: apaciguador, adj. bohuláhúlla , boté''í (el. 1), el - o bOhuláhúlla, o boté''!; -es bahuláhúlIa (el. 2), baté''í (el. 2), los -es a bahuláhúlla, a batc''í.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apaciguar: apaciguar, v. inf o hobbia, o te''a; el anciano apacigua a los guerreros e obéolla é la hobbia a apoderarse I 363 abitábítta [e obéolla e láa hobbiá abitábítta]. 2. -se o pélla; ¡apaciguaos, que ya está bien! pélláám, seí kállo!', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mMpe', 'adj.', NULL, 'Cl. 1', 'apaleador: apaleador, adj. mMpe , boppá ; -es bMpe (el. 2), boppá (el. 2), los -es a bMpe, a boppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apalear: apalear, v. inf. o óppa; los ladrones fueron apa leados i húbbé ye óppi o [i húbbé yóppio].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('emasíín', 's.', 'm.', 'Cl. 7', 'aparato: emasíín , el - e emasíín [eemasíín]; -s mmasíín (el. 8), los -s e mmasíín. 2. - de radio riberí (el. 5, el- de radio e riberí; -s de radio aberí (el. 6), los -s de radio a aberí; escucho los -s de radio n la batóbiera a aberi [n la batóbiera aberí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

