  ('inf', 'v.', NULL, NULL, 'aparecer: aparecer, v. inf. o leporea; mi aparato de radio no aparece e riberi ID ri tyi leporea [e ribériID tJí leporea].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aparejar: aparejar, v. inf. o kossá; el maestro de ceremo nias apareja a las personas e eebí a la kossá a batyo [eebí a la kossá batJo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apartar: apartar, v. inf. o koppia; o bó''a bi''o; aparto mis cosas n la koppia a lokko ID [n la koppia lok kom]. 2. -se o púllá bi''o; me aparto de ti n la o púllá bi''o [n lo púlla bi''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'apatía: apatía, s. f boe1e , la - o boe1e; -s beele (el. 4), las -s e beele. apático, a, adj. eeppé (el. 7), el - e eeppé [eep pé]; -s bieppé (el. 8), los -s e bieppé; esta per sona es - 010 botyo e eeppé [010 botJo e eppé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyupiáera', 's.', 'm.', 'Cl. 7', 'apellido: etyupiáera , ribotyílla (Cl. 5), el- e etyupiáera [eetJupiáera], e ribOtyílla, el pri mer - del gobernante no es de la isla de los bubis e etyupiáera eotya o boitta e tá púri e etúllá wela á abobée [eetJ upiáera eotJ a o bóitta e tá pure tullá wéla ábobée]; -s bityupiáera (el. 8), abOtyíl la (el. 6), los -s e bityupiáera, a abotyílla; hay un libro de los apellidos bubis he ribúkku rá abotyíl la bá abobée [he ribúkku rábOtJíla bábObbée].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apenar: apenar, v. inf o batyáa; o ó''a roppá ; este asunto me apena elo elabba é la le ó''ia rop pá [elelabba é la ló''ia roppá]. 2. -se o batyá bi''o; estoy apenado n la batyáa bi''o [n la batJá bi''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'apestar: apestar, v. i''!f o hMmua; esta carne apesta bOlo borÍlmua bo lá hMmua, el pescado no apesta, está rico e tyué e tyá la hMmua, é bOroo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehólle', 's.', 'f.', 'Cl. 7', 'apetencia: ehólle , la - e ehólle [eehólJe]; -s bihólle (el. 8), las -s e bihólle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eotyú', 's.', 'm.', 'Cl. 7', 'apetito: eotyú , ebukká , ebu''á (el. 7), el - e eotyú [eeotJú], e ebukká [eebuk ká], e ebu''á [eebu''á]; -s biotyú (el. 8), mbukká (el. 8), mbu''á (el. 8), los -s e biotyú, e mbukká, e mbu''á.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apiadar: apiadar, v. inf. o ó''ia losisi; me apiada su buen corazón o bOtébbá bo áí buebue bo lá le ó''ia losi si [o botébbá buáí buebue bó la ló''ia losisi]. 2. -se o ó''ella losisi; me apiadas mucho n la o ó''el la losisi sóté [n lo ó''ella losisi sóté].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'aplacar: aplacar, v. i''!f o te''a; el anciano no pudo - a los esposos e obéolla e tá pityi o te''a e ribállá [e obéolJa e tá pitJo te''é ribállá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebinaeri', 's.', 'm.', 'Cl. 7', 'aplastamiento: ebinaeri , el- e ebi naeri [eebinaeri]; -s ibinaeri (el. 8), los -s e ibinaeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'aplastar: aplastar, v. i''!l o binna, o bitya, o bityela, o kenna, o nettá; el coche aplastó su pierna o mottó M bín n i o lopollá lo áí [o mottó bó bínni o lopollá luáí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aplaudir: aplaudir, v. inf. o óppa ebátyo; cuando habla el jefe la gente aplaude na á la to''ólla o botúkku a batyo ba lá óppa ibátyo [na á la tó''ólla o botukkú a batJo bá lóppa ibatJoo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebátyo', 's.', 'm.', 'Cl. 7', 'aplauso: ebátyo , ebasso , el e ebátyo [eebátJo] ; -s ibátyo (el. 8), mbasso (el. 8), los -s e ibátyo, e mbasso; las personas aplau dieron mucho a batyo ba óppi ibátyo bíkebíke [a batJo bóppí íbatJo bikébíkke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aplicar: aplicar, v. inf. o heráa; mi madre aplica el ungiien to a mi herída o oberíi m a la heráa o bOlallo e peké ID bi''o [oberim la heró Mlallo e pekém bí''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekakká', 'adj.', NULL, 'Cl. 7', 'apocado: apocado, adj. ekakká , seké , seéle (el. 12), el- e ekakká [eekakká], e seké, e seéle; -s bikakká (el. 8), tueké (el. 13), tueé1e (el. 13), los -s e bikakká, o tueké, o tueéle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apocar: apocar, v. inf. o sikkiáa, o ekébbia; las imágenes de televisión apocan a los niños e birikiriki bi láa ekébbia a bóllá; esta persona es muy apoca da 010 Mtyo sekké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 's.', NULL, NULL, 'apoderarse: apoderarse, s. inf. o itya; los continentales se apoderan de nuestra tierra a barannó ba lá itya o bobba M áó [a barannó bá HtJo bobba wááó]. 364 / apodo', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sibotyílla', 's.', 'm.', 'Cl. 12', 'apodo: sibotyílla , el- e sibOtyílla;-s tobotyíBa (el. 13), los -s o ilibOtyílla; mi - es astucia extrema, no es mi nombre e sibOtyílla rÍl ká misí miomó tyi'' á e ílla rÍl [e sibOtSíllarÍl ká misí miomó, tSi''é illaarÍl], en el pasado muchos -s se convirtieron en apellidos rínnalé ilibotyílla túke túke to heri bityupiáera [rÍlmalé tobOtSílla tukétúke to herí bítSupiáera].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyubbá', 's.', 'm.', 'Cl. 7', 'aposento: etyubbá , róm , etubá (el. 7), rúúm (el. 5), ro (CI. 7), el - e etyubbá [eetyubbá], e róm, e etubá, e rúúm, e ro [eo]; -s bityubbá (el. 8), bóm (el. 5), bitubá (el. 8), búúm (el. 6), bio (el. 8), los -s e bityubbá, a bóm, e bitubá, a búúm, e bio.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apostar: apostar, v. inf. o petta, o petaBa, o petta bueka; no quiero - contigo n tyá na''a o petaBa la úwe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'apoyar: apoyar, v. inf o leára, o tyúppia, o tealla, o tupiáe ra; apoya tu bastón contra la pared leará e sa''á o la e eteppe [Ieáré sa''áo léeteppe]. 2. - a alguien o lolella, o iálla; no tengo a nadie que me apo ye n ta okkí botyo a le iáBe [n tokkí bótSo a le ialle]. 3. -se o leárea, o tyúpea; me apoyo en la pared n la leárea e eteppe [n la leáre eteppe], mi vecino no puede caminar y se apoya con un bastón o botyo á é epatto rÍl ata pá''e o etta a la tyúpea sa''á [o bOtSo épattoIÍl ata pá''o etta a la tSu péa sa''á].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyuppo', 's.', 'm.', 'Cl. 7', 'apoyo: etyuppo , reetyo , lotup pió (el. 1 1), botyúppo (el. 3), eléálo (el. 7), etu piáeri (el. 7), el- e etyuppo [eetyuppo], e reetyo, o IOtuppio, o bOtyúppo, e eléálo [eeléálo], e etupiáe ri [eetupiáeri]; -s bityuppo (el. 8), beetyo (el. 6), biléálo (el. 8), bitupiáeri (el. 8), tuppio (el. ID); los -s e bityuppo, a beetyo, e biléálo, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'aprender: aprender, v. in! o e''áa, aprendo el bubi n la e''áa etyo [n le''étyo], no quiero - el bubi n tyá na''a o e''áa etyo [n tSá na''o e''étSo], hoy aprendo una canción lello n la e''áa loberí [Iello n le''á loberí], ayer aprendía un cuento mpári n e''essi siatta [mpári ne''essí síatta].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

