  ('in', 'v.', NULL, NULL, 'apretar: apretar, v. in! 1. o bitella; el abuelo aprieta el bra zo del mozo o bOyolla a la bitella o 10bM ló bOse séppe [o boyolla a la bitello lobbo ló boseséppe]. 2. o birea; el perro apretaba el esfinter para hacer sus deposiciones e puá e biteseei e ba tóbessi la [e puá e bíteseei e ba tóbessi lá]. 3. o oyáa, aprieto el cordón espinoso n la oyáa o obellá [noyóbel lá]. 4. -se o akalla, -se el cinturón o akalla e ehu lo bOsappo [o akaleehulo bosappo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
