  ('inf', 'v.', NULL, NULL, 'aprobar: aprobar, v. inf. o ebbiera; mi jefe ha aprobado mis vacaciones o mmása IÍl a ebbieria o IOhebbo r Í l [o mmásarÍl a ebbieríó 10hebMrÍl]. 2. o hettáa; el alumno ha aprobado o bue''á a hetyíi [o bue''á a hétSíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
