  ('sitté', 's.', 'm.', 'Cl. 12', 'arbusto: sitté , siruppú , - de la berenjena liityé''a (el. 11), - de hojas verdes grandes y amargas biihóhOó (el. 3), - trepador de frutos ovoides y sépalos de color rojo vivo (Mussaenda erythrophylla) bokolekko (el. 3), de hojas tintóreas y de líquido venenoso bota bué (el. 3), - parásito IOpópo (el. 1 1), - de la rafia bOtekka (el. 3); -s totté (el. 13), toruppú (el. 13), -s de la berenjena batyé''a (el. 6), -s de hojas verdes grandes y amargas behóhiió (el. 4), -s trepadores de frutos ovoides y sépalos de color rojo vivo (Mussaenda erythrophylla) beko lekko (el. 4), -s de hojas tintóreas y de líquido venenoso betabué (el. 4), -s parásitos apópo (el. 6), -s de la rafia betekka (el. 4).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
