  ('f', 's.', NULL, 'Cl. 3', 'ardilla: ardilla, s. f bOsoppé , - voladora eba''é (el. 7), - grande bosoppé (el. 3), mosombé (el. 3), mediana bohalle (el. 3), - pequeña esellé (el. 7), eséné (el. 7); -s besoppé (el. 4), -s volado ras iba''é (el. 8), mba''é (el. 8), -s grandes besoppé (el. 4), mesombé (el. 4), -s pequeñas bisellé (el. 8), biséné (el. 8); las -s estropearon mis piñas de cacao e besoppé be káppi e bim máloto rh [e besope be kápie bimrnálotoorh].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
