  ('in', 'v.', NULL, NULL, 'arrasar: arrasar, v. in! o tyitta, o okólla; el aluvión arra sa toda la comida a baoppo ba lá tyitta o bora''o OOmmaa [a baopo bá lá tSittii OOra''o bómmaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bokólla', 'adj.', NULL, NULL, 'arrastrador: bokólla (el. 1, el- o bokól la; -es bokólIa (el. 2), los -es a bokólla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrastrar: arrastrar, v. in! l. o okólla, o susulla, o ubolla, el perro arrastra el coche e puá e lá okólla o motóo [e puá é lokóllo motóo]. 2. -se o okórea, me arrastro ante mi desgracia n la okórea o boho''o m álo [n lokórea o boho''omálo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrebatar: arrebatar, v. in! o OOánna; el gobernante me ha arrebatado mi vida e kóbinna a le boán e ribotyom [e kobinna a le boáné ribotSoolÍ1].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arreglar: arreglar, v. in! 1. o lakaella; yo arreglo mi casa n la lakaella e tyóbbo lÍ1 [n la lakaelle tSóbboom]. 2. -se o pénera; yo me arreglo para ir a misa n la ba pénera ó o bella o tyotyi [n la ba pénero o helIo tSotSi]. 3. hacer - o lakaera; la mujer hizo arreglar su coche o waísso a lakaeria o motóo wáí [o waísso a lakáeríó motó wááí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riheri', 's.', 'm.', 'Cl. 5', 'arreglo: riheri , el - e riheri; -s babe ri (el. 6), los -s a baheri; el - de la casa dura mucho e riheri ra e tyóbbo ri lá oppa lobbó [e riheri re tSóbbó TÍ lá oppa lobbó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrendar: arrendar, v. in! o bóra, o reiltibbia; quiero - mi ca sa n la na''a o bóra e tyóbbo m [n la na''o boré tSob boom], n la na''a o reiltibbia e tyóbbo m [n la na''o reñtibbie tSóbboom], yo arriendo mi libro n la rentibbia e ribúkkuún [n la rénhibbie ribúkkuulÍ1 ].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrestar: arrestar, v. in! o IÍlmetta, o hMmota; todas las personas del poblado fueron arrestadas a bat yo bammaa ba e eriia wela ba mmetyi ó [a batSo bammaa béria wela bá IÍ1metSo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oOO''ó', 'adv.', NULL, NULL, 'arriba: arriba, adv. oOO''ó, obo''ó; voy hacia - n la bella obo''ó [na hellobo''ó], las mujeres viven siempre - a baísso ba lá pélla o obo''ó tyommaa [a baísso ba lá péllobo''ó tSommaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrimar: arrimar, v. in! o koppia; arrimo mi asiento al tuyo n la koppia e empa m e ao bi''o [n la kop piempalÍ1 e áo bi''o]. 2. -se o kopea, o tyutyera; me arrimo a ti porque tengo frío na o kopea bi'' o kóri na ó''a sille [no kópea bi''o kóri no''á sille].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'arrojar: arrojar, v. in! o ubera; arrojo el coco a mi ami go n la uhera o buakaleko o wéso''o lÍ1 [n la uhero buakaleko o wéso''oom].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ríe', 's.', 'm.', 'Cl. 5', 'arroyo: ríe , el - e ríe; -s bíe , los -s a bíe; los -s están secos a bíe ba héi [a bié bá héíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ressi', 's.', 'm.', 'Cl. 10', 'arroz: ressi , el - i ressi; quiero comer - mañana n la na''a o ráa ressi obaam [n la na''o rá ressi obaam].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('pI', 'adj.', NULL, NULL, 'as: as, adj. pI. bebe (el. 2 y 6) personas - batyo bebe, mejillas - bakekko bebe, biebie (els. 4 y 8) narices - bempo biebie, pueblos - biriia biebie, nene (el. lO) casas - ty6bbo nene, tuetue (el. 13) cuentos - toatta tuetue.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('OOnoa', 'adj.', NULL, 'Cl. 3', 'asado: asado, adj. OOnoa , pollo - ko''e á bonoa [ko''e á bónoa], el - o bonoa, el pollo - e ko''e á aspirar I 367 bonoa [e ko''e á bónoa]; -s benoa (el. 4), pollos -s ko''e yá bonoa [ko''e yá bónoa], los -s e benoa, los pollos -s i ko''e yá bonoa [i ko''e yá bónoa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'asamblea: asamblea, s. f rokko , inoá , eoperi (el. 7), etohó (el. 7), - de notables e inoá ré bio béolla, riobbí (el. 5), -rio mmotye (el. 1), la - e rokko, e inoá, e eoperi [eeoperi], e riobbí, e eto hó [eetohó]; -s bokko (el. 6), banoá (el. 6), bioperi (el. 8), baobbí (el. 6), las -s a bokko, a banoá, e bioperi, a baobbí, e bitohó; la - del pue blo e rokko rá e eriia [e rokko rériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'asar: asar, v. ini o tokka, o nooa; voy a - plátanos ka noa''á bekobbe [ka noa''á békobbe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loatya', 's.', 'm.', 'Cl. 5', 'ascensor: loatya (el. 1 1), ribissó , el - o loatya, e ribissó; -es baatya , abissó (el. 6); el - está averiado o loatya lo kapei [o 10atSa ló kápeei]. ascua, s'' ¡: ematyotyo (el. 7), el- e ematyotyo;-s bimatyotyo (el. 8), las -s e bimatyotyo; pone mos las -s en la plancha e bimatyotyo to la bi heráa e ehaíeen wela [e bimatSotSo to la bi here haíeen wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'asegurar: asegurar, v. inf 1. o ebbia, o ó''ia, te aseguro que sí n ebbia. 2. -se o ó''ia, me aseguré de ello m ba ó''íía o [m bó''ía, m bó''io].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'asemejar: asemejar, v. ini t. o hálla. 2. -se o hálla. hacer o haráa; me asemejo a pescador n háám o boob be [n hammóboobbe], el niño se asemeja a su tío o bollá a háám o bOioppé áí [o bollá hámó boioppáí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eiloom', 's.', 'm.', 'Cl. 7', 'aseo: eiloom , el- e eiloom ; -s biiloom , los -s e biiloom; el - está cerrado e eiloom e ribei [eeiloom e ríbei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

