  ('lállo', 'adv.', NULL, NULL, 'así: así, adv. lállo, allo; - es allo se, - habló el espíri tu allo kálo a to''óm la o mmo [allo kálo a to''órÍl lá ó mmo]; -- ro''oro''o (el. 5).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eakko', 's.', 'm.', 'Cl. 7', 'asidero: eakko , eappo , el - e eakko [eeakko], e eappo [eeappo]; -s biakko (el. 8), biappo (el. 8), los -s e biakko, e biappo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('empa', 's.', 'm.', 'Cl. 7', 'asiento: empa , euppa , el - e empa [eempa], e euppa [eeuppa]; -s bimpa (el. 8), biuppa (el. 8), -s nuevos bimpa bi he, los -s e bimpa, e biuppa, los -s delanteros e bimpa bi obOsso [e bimma biobOsso]; - pequeño simpa (el. 12), - grande empampa (el. 7), el - peque ño e simpa, el- grande e empampa [empampa], -s pequeños rompa (el. 13), -s grandes bim pampa (el. 8), los -s pequeños o tompa, los -s grandes e bimpampa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bopuératá', 'adj.', NULL, 'Cl. 1', 'asistente: asistente, adj. bopuératá , boiálla (el. 1), emmaeri (el. 7), el - o bopueratá, o boiál la, e emmaeri [eemmaeri]; -s bapueratá (el. 2), baiálla (el. 2), bimmaeri (el. 8), los -s a bapuératá, a baiálla, e bimmaeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'asma: asma, s. f ehiió , el - e ehiió ; -s bihiió (el. 8), las -s e bihiió; tengo - ne ehiió, el - ataca al médico e ehiió e hMmotyi e rokútta [ehió é llMmotSé rokútta].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'asociación: asociación, s. f wallá , roko , sosie ráa (el. 12), la - o wallá, e roko, e sosieráa; aso ciaciones biallá (el. 8), boko (el. 6), tosiera (el. 13), las asociaciones e biallá, a bOko, o tosieráa; las asociaciones de vecinos hacen una fiesta e biallá bi á batyo bá e epatto be la pélla ripelló [e bial lá biá bátSo bépatto bé lá pélla ripelló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'asombrar: asombrar, v. inf 1. o atyára; el tiempo asombra a la gente e ebélló e lá atyára a batyo [eebelló lá atSára batSo]. 2. -se o atyálla, mientras vivas verás cosas que te asombrarán na we lé o obOtyo ommaa o la elláa bilabba ná o le atyálla [na wé lóbotSo ommaa o lellá bilabba ná o látSálla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sihám', 's.', 'm.', 'Cl. 12', 'aspecto: sihám , watyatya , el - e sihám, o watyatya; -s tohám (el. 13), beatyatya (el. 4), los -s o tohám, e beatyatya; tiene buen - okkí bosso buebue [okkí bósso buebue].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'aspirar: aspirar, v. ini o tyotyóbia; - rapé o nópibia; la abuela aspira rapé o bonánna a la nópibia, yo aspiro rapé n la nópibia. 3()8 / astilla', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'astilla: astilla, s. f etubá , la - e etubá ;-s bitubá (el. 8), las -s e bitubá; de tal palo tal setyi a tyí''a bella epa''á [setSí tSáa belepa''á].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'astillarse: astillarse, v. in! o sábba; los árboles viejos se asti Dan mucho a batté bololló bá la sábba likélíke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'astucia: astucia, s. f esií , esí , la - e esií [eesií], e esí [eesí]; -s bisií (el. 8), misí (el. 8), las -s e bisií, e misí; trabaja con - todo el año a la bókobia la esií o loa 10mmaa [a la bókobia 1esií o luá lommaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosií', 'adj.', NULL, 'Cl. 1', 'astuto: bosií , esussa , el - o bosií, e esussa [eesussa], hombre - bokattí (el. 1), botará (el. 3); -s basií (el. 2), bisussa (el. 8), los -s a basií, e bisussa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOkottó', 's.', 'm.', 'Cl. 3', 'asueto: bOkottó , el - o bokotto; -s bekotto (el. 4), los -s e bekottó; el día del - la gente no va a la finca e ello a o bOkotto a batyo bá tyi a hella obáám [ello o bókótto a batSo tSáa helló obáám].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bo', 's.', 'm.', 'Cl. 3', 'asunto: bo1áa , elabba , botólló (el. 3), labba (el. 6b), el - o boláa, e elabba [e1abba], o botólló, a labba; -s beláa (el. 4), bi labba (el. 4), betólló (el. 4), los -s e beláa, e bilabba, e betólló; los -s tradicionales e bilabba ya ribOtyo [e bilaba ya ríbOtSo], -s importantes bilabba bióte. 2. asuntillo, dim. silabba (el. 12), el- e silabba; -s tolabba (el. 13), los -s o tOlab ba; tengo muchos -s que tratar n okkí tOlabba to se [nokkí tólabba to se].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosáráa', 's.', 'm.', 'Cl. 1', 'asustador: bosáráa , el- o bosáráa; -es basáráa , besáráa , los -es a basáráa; hay muchas personas que son -es he batyo bikébíke ná basáráa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inI', 'v.', NULL, NULL, 'asustar: asustar, v. inI o sára, o karíbia. 2. -se o karíbba, o baríbba, o bárima, o sábba; la noche asusta a muchos niños o botyíó bó la sára a bóllá bíke bíke [o botSíó bó la sará bollá bikébíke]; mi cora zón se asusta (me he llevado un buen susto) o botébbá rÍl bo la sábba [o bOtebáffi bó la sábba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'atacar: atacar, v. in! 1. o atakalla, me ataca el hambre e tyallá é la ne átakalla [e tSállá é lá le átakalla]. 2. - a una persona entre varias o okáera, el por tavoz fue atacado por tres personas e to''óleri o okáeria o batyo be battá [e to''óleri okaerío bátSo be battá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loakke', 's.', 'm.', 'Cl. 11', 'atado: loakke , el-o lOakke; -s beak ke (el. 4), los -s e beakke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ipuaera', 's.', 'm.', 'Cl. 5', 'atajo: ipuaera , mooka , el - e ipuaera, o mooka; -s apuaera (el. 6), meoka (el. 4), los -s a apuaera, e meoka; el- llega al pobla do e ipuaera é la pella obessé [e ipuaera é la pell60bessé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'atanga: atanga, s. f obbé , la - e obbé; -s biobbé (el. 8), las -s e biobbé; las -s están en el mer cado e biobbé bi lé o mmakétte [e biobbé bí ló mmakétte].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rioppo', 's.', 'm.', 'Cl. 5', 'ataque: rioppo , - de nervios rikokko (el. 5), el - e rioppo; -s baoppo (el. 6), -s de nervios bakokko (el. 6); el - de nervios no le deja hablar e rikokko ri tyi tyuará a to''óm [e rikokko ri tSi tSuará á tó''óm].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atar: atar, v. inf. 1. o akka; la mujer "ata" su corazón (la mujer aguanta lo indecible) o waísso a la akka e etébbá áí [o waísso la akketebbáí]. 2. o tópa, o topáa; "ato" mis oídos para entender (presto atención para entender) na tópa a batóo rÍl ka o o''áa [na topá batórÍl kó''e]. 3. - con o topálla; mi fardo, lo ato con bejuco o bo''e rÍl n la bO topálla obellá [o bo''erÍl n la bo tópalla obellá]. 4. - para alguien o topella, o akella. S. - fuerte o koya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buatotyio', 's.', 'm.', 'Cl. 3', 'atardecer: buatotyio , el - o buato tyio, llegó al- a pooi buatotyío [a poi buátotSio]; -es biatotyio (el. 8), los -es e biatotyio.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

