INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('lobakka', 's.', 'm.', 'Cl. 3', 'ataúd: lobakka (el. 1 1), bokíssi ; -es bakka (el. 10), biokíssi (el. 8); el- llegó cuan do el cadáver estaba ya enterrado o lobakka lo pooi ná e erutta e''a tyileri o [o lobakka ló poi ná erutta e''á tSílero].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosáráa', 'adj.', NULL, 'Cl. 1', 'atemorizador: bosáráa , el - o bosáráa; -es basáráa (el. 2), los -es a basáráa; los -es salen de noche a basáráa ba lá pullá e etyíó [a basará bá láa pulé etSiió].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'atemorizar: atemorizar, v. in! o sára; si alguien atemoriza se le denomina atemorizador na botyo a la sára a la el ella o bosára [na bótSo la sára a lelel lo bosáráa]. atención, 1. interj. héle!, hélellé! 2. s.! rilebueri (el. 5), la - e rilebueri; prestar - o bOlóbiera, o batóbiera, o tópa i kótya [o tópi kótSa]; presta cuando te hablo bOlóbiera na n la o tówálla [bOlobiera ná n lo tówalla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'atender: atender, v. in! o batóbiera, o bOlóbiera, O oátye ra, o tópa i kótya [o tópi kótSa], o ekábi''o (cui autorización I 369 dar); atiende al niño ekábo bi''o o bollá, atiénde me por favor ekált�bi''o tyuíi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosáráa', 'adj.', NULL, 'Cl. 1', 'aterrador: aterrador, adj. bosáráa , el- o bosáráa; -es basáráa (el. 2), besáráa (el. 4), los -es a basáráa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aterrar: aterrar, v. inf o sára; esta estatua aterra a los cuervos bolo botebótyo bo lá sára i ka''á [bolo botebótSo bo lá sarí ka '' á].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atetar: atetar, v. inf o áppia, o náppia; la madre ateta al niño o oberíi a la áppia o bollá [oberí la áppio bOllá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atisbar: atisbar, v. inf. o elláa, o notella; atisbo un cayu co a lo lejos n la elláa wáttoo ototo [nellá watto ototo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atizar: atizar, v. inf o kóbba, o kokka, o obbá; - el fuego o kóbba o boissó [o kobbó boissó); atizo el fuego n la obbá o boissó [na obbó boissó).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atontar: atontar, v. inf. o ekébbia; esta noticia atonta a los oyentes bolo bOatta bo lá ekébbia a bOátyera. 2. -se o ekébba; el perro se atonta con el true no e puá e lá ekébba la e ekuku [e puá é lékébba leekukuu].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atormentar: atormentar, v. inf. o tyipóbia, o tyitóra; el humo le atormenta e ehútu e lá bo tyipóbia [ehútu e lá bo tSípobia] .2. -se o tyipóbba; no me atonnen tes we le tyipóbie.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atragantar: atragantar, v. inf. o oppa; cuando como pesca do me atraganto na IÍ la ráa tyué n la oppa [na IÍ la ra tfué n la oppa]. 2. -se o oppa, o kobba; cuando como pescado me atraganto na IÍ la rá tyué n la oppa [na IÍ la rá tfué n loppa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atrapar: atrapar, v. inf o rnmetta; atrapo los mangos n la r hmetta e imallkoro [n la mmette imalÍkoro], el alguacil atrapa al pescador e eporosía e lá mmetta o boobbe [eporosiá é láa mmetto boobbe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nná', 'adv.', NULL, NULL, 'atrás: atrás, adv. nná, nnápua; siéntate - pélla e nnápua [péllé nnápua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atravesar: atravesar, v. inf. o péréa; atravieso la calle n la péréa o bokóo [n la peréo bokóo).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elasálássá', 's.', 'm.', 'Cl. 7', 'atrevimiento: elasálássá , rappo (el. 5), el - e elasálássá [eelasálássá], e rappo; -s bilasálássá (el. 8), bappo (el. 6), los -s e bilasá lássá, a bappo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atribuir: atribuir, v. inf. o pá, o takiáera; atribuyo el albo roto a los escolares n takiáeriia e nokonoko a bakuerakueráa [n takiáeríé nokonoko a bakuera kueráa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'atropellar: atropellar, v. inf. o binna; el coche atropelló al buey o motóO bo binni e pókkó [o motó bó bínni e pokkó], no cruces para que no te atropelle un coche we pérée o ta péri o binna ó motóo [wé pérée o ta péro binnoo móto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOhétyo', 's.', 'm.', 'Cl. 3', 'atuendo: bOhétyo , el - o bOhétyo; -s behétyo, los -s e behétyo; los -s se secan con el calor del Sol e behétyo bé la héa la e húé e itóhí [e behétfo be láa héa le hué é ítohí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aullar: aullar, v. inf. o hóbba; o heúbba; el perro aúlla e puá é la hóbba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebé''i', 's.', 'm.', 'Cl. 7', 'aullido: ebé''i , el - e ebé''í ; -s ibé''í (el. 8), los -s e ibé''í; el- del perro me des pertó e ebé''í é pua e le ebbi [ebe''í é pua e le ebbi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'aumentar: aumentar, v. inf o owera, o hura, o herá bi''o; la suerte aumentó mis ahorros e ri''uá ri oweriia e reppo rh [e ri''uá róweriie reppoorh].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elotolottó', 's.', 'm.', 'Cl. 7', 'auricular: elotolottó , el- e elotolot tó; -es bilotolottó (el. 8), los -es e bilotolottó; los -es están en la tienda e bilotolottó bi lé o sáppo [e bilotolottó bí lóo sáppo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'aurora: aurora, s. f ebarityio , ebaam , la e ebarityio [eebaritfio], e ebaam [eebaam], el rocío de la - e ribba (el. 5); -s mbarityio (el. 8), mbaam (el. 8).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('roorí', 's.', 'm.', 'Cl. 5', 'autogobierno: roorí , roréa , el - e roorí, e roréa; -s boorí , boréa , los -s a boorí, a boréa; los -s son buenos para los pueblos a boréa ba seri e biriia bebe [a boréa bá seré biriia bebe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

