  ('euláúla', 's.', 'm.', 'Cl. 7', 'automóvil: euláúla , motóo , el - e euláúla , o motóo; -es biuláúla (el. 8), meotóo (el. 4), los -es e biuláúla, e meotó6; los -es corren mucho e biuláúla bi lá húbbia lobó lobó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'autoprotegerse: autoprotegerse, v. inf. o bulaerea, o burea; me autoprotejo de la lluvia na bulaerea o lóllá [na bulaereo lóllá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opénera', 'adj.', NULL, 'Cl. 1', 'autor: autor, adj. opénera , el- o opénera [opéne ra]; -es apénera (el. 2), los -es a apénera; el firmó mi carta o opénera a saatyi o boataboatyó l Í 1 [ oopénera a saatSo bóataboatf órh].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'autoridad: autoridad, s. f kóbinna , la - e kóbinna, -es kóbinna (el. !O), las -es i kóbinna; las -es tuvieron una asamblea i kóbinna i okkí eoperi [i kóbinna í okki Cóperi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'autorización: autorización, s. f bosabo , mosabo , la - o bosabo, o mosabo; autorizaciones besabo 370 / autorizar (el. 4), mesabo (el. 4), las autorizaciones e besabo, e mesabo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'autorizar: autorizar, v. inl o páa to''ú ; el jefe me autorizó hablar en su nombre o botúkku a le péi o to''ú o tO''ólla la e illa ri ái [o bOtukkú a le peyó to''ú o tó''ólla le illa rái].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'auxiliar: auxiliar, v. inl o iálla, o bepubbia, o hMmotaella; los pescadores auxilian al anciano a baobbe ba lá iálla e obéolla [a baobbe bá lá iálle obéolla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eiállo', 's.', 'm.', 'Cl. 7', 'auxilio: eiállo , el- e eiállo ; -s biiállo (el. 8), los -s e biiállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 's.', NULL, 'Cl. 5', 'avanzadilla: avanzadilla, s. I rokátya , la - e rokátya; -s bokátya , las -s a bokátya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'avanzar: avanzar, v. inl o etta, o akátta; avanzo deprisa n la etta bakassO [na etta bakasso], no avanzo deprisa n tyi''a la etta bakassO [n tSá etta bakasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sipoppi', 'adj.', NULL, 'Cl. 12', 'avaro: avaro, adj. sipoppi , el - e sipoppi; -s topoppi (el. 13), los -s o topoppi; creo que no soy - n siá n tyi sipoppi [nsiá n tSi sipoppi], esta persona es avara 010 bOtyo e sipoppi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 's.', NULL, 'Cl. 7', 'ave: ave, s. I elori , bohahí , el - e elori [eelorí], o bohahí; -s bilorí (el. 8), behahi (el. 4), las -s e bilorí, e behahí; - gallinácea ko''e (el. 9), -s gallináceas ko''e (el. 10).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
