  ('buía', 's.', 'm.', 'Cl. 3', 'bosque: buía , ehobbá , el - o buía, e ehobbá [eehObbá]; -s biía (el. 8), bihob bá (el. 8), los -s e biía, e bihObbá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'bostezar: bostezar, v. inf. o nobba; preso las personas que escuchan al mandatario bostezan a batyo ba lá batóbiera bá o boitta ba la nobba [a batJo ba láa bat6biera bo b6itta bá la nobba];pas. duro yo bostezaba mientras hablabas n nobessi o towessi lá [n nobessi o towessí lá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
