  ('il''', 'v.', NULL, NULL, 'conversar: conversar, v. il''!l o pobba; o to''ólla; preso yo con verso n la pobba. n la to''ólla [n la tó''ólla], tú conversas o la pobba, o la to''ólla [o la tó''ól1a], etc., paso punto yo conversé n pobbi, n to''órí [m pobbi/n tó''óri], tú conversaste o pobbi, o tO''óri [o tó''óri], etc., paso duro yo conversaba n pobessi, n tówessi, tú conversabas o pobessi, o tówessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
