  ('inf', 'v.', NULL, NULL, 'criar: criar, v. inf o bópáa; preso la gaUina cría a sus pollitos e karió''e e lá bópáa o toko''e to áe [e karíó''e e láa bopó toko''e tuáe]; paso punto este hombre no crió a su hijo oló boie a ta bópíi o bóllá áí roló bOie ata bópio bolááí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
