  ('tyuappó', 's.', 'm.', 'Cl. 13', 'cruce: tyuappó , el - o tyuappó; -s t yuappa (el. 13), los -s o tyuappa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
