  ('irif', 'v.', NULL, NULL, 'cruzar: cruzar, v. irif. o péréa;pres. yo cruzo la calle n la péréa o bokóo [n la péréo bokóo], tú cruzas el mar o la péréa e elo''á [o la péréelo''á], él cruza el río a la péréa e ríe [a la peréeríe], etc., paso punto yo crucé n péréi [m péréi], tú cruzaste o péréi, él cruzó a péréi, etc., paso duro yo cruzaba n péreseei [m péreseei], tú cruzabas o péreseéi, él cruzaba a péreseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'cuadrilla: cuadrilla, s. f rokkí , wallá , la - e rooki, o wallá; -s bokkí (el. 6), biallá (el. 8), las -s a bokkí, e biallá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epa''i', 's.', 'm.', 'Cl. 7', 'cuadro: epa''i , el- e epa''i ; -s ipa''i (el. 8), los -s e ipa''L cuánto, int. abe''e (els. 2 y 6) ¿- gente hay aquí? he batyo abe''e hállo?, ebe''e (el. 4) ¿-s plátanos quieres? o la na''a bekobbe ebe''e?, ibe''e (el. 8) ¿-s pueblos hay? he biriia ibe''e?, be''e (el. 10) ¿-s sardinas hay en la charca? he kollo be''e e erib ba wela? [he kollo be''e reriba wela?], tobe''e (el. 13) ¿-s cuentos me vas a contar? o la le sella toatta tobe''e?, labe''e (todas las clases) ¿- cuesta esta carne? ele nabba é labe''e?, ¿- cuesta este asiento? eló empa é labe''e?, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'cuarenta: cuarenta, adj. numo batyílla appa; - personas batyo be batyílla appa [batJo be batJilá appa]. cuarto, 1. s. m. etubá (el. 7), - de baño isubbó (el. 5), - de aseo koppí (el. 9), el - e etubá [eetubbá], el - de baño e isubbó, el - de aseo e koppí; -s bitubá (el. 8), -s de baño basubbó (el. 6), -s de aseo koppí (el. 10), los - e bitubá, los -s de baño a basubbó, los -s de aseo i koppí. 2. adj. ardo bale (Cls. 2 y 6) la cuarta persona o botyo a bále, la cuarta cama e raatyé ri a bale [e ratJe ra bálle]; biele (el. 4) la cuarta historia o bOatta bo a biele [o boatta bua bielle]; bile (el. 8) el- poblado e eriia a bile [eeria a bílle]; nne (el. 10) el - vestido o luua lo a nne [o loa lua íme]; tuele (el. 13) el- cuento e siatta si a tuele [e siat ta sa tuelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

