  ('f', 's.', NULL, 'Cl. 3', 'cuerda: cuerda, s. f opetté , - resistente bosappo (el. 3), la - o opetté [oopetté], la - resistente o bosappo; -s epetté (el. 4), -s resistentes besap po (el. 4), las -s e epetté [eepetté], las -s resis tentes e besappo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
