  ('f', 'S.', NULL, 'Cl. 3', 'cueva: cueva, S. f bosilla . boappú , la - o bosilla, o boappú; -s besilla (el. 4), beappú (el. 4), las -s e besilla, e beappú. cuidado, 1. S. m. ribóperi (el. 5), ribóppi (el. 5), riotyanna (el. 5), el - e ribóperi, e ribóppi, e rio tyanna; -8 abóperi (el. 6), abóppi (el. 6), baotyan na (el. 6), los -s a abóperi, a abóppi, a baotyanna. 2. j-! int. buanná!, hélle!, - con el perro hélle la e puá [hélle le puáa]; ten - buanná!', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'cuidar: cuidar, v. irif. o ekábi''o; preso yo cuido a mi padre n la ekábi''o o boie m [n lekó biiiem bí''o], tú cui das al niño o laekábi''o o bOllá [o 1ekó bolla bí''o], etc., paso punto yo cuidé a mi abuelo n ekíbi''o o boyolla m [nekió boyollarh bí''o], tú cuidaste al niño o ekíbi''o o bollá [wekíó bolla bí''o], etc.,pas. duro yo cuidaba a mi padre n ekessibi''o o boie m [nekessó boiem bí''o], tú cuidabas al niño o ekes sibi''o o bollá [wekessó bolla bí''o], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'culebra: culebra, s. f bappa , nMa , - inofen siva ebebe (el. 7), - grande luebba (el. 1 1), negra bebíla (el. 9), - verde biisappí (el. 3), la - e bappa, e nMa, la - inofensiva e ebebe [eebe be], la - grande o 1uebba, la - negra e bebíla, la - verde o bosappí; -s bappa (el. 10), nMa (el. 10), -s inofensivas ibebe (el. 8), -s grandes bebba (el. 6), -s negras bebíla (el. 10), -s ver des besappí (el. 4), las -s i bappa, i nooa, las -s inofensivas e ibebe, las -s grandes a bebba, las -s negras i bebíla, las -s verdes e besappí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
