  ('j', 's.', NULL, NULL, 'danza: danza, s. j: lObileri (el. 1 1), - bubi de los espíri tus barekaita rimuetye (el. 5), - de la cintura boatte (el. 3), la - o lobileri, la - bubi de los espíritus barekaita e rimuetye, la - de la cintu ra o boatte; -s bileri (el. 10), -s bu bis de los espíritus barekaita amuetye (el. 6), -s de la cintura bea tte (el. 4), las -s i bilen, las - s bubis de los espíritus barekaita a amuetye [aamuetSe], las -s de la cintura e beatte.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('üif', 'v.', NULL, NULL, 'dañar: dañar, v. üif. o tóbbia;pres. yo daño n la tóbbia, tú dañas o la tóbbia, él daña a la tóbbia, etc.; paso punto yo dañé n tóbía, tú dañaste o tóbía, él dañó a tóbía, etc.; paso duro yo dañaba n tóbiesiia, tú dañabas o tóbiesiia, él dañaba a tóbiesiia, etc. 2. -se o itólla, o tóbba; preso me daño n la itólla [n litólla], n la tóbba [n la tobbáa], te dañas o la itól la [o Iitólla], o la tóbba [o la tobbáa], se daña a la itólla [a Iitólla], a la tobba [a la tobbáa], etc.; paso punto me dañé n itóri [nitóri], n tóbbi [n tobbíi], te dañaste o itóri [witóri], o tóbbi [o tobbíi], se dañó a itóri [itóri], a tóbbi [a tobbíi], etc.; paso duro me dañaba n itólessi [nitólessi], n tóbessi, te daña bas o itólessi [witólessi], o tobessi, se dañaba a itólessi [itólessi], a tóbessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('roppá', 's.', 'm.', 'Cl. 5', 'daño: roppá , el - e roppá; -s boppá (el. 6), los -s a boppá; me haces - o la le ó''ia roppá [o la ló''ia roppá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyikka', 's.', 'm.', 'Cl. 3', 'dardo: botyikka , el - o botyikka; -s betyikka (el. 4), los -s ti betyikka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('narnmo', 's.', 'm.', 'Cl. 9', 'dátil: narnmo , pillá , el- e námmo, e pillá; -es narnmo (el. lO), pillá (el. 10), los -es i narnmo, i pillá. de, caneco prep. a [á], e [é]; el pueblo - los hom bres ti eriia a baie [eeria á baie], persona -1 mis mo pueblo botyo a ti eriia [bOtjo ériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('onno', 'adv.', NULL, NULL, 'debajo: debajo, adv. onno; *atá (efr. bubi); el hombre está - de la cama o bOie a la e raatyé atá [o boie a le raatjátta]. deber, 1. s. m. mpo (el. 9), el- e mpo; -es mpo (el. 10), los -es i mpo. 2. v. inf o hOálla; preso yo debo a esta persona n hOán 010 botyo [n hoanólo bOtjo], tú debes a tu jefe o hOán o mmása o [o hOánó mmásaao], etc.; paso duro yo debía a mi vecino n ka hOán o botyo e epatto rn [n ka hOánó botjo épattoorn], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obottó', 'adj.', NULL, 'Cl. 3', 'débil: débil, adj. obottó , el - o obottó ; -es abóttó , los -es a abottó .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'debilidad: debilidad, s. f obottó , obotto , la o obóttó [oobottó], o obotto [oobotto]; -es ebottó (el. 4), ebotto (el. 4), las -es e ebóttó [eebottó], e ebotto [etibotto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'debilitarse: debilitarse, v. inf o lokolla; preso me debilito n la lokolla, te debilitas o la lokolla, se debilita a la lokolla, etc.; paso punto me debilité n lokori, te debilitaste o lokori, se debilitó a lokori, etc.; paso duro me debilitaba n lokolessi, te debilita bas o lokolessi, se debilitaba a lokolessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'decapitar: decapitar, v. inf o epólla hNko; paso duro las personas de antaño decapitaban a los blancos a batyo ba rnmalé ba epuessi i hNko i á apotto [a batjo bárnmalé bépuessí i hNko yápotló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'decir: decir, v. inf o buelláa, o túbaera, o héttáa, o oháa; preso yo digo n la buelláa, yo digo a esta perso na n la buelláa 010 bOtyo [n la buellólo bOtjo], él dice a su padre a la buelláa o boie áí [a la bueló boiái], a la túbaera o boie ái [a la túbaero boiáí], dilo bien héttáa hó lelle [hetta hó lelle], etc.; paso punto yo le dije la verdad n bO bueríi e ette [m bo bueré ette], tú dijiste mentiras o túbaeriia bisoi [o tubáeríá bisoí], etc.; paso duro yo le decía a esta persona n buelessi 010 bOtyo [m bülessólo dejar / 405 botSo], tú me decías todos los hechos o le bue lessi e bilabba bi mmaa [o le buelessé bilaba bim maa] , etc.; ¿qué dices? ká o la oháa le? [ká ó lohá le?], ¿qué has dicho? ká bo ohí le? [ká bóhí le?] no he dicho nada n ta ohí labba lelálle [n tóhi labba lelálle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i', 's.', NULL, 'Cl. 7', 'declaración: declaración, s. i enonori , la - e enonori [eenonori]; declaraciones binonori (el. 8), las declaraciones e binonori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'declarar: declarar, v. ini o sosolla, o sosuella; preso yo declaro n la sosolla, n la sosuella, tú declaras o la sosolla, o la sosuella, él declara a la sosolla, a la sosuelIa, etc.; paso punto yo declaré n sosom/n sosori, n sosuemln sosueri, tú decla raste o sosom/o sosori, o sosuem/o sosueri, él declaró a sosom/a sosori, a sosuem/a sosueri, etc.; paso duro yo declaraba n sosuessi, n sosue lessi, tú declarabas o sosuessi, o sosuelessi, él declaraba a sosuessi, a sosuelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('yo', 'V.', NULL, NULL, 'decorar: decorar, V. ¡ni o pippa;pres. yo decoro mi casa n la pippa e tyóbbo rh [n la pippe tSóbboom], tú decoras tu habitación o la pippa e etyubbá ó [o la pippeetSubbáaó], él decora la plaza a la pip pa e riossa [a la pippe riOssa], etc.; paso punto yo decoré la calle n pippi o bokóo [m pippi o bókóo], tú decoraste el salón o pippi e palláa [o pippi e pálla], él decoró el árbol de Navi dad a pippi e ripuppu [a pippi e rípuppu], etc.; paso duro yo decoraba mi coche n pipessi o motóom [m pipessó motóom], tú decorabas el hospital o pipessi e tyóbbo i kaaí [o pipessé tSobbo í kaaí], él decoraba el oratorio a pipes si e róhiáa [a pipessé rohiáa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botó''ia', 'S.', 'm.', 'Cl. 3', 'decoro: botó''ia , el - o botó''ia; -s betó''ia (el. 4), los -s e betó''ia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i', 'S.', NULL, 'Cl. 3', 'decrepitud: decrepitud, S. i bolólló , borulla , bOruri (el. 3), la - o bOlólló, o borulla, o boruri; -es beolólló (el. 4), berulla (el. 4), beruri (el. 4), las -es e beolólló, e berulla, e beruri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bone', 's.', 'm.', 'Cl. 3', 'dedo: bone , - del pie bonessú , el - o boné, el - del pie o bOnessú; -s bene (el. 4), -s del pie benessú (el. 4), los -s e bene, los -s del pie e benessú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elebbáa', 'S.', 'm.', 'Cl. 7', 'defecto: elebbáa , el - e elebbáa [eelebbáa]; -s bilebbáa (el. 8), los -s e bilebbáa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'defender: defender, v. inf o bulaella; preso yo defiendo n la bulaella, tú defiendes o la bulaella, ella defien de a la bulaella, etc.; paso punto yo defendí n bulaeri [m bulaeri], tú defendiste o bulaeri, él defendió a bulaeri, etc.; paso duro yo defendía n bulaelessi [m bulaelessi], tú defendías o bulae lessi, él defendía a bulaelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
