  ('obulabotyo', 'adj.', NULL, 'Cl. 1', 'defensor: obulabotyo , obulaba tyo (el. 1), obulabetyo (el. 1), el- o obulabotyo [oobulabotSo], o obulabatyo [oobulabatSo], o obulabetyo [oobulabetSo]; -es abulabOtyo (el. 2), abulabatyo (el. 2), abulabetyo (el. 2), los -es a abulabOtyo [aabulabOtSo], a abulabatyo [aabu labatSo], a abulabetyo [aabulabetSo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

