  ('f', 'S.', NULL, 'Cl. 7', 'dejación: dejación, S. f etyi''ó , la - e etyi''ó [1515 tSi ''ó]; dejaciones bityi''ó (el. 8), las dejaciones e bityi''ó. dejadez, s'' ¡: bOeppé (el. 3), boorí (el. 3), la - o boeppé, o boorí; -ces beppé (el. 4), beoré (el. 4), las -ces e beppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'dejar: dejar, V. inf o tyi''a; preso yo dejo n la tyí''a, tú dejas o la tyí''a, ella deja a la tyí''a, etc.; paso punto yo dejé n tyí''i, tú dejaste o tyí''i, él dejó a tyí''i, etc.; paso duro yo dejaba n tyí''essi, tú deja bas o tyí''essi, él dejaba a tyí''essi, etc. 2. - para alguien o tyíella; preso yo dejo un sitio para mi pariente n la tyíella o bOtyo rh eruua [n la tSiello botSomeruua], tú dejas agua para mí o la le tyíella boppé, etc.; paso punto yo dejé una noticia para la gente n tyíeri a batyo bOatta [n tSíerá batSo bOatta], tú me dejaste tiempo o le tyíeri 406 / delante ebéló [o le tSic�rebeló], etc.; paso duro yo dejaba un sitio para tu pariente n tyíelessi o bOtyo o eruua [n tSíelessó botSoo eruua], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOsuállo', 's.', 'm.', 'Cl. 3', 'delante: bOsuállo , - de *álo; - de mi casa e tyóbbo rÍl álo [e tSobbómállo], - del coche o motóO álo [o motóalo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'delatar: delatar, v. inf. o rikora; preso yo delato n la riko ra, yo delato al extranjero n la rikora o bOríbáa, tú delatas o la rikora, etc.; paso punto yo delaté n rikoriia, yo delaté al ladrón n rikoriia e húbbé [n rikóríé hubbe], tú delataste o rikoriia, etc.; paso duro yo delataba n rikoresiia, tú delatabas o rikoresiia, él delataba a rikoreslia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtákko', 's.', 'm.', 'Cl. 1', 'delegado: bOtákko , el - o bOtákko; -s batákko (el. 2), los -s a batákko; el- del gobierno o bOtákko bO e kobinna [o bOtakko bué kobinna].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'deleitar: deleitar, v. inf. 1. o ó''ia hOróo ; el músico nos deleita con su canción e neppí e láa e ó''la bOróo la o loberí lo áe [e neppí é le ó''ia boro lo loberí luáe]'' 2. -se o ó''a boroo [o o''á bOroo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boroo', 's.', 'm.', 'Cl. 3', 'deleite: boroo , el- o bOroo; -s heroo (el. 4), los -s e beroo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eposso', 's.', 'm.', 'Cl. 7', 'delfín: eposso , el- e eposso ; delfines mposso (el. 8), los delfines e mposso; a los niños les gustan los delfines a bollá bá horíi e mposso [a bollá bá hóré mposso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('losikko', 's.', 'f.', 'Cl. 3', 'delgadez: losikko (el. 1 1), bosikkí , la - o losikko, o bosikkí; -ces besikko , besikkí (el. 4), las -ces e besikko, e besikkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'deliberar: deliberar, v. irif. o katta; los delegados están deliberando a batákko ba lá katta [a batakko bá láa katta].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'demandar: demandar, v. il''!f: o rikora, o oballa. preso yo demando a alguien n la rikora botyo, tú deman das a tu jefe o la rikora o mmása o [o la rikoro mmásaao], ella demanda a todos a la rikora a batyo ba rnmaa [a la rikora batSo bammaa], etc.; paso punto yo demandé al gobernador n rikoriia o boitta [n rikóríó hOitta], tú demandaste a los muchachos o rikoriia a baséseppe [o rikóríá base seppe], él demandó a su padre a rikoriia o boie áí [a rikóríó bOiááí], etc.; paso duro yo demanda ba a alguien n rikoresiia bOtyo [n rikoresíá bótSo], tú demandabas al gobierno o rikoresiia e kobinna [o rikoresíé kobinna], él me demandaba a le rikoresiia [a le ríkoresiia], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyoppo', 's.', 'f.', 'Cl. 9', 'demencia: tyoppo , betyoppo , la - e tyoppo, o botyoppo; -s tyoppo (el. 10), betyoppo (el. 4), las -s i tyoppo, e betyoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyoppo', 'adj.', NULL, 'Cl. 9', 'demente: demente, adj. tyoppo , el - e tyoppo; -s tyoppo (el. lO), los -s i tyoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'demoler: demoler, v. inf. o halla; preso yo demuelo mi casa n la halla e tyóbbo rÍl [n la halle tSóbboorÍl], tú demueles el puente o la halla e ré''óo [o la halle re''oo], etc.;pas. punto yo demolí tu casa n hari e tyóbbo o [n haré tSobboo], tú demoliste la igle sia o hari e tyotyi [o haré tSotSi], etc.; paso duro yo demolía las casas del pueblo n halessi i tyóbbo i e eriia wela [n halessí i tSóbbo yéria wella], tú demolías la cabaña o halessi o wettya [o hales só wettSa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmo', 's.', 'm.', 'Cl. 1', 'demonio: mmo , el- o mmo; -s bibbó (el. 2), los -s a bibbo; el - del pueblo o mmo á e eriia [o rnmo ériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'demostrar: demostrar, v. inf. o tappáa. preso yo demuestro n la tappáa, tú demuestras o la tappáa, etc.; pas punto yo demostré n tappíi, tú demostraste o tappíi, etc.; paso duro yo demostraba n tápessi, tú demos trabas o tápéssi, él demostraba a tápessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'denominar: denominar, v. irif. o usólla, o elella; esta calle se denomina Küdda bolo bokoo bO la elella o Kod da [bolo boko bó lelello kOdda].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sing', 's.', NULL, 'Cl. 6', 'dentadura: dentadura, s. sing. bello , la - a bello.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oarnmo', 'adv.', NULL, NULL, 'dentro: dentro, adv. oarnmo; - de buela; *wela (Cji: bubi). inf. o oballa; preso yo denuncio a alguien n la oballa hOtyo, tú denuncias a tu jefe o la oballa o rnmása o [o la oballo rnmásaao], ella denuncia a todos a la oballa a batyo ba mmaa [a la oballa batSo barnmaa], etc.; paso punto yo denun cié al gobernador n obari o boitta [n obaró bOit tal, tú denunciaste los hechos o obari e bilabba [o obaré bilabba], él denunció a su padre a oba ri o boie áí [a obaró boiáí], etc.; paso duro yo denunciaba a alguien n obalessi botyo [n obales sí bótSo], tú denunciabas al gobierno o obalessi e kobinna [o obalessé kobinna], él me denunciaba a le obalessi [a le óbalessi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bole''o', 's.', 'm.', 'Cl. 1', 'depositario: bole''o , el- o bole''o;-s bale''o (el. 2), los -s a bale''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rileppo', 's.', 'm.', 'Cl. 5', 'depósito: rileppo , - de cadáver es ileppé (CI. 5), el- e rileppo, el- de cadáveres e ileppé;-s baleppo (el. 6), -s de cadáveres baleppé (el. 6), los - s a baleppo, los -s de cadáveres a baleppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bakasso', 'adv.', NULL, NULL, 'deprisa: deprisa, adv. bakasso; esta persona habla - OIó botyo a la to''ólla bakasso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 45 (entradas 1101 a 1125)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('esootyi', 's.', 'm.', 'Cl. 7', 'derecho: esootyi , el- e esootyi [eesoo tSi]; -s bisootyi (el. 8), los -s e bisootyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'derivar: derivar, v. inf o púlláa, o pueIla; el cansancio deriva del trabajo o botyibíi bo lá puella e elakó [o botSibí bó láa puelleelakkó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'derramar: derramar, v. inf lo o tobba; preso yo derramo el aceite n la tobba a biitá [n la tobba biitá], tú derra mas el agua o la tobba a boppé [n la tobba boppé], ella derrama el keroseno a la tobba i karosíi [a la tobbi karosíi], etc.; paso punto yo derramé el acei te n tobbi a biitá [n ilibbia bíitá], tú derramaste el agua o tobbi a boppé [o tobbia bóppé], él derra mó el keroseno a tobbi i karosíi [a tobbí karosíi], etc.; paso duro yo derramaba el aceite n tobessi a biitá [n tobésá biitá], tú derramabas el aceite o tobessi a boppé [o tobésá boppé], él derramaba el keroseno a tobessi i karosíi [a tobésí karosíi]. 2. -se o tobeea; preso se derrama el aceite a biitá ba lá tobeea [a biitá bá lá tobeea]; paso punto se derra mó el agua a boppé ba tobeei [a boppé bá tóbeei]; paso duro se derramaba el keroseno i karosíi i tobieseei [i karosí í tóbieseei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'derretir: derretir, v. inj: o tyatyora; el calor derrite el alquitrán e húé e lá tyatyora i kolótta [e hué é láa tSatSori kolótta]. 2. -se o tyatyolla; el hierro se derrite con el calor o bOkussú bo lá tyatyolla la e húé [o bokussú bó láa tSatSolla le húúé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'derribar: derribar, v. in;/: l. o halla;pres. yo derribo la casa de mi jefe n la halla e tyóbbo o mmása m [n la halle tJobbó ó rnmásaarn], tú derribas la cabaña o la halla o wettya [o la hallo wettJa], etc.; paso punto yo derribé n hari, tú derribaste o hari, él derribó a hari, etc.; paso duro yo derribaba n halessi, tú derribabas o halessi, él derribaba a halessi, etc. 2. -se o haleea; se ha derribado la casa del pueblo e''a haleei e tyóbbo á e eriia [e''á háleei e tSobbó ériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'derrochar: derrochar, v. in;/: o kappa; preso mi hermano mayor derrocha todo su dinero o bonatú''órn a la kappa i bonní i áí kubaa [o bOnatú''órn a la kap pi bonní yáí kúbbaa];pas. punto el abuelo derro chó toda su riqueza o boyólla a kappi i ka''ó i áí [o boyólla a kappí ka''ó yáí kúbbaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'derrotar: derrotar, v. inf o tó'' a; pres. nosotros derrotamos a los militares to la tó''a a abitábítta. paso punto mis abuelos derrotaron a los bueyes a bayólla m ba tó''i i pókkó [a bayóllarn bá tó''i pókkó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('telle', 's.', 'm.', 'Cl. 9', 'derrotero: telle , el - e telle; -s telle (el. 10), los -s i telle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'derrumbar: derrumbar, v. in;/: 1. o tyuulá, o halla; preso yo derrumbo a mi .jefe n la tyuulá o mmása m [n la tSuló mmásaarn], tú derrumbas al ladrón o la tyuulá e húbbé [o la tSulé hubbe], etc.; paso punto yo derrumbé a mi amigo n tyuurí o wéso''orn [n tSuró weso''oOln], tú derrumbaste al ladrón o tyuurí e húbbé [o tSuré hubbe], etc.; paso duro yo derrumbaba a tu hermano n tyulessi o bObeIle ó [n tSulessó bobelleeó], yo derrumbaba el árbol n tyikólessi o botté [n tSikólessó botté], etc. 2. -se o tyikóleea; se ha derrumbado la ceiba bo''a tyi kóleei o bubbá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desabrigar: desabrigar, v. inf lo o bityolla;pres. el viento me desabriga e ehurú e lá le bityolIa [eehurú é láa le bítSolla]; paso punto el viento desabrigó al niño e ehuTÚ e bityori o bóllá [eehUTÚ é bítSoro bolIá]. 2. -se o bityoleea; preso me desabrigo con el calor n la bityoleea la e húé [n la bitSoleea le húúé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desabrochar: desabrochar, v. in;/: 1. o sokolIa, o hosolla; preso yo desabrocho n la sokoIla, tú desabrochas o la sokolla, ella desabrocha a la sokolla, etc.; paso punto yo desabroché n sokori, tú desabrochaste o sokori, él desabrochó a sokori, etc.; paso duro yo desabrochaba n sokolessi, tú desabrochabas o sokolessi, él desabrochaba a sokolessi, etc. 2. -se o sokoleea, o hosoleea; pres. me desabrocho n la sokoleea, n la hosoleea; imp. desabróchate sokoleea [sokolééá], hosoleea [hosolééá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desacertar: desacertar, v. inf o itta;pres. este hombre desa cierta siempre oló bOie a la itta tyommaa; paso punto el gobierno ha desacertado e kóbinna e ityi [e kóbinna e ítSi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eityi', 's.', 'm.', 'Cl. 7', 'desacierto: eityi , el - e eityi ; -s biityi , los -s e biityi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'desaconsejar: desaconsejar, v. ir¡{ o huelolla;pres. yo desacon sejo n la huelolla, tú desaconsejas o la huelolla, él desaconseja a la huelolla, etc.; paso punto yo desa consejé n huelori, tú desaconsejaste o huelori, él desaconsejó a huelori, etc.; paso duro yo desacon sejaba n huelolessi, tú desaconsejabas o huelo lessi, él desaconsejaba a huelolessi, etc. 408 / desafiar', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desafiar: desafiar, v. inf o tobálera; preso yo te desafio n la o tobálera [n lo tobálera], yo no te desafio n tyi''a la o tobálera [n tSá lo tobálera], no me desafies we le tobálere.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buelálabbé', 'adj.', NULL, 'Cl. 1', 'desafortunado: desafortunado, adj. buelálabbé , ), el o buelálabbé; -s belálabbé (el. 2), los -s a belá labbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desairar: desairar, v. in,f o sibáa;pres. yo te desairo n la o sibáa [n lo síbba], tú me desairas o la le sibáa [o la le síbba], no me desaires we le sibee.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopello', 's.', 'm.', NULL, 'desaire: lopello (el. 1 1), el - o lopello; -s pello (el. 10), los -s i pello.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'desaparecer: desaparecer, v. inj: o ribella; preso las cosas tra dicionales desaparecen e bilabba bi a rÍlmalé bi lá ribella [e bilabba biá rÍlmalé bí láa ribella], etc.; pas. punto las personas desaparecieron a batyo ba riberi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desarreglar: desarreglar, v. in,{ o kakára; paso punto he desa rreglado la cama n kakária e raatyé [n kakáríé raatSé], no desarregles la cama we kakáre e raa tyé [we kákáre raatSé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desasir: desasir, v. inf o solla, o akolla; preso yo desasgo el asa de la olla n la akolla e eakko é etém [n la akolleakko éetéém], tú desases el asa de la fiam brera o la akolla e eakko é enenée [o la akolleak ko énenée], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'desatar: desatar, v. inj: o akolla, o solla; preso yo desato n la akolla, tú desatas o la akolla, él desata a la akolla, etc.; paso punto yo desaté n akori [nakori], tú desataste o akori [wakori], él desató a akori, etc.; pas. duro yo desataba n akuessi [nakuessi], tú desatabas o akuessi [wakuessi], él desataba a akuessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desayunar: desayunar, v. in,f o hatta; preso yo desayuno n la hatta, tú desayunas o la harta, él desayuna a la hat ta, etc.; paso punto yo desayuné n hattyi, tú desayu naste o hattyi, él desayunó a hattyi, etc.; paso duro ayer desayunaba malanga mpári n hatessi bekok kó, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehatto', 's.', 'm.', 'Cl. 7', 'desayuno: ehatto , el- e ehatto [eehat to]; -s bihatto (el. 8), los -s e bihatto; damos por la mañana to la páa ehatto e ebari [to la pehatto eebari]; - incluido chatto léso''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kokoppé', 's.', 'm.', 'Cl. 9', 'desazonado: kokoppé , el - e kokop pé; -s kokoppé (el. 10), los -s i kokoppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 46 (entradas 1126 a 1150)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'desbastar: desbastar, v. inf o ba''a;pres. yo desbasto la pal mera n la ba''a o obílla [n la ba''obílla]; pas. punto yo desbasté la palmera n ba''i o obílla [m ba''ío obilla]; pas. duro yo desbastaba el bambú n ba''essi o botyerú [m ba''essó botSerú].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epapara', 's.', 'm.', 'Cl. 7', 'desbroce: epapara , ekóri , el - e epapara , e ekóri ; -s mpa para (el. 8), bikóri (el. 8), los -s e mpapara, e bikóri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desbrozar: desbrozar, v. inf o hobbá, o papara;pres. yo des brozo la parcela n la hobbá e eyári [n la hobbée yári], tú desbrozas tu finca o la hObbá o buáám ó [o la hObbó buamm ó]; paso punto yo desbrocé el camino n hObbí e telle [n hobbié telle], tú des brozasté el bosque o hobbí e ehobbá [o hob biéehObbá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'descalzar: descalzar, v. inf o hetyólla; preso yo descalzo al niño nne n la hetyólla o bóllá i sússu [nne n la hetSóllo bóllá i sússu].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'descansar: descansar, v. in! o ebbáa; preso yo descanso n la eb báa, tú descansas o la ebbáa, él descansa a la ebbáa, etc.; pas. punto yo descansé n ebbíi, tú descansaste o ebbíi, él descansó a ebbíi, etc.; paso duro yo descansaba n ebessi, tú descansa bas o ebessi, él descansaba a ebessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boebbó', 's.', 'm.', 'Cl. 3', 'descanso: boebbó , eheberi , lohebbó (el. 1 1), riebba (el. 5), el- o ooebbó, e eheberi [eeheberi], o lohebbó, e riebba; -s beebbó (el. 4), biheberi (el. 8), bahebbó (el. 6), baebba (el. 6), los -s e beebbó, e biheberi, a bahebbó, a baebba; el - eterno o lohebbó lo a tyommaa [o lohebbó luá tSómmaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'descargar: descargar, v. inf o íhóra, o haólla; preso yo des cargo el coche n la haólla o motóO [n la háóllo motóO], tú descargas a tu madre o la íhóra o obe ríi ó [o la ihóroberió], etc.; paso punto yo des cargué el barco n haóri o buátto [n ha6ró buat to], tú descargaste el armario o haóri e eleppo [o ha6réleppo], etc. paso duro yo des cargaba el barco n hauessi o buátto [n haues s6 buatto], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'descender: descender, v. inj: o sootyó; preso yo desciendo n la ba sootyó [n la ba sóotSó], tú desciendes o la desdeñar I 409 ba sootyo [o la ba sootSo], él desciende a la ba sootyo [a la ba sootSoJ, etc.; paso punto yo des cendí n ba sotyiia, tú descendiste o ba sotyiia, él descendió aba sotyiia, etc.; paso duro yo descen día n ba sotyesiia [m ba sotSesiia], tú descendías o ba sotyesiia, él descendía aba sotyesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bobora', 's.', 'm.', 'Cl. 1', 'descendiente: bobora , el - o bObo ra; -s babora, los -s a babora.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esotyo', 's.', 'm.', 'Cl. 7', 'descenso: esotyo , losootyo (el. 1 1); el- e esotyo; -s bisotyo (el. 8), besootyo (el. 4), los -s e bisotyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desclavar: desclavar, v. inf o nélolla;pres. yo desclavo n la né lolla, tú desclavas o la nélolla, él desclava a la nélolla, etc.; paso punto yo desclavé n nélori, tú desclavaste o nélori, él desclavó a nélori, etc.; paso duro yo desclavaba n nélolessi, tú desclava bas o nélolessi, él desclavaba a nélOlessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desconfiar: desconfiar, v. inf o betélolla; preso yo desconfio de ti n la o betélolla [n lo bételolla], tú desconfias de nosotros o la e bételolla [o le bételolla], etc.; paso punto yo desconfié de ti n o betélori [no betélori], tú desconfias o betélori, etc.; paso duro yo desconfiaba n betélOlessi [m betélolessi], tú desconfiabas o betélolessi, etc.; todo el mundo desconfia del gobierno a batyo ba mmaa ba lá betélolla e kobinna [a batSo bammaa ba lá betélole kobinna].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'desconocer: desconocer, v. inj: o ribálla, o anna; preso desco nozco a esta persona n ta bo aam (o anna) 010 botyo [n ta buáam ólo botSo];pas. duro descono cía a esta persona n tyí''a bo aam 010 botyo [n tSí''a buaalÍl ólo botSo], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'desconsolar: desconsolar, v. ini o té''ólla; preso el dolor me desconsuela e roppá ri lá le té''olla; pres. neg. no me desconsueles we le t(:''olle [we le te''ólle]. descontento, aqj. buallé (el. 3), el - o buallé; -s biallé (el. 8), los -s e biallé; estoy - ne buallé, n tyi hMmabi''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'descorchar: descorchar, v. in! o rulolla; preso yo descorcho una botella n la rulolla opoteri; preso neg. yo no descorcho una botella n tyí''a rulolla opoteri; paso punto yo descorché una petaca n rulOri tamma [n rulori tárnma], tú descorchaste una calabaza vinatera o rulori kobbí [o rulori kóbbi], etc. paso duro yo descorchaba una garrafa n rulolessi tyáa [n ruloléssí tSa], tú descorchabas una botella o rulolessi opoteri [o rulOléssí ópoteri] , etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'descuartizar: descuartizar, v. in! o kétya; preso yo descuarti zo los helechos n la kétya i kétya (sing. lokétya) [n la ketSí i kétSa], tú descuartizas la carne o la kétya o bolÍlmua [o la ketSó bOlÍlmua], etc.; paso punto con su machete descuartizó los asientos la e isaké ri áí a kétyía e bimpa [le isaké ráí a ke tSíé bimpa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'descubrir: descubrir, v. inf. 1. o elláa, o lepolla, o bilolla; preso yo descubro n la lepolla, tú descubres o la lepolla, él descubre a la lepolla, etc.; paso punto yo des cubrí n lepom, n lepOri, tú descubriste o lepom, o lepOri, él descubrió a lepom, a lepori, etc.; paso duro yo descubría n lepuessi, tú descubrías o lepues si, él descubría a lepuessi, etc. 2. -se o bilolla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desdecir: desdecir, v. in! o belólla; preso yo desdigo al jefe n la belólla o mmása [n la belóllo mmása], tú desdices a tu hermano o la belólla o bobélle o [o la belóllo bobéleeo], él desdice a la belólla, etc.; paso punto yo desdije n belóri [m belóri], tú des dijiste o belóri, él desdijo a belóri, etc.; paso duro yo desdecía n belólessi [m belólessi], tú desde cías o belólessi, él desdecía a belólessi, etc. 2. -se o belólea; preso me desdigo n la belólea, te desdices o la beIólea, se desdice a la belólea, etc.; paso punto me desdije n beIólei [m belólei], te desdijiste o belólei, se desdijo a belólei, etc.; paso duro me desdecía n belóleseei [m beló leseei], te desdecías o belóleseei, se desdecía a belóleseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ripukké', 's.', 'm.', 'Cl. 5', 'desdén: ripukké , rikupi , el - e ripukké; desdenes apukké (el. 6), bakupí (el. 6), los -s a apukké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eborábéllo', 'adj.', NULL, 'Cl. 7', 'desdentado: desdentado, adj. eborábéllo , el - e ebo rábéllo; -s iborábéllo (el. 8), los -s e iborábéllo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desdeñar: desdeñar, v. inf. o kuppia; preso yo desdeño n la kup pia, tú desdeñas o la kuppia, él desdeña a la kuppia, etc.; paso punto yo desdeñé n kupiia, tú desdeñaste o kupiia, él desdeñó a kupiia, etc.; paso duro yo desdeñaba n kupiessiia, tú desde ñabas o kupiesiia, él desdeñaba a kupiesiia, etc. 410 / desdicha', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'desdicha: desdicha, s. f boho''o , buelálabbé , la - o bohO''o, o buelálabbé; -s beho''o (el. 4), beelálabbé (el. 4), las -s e behO''o, e beelálabbé. desdichado, ad}. buelálabbé (el. 1), el- o buelá labbé; -s belálabbé (el. 2), los -s a belálabbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desdoblar: desdoblar, v. inf o hótolla, o pepólla; preso yo desdoblo n la pepólla, tú desdoblas o la pepólla, él desdobla a la pepólla, etc.; paso punto yo des doblé n pepóóm, tú desdoblaste o pepóóm, él desdobló a pepóóm, etc.; paso duro yo desdobla ba n pepuessi, tú desdoblabas o pepuessi, él des doblaba a pepuessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desear: desear, v. inf o hOlláa, o na''a, o elella;pres. yo deseo n la hOlláa [n la hólláa), n la na''a, tú deseas o la hOlláa [o la hólláa), o la na''a, él desea a la hOlláa [a la hólláa), a la na''a, etc.; pos. punto yo deseé n horí, 1 1 na''i, tú deseaste o hOrí, o na''i, él deseó a horí, a 1 1a''i, etc.; pos. duro yo deseaba n hOléssi, n na''essi, tú deseabas o hOléssi, o na'' essi, él deseaba a hOles si, a na'' essi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desecar: desecar, v. inf o héya, o héa, o sétaella; preso en verano se deseca el río grande e tyokkó ri láa héa e ríe rotee [e tJokkó rí láa héa e ríe rótee); paso punto la piscina se quedó sin agua e eribba e sétaeri boppé [eeribba e sétáerí booppé); paso duro la piscina se quedaba sin agua e eribba e sétaelessi boppé [eeribba e sétáeléssí booppé).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

