  ('ir', 'v.', NULL, NULL, 'desembalar: desembalar, v. ir¡l o akolla; preso yo desembalo la garrafa n la akolla e tyáa [n la akolle tJáa); paso punto yo desembalé los vasos n akori e bityakka [nakoré bitJakka];pas. duro yo desembalaba las cajas n akolessi e biokíssi [nakoléssé biokíssi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
