  ('f', 'S.', NULL, 'Cl. 5', 'desembocadura: desembocadura, S. f ribetto , la - e ribet to; -s abetto (el. 6), las -s a abetto. desempleado, .1''. m. b011tóbessé (el. 1), el- o bOn tóbessé; -s bantóbessé (C\. 2), los -s a bantóbessé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'V.', NULL, NULL, 'desencadenar: desencadenar, V. i''!l o topólla; preso el militar desencadena a los presos o obitábítta a la topól la a batyelemán [oobitábítta a la topólla batJele máán].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'desenterrar: desenterrar, V. inl o tyilólla; preso yo desen tierro n la tyilólla, yo no desentierro 11 tyí''a la tyilólla [n tJá la tJilólla], tú desentierras o la tyilólla, etc.; paso punto yo desenterré n tyiló ri, yo desenterré a mis abuellos n tyilóri a bayolJa m [n tJilórá bayolJaam], etc.; paso duro yo desenterraba n tyilólessi, tú desenterra bas o tyilólessi, él desenterraba a tyilólessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'desentumecer: desentumecer, V. ir¡l o tupelolla, o nabOlla;pres. yo desentumezco mis piernas n la tupelolla a aponná m [n la tupelolla aponnáám, etc.; paso punto yo desentumecí mis brazos 11 tupelori a abbO m [n tupelórá abboom], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eeléri', 'S.', 'm.', 'Cl. 7', 'deseo: eeléri , el - e celéri ; -s bieléri (el. 8), los -s e bieléri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'desertar: desertar, v. ir¡l o húbbia; paso punto los militares desertaron a abitábítta ba húbbiia; paso duro los militares desertaban durante la guerra a abitá bítta ba húbiesiia la e bittá [a abitábítta bá húbie siia le bittá]. desertor, aqj. n0110wé (el. 9), el - e nonowé; -es l 1onowé (el. lO), los -es i nonowé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'desfalcar: desfalcar, V. inl o ubáa; paso punto el banquero desfalcó todo el dinero de la caja de caudales o bueppo a ubíi i tyokko i e reppo [o bueppo a ubí tJokko ye reppo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eubáa', 'S.', 'm.', 'Cl. 7', 'desfalco: eubáa , el - e eubáa [eeu báa); -s biubáa (el. 8), los -s e biubáa; el- de los bienes del pueblo e eubáa í ka''ó i á e eriia [eeu bá í ka'' o yériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desgajar: desgajar, v. inf o salolla;pres. yo desgajo 11 la salol la, tú desgajas o la salolla, él desgaja a la salolla, etc.;pas. punto yo desgajé n salori, tú desgajaste o salorí, él desgajó a salori, etc.; paso duro yo desga jaba 11 salolessi, tú desgajabas o salolessi, él des gajaba a salOlessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'desgarrar: desgarrar, V. inf o saatta; preso yo desgarro n la saatta, tú desgarras o la saatta, él desgarra a la saatta, etc.; paso punto yo desgarré n saatyi, tú desgarraste o saatyi, él desgarró a saatyi, etc.; paso duro yo desgarraba 11 saatessi, tú desga rrabas o saatessi, él desgarraba a saatessi, etc.; -se o sábba; la lona se desgarró e etapóllo é sábbi [eetapóllo é sábbi]. desgarrón, .1''. m. etata (el. 7), etatari (C\. 7), el- e etata [eetatta], e etatari [eetatari]; desgarrones bitata (el. 8), bitatari (el. 8), los desgarrones e bi tata, e bitatari. desnudo I 411', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('s', 'adJ.', NULL, 'Cl. 1', 'desgraciado: desgraciado, adJ. s. buelálabbé , el - o buelálabbé; -s belálabbé (el. 2), los -s a belá labbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desgranar: desgranar, v. inf o kopolla;pres. yo desgrano mis piñas de cacao n la kopolla e bimmáloto lÍ1 [n la kopolle bimmálotoolÍ1]; paso duro los niños des granaban las piñas de cacao a bó11á ba kopuessi e bimmáloto [a bo11á bá kopuesse bimmálottoJ. inf o tyiolo11a; pos. punto mis cabe llos están desgreñados e bisílla lÍ1 bi tyiOlori [e bisillálÍ1 bí tJíOlori].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lobotyobotyo', 's.', 'm.', NULL, 'desierto: lobotyobotyo (el. 1 1), el - o lobo tyobotyo; -s botyobotyo (el. 10), los -s i botyo botyo. inf o usólla; paso punto he designado a tres personas n usóri batyo bé battá [n usorí bátJo bé battá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'desinflar: desinflar, v. in! o haólla, o hulolla; preso tu her mana desinfla el balón o weta o a la haólla e suppá [o weta a la háólle suppá], el hambre desinfla mi estómago e tyallá e lá hulo11a o buel lá m [e tJallá é lá hulollo buelláam]; paso punto yo desinflé el globo n haóri e ebolobolló [n haó réebOlobolló ].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'V.', NULL, NULL, 'desistir: desistir, V. il''!f. o oátyella; preso yo desisto n la oá tye11a [n 100tJella];pas. punto he desistido n oátye ri [noátJ eri].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'V.', NULL, NULL, 'desligar: desligar, V. il''!f o ako11a ; preso yo desligo n la akol la, tú desligas o la akolla, él desliga a la ako11a, etc.; paso punto yo desligué n akori, tú desligaste o akori, él desligó a akori, etc.; paso duro yo des ligaba n akOlessi, tú desligabas o akolessi, él desligaba a akolessi, etc. 2. -se o akólea.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('pohá', 's.', 'm.', 'Cl. 9', 'desmán: pohá , el- e pohá; desmanes pohá (el. 10), los desmanes i pohá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esélásélá', 's.', 'm.', 'Cl. 7', 'desmayo: esélásélá , lokukke (el. I 1), el- e esélásélá [eesélásélláa], o lokukke; -s bisé lásélá (el. 8), bekukke (el. 4), los -s e bisélase la, e bekukke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'desmedrar: desmedrar, V. inf. o sikkiáa; preso el hambre desmedra al perro e tya11á e lá sikkiáa e puá [e tJallá é láa sikkíé pua]. 2. -se o sikkáa; preso el abuelo se desmedra con el tiempo o bOyolla a la sikkáa la e ebéló [o boyolla a la sikká lebelló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desmenuzar: desmenuzar, v. inf o kétya, o kétyólla; preso yo desmenuzo el pescado salado n la kétya e solo píssi [n la ketJé solopíssi], n la kétyó11a e solopís si [n la ketJó11e solopíssi]; paso punto yo desme nucé el pescado n kétyía e tyué [n ketJíé tJue], n kétyóm e tyué [n ketJómé tJue], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'desmontar: desmontar, v. il''!f o kakára, o hobbá, o papara; preso yo desmonto el asiento n la kakára e empa [n la kakáreempa], yo desmonto mi finca n la hobbá o buáám ITI [n la hobbó buannÍl]; paso punto yo desmonté la cabaña n kakária o wettya [n kakáríó wettJa], yo desmonté el bosque n hobbí e ehobbá [n hobbiéehobbá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epapara', 's.', 'm.', 'Cl. 7', 'desmonte: epapara , ekóri , el e epapara [eepapara], e ekóri [eekóri]; -s mpapara (el. 8), bikóri (el. 8), los -s e mpapara, e bikóri. in! o hetyólla, o hetyóra; preso yo', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

