  ('buihó', 'adj.', NULL, 'Cl. 2', 'desobediente: desobediente, adj. buihó (els. 1 y 3), el- o buihó; -s bihó , los -s a bihó. in! o kakára, o kappa, o halla; paso punto los malhechores desolaron el poblado a basalábbe ba kakária e eriia [a basalábbe ba kaká ríériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekorokoro', 's.', 'm.', 'Cl. 7', 'desorden: ekorokoro , rmtya , el- e ekorokoro [eekorokoro], e fÍlítya; desórde nes bikofokoro (el. 8), baiJ.tya (el. 6), los desór denes e bikorokoro, a baiJ.tya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'desordenar: desordenar, v. inj: o kakara; pres. yo desordeno la ropa n la kakara i kuua [n la kakari kuua] , tú desordenas el baúl o la kakara o lobakka [o la kakaro lobakka], él desordena los libros a la kaka r a a abúkku [a la kakarabúkku], etc.; paso punto yo desordené la ropa n kakariia i kuua [n kakaríí kuua], tú desordenaste el baúl o kakariia o lobak ka [o kakaríó lobakka], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('labotólábot', 'adv.', NULL, NULL, 'despacio: despacio, adv. labotólábot6; yo camino - n la etta labotóláboto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'despedir: despedir, v. in! o hékia, o berera; preso yo despi do n la berera, n la hékia, tú despides o la bere fa, o la hékia, él despide a la berera a la hékia, etc.;pas. punto yo despedí n bereriia [m berefiia], tú despediste o bereriia, él despidió a bereriia, etc.; paso duro yo despedía n bereresiia [m ben� resiia], tú despedías o bereresiia, él despedía a bereresiia, etc. 2. -se o ó''ia, o beráereea; preso me despido n la ba ó''ia [n la bó''ia], n la berá ereea, te despides o la ba ó''ia [o la bó''ia], o la be ráereea, se despide a la ba ó''ia [a la bó''ia], a la beráereea, etc.; paso punto me despedí n ba ó''íia [m bó''íia], n beráeriia [m beráeriia], te despedis te o ba ó''íia [o bó''íia], o beráeriia, se despidió a ba ó''íia [a bó''íia], a beráeriia, etc.; paso duro me despedía n ba ó''íesiia [m bó''íesiia], n beráeresiia [m beráeresiia], te despedías o ba ó''íesiia [o bó''íesiia], o beráeresiia, se despedía a ba ó''íesiia [a bó''íesiia], a beráeresiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'despeinar: despeinar, v. inf o tyiololla; preso yo despeino los cabellos de mi abuelo n la tyiololla e esílla o bOyolla rn [n la tSiOlolesilá ó bóyollaarn], tú des peinas los cabellos de tu hijo o la tyiololla e bisílla bi o bollá o [o la tSiololle bisillá bíó bol laao], etc.; paso punto yo despeiné a mi abuelo n', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'despensa: despensa, s. f eleppo , la - e eleppo [eelep po]; -s bileppo (el. 8), las -s e bileppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buátyi', 's.', 'm.', NULL, 'despertador: buátyi (el . 3), el - o buátyi; -es biátyi (el. 8), los -es e biátyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'despertar: despertar, v. inf o ebba; preso yo despierto n la eb ba, tú despiertas o la ebba, él despierta a la ebba, etc.; paso punto yo desperté n ebbi, tú despertaste o ebbi, él despertó a ebbi, etc.; paso duro yo desper taba n ebessi, tú despertabas o ebessi, él des pertaba a ebessi, etc. 2. -se o ebea; preso me despierto n la ebea, te despiertas o la ebea, se des pierta a la ebea, etc.; paso punto me desperté n ebei, te despertaste o ebei, se despertó a ebei, etc.; paso duro me despertaba n ebeseei, te des pertabas o ebeseei, se despertaba a ebeseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'despilfarrar: despilfarrar, v. inl o kappa;pres. yo despilfarro el dinero n la kappa i tyokko [n la kappi tSokko], tú despilfarras tus bienes o la kappa i ka''ó ó [o la kappi ka''óó], etc.; paso punto despilfarré mi dinero en la juventud n kappi i tyokko rÍl e esoko wela [n kappí tJokkoIÍI eesoko wélla], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rikappi', 's.', 'm.', 'Cl. 5', 'despilfarro: rikappi , el - e rikappi; -s bakappi , los -s a bakappi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'desplegar: desplegar, v. irif. o hótolla, o area;pres. yo desplie go la manta n la hótolla o bokutta [n la hótollo bokutta], n la area o bOkutta [n lareo bokutta], etc.; imp. despliega la manta, por favor hótolla bó o bOkutta tyuíi [hotóllá bó o bOkutta tS uíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desplumar: desplumar, v. inf o sulla; preso yo desplumo el pájaro n la sulla e sinorí [n la sulle sinorí], tú desplumas el gallo o la sulla o boteó''e [o la sullo boteo''e], etc.; paso punto yo desplumé el pájaro n suri e sinorí [n sure sínorí], tú desplumaste el gallo o suri o boteó''e [o suro bóteo''e], etc.; -se o sulea; el pollo se despluma e ko''e e lá sulea [e ko''e é la sulea] .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'despojar: despojar, v. inf o boánna; preso yo te despojo de tus bienes n la o bOánna i ka''ó ó [n lo bóanni ka''ó ó]; paso punto yo le despojé de su dinero n bo bOán i tyokko i áí [m bo bOání tJokko yááí], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desposar: desposar, v. inf o baráa;pres. el alcalde desposa a los novios o botúkku a la baráa a bana''í [o botukkú la bará bana''í]; paso duro la alcaldesa desposaba a los prometidos o botúkuáari a bare siia a bana''í [o botukuáari a baresíá bana''í], etc. 2. -se o balárea.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mareri', 's.', 'm.', 'Cl. 9', 'desposorios: mareri , ribállá , los - e maréri, e ribállá; - (PI) mareri (el. 10), abállá (el. 6), los - i mareri, a abállá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'despreciar: despreciar, v. inf o kuppia, o pobbá; preso yo desprecio n la kuppia, tú desprecias o la kuppia, él desprecia a la kuppia, etc.; paso punto yo des precié n kupiia, tú despreciaste o kupiia, él despreció a kupiia, etc.; paso duro yo desprecia ba n kupiesiia, tú despreciabas o kupiesiia, él despreciaba a kupiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopéllo', 's.', 'm.', NULL, 'desprecio: lopéllo (el. 1 1), el- o lopéllo;-s pello (el. 10), los -s i pello.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'desprender: desprender, v. inf o salolla; preso yo desprendo la corteza del árbol n la salolla e e10lló [n la salolleeIOlló], yo no desprendo la corteza del árbol n tyí''a salolla e e10lló [n tJá la salolleelol ló], tú desprendes la hoja de palma o la salolla o losalla [o la salollo losalla], el niño desprende el brazo del ogro o bóllá a la salOlla o lobbó lo e enokonokko [o bollá a la salollo lobbó luénoko nokko], etc.; paso punto el militar desprendió la oreja de Riloha o obitábítta a salori o lotóo lo e Rilo''a [oobitábítta a salóró lotó lué rílo''a], tú des prendiste el dátil o salori e pillá [o salóré pilla], etc. 2. -se o salolea; preso las hojas de palma de desprenden con la tormenta a basalla ba lá salOlea la e pullá [a basalla ba lá salOlea le pullá]; paso punto las chapas de zinc se desprendieron con el viento i tyallá i salolei la e ehurúru [i tJal lá í sálOlei leehurúru]; pas. dur. las nipas se des prendían i tyerú i saloleseei [i tS ero í sálOleseei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'destacar: destacar, v. inl (a) o takkáa; preso yo destaco n la takkáa, tú destacas o la takkáa, él destaca a la tak káa, etc.; paso punto yo destaqué n takkíi, tú des tacaste o takkíi, él destacó a takkíi, etc.; paso duro yo destacaba n takéssi, tú destacabas o takessi, él destacaba a takessi, etc. (b) o akabia (ir elegante mente vestido); preso yo destaco n la akabia, tú destacas o la akabia, él destaca a la akabia, etc.; paso punto yo destaqué n akabiia [nakabiia], tú destacaste o akabiia [wakabiia], él destacó a aka biia, etc.; paso duro yo destacaba n akabiesiia [nakabiesiia], tú destacabas ° akabiesiia [waka biesiia], él destacaba a akabiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sing', 's.', NULL, NULL, 'destajo: destajo, s. sing. tyopu (el . 9), el- e tyópu; -s tyó pu (el. 10), los -s i tyópu.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'destapar: destapar, v. inf o bityolla; preso yo destapo la olla n la bityolla e etérÍ! [n la bitJolleetéérÍ!], tú destapas a tu hermano o la bityolla ° bobélle ó [o la bitJollo bóbélleeó], él destapa el agujero a la bityolla ° bolló [a la bitJollo bOlló], etc.; paso punto yo destapé la olla n bityori e etéIÍI [m bi tSóréetéérh], tú destapaste a tu hermano ° bityori o bobelle o [o bitJóró bobélleeó], él des 414/ destejer tapó el agujero a bityori o bolló [a bitSóró bolló], etc.; paso duro yo destapaba los panes n bityues si a basoppo [m bitSuessá basoppo], tú destapa bas el bidón o bityuessi e ribetté [o bitSuessé ribetté], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'destejer: destejer, V. inf o tokólla; preso yo destejo n la tokólla, tú destejes o la tokólla, etc., paso punto yo destejí n tokóri (n tok6m), tú destejiste o tokóri (o tok6m), etc. paso duro yo destejía n tokuessi, tú destejías o tokuessi, etc. 2. -s o bi lolla. destello, .1''. m. sityetyee (el. 12), el - e sityetyee; -s totyetyee (el. 13), los -s o totyetyee.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'desterrar: desterrar, V. inf o pupuálla; preso los ancianos des tierran a mi madre e biobéolla bi lá pupuálla o oberii IÍI [e biobé611a bi láa pupuállooberíilÍl]; paso punto el gobierno desterró a los presos e k6binna a pupuám a batyelemán [e k6binna a pupuámá batSeIemáán]; paso dur. la abuela desterraba a su hijo cada año o bonánna a pupuálessi o b611á áí 16a lo e lo ba [o bOnánna a pupuálessó bollaaí 16a lué lo ba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

