INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inl', 'V.', NULL, NULL, 'destetar: destetar, V. inl o ira;pres. la mujer desteta a su hijo o waísso a la ira o bóllá áí a abelle [o wais só a la iro bolláí abelle]; paso punt. la mujer des tetó a su hijo o waísso a iria o b611á áí a abelle [o waissó a irió bollai aabelle]; paso duro la mujer destetaba pronto a su hijo o waísso a iresiia o bóllá áí a abelle bakasso [o waissó a iresíó bollai a abelle bakasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eira', 's.', 'm.', 'Cl. 7', 'destete: eira , el- e eira ; -s bii ra (el. 8), los -s e biira.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyí''o', 'S.', 'm.', 'Cl. 7', 'destierro: etyí''o , esatta , el- e elyí''o [eetSí''o], e esatta [eesatta]; -s bityí''o (el. 8), bisatta (el. 8), los -s e bityí'' o, e bisatta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribotyo', 'S.', 'm.', 'Cl. 5', 'destino: ribotyo , el - e ribotyo; -s abOtyo (el. 6), los -s a abotyo; el - de mi vida e telle e ribOtyo IÍI [e telle é ribOtJoolÍI]''', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'destrenzar: destrenzar, V. in/. o otolIa; preso yo destrenzo n la otolla, tú destrenzas o la otolla. él destrenza a la otolla, etc.; paso punto yo destrencé n otori, tú destrenzaste o otori, él destrenzó a otori, etc.; paso duro yo destrenzaba n otolessi, tú destren zabas o otolessi, él destrenzaba a otolessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'destripar: destripar, v. inl o butólla; preso yo miro cómo mi padre destripa la cabra n la ekkáa alo o boie I Í I a la butólla lá o buellá bo e póríi [n lekkó boieffi alo a la butólla lo buéllá bué póri].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i', 'v.', NULL, NULL, 'destrozar: destrozar, v. i,!f. o kappa; preso yo destrozo n la kap pa, tú destrozas o la kappa, él destroza a la kappa, etc.; paso punto yo destrocé n kappi, tú destrozaste o kappi, él destrozó a kappi, etc.; paso duro yo destrozaba n kapessi, tú destroza bas o kapessi, él destrozaba a kapessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rikappi', 's.', 'm.', 'Cl. 5', 'destrozo: rikappi , el - e rikappi; -s bakappi (el. 6), los -s a bakappi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'destrucción: destrucción, S. f rikappi , la - e rikappi; destrucciones bakappi (el. 6), las destrucciones a bakappi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'destruir: destruir, V. inf. o halla, o kappa; preso yo destru yo n la halla, n la kappa, tú destruyes o la halla, o la kappa, él destruye a la halla, a la kappa, etc.; paso punto yo destruí n hari, n kappi, tú destruis te o hari, o kappi, él destruyó a hari, a kappi, etc.; paso duro yo destruía n halessi, n kapessi, tú destruías o halessi, o kapessi, él destruía a halessi, a kapessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'desunir: desunir, V. inf. o okanolla; preso el dolor desune a las personas e roppá ri lá okanolla a batyo [e roppá rí lókanolla batSo]; paso punto el hambre desunió a los hombres e tyallá e okanori a baie [e tSallá ókanora baiie]; paso duro los hijos desu nían al matrimonio a bóllá ba okanolessi e ribá lIá [a bollá bókanolesse ribállá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehetyoro', 'S.', 'm.', 'Cl. 7', 'desuudo: ehetyoro , el - e ehetyoro [eehetJoro]; -s bihetyoro (el. 8), los -s e bihetyoro. 412/ desobedecer', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sibólló', 's.', 'm.', 'Cl. 12', 'desvalido: sibólló , el- e sibólló; -s tobólló (el. 13), los -s o tobólló; los -s del pue blo o tobólló to e eriia wela [o tobOlló tuéria wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'desvelar: desvelar, V. inf. o lepolla; preso yo desvelo tus secretos n la lepolla e bihattá 6 [n la lepolle bihattá6], tú desvelas la verdad o la lepolla e ette [o la lepolle ette], etc.; paso punto yo desvelé el pacto n lepi)m e ehattá [n lepóméehattá], n lepo ri e ehattá [n lepóréehattá], tú desvelaste mi des tino o lepom e ribotyo IÍI [o Icpómé ribotSoolÍl], etc.; paso duro yo desvelaba los secretos del gobierno n lepuessi e bihattá bi e kóbinna [n lepuessé bihatta bié k6binna], tú desvelabas nuestro pacto o lepuessi e ehattá áó [o lepuessé hattááó], etc . .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehette', 'S.', 'm.', 'Cl. 7', 'desvelo: ehette , el- e ehette ; -s bihette , los -s e bihette.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'detener: detener, v. inf 1. o hMmótta; preso yo detengo n la hMmótta, tú detienes o la hMmótta, él detie ne a la hMmótta, etc.; paso punto yo detuve n hMmótyi, tú detuviste o hMmótyi, él detuvo a hMmótyi, etc.;pas. duro yo detenía n hMmótes si, tú detenías o hMmótessi, él detenía a hMmó tessi, etc. 2. -se o mma; preso el coche se detie ne o motóo bo lá mma [o motó bó la mma]; paso punto el avión se detuvo o bOkáa bo mmi [o bOká bó IÍlmi]; paso duro las personas se detenían ante el tanatorio a batyo ba IÍlmessi e ileppé alo [a batSo ba IÍlmessi e ileppe álo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyebólla', 's.', 'm.', 'Cl. 9', 'detergente: tyebólla , sóppo , el - e tyebólla, e sóppo; -s tyebólla (el. 10), sóppij (el. 10), los -s i tyebólla, i sóppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'deteriorar: deteriorar, v. inf o kappa, o kappia;pres. el frío deteriora las piñas de cacao e sille si lá kappa e bimmáloto [e sille sí la kappe bimmálotto]; paso punto los ladrones deterioraron la imagen del pueblo i húbbé i kappi e rubbí ri e eriia [i hubbé í káppi e rubbí rériia]. 2. -se o kapea; preso el motor del coche se deteriora e emasíín o motóo e lá kapea [eemasíín o mótó é lá kapeea].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'detestar: detestar, v. inf o kooa; preso yo detesto la tor menta n la kooa e pullá [n la koe pullá], n e kooi e pullá [ne kói e pullá], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'detonar: detonar, v. i''!f o póbbia, o póbba; paso punto el cazador detonó sus perdigones o obébá a pób bia e benná be áí [oobebá a póbbíé benná biáí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('onná', 'adv.', NULL, NULL, 'detrás: detrás, adv. onná; - de nnabí''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOaó', 's.', 'f.', 'Cl. 3', 'deuda: bOaó , la - o boaó; -s beaó (el. 4), las -s e beaó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'devanar: devanar, v. inf o péppa; pres. la doncella devana la madeja o bulla bo lá péppa e eillóo [o bulla bo lá peppéillóo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'devorar: devorar, v. inf. o nokóbiera; pres. yo devoro n la nokóbiera, tú devoras o la nokóbiera, él devora a la nokóbiera, etc.; paso punto yo devoré n nokó bieriia, tú devoraste o nokóbieriia, él devoró a nokóbieriia, etc.; paso duro yo devoraba n nokó bieresiia, tú devorabas o nokóbieresiia, él devo raba a nokóbieresiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bokó', 's.', 'm.', 'Cl. 3', 'día: bokó , elló ; - siguiente obari; de - okó, el - o bOkó, e elló [eelló]; -s beokó(el. 4), billó (el. 8), los -s e beokó, e billó; le vi de - n bo eeÍl e okó [n wené okkó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

