  ('bopippí', 's.', 'f.', 'Cl. 3', 'dictadura: bopippí , raakio , la - o bOpippí, e raakio; -s bepippí , baakio (el. 6), las -s e bepippí, a baakio. diecinueve, numo ó la biele; - dedos bene (el. 4) bié ó la biele, personas batyo (el. 2) be ó la bale, - camas baatyé (el. 6) be ó la bale, - pue blos biriia (el. 8) bié ó la bile, - sardinas koIlo (el. 10) yé ó la nne, - pájaros tonorí (el. 13) tué ó la tuele. 416/ dieciocho dieciocho, numo ó la betá; - dedos bene (el. 4) bié ó la betá, - personas batyo (el. 2) be ó la batá, - camas baatyé (el. 6) be ó la batá, - pue blos biriia (el. 8) bié ó la bitá, - sardinas kollo (el. 10) yé ó la ntyá, - pájaros tonorí (el. 13) tué ó la totá. dieciséis, numo ó la bulé; - dedos bene (el. 4) bié ó la bulé, - personas batyo (el. 2) be ó la bulé, camas baatyé (el. 6) be ó la riJé, - pueblos biriia (el. 8) bié ó la nné, - sardinas kollo (el. 10) yé ó pájaros tonorí (el. 13) tué ó la silé. la lulé, diecisiete, numo ó la eppa; - dedos bene (el. 4) bié ó la eppa, - personas batyo (el. 2) be ó la appa, - camas baatyé (el. 6) be ó la appa, - pue blos biriia bié ó la mma, - sardinas kollo (el. 10) yé ó la mpa, - pájaros tonorí tué ó la tobba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rello', 's.', 'm.', 'Cl. 5', 'diente: rello , el- e rello; -s bello (el. 6), los -s a bello; -s de oro bello ba 0010110. diez, numo bó (els. 2 y 6): - personas batyo be bó, - mejillas bakekko be bó; bió (els. 4 y 8): - his torias beatta bié bió, - pueblos biriia bié bió; nó (el. 10): - sardinas kollo yé nó; tó (el. 13): pueblecitos toriia tué tó [toria tué to].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('to''ú', 'adj.', NULL, 'Cl. 13', 'dificil: dificil, adj. to''ú obó; la respuesta es - e ehMmero é to''ú [eehMmero é to''ú], e eehMmero é obó, una persona - botyo a bonokoa [botSo a bónokoa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'dificultar: dificultar, v. in[. o sipára; preso la pobreza difi culta nuestro trayecto e sibólló si lá sipára o loetto lo áó [e sibolló sí láa sipáro loetto luáó]; paso punto el tiempo dificultó nuestro trabajo e ebéló e sipária e elako áó [eebeló é síparieelako áó]; paso duro el hambre dificultaba la crianza del niño e tyallá e sipáresiia e ribóppi ri o bollá [e tSallá é sípáresiie riboppí ró bollá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'difundir: difundir, v. inl o ettya; preso yo difundo la noti cia n la ettya o OOatta [n la ettSo OOatta]; paso punto tú difundiste el asunto o etyia e elabba [o etSíélabba];pas. duro él/ella difundía el asunto e e etyesia e elabba [e e etSesia eelabba], bue a etyesia e elabb a [bue a etSesiélabba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('mmo', 's.', 'm.', 'Cl. 1', 'difunto: mmo , el - o mmo; -s bibbo (el. 2), ibbo (el. 2), los :-,S a bibbO, a ibbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekasso', 'adj.', NULL, 'Cl. 7', 'diligente: diligente, adj. ekasso , el - e ekasso [eekasso]; -s bikasso (el. 8), los -s e bikasso; sé - sil ekasso [sekasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekolakolla', 's.', 'm.', 'Cl. 7', 'diluvio: ekolakolla , el- e ekolakolla [eekOlakolla]; -s bikolakolla (el. 8), los -s e bikolakolla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonní', 's.', 'm.', 'Cl. 9', 'dinero: bonní , tyokko , el - e bonní, e tyokko; -s bonní (el. lO), tyokko (el. 10), los -s i bonní, i tyokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eruppé', 's.', 'm.', 'Cl. 7', 'dios: eruppé , ruppé , -a Madre Bisílla; - de la música y la salud Laha; - del trueno Riobátta; - del amor Ebi''o, el- e eruppé [eeruppé]; -es biruppé (el. 8), los -es e biruppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('takkí', 's.', 'm.', 'Cl. 9', 'director: takkí , el - e takkí; -es tak kí (el. 10), los -es i takkí; el- del banco e takkí é reppo, e takkí ó lobakka lo i bonní [e takkí ó lóbakka luí bonní].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
