  ('inf', 'v.', NULL, NULL, 'dirigir: dirigir, v. inf o lekkia; preso yo dirijo n la lekkia, tú diriges o la lekkia, él dirige a la lekkia, etc.; paso punto yo dirigí n lekiia, tú dirigiste o lekiia, él dirigió a lekiia, etc.;pas. duro yo dirigía n lekie siia, tú dirigías o lekiesiia, él dirigía a lekiesiia, etc. 2. -se o tóttáa, o bekalla; preso me dirijo n la tóttáa, n la bekalla, te diriges o la tóttáa, o la bekal la, se dirige a la tóttáa, a la bekalla, etc.; paso punto me dirigi n tótyíi, n bekari [m bekari], te dirigis te o tótyíi, o bekari, se dirigió a tótyíi, a bekari, etc.; paso duro me dirigía n tótessi, n bekalessi [m bekalessi], te dirigías o tótessi, o bekaIessi, se dirigía a tótessi, a bekaIessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
