  ('in', 'v.', NULL, NULL, 'disculpar: disculpar, v. in! o tyiálella; preso yo disculpo n la tyiálella, tú disculpas o la tyiálella, él disculpa a la tyiálella, etc.; paso punto yo disculpé n tyiáleri, tú disculpaste o tyiáleri, él disculpó a tyiáleri, etc.; paso duro yo disculpaba n tyiálelessi, tú disculpa bas o tyiálelessi, él disculpaba a tyiálelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
