  ('inf', 'V.', NULL, NULL, 'discutir: discutir, V. inf. o obálla; preso yo discuto n la obál la [n lobálla], tú discutes o la obálla [o lobálla], él discute a la obálla [a lobálla], etc.; paso punto yo discutí n obári [nobári], tú discutiste o obári [bObári], él discutió a obári [obári], etc.; paso duro yo discutia n obálessi [nobálessi], tú discutias o obálessi [bObálessi], él discutía a obálessi [obá lessi], nosotros discutíamos túe to obálessi [tue tobálessi], vosotros discutiais túe lo obálessi; [tue lobásessi], ellos discutian be ba obálessi [le bóbalessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'diseñar: diseñar, v. in! (a) o tetya; preso yo diseño n la te tya, tú diseñas o la tetya, etc.; paso punto yo dise ñé n tetyi, tú diseñaste o tetyi, eUa diseñó a tetyi, etc.; paso duro yo diseñaba n tetyessi, tú diseña bas o tetyessi, etc. (b) o dibubaIla; preso yo diseño n la dibuballa, tú diseñas o la dibubaIla, ella dise ña a la dibuhalla, etc.; paso duro yo diseñaba n dibubalessi, tú diseñabas o dibubalessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'S.', NULL, NULL, 'disgustar: disgustar, S. in/ tyipóbia; o heráa buallé, o heráa nobbe; preso yo te disgusto n la o tyipóbia [n lo tJípobbia], n la o heráa buallé [n lo bera buallé], n la o heráa nobbe [n lo bera nobbe]; paso punto tu conducta me disgustó e eseríi o e le hería buallé [eeserío é le heria buallé]. 2. -se o sá bual lé; preso mi madre se disgusta cada día o oberíi rÍl a sá buaIlé ello eba [ooberírÍl la sa buálle ello ebba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buallé', 'S.', 'm.', 'Cl. 3', 'disgusto: buallé , wallée , nobbe (el. 9), el - o buallé, o wallée; -s biallé (el. 8), biallée (el. 8), los -s e biallé, e biallée, i nobbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'disminuir: disminuir, V. in! (a) o sikkiáa, o sikkáa; preso el tiempo disminuye e ebéló é la sikkáa [eebeló é la sikkáa]. (b) o sétya; pres. el invierno disminu ye las cosas e esubba e lá sétya a lokko [eesubba e láa sétJa lokko].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opelle', 'S.', 'm.', 'Cl. 3', 'disoluto: opelle , el- o opelle ; -s epelIe , los -s e epelle .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'disolver: disolver, v. in! o bu''ura; preso yo disuelvo n la bu''u f a , tú disuelves ola bu''ura, él disuelve a la bu''ura, etc.; paso punto yo disolví TI bu''uria [m bu ''uria], tú disolviste o bu''uria, él disolvió a bu''uria, etc.;pas. duro yo disolvia n bu''uresiia [m bu''uresiia], tú disolvías o bu'' uresi ia, él disolvía a bu'' uresiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'disparar: disparar, v. in/ o kobba, o mpá; preso yo disparo una escopeta n la mpá etataa [n la mpetata]; paso punto yo disparé n mpí [mmpí], tú disparaste o mpí, él disparó a mpí, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekokoo', 'S.', 'm.', 'Cl. 7', 'disparo: ekokoo , el - e ekokoo [eekokoo]; -s bikokoo (el. 8), los -s e bikokoo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'dispensar: dispensar, V. in! o páa; preso tu abuelo me dis pensa con elogios o boyolla o a la le páa bisa''o [o boyollao a la le pá bísa''o].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'dispersar: dispersar, V. in! o naríbba, o naríbbia; preso la tormenta dispersa a las personas e pullá e lá naríbbia a batyo [e pullá é láa naríbbia batJo];pas. punto la lluvia dispersó a la gente o lóllá lo narí bia a batyo [o lollá ló náríbíá batJo]'' 2. -se o naríbba; paso punto todos los animales se disper saron con el disparo i nabba kubbaa i naríbbi la e ekokoo [i nabba kubbaa i náríbbi leekokoo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'disputa: disputa, S. f bOláa , 10báárÍl (el. 1 1), la - o boláa, o 10báárÍl; -s beláa (el. 4), kobáárh (el. 10), kobárí (el. 10), las -s e beláa, i kobáárÍl, i kobárí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'disputar: disputar, V. in! (a) o obálla; preso ellos disputan mucho be ba lá obálla likélíke; paso punto ellos disputaron en el trabajo be ba obári o é elako [be bóbári o élakko]. (b) o bulla; preso ellos dis putan los bienes be ba lá bulla i ka''ó [be bá lá bulli ka''ó]''', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
