  ('inf', 'v.', NULL, NULL, 'domesticar: domesticar, v. inf o i''a, o otyáa; preso yo domes tico al caballo n la otyáa e eossi [n 10tSéossi], n la i''a e eossi [n l''ieossi], tú domesticas al cerdo n la otyáa e esóló [n 10tSéesoló], etc.; paso punto yo domestiqué al caballo n otyía e eossi [notSíéos si], n i''i e eossi [ni''iéossi], tú domesticaste al cangrejo o (lo) otyía o lokkáa [botSió lokkáa, o lotSia o lokkáa], o (lo) í''ia o lokkáa [wi''ió lokkáa o lo í''ia o lokkáa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
