  ('i''', 'v.', NULL, NULL, 'donar: donar, v. i''!f o páa; preso yo dono todos mis bie nes n la páa i ka''ó m kubbaa [n la pí ka''om kúb báa]; paso punto tú donaste todas tus cosas o péi a lokko o lámmaa [o peyá lokkoo lámmaa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
