  ('eoko', 'S.', 'm.', 'Cl. 7', 'eco: eoko , ebOebOe , el - e eoko [eeokko], e ebOehoe [eebOebOe]; -s bioko (el. 8), bibOehoe (el. 8), los -s e bioko, e bibOebOe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boulla', 'S.', 'f.', 'Cl. 3', 'ecolecta: boulla , bokulakulla , boukka (el. 3), la - o boulla, o bokulakulla, o bouk ka; -s beulla (el. 4), bekulakulla (el. 4), beukka (el. 4), las -s e beulla, e bekulakulla, e beukka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
