  ('inf', 'v.', NULL, NULL, 'elegir: elegir, v. inf. o suppáa; preso yo elijo el mejor asiento n la suppáa e empa éé [n la suppémpa eé]; paso punto tú elegiste mi coche o suppíi o motóo lÍ1 [o suppió motoolÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribisso', 'S.', 'm.', 'Cl. 5', 'elevador: ribisso , loatya (el. 1 1), el e ribisso, o loatya; -es abisso (el. 6), los -es a abisso; el - está estropeado e ribisso ri kapei [e ribisso rí kápeei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'elevar: elevar, v. inl o atya; preso yo elevo n la atya, tú elevas o la atya, él eleva a la atya, etc.; paso punto yo elevé n atyi, tú elevaste o atyi, él elevó a atyi, etc.; paso duro yo elevaba n atyessi, tú elevabas o atyessi, él elevaba a atyessi, etc. ella, prono suj. a, e; mi hermana - lloraba o wet talÍl a bé''éssi. ellas, prono sujo ba; bé; - están caminando bé ba lá etta [bé bá la etta]. ellos, prono suj. ba; - no están ba tyi ho.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'V.', NULL, NULL, 'elogiar: elogiar, V. il''!f o sákka, o sákkia; preso yo elogio a mi hijo n la sákkia o bollá lÍl [n la sakkió bol laalÍl], tú elogias a tus trabajadores o la sákkia a balakoláko o [o la sakkiá balakolákoo], él elo gia a su hermana a la sákkia o wetta áí [a la sak kió wettaaí], etc.; paso punto yo elogié a mi madre n sákíia o obéríi lÍ1 [n sakíóberííill], tú elogiaste o sákíia, él elogió los trabajos de las personas de antaño a sákíia e bilakko bi a batyo bá aotya [a sakíé bilakko biá bátSo bááotSa], etc.; paso duro yo elogiaba n sákiésiia, tú elogiabas o sákiésiia, él elogiaba a sákiésiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribekko', 's.', 'm.', 'Cl. 5', 'elogio: ribekko , OOsákko , OOsa''o (el. 3), ritolállo (el. 5); el - e ribekko, o OOsákko, o OOsa''o, e ritolállo; -s abekko (el. 6), biisákko (el. 4), besa''o (el. 4), baililállo (el. 6), los -s a abekko, e besákko, e besa'' o, a batOlállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 'S.', NULL, 'Cl. 5', 'embajada: embajada, S. I ritákko , bObatáko , la - e ritákko, o bobatáko; -s batákko (el. 6), bebatáko (el. 4), las -s a batákko, e bebatáko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botákko', 'S.', 'm.', 'Cl. 3', 'embajador: botákko OObatakí , el - o botákko, o bobatakí; -es betákko (el. 4), babatakí (el. 2), los -es e betákko, a babatakí. embalar, 11. inf. o kapélla; preso yo embalo n la kapél la, tú embalas o la kapélla, él embala a la kapélla, etc.; paso punto yo embalé n kapém, tú embalaste o kapém, él embaló a kapém, etc.; paso duro yo embalaba n kapélessi, tú embalabas o kapélessi, él embalaba a kapélessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rebbá', 'S.', 'm.', 'Cl. 5', 'embarazo: rebbá , etobo , el e rebbá. e etobO [eetobbo]; -s bebbá (el. 6), bitobo (el. 8), los -s a bebbá, e bitobo. * - de pocas semanas sebbé (el. 12), el - de pocas semanas e sebbé, -s de pocas semanas tuebbé (el. 13), los -s de pocas semanas o tuebbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'emborrachar: emborrachar, V. inf o ribbiáa; preso el vino emborracha o buém bo lá ribbiáa; paso punto el vino de palma le emborrachó a ba''u ba bó ribbía, etc. 2. -se o ríbbáa, o boballa, o nkóbba; pres. me emborracho n la boballa, n la nkóbba, te embo rrachas o la boballa, o la nkóbba, se emborracba a la bobalIa, a la nkóbba, etc.; paso punto me embo rraché n bobari, n nkóbbi, te emborrachaste o nkóbbi, se emborrachó a nkóbbi, etc.; paso duro me emborrachaba n nkóbessi, te emborracha bas o nkóbessi, se emborrachaba a nkóbessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'emboscada: emboscada, S. f ribekkú , la - e ribekkú; -s abekkú , las -s a abekkú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehutéri', 'S.', 'm.', 'Cl. 7', 'embozo: ehutéri , el - e ehutéri [eehutéri]; -s bihutéri (el. 8), los -s e bihutéri , los -8 de las mantas e bihutéri bi e bekutta [e bihutéri bie békutta]. encargar / 423', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'embriagar: embriagar, v. inf o ribbiáa; preso el vino embriaga o buem bO lá ribbiáa; paso punto el coñac le embriagó i konyákko i bó ribbía, etc. 2. -se o boballa, o nkóbba; preso me emborracho n la boballa, n la nkóbba, te emborrachas o la boballa, o la nkóbba, se emborracha a la bobal la, a la nkóbba, etc.; paso punto me emborraché n bobari, n nkóbbi, te emborrachaste o nkóbbi, se emborrachó a nkóbbi, etc.; paso duro me emborrachaba n nkóbessi, te emborrachabas o nkóbessi, se emborrachaba a nkóbessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtyípótyípóo', 's.', 'm.', 'Cl. 3', 'embrollo: bOtyípótyípóo , el - o bO tyípótyípóo; -s betyípótyípóo (el. 4), los -s e betyípÓtyípóo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'embrujar: embrujar, v. inf o isera; preso mi jefe me embruja o mmássa ro a la le isera [o mmássam a la le ísera]; paso punto el visitante me embrujó o boheppóo a le iseriia isenna [o boheppó le iseriia isenna].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

