  ('bosori', 's.', 'm.', 'Cl. 1', 'emigrante: bosori , bOríbáa , el - o bOsori; -s basori , baríbáa , los -s a basori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 1', 'eminencia: eminencia, s. f mmeá , la - o mmeá; -s ammeá (el. 2), las -s a ammeá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
