  ('inf', 'v.', NULL, NULL, 'empaquetar: empaquetar, v. inf o kapella, o akalla; preso yo empaqueto n la kapella, tú empaquetas o la kapella, él empaqueta a la kapella, etc.; paso punto yo empaqueté n kapem, tú empaquetaste o kapem, él empaquetó a kapem, etc.; paso duro yo empaquetaba n kapelessi, tú empaquetabas o kapelessi, él empaquetaba a kapelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'emparejar: emparejar, v. inf o kossá;pres. el hombre empa reja a los pájaros o boie a la kossá o tonorí [o boie a la kossó tonorí]; paso punto los tios empa rejaron a sus sobrinos a baióppé ba kossí i nep pó i ábó [a baióppé bá kóssí i neppó yábbó]; paso duro nosotros emparejábamos a los perros to kosessi i puá [to kosessí i puáa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'empeorar: empeorar, v. inl o kopea a há labé [o kopea ha lábbe]; preso el enfermo empeora o boloari a la kopea a ha labé [o boloari a la kopea ha lábbe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sing', 's.', NULL, 'Cl. 1', 'emperador: emperador, s. sing. botákityé , tákityé (el. 9), el- o botákityé, e tákityé; -es batákityé (el. 2), tákityé (el. 10), los -es a batákityé, i tákityé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'empezar: empezar, v. inf o papella, o bityolla; preso yo empiezo n la papella, n la bityolla, tú empiezas o la papella, o la bityolla, él empieza a la papel la, a la bityolla, etc.; paso punto yo empecé n paperi [m paperi], n bityori [m bitSori], tú empe zaste o paperi, o bityori, él empezó a paperi, a bityori, etc.; paso duro yo empezaba n papelessi [m papelessi], n bityuessi [m bitSuessi], tú empe zabas o papelessi, o bityuessi, él empezaba a papelessi, a bityuessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'empresa: empresa, s. f bísinessi , sosieráa , la - e bísinessi, e sosieráa; -s bísinessi (el. 10), tosieráa (el. 13), las -s i bísinessi, o tosieráa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'empujar: empujar, v. inl o tyitobia; preso las personas empujan el coche a batyo ba lá tyitobia o motóO [a batJo ba lá tSitobio motóo]; paso punto empu jaste el coche o bo tyitobiia o motóo [o bo tSíto biia o motóo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'emular: emular, v. inl o hobiera, o kobaera; preso el niño emula al músico o bóllá a la hobiera e neppí [o bollá a la hobiere neppí]; paso punto tú emulaste al sacerdote o hobieriia o bohiárúppe [o hobíee ríó bohiárúppe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('wela', 'adv.', NULL, NULL, 'en: en, adv. wela; - el oratorio e róhiáa wela [e rohiá wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bopaosélla', 's.', 'm.', 'Cl. 1', 'enamorado: bopaosélla , paoséla (el. 9), el - o bopaosélla, e paoséla; -s bOpaosélla (el. 2), paoséla (el. 10), los -s a bapaosélla, i paoséla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'encabezar: encabezar, v. inf o okátella; preso el sanador encabeza el ejército o bohiammó a la okátella o lohúa [o bohiammó a lokátello lohúúa]; paso punto yo encabecé n okáteri [nokáteri], tú encabezaste o (bo) okáteri [bokáteri], él encabezó a okáteri [okáteri], nosotros encabezamos to okáteri [toká teri], vosotros encabezasteis lo okáteri [Iokáteri], ellos encabezaron ba okáteri [bokáteri].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boloppo', 's.', 'm.', 'Cl. 3', 'encendedor: boloppo , siossó (el. 12), el- o boloppo, e siossó; -es beloppo (el. 4), tOossó (el. 13), los -es e beloppo, o toossÓ.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'encender: encender, v. inl o bó''ia, o loppá; preso yo encien do n la bó''ia, n la loppá, tú enciendes o la bó''ia, o la loppá, él enciende a la bó''ia, a la loppá, etc.; pos. punto yo encendí n bó''ía [m bó''ía], n loppí, tú encendiste o bó''ía, o loppí, él encendió a bó''ía, a loppí, etc.; pos. duro yo encendía n bó''íesiia [m bó''íesiia], n lopessi, tú encendías o bó''íesiia, o lopessi, él encendía a bó''íesiia, a lopessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'encerrar: encerrar, v. inf. o p15lal1a;pres. yo encierro al perro n la pelalla e puá [n la pelaIl15 puáa], yo no encierro al perro n tyá la pelaIla e puá [n tSá p15lall15 puáa]; pos. punto yo encerré al gato n si pelam e sipóssi [n si pelaam e sipóssi], yo encerré al perro n e pelam e puá [ne pélaam e puáa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribekkú', 's.', NULL, 'Cl. 5', 'encerrona: encerrona, s.f. ribekkú , la - e rib15kkú;-s abekkú (el. 6), las -s a abekkú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebuté', 's.', 'f.', 'Cl. 7', 'encía: ebuté , la - e ebuté ; -s ibuté (el. 8), las -s e ibuté.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oOO''ó', 'adv.', NULL, NULL, 'encima: encima, adv. oOO''ó; *puá; - de la silla e empa puá [1515mpapuá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'encontrar: encontrar, V. inf. o elláa; preso yo encuentro n la elláa [n lelláa], tú encuentras o la elláa [o lelláa], él encuentra a la elláa [a lelláa], etc.; pos. punto yo encontré n eelÍl [neelÍl], tú encontraste o eelÍl [weelÍl], él encontró a eelÍJ., etc.; pos. duro yo encontraba n elessi [nelessi], tú encontrabas o elessi [welessi], él encontraba a elessi [elessi], etc. 2. -se o hítaella, o hítta; preso nos encontra mos en la plaza to la hítaella o e riossa pua [to la hítaello e riossa puá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('witáeri', 'S.', 'm.', 'Cl. 3', 'encuentro: witáeri , etyiáeri , eopéri (el. 7), eitánna (el. 7), el - o witáeri, e etyiáeri [1515tSiáeri], e eoperi [1515operi], e eitánna [15eitánna]; -s beitáeri (el. 8), bityiáeri (el. 8), bioperi (el. 8), biitánna (el. 8), los -s e beitáeri, e bityiáeri, e bioperi, e biitánna.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

