  ('inl', 'v.', NULL, NULL, 'enderezar: enderezar, v. inl o hótolla, o sotya; preso yo enderezo los asuntos n la sotya e bilabba [n la sotS15 bilabba], yo no enderezo los asuntos n tyí''a la sotya e bilabba [n tSá la sotS15 bilabba], tú enderezas la historia o la sotya o boatta [o la sotSo OOatta], etc.; pos. punto yo enderecé los asuntos n sotyiia e bilabba [n sotSíé bilabba], yo no los enderecé n ta bi sotyiia [n ta bí sotSííá], etc.; pos. duro yo enderezaba la historia de mi pueblo n sotyesiia o boatta 00 e eriia lÍl [n sotSe síó OOatta buériaam], tú enderezabas todos los asuntos o sotyesiia e bilabba bi mmaa [o sotSesíé bilabba bimmaa], etc. 2. -se o sotta; preso los asuntos se enderezan e bilabba bi la sotía, las cosas no se han enderezado a labba la tá sotyi [a labba lá tá sotSí]. Tb. o r{góÚl.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elopa', 'S.', 'm.', 'Cl. 7', 'endiablado: elopa , el - e elopa [1515loppa]; -s bilopa (el. 8), los -s e bilopa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
