  ('botyo', 'S.', 'm.', 'Cl. 1', 'enemigo: botyo ésappá el- o botyo ésappá; -s batyo bésappá (el. 2), los -s a batyo bé sappá. enemistad, s . . f. bosurí (el. 3), la - o OOsuó; -es besuó (el. 4), las -es e b15suó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonokko', 's.', 'f.', 'Cl. 3', 'energía: bonokko , boo , la - o bonokko. o boo; -s b15nokko (el. 4), beoo (el. 4), las -s e benokko, e beoo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('asáityi', 's.', 'm.', NULL, 'enero: asáityi , el mes de - o buéá bo a sáityi [o bu15á buá sáitSi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonobbe', 'S.', 'm.', 'Cl. 3', 'enfado: bonobbe , buallé , nobbe (el. 9), el - o bonobbe, o buallé, e nobbe; -s b15nobbe (el. 4), biallé (el. 8), nobbe (el. lO), los -s e b15nobbe, e biallé, i nobbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'enfardar: enfardar, V. inf. o akalla, o akka, o kapella; preso yo enfardo los leños n la akalla i kóólÍl [n la a kalli kóólÍl]; pos. punto yo enfardé mis enseres n akari a lokko lÍl [nakará 10kkoolÍl], etc. 2. para alguien o akella; preso yo le enfardo la ropa n la 00 akella i kuua [n la 00 ákelli kuua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kaaí', 's.', 'f.', 'Cl. 9', 'enfermedad: kaaí , roppá , la e kaaí, e roppá; -es kaaí (el. lO), OOppá (el. 6), las -es i kaaí, a OOppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riseríi', 's.', 'f.', 'Cl. 5', 'enfermería: riseríi , la - e riseói; -s baseói (el. 6), las -s a baseríi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonnya', 'S.', 'm.', 'Cl. 1', 'enfermero: bonnya , el- o OOnnya; -s bannya (eL 2), los -s a bannya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('OOloari', 'S.', 'm.', 'Cl. 1', 'enfermo: OOloari , el- o boloari; -s baloari (el. 2), los -s a baIoari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosuállo', 'adv.', NULL, 'Cl. 3', 'enfrente: enfrente, adv. bosuállo , oOOsso, - de la casa o OOsuállo bo e tyóbbo [o bosuállo bu15 tSóbbo]. enriquecer I 425', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'enganchar: enganchar, v. inf. o nánáa, o e''áella; preso yo engancho las cadenas n la e''áella i tyókko [n le''áelli tJókko], tú enganchas las ramas o la e''áella e bitabbé [o le''áelle bitabbé], él engancha las lianas a la e''áella i petté [a le''áelli petté], etc.; paso punto yo enganché n e''áeri [ne''áeri], tú enganchaste o e''áeri [we''áeri], él enganchó a e''áeri [e''áeri], etc.; paso duro yo enganchaba n e''áelessi [ne''áelessi], tú enganchabas o e''áeles si [we''áelessi], él enganchaba a e''áelessi [e''áe lessi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebotyí', 's.', 'm.', 'Cl. 7', 'engaño: ebotyí , esoí , el - e ebOtyí [eebottJí]; -s ibOtyí (el. 8), bisoí (el. 8), los -s e ibotyí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'engarzar: engarzar, v. inf. o tolaella, o tokká; preso yo engarzo las cadenas n la tolaella i tyókko [n la tolaelli tJókko], tú engarzas las cuentas o la tok ká e betotto [o la tokké betotto]; paso punto voso tros engarzasteis vuestras ideas lo tolaeri e betapáero bi áno [lo toláeré betapáero biánno]; paso duro ellas engarzaban sus trenzas be ba tolaelessi e bésuppa be ábo [be bá tolaelesse besuppa biábbo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOseppa', 'adj.', NULL, 'Cl. 1', 'engreído: engreído, adj. bOseppa , el- o bOseppa;-s baseppa (el. 2), los -s a baseppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riakko', 's.', 'm.', 'Cl. 5', 'enlace: riakko , eu''o , ritolló (el. 5), el- e riakko, e eu''o [eeu''o], e ritolló; -s baakko (el. 6), biu''o (el. 8), batolló (el. 6), los -s a baakko, e biu''o, a batolló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'enlazar: enlazar, v. inf. o tolaella, o siaella; pres. el pesca dor enlaza los cordones o boobbe a la tolaella e besorí [o boobbe a la tolaelle besorí], yo enlazo los dos caminos n la siaella i telle pa ebá [n la siaelli telle pebbáa]; paso punto vosotros enlazas teis vuestras ideas lo tolaeri e betapáero bi áno [lo toláeré betapáero biánno]; paso duro ellos enlazaban sus nipas be ba tolaelessi i tyerú i ábO [be ba tolaelessii tJ erú yábbo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'enmendar: enmendar, v. inf o bella, o lakaella; preso los abuelos enmiendan sus vidas con la vejez a bayolla ba lá lakaella e ribotyo ri ábo la o borolla [a bayolla ba lá lakaelle ribotJo rábbo lo borolla]; paso punto yo no enmendé mi error n ta lakaeri e eitalla rÍ1 [n ta lákaereitallam].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 11', 'enmienda: enmienda, s. f lobettá , ehella , la - o lobettá; -s bettá , bihella , las -s i bettá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOnobbe', 's.', 'm.', 'Cl. 3', 'enojo: bOnobbe , buallé , nobbe (el. 9), el - o bOnobbe, o buallé, e nobbe; -s benobbe (el. 4), biallé (el. 8), nobbe (el. lO), los -s e bonobbe, e biallé, i nobbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'enredadera: enredadera, s. f bokorí , bolokkí , la - o bokorí, o bolokkí; -s bekorí (el. 4), belok kí (el. 4), las -s e bekorí, e belokkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'enrollar: enrollar, v. in! (a) o péppa, o rippáa; preso yo enrollo n la péppa, n la rippáa, tú enrollas o la péppa, o la rippáa, él enrolla a la péppa, a la rip páa, etc.;pas. punto yo enrollé n péppi [m péppi], n rippíi, tú enrollaste o péppi, o rippíi, él enrolló a péppi, a rippíi, etc.; paso duro yo enrollaba n pépéssi [m pépessi], n ripessi, tú enrollabas o pé pessi, o ripessi, él enrollaba a pépessi, a ripessi, etc. 2. -se (a) o ripéa; preso el ciempiés se enro lla e esokólla e la ripéa [eesokolla e láa ripéa], el cordón se enrolla o bosorí bo la ripéa [o bosorí bó la ripéa], etc.; paso punto el ciempiés se enro lló e esokólla e ripéi [eesokólla e rípéi], el cor dón se enrolló o bosorí bo ripéi [o bosorí bó rípéi], etc.; paso duro la serpiente se enrollaba e nóóa e ripeseei [e nooá é ripeseéi], la cuerda se enrollaba o opetté bo ripeseei [oopetté bó rípeseei], etc. (b) o tó''ólla Iíke (hablar mucho).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'enroscar: enroscar, v. ir¡[. o rippáa; preso yo enrosco la cuerda n la rippáa o opetté [n la rippópetté], tú enroscas el ciempiés o la rippáa e esokólla [o la rippésokolla], él enrosca el cordón a la rippáa o bosiirí [a la rippóbosorí], etc. ; pas. punto yo enros qué la cuerda n rippíi o opetté [n rippíópetté], tú enroscaste el ciempiés o rippíi e esokolla [o rip píésokolla], él enroscó el cordón de mi zapato a rippíi o bosorí bo e sússu rÍl [a rippíó biisori bué sússuum], etc.; pas. duro yo enroscaba n ripessi, tú enroscabas o ripessi, ella enroscaba a ripessi, etc. 2. -se o ripéa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

