INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'ensartar: ensartar, v. inf o tokká; preso la doncella ensar ta las cuentas o bulla bo lá tokká e betotto [o bulla bo láa tokké betotto], tú ensartas las con chas o la tiikká e biokollo [o la tokké biokollo]; paso punto ellos ensartaron las bolas ba tokkí e betotto [ba tókkíé betotto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'ensayar: ensayar, v. in:! o ke''ea, O ke''o; preso yo ensayo esta canción n la ba ke''o lólo loberí [n la ba ké''o ló loberi]; paso punto tú ensayaste este baile o ba ke''io lólo lobileri [o ba ké''io ló lobileri].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esori', 's.', 'm.', 'Cl. 7', 'ensayo: esori , eke''o , rike''o (el. 5), el - e esori [eesori], e eke''o [eeke''o], e rike''o; -s bisori (el. 8), bike''o (el. 8), bake''o (el. 5), los -s e bisori, e bike''o, a bake''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bue''iáa', 's.', 'm.', 'Cl. 1', 'enseñante: bue''iáa , - (mujer) bue''iáari (el. 1), el- o bue''iáa, la - o bue''iáari; -s be''iáa (el. 2), - (mujeres) be''iáari (el. 2), los -8 a be''iáa, las -s a be''iáari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'enseñar: enseñar, v. in,f o é''ia; preso yo enseño n la é''ia [n le''iáa], tú enseñas o la é''ia [o le''iáa], él ense ña a la é''ia [a le''iáa], etc.; paso punto yo enseñé n e''ía [ne''ía], tú enseñaste o e''ía [we''ía], él ense ñó a e''ía [e''ía], etc.; paso duro yo enseñaba n e''iesiia [ne''iesiia], tú enseñabas o e''iesiia [we''iesiia], él enseñaba a e''iesiia [e''iesiia], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lokko', 's.', 'm.', NULL, 'enseres: lokko (el. 1 1), los - a lokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'ensimismarse: ensimismarse, v. in! o poppa; preso yo me ensi mismo n la poppa, nna poppa, tú te ensimismas o la poppa, él se ensimisma a la poppa, etc.; paso punto yo me ensimismé n poppi [m poppi], tú te ensimismaste o poppi, él se ensimismó a poppi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'ensuciar: ensuciar, v. ir¡[. o ke''ubbia; preso yo ensucio tus zapatos n la ke''ubbia i sússu o [n la ke''ubbii sús suuo]; paso punto el niño ensució su ropa o bollá a ke''ubia i kuua i áí [o bollá a ke''úbíí kua yááí]. 2. -se o ko''ubba; preso el vestido se ensucia o luua lo lá ko''ubba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tollo', 's.', 'm.', 'Cl. 13', 'ensueño: tollo , tyebbá , el - o tollo, e tyebbá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'entender: entender, v. inj: o o'' áa, o MUa; pres. yo entiendo n la o''áa [n lo''áa], n la oálla [n loálla], tú entien des o la o''áa [o lo''áa], o la oálla [o loálla], él entiende a la o''áa [a lo''áa], a la oálla [a loálla], etc.; paso punto yo entendí n o''íi [no''íi], n oári [noári], tú entendiste o o''íi [bo''íi], o oári [boá ri], él entendió a o''íi [o''íi], a oári [oári], etc.; paso duro yo entendía n o''essi [no''essi], n oáles si [niiálessi], tú entendías o o''essi [bii''essi], o oá lessi [biiálessi], él entendía a o''essi [o''essi], a oálessi [oálessi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('biikuppá', 's.', 'm.', 'Cl. 3', 'entendimiento: biikuppá , ro''aeri (el. 5), el - o biikuppá, e ro''áeri; -s bekuppá (el. 4), bo''áeri (el. 6), los -s e bekuppá, a bo''áeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('biityilella', 's.', 'm.', 'Cl. 1', 'enterrador: biityilella , el- o biityilel la; -es batyilella (el. 2), los -es a batyilella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'enterrar: enterrar, v. in! o tyilella;pres. los abuelos entie rran a sus n�etos a bayolla ba lá tyilella i bobbé i ábo [a bayolla ba lá tJilelli bobbé yábbo]; paso punto el padre enterró a su hijo o boie a tyileri o bollá áí [o boie a tJileró bollaaí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyileri', 's.', 'm.', 'Cl. 3', 'entierro: botyileri , el - o botyileri; -8 betyileri (el. 4), los -s e betyileri. equivocar / 427', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('otyé', 's.', 'm.', 'Cl. 3', 'entorno: otyé , el - o otyé ; -s ityé (el. 8), los -s ityé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('telállo', 's.', NULL, 'Cl. 9', 'entrada: entrada, s.f. telállo , riatyi , púrúu (el. 9), la - e telállo, e riatyi, e púrúu; -s telállo (eL 10), baatyi (Cl. 6), púrúu (el. 10), las -s i telállo, a baa tyi, i púrúu; la - del pueblo e telállo e eriia [e telál lo ériia], la - de la frente e riatyi ri e polló [e ria tSi re pólló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'entrar: entrar, v. inf. o helóo''áa, o hélla (oammó); preso yo entro n la hélla oammó [n la hellóarnmó], tú entras o la hélla oarnmó [o la hellóarnmó], él entra a la hella oarnmó [a la hellóarnmó], etc.; paso punto yo entré n héri oarnmó [n heróarnmó], tú entraste o héri oarnmó [o heróarnmó], él entró a herí oarnmó [a heróarnmó], etc.; paso duro yo entraba n hessi oarnmó [n héssóammó], tú entrabas o héssi oarnmó [o héssóammó], él entraba a hessi oarnmó [a hés sóammó], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'entregar: entregar, v. inf. o e''era, o puráa;pres. yo entrego n la e''era [n la é''era], n la puráa, tú entregas o la e''e ra [o la é''era], o la puráa, él entrega a la e''era [a la é''era], a la puráa, etc.;pas. punto yo entregué n e''e riia/n e''enna [ne''eriia]/[ne''énna], n puria [m puria], tú entregaste o e''eriia/o e''enna [we''eríia]/[we''en na], o puria, él entregó a e''eriia/a e''enna [e''e riia]/[e''énna], a puría, etc.; paso duro yo entregaba n e''eresiia, n puesiia [m puesiia], tú entregabas o e''eresiia [we''eresiia], o puesiia, él entregaba a e''e resiia [e''éresiia], a puesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'entrelazar: entrelazar, V. inf. o tolaella, o siaella; pres. voso tros entrelazáis las nipas 10 la tolaella i tyerú [10 la tolaelli tS erú]; paso punto tú entrelazaste las madejas o tolaeri e biillóo [o toláeré biillóo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ripetyapetyá', 'S.', 'f.', NULL, 'entrepierna: ripetyapetyá (eL 5), la - e epe tyapetyá [eepetSapetSáa]; -s apetyapetyá (el. 6), las -s a apetyapetyá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosobo', 'S.', 'm.', NULL, 'entretenimiento: bosobo (eL 3), el - o bOsobo; -s besobo (eL 4), los -s e besobo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('róho', 'S.', 'm.', NULL, 'entusiasmo: róho (el. 5/6), rohoho (el. 5/6), el- e róho, e rohoho; -s bóho (el. 6), boho ho (el. 6), los -s a bóho, a bohoho.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eakakótte', 'S.', 'm.', 'Cl. 7', 'envase: eakakótte , el- eakakótte; -s biakakótte (el. 8), los -s e biakakótte.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'envejecer: envejecer, V. inf. o rulla; preso yo envejezco n la rulla, tú envejeces o la ruJIa, él envejece a la rulla, etc.; paso punto yo envejecí n ruri, tú envejeciste o ruri, él envejeció a ruri, etc.; paso duro yo enve jecía n ru1essi, tú envejecías o rulessi, él enveje cía a rulessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('borulla', 'S.', 'm.', 'Cl. 3', 'envejecimiento: borulla , bOruri (el. 3), el o bOrulla, o boruri; -s berulla (eL 4), beruri (el. 4), los -s e berulla, e beruri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

