  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'enviar: enviar, v. inf. o ará, o arera, o senáera, oráa; preso yo envío n la ará [n lará], tú envías o la ará [o lará], él envía a la ará [a lará], etc.; paso punto yo envié n aria [naría], tú enviaste o aría [waría], él envió a aría [aría] , etc.; paso duro yo enviaba n aresiia [naresiia], tú enviabas o aresiia [waresiia], él enviaba a aresiia [aresiia], etc. 2. - a alguien o takólla, o ará botyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buehé', 'S.', 'f.', 'Cl. 3', 'envidia: buehé , bokoa , la - o buehé, o bokoa; -s beehe (el. 4), bekoa (el. 4), las -s e beehe, e bekoa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'envidiar: envidiar, v. irif. o kooa;pres. yo envidio n la kooa, tú envidias o la kooa, él envidia a la kooa, etc.; paso punto yo envidié n kooi, tú envidiaste o kooi, él envidió a kooi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rihúo', 'S.', 'm.', 'Cl. 5', 'envoltorio: rihúo , el - e rihúo; -s bahúo (el. 6), los -s a bahúo; los -s de los extran jeros a bahúo bá bakóllé [a bahuó bá bákollé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rihúo', 'S.', 'm.', 'Cl. 5', 'envuelto: rihúo , el- e rihúo; -s bahúo (el. 6), los -s a bahúo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, NULL, 'epidemia: epidemia, S. f . bokaaí (el. 3), la o bOkaaí; -s bekaaí (el. 4), las -s e bekaaí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebelló', 'S.', 'f.', 'Cl. 7', 'época: ebelló , - lluviosa esubba (el. 7), - seca tyokkó (el. 9), la - e ebelló [eebelló], la - lluviosa e esubba [eesubba], la -seca e tyokkó; -s ibelló (el. 8) -s lluviosas bisubba (el. 8), -s secas tyokkó (el. 10), las -s e ibelló [e ibélló], las -s lluviosas e bisubba, las -s secas i tyokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eityi', 's.', NULL, 'Cl. 7', 'equivocación: equivocación, s.f. eityi , loribbí , eitalla (el. 7), la - e eityi [eeitSi], o IOribbí, e eital la [eeitalla]; equivocaciones biityi (el. 8), berib bí (el. 4), biitalla (el. 8), las equivocaciones e biityi, e beribbí, e biitalla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'equivocar: equivocar, V. inf. o itya; preso yo equivoco n la itya, tú equivocas o la itya, él equivoca a la itya, etc.; paso punto yo equivoqué n ityiia, tú equivo caste o ityiia, él equivocó a ityiia, etc.; paso duro yo equivocaba n ityesiia, tú equivocabas o itye siia, él equivocaba a ityesiia, etc. 2. -se o itta; preso me equivoco n la itta, te equivocas o la itta, se equivoca a la itta, etc.; paso punto me equivo qué n ityi, te equivocaste o ityi, se equivocó a 428 / era ityi, etc.; paso duro me equivocaba n itessi, te equivocabas o itessi, se equivocaba a itessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epa''á', 's.', 'm.', 'Cl. 7', 'erizo: epa''á , - de mar epa''á , el - e epa''á , el - de mar e epa''á ; -s ipa''á , -s de mar ipa''á , los -s e ipa''á, los -s de mar e ipa''á.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'errar: errar, v. inf o itta; preso yo yerro n la itta, tú yerras o la itta, él yerra a la itta, nosotros erra mos ro la itta, vosotros erráis lo la itta, ellos yerran ba lá itta; paso punto yo erré n ityi, tú erras te o ityi, él erró a ityi, etc.; paso duro yo erraba n itessi, tú errabas o itessi, él erraba a itessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loribbí', 's.', 'm.', 'Cl. 7', 'error: loribbí (el. 1 1), eityi , eitalla (el. 7), el- o loribbí, e eityi [eeitJi], e eitalla [eei talla]; -es beribbí (el. 4), biityi (el. 8), biitalla (el. 8), los -es e beribbí, e biityi, e biitalla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'eructar: eructar, v. irif. o puráa buebba; preso yo eructo después de comer n la puráa buebba n ka ra lá [n la purá buebba n ka ra lá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buebá', 's.', 'm.', 'Cl. 3', 'eructo: buebá , webbá , el - o buebá, o webbá; -s bebá (el. 4), los -s e bebá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kuppá', 's.', 'm.', 'Cl. 9', 'erudito: kuppá , el - e kuppá; -s kup pá (el. lO), los -s i kuppá. esa, dem. *0 (efr. ese).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'escalar: escalar, v. i''!f o obba; preso yo escalo montañas n la obba bió, tú escalas pedrizas o la obba biatte, él escala edificios a la obba tyóbbo, etc.; paso punto el muchacho escaló las pedrizas o boseseppe a obbi e biatte [o boseseppe a obbie bíatte]; paso duro nosotros escalábamos edificios ro obessi i tyóbbo [ro obessí i tJ óbbo ].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
