  ('simpa', 's.', 'm.', 'Cl. 12', 'escaño: simpa , empa , el- e simpa, e empa [eempa]; -s tompa (el. 13), bim pa (el. 8), los -s o tompa, e bimpa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'escapar: escapar, v. inf o sebbáa, o húbbia; preso yo esca po n la sebbáa, n la húbbia, tú escapas o la seb báa, o la húbbia, él escapa a la sebbáa, a la húb bia, etc. 2. -se o sebéa; preso yo me escapo n la sebéa [nna sebéa], tú te escapas o la sebéa [o la sebéa], él se escapa a la sebéa [a la sebéa], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lotáppo', 's.', 'm.', 'Cl. 4', 'escaparate: lotáppo (el. 1 1), el- o lotáppo; -s betáppo , los -s e betáppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'escarbar: escarbar, v. irif. o pakara, o passa, o putta; preso yo escarbo n la pakara, n la putta, tú escarbas o la pakara, o la putta, él escarba a la pakara, a la put t a, etc.; paso punto yo escarbé n pakaria [m paka ria], n putyi [m putJi], tú escarbaste o pakaria, o putyi, él escarbó a pakaria, a putyi, etc.; paso duro yo escarbaba n pakaresiia [m pakaresiia], n putes si [m putessi], tú escarbabas o pakaresiia, o putessi, él escarbaba a pakaresiia, a putessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
