  ('inf', 'v.', NULL, NULL, 'escoger: escoger, v. inf o ukka, o suppáa; preso yo escojo un libro n la ukka ribúkku, n la suppáa ribúkku [n la suppá ribúkku]; paso punto yo escogí una tela n ukki luua [nukki lúua], n suppíi luua [n suppi lúua];pas. duro ella escogía el camino cor to a supessi e telle kutyú [a supessé telle kutJú]. Tb. o toM/la.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOkuerakueráa', 'adj.', NULL, 'Cl. 1', 'escolar: escolar, adj. bOkuerakueráa , el- o bOkuera k ueráa; -es bakuerakueráa (el. 2), los -es a bakue r a k ueráa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'esconder: esconder, v. inf o leppa; preso yo escondo n la lep pa, tú escondes o la leppa, él esconde a la leppa, etc.; paso punto yo escondí n leppi, tú escondiste o leppi, él escondió a leppi, etc.; paso duro yo escon día n lepessi, tú escondías o lepessi, él escondía a lepessi, etc. 2. -se o lepea; preso me escondo n la lepea, te escondes o la lepea, se esconde a la lepea, etc.; paso punto me escondí n lepei, te escondiste o lepei, se escondíó a lepei, etc.; paso duro me escondía n lepieseei, te escondías o lepieseei, se escondía a lepieseei, etc. español / 429', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
