  ('f', 's.', NULL, 'Cl. 7', 'escopeta: escopeta, s. f etataa , la - e etataa ; -s bitataa , las -s e bitataa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boelo''o', 's.', 'm.', 'Cl. 3', 'escorpión: boelo''o , el - o boelo''o; escorpiones beelo''o (el. 4), bielo''o (el. 8), los escorpiones e beelo''o, e bielo''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopetyíi', 's.', 'm.', 'Cl. 11', 'escozor: lopetyíi , el- o lopetyíi; -es epetyíi (el. 4), los -es e epetyíi [eepetSíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'escribir: escribir, v. inf o irera, o mákka; preso yo escribo una historia n la irera boatta, n la mákka boatta, tú escribes cuentos o la irera toatta, o la mákka toatta, él escribe porque quiere a la irera kóri a la na''a, a la mákka kóri a la na''a, etc.; paso punto yo escribí una historia n ireriia boatta [n ireriá bóatta], n makki boatta [m makkí bóatta], tú escri biste cuentos o ireriia toatta [o ireriá tóatta], o makki toatta [o makkí tóatta], él escribió a ire riia, a mákki, etc.; paso duro yo escribía a tu her mana n ireresiia o wetta o [n ireresíó wettaao], tú escribías o ireresiia, o mákessi, él escribía a ire resiia, a mákessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sing', 'adj.', NULL, 'Cl. 1', 'escuchante: escuchante, adj. sing. bOátyera , el - o bOátyera; -s baoátyera (el. 2), los -s a baoátyera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'escuchar: escuchar, v. inf o batóbiera, o oátyera; preso yo escu cho n la batóbiera, n la oátyera [n lOátSera], tú es cuchas o la batóbiera, o la oátyera [o 10átSera], él escucha a la batóbiera, a la Oátyera [a 10átSera], etc.; paso punto yo escuché n batóbieriia [m batóbie riia], n Oátyeri ia [nOátS eriia], tú escuchaste o bató bieriia, o Oátyeriia [boátSeriia], él escuchó a ba tóbieriia, a oátyeriia [oátSeriia], etc.; paso duro yo escuchaba n batóbieresiia [m batóbieresiia], n Oátyeresiia [noátSeresiia], tú escuchabas o bató bieresiia, o Oátyeresiia [boátSeresiia], él escucha ba a batóbieresiia, a oátyeresiia [oátSeresiia], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kobo', 's.', 'm.', 'Cl. 9', 'escudo: kobo , el - e kobo; -s kobo (el. 10), los -s i kobo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'escuela: escuela, S. f re''eri , sikuella , la - e r/!''eri, e sikuella; -s be''eri (el. 6), t6kuella (el. 13), las -s a be''eri, o t6kuella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'escultura: escultura, S. f bOtebótyo , la - o bOte bótyo; -s bitebótyo (el. 8), las -s e bitebótyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'escupir: escupir, V. inf o puera; preso yo escupo n la pue ra, tú escupes o la puera, él escupe a la puera, etc.;pas. punto yo escupí n pueriia [m pueriia], tú escupiste o pueriia, él escupió a pueriia, etc.; paso duro yo escupía n pueresiia [m pueresiia], tú escupías o pueresiia, él escupía a pueresiia, etc. 2. - saliva o puera tuái. ese, dem. *0; 00 (el. 1): - hombre 00 boie; obo (el. 3): - árbol obo bOtté; ere (el. 5): - Sol ere itohi; ee (el. 7): - pueblo ee eriia, - animal ee nabba; 010 (el. 1 1): - vestido 010 luua; ese (el. 12): - suceso ese sokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eu''o', 's.', 'm.', 'Cl. 7', 'eslabón: eu''o , ritolló , esiaello (el. 7), el- e eu''o [eeu''o], e ritolló, e esiaello [eesiaello]; eslabones biu''o (el. 8), batolló (el. 6), bisiaello (el. 8), los eslabones e biu''o, a batolló, e bisiaello.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'esnifar: esnifar, V. inf o nópibia; preso mi madre esnifa tabaco molido o oberii rh a la nópibia sinópi [ooberirh la nópibia sinóppi]; paso punto los bra ceros esnifaron el tabaco molido a bakollé ba nópibiia e sinópi [a bakollé bá nópíbié sinóppi]. eso, prono dem. ee (els. 7, 9): ese objeto, eso ee ollé, ee, entrégame - e''era le ee [e''eráléée].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'espalda: espalda, s. f hNná , nná , la - e hNná, e nná; -s hNná (el. lO), nná (el. 10), las -s i hNná, i nná.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosáráa', 'S.', 'm.', 'Cl. 1', 'espantador: bosáráa , el- o bosáráa; -es basáráa , los -es a basáráa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i', 'v.', NULL, NULL, 'espantar: espantar, v. i1!f. o baribbia, o sáráa, o karibia; pres. yo espanto n la karibia, tú espantas o la karibia, él espanta a la karibia, etc.; paso punto yo espan té n karibiia, tú espantaste o kanbiia, él espantó a karibiia, etc.; paso duro yo espantaba n karibie siia, tú espantabas o karibiesiia, él espantaba a karibiesiia, etc. 2. -se o karibba, o baribba; preso me espanto por la noche n la baribba botyíó, te espantas o la baribba, se espanta a la baribba, etc.; paso punto me espanté n baribbi [m baribbi], te espantaste o baribbi, se espantó a baribbi, etc.; paso duro me espantaba n baribessi [m baribessi], te espantabas o baríbessi, se espantaba a bari bessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esárii', 's.', 'm.', 'Cl. 7', 'espanto: esárii , esára , el - e esáríi [eesarii], e esára [eesára]; -s bisárii (el. 8), bisára (el. 8), los -s e bisárii, e bisára.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opanná', 'S.', 'm.', 'Cl. 1', 'español: opanná , -a opanári , el - o opanná , la - o opanári ; -es apanná , -as, apanári , los -es a apanná [aapanná], las -as a apanári [aapanári]. 430 / esparcir', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'esparcir: esparcir, v. inl o kukura; preso el hombre espar ce los dátiles ii boie a la kukura i pillá [o boie a la kukuri pillá]; paso punto tu hermano esparció las semillas o bobelle o a kukuriia e biakká [o bObelle o a kukuríé biakká].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehítaeri', 'S.', 'm.', 'Cl. 7', 'espectador: ehítaeri , el - e ehítaeri [eehítaeri]; -es bihítaeri (el. 8), los -es e bihítaeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

