  ('inl', 'V.', NULL, NULL, 'esperar: esperar, V. inl o betella, o oyáera; preso yo espe ro n la betella, n la oyáera [n lóyáera], tú esperas o la betella, o la oyáera [o lóyáera], él espera a la betella, a la oyáera [a lóyáera], etc.; paso punto yo esperé n beteri [m beteri], n oyáeriia [noyáeriia], tú esperaste o beteri, o oyáeriia [boyáeriia], él esperó a beten, a oyáeriia [oyáeriia], etc.; paso duro yo esperaba n beteJessi [m betelessi], n oyáere siia [noyáeresiia], tú esperabas o betelessi, o oyáeresiia [boyáeresiia], él esperaba a betelessi, a oyáeresiia [oyáeresiia], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
