  ('bohiammo', 'S.', 'm.', 'Cl. 1', 'espiritista: bohiammo , elottyí (el. 7), el - o bohiammo, e elottyí [eelottSí]; -s bohiammo (el. 2), bilottyí (el. 8), los -s a bohiammo, e bilottyí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rnmo', 'S.', 'm.', 'Cl. 1', 'espíritu: rnmo , boribbo , bOé (el. 3), boteríbbo (el. 1), el- o rnmo, o boribbo, o boé, o boteríbbo; -s bibbo (el. 2), baribbo (el. 2), beoé (el. 4), bateríbbo (el. 2), los -s a bibbó, a baribbo, e beoé, a bateríbbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 1', 'esposa: esposa, s. l waísso , warí , segunda - bohNkí , la - o waísso, o warí, la segun da - o bohNkí; -s baísso (el. 2), barí (el. 2), segundas -s bahNkí (el. 2), las -s a baísso, a barí, las segundas -s a bahNkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'esposar: esposar, v. i''!l o bálla;pres. yo esposo n la bálla, tú esposas o la bálla, él esposa a la bálla, etc.; paso punto yo esposé n bári [m bári], tú esposaste o bári, él esposó a bári, etc.; paso duro yo esposaba n bálessi [m bálessi], tú esposabas o bálessi, él esposaba a bálessi, etc. 2. - para alguien o baleJ la, o baráa; preso yo esposo una mujer para mi hermano n la baIella o bobelle IÍ1 waísso [n la balello bóbelleIÍ1 wáisso], etc.; paso punto yo espo sé una mujer para mi sobrino n baleri e neppó IÍ1 waísso [m baleré neppóIÍ1 waísso], etc.; paso duro yo esposaba n balelessi [m balelessi], tú esposa bas o balelessi, él esposaba a balelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bObbe', 'S.', 'm.', 'Cl. 1', 'esposo: bObbe , el- o bobbe; -s bobbe (el. 2), abállá (el. 6), los -s a bobbe, a abállá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekáókáó', 'S.', 'm.', NULL, 'esputo: ekáókáó (eL 7), el- e ekáókáó [eekáó kááó]; -s bikáókáó (eL 8), los -s e bikáókáó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rn', 'S.', NULL, 'Cl. 4', 'esqueleto: esqueleto, S. rn. losikko (el. 1 1), luM (el. 1 1), el - o losikko, o luhá; -s besikko , kuhá (el. 10), los -s e besikko, i kuhá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'esquilar: esquilar, v. i''!l o poli á, o sulla; preso ellos esqui lan el cordero be ba lá sul1a e sityoru [be bá la sulle sitSoru]; paso punto nosotros esquilamos la cabra to porí e póríi [tó póré pori].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('dem', 'adj.', NULL, NULL, 'esta: esta, adj. dem. *10 (efr. este).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riiissa', 'S.', 'm.', NULL, 'estadio: riiissa (eL 5), el- e riossa; -s baos sa (el. 6), los -s a baossa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebo''u', 'S.', 'm.', 'Cl. 7', 'estanque: ebo''u , el- e ebo''u ; -s mbo''u , los -s e mbo''u.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'estar: estar, V. inl o sá; pres. yo estoy ne, tú estás we, él está e, nosotros estamos tue, vosotros estáis lue, ellos están be; paso punto yo estuve n séi, tú estu estriar / 431 viste o séi, él estuvo a séi, nosotros estuvimos to séi, vosotros estuvisteis lo séi, ellos estuvieron ba séi [há séi]; paso duro yo estaba n séssi, n séi, tú estabas o sessi, o séi, él estaba a sessi, a séi, etc.; - bien o sá lelle; estoy bien ne lelle; suelo - bien ne sá lelle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('r', 'S.', NULL, 'Cl. 3', 'estatua: estatua, S. r bOtebótyo , la - o bOtebótyo; -s bitebótyo , las -s e bitebótyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('dem', 'adj.', NULL, NULL, 'este: este, adj. dem. 010; - hombre 010 bOie (el . 1), árbol bolo botté (el. 3), - barril rilo ribetté (el. 5), - pueblo elo eriia (el. 7), - animal elo nabba (el. 9), - brazo 1010 lobbo (el. 11), - cochecito silo simotóo (eL 12), - cochecito es muy rápi do silo simotóo sí la húbbia sóté, etc. 2. s. m. osso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('onná', 'adv.', NULL, NULL, 'este: este, adv. onná (punto cardinal). Tb. osso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lotatáppa', 's.', 'f.', 'Cl. 11', 'estera: lotatáppa , boassó , la o lotatáppa, o bOassó; -s batatáppa (el. 6), beas só (el. 4), las -s a batatáppa, e beassó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boá', 'S.', 'm.', 'Cl. 3', 'estercolero: boá , buía (eL 3), rituttá (el. 5), el- o boá, o buía, e rituttá; -s beoá (el. 4), biía (el. 8), batuttá (el. 6), los -s e beoá, e biía, a batuttá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 61 (entradas 1501 a 1525)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('eoppa', 'S.', 'm.', NULL, 'estéril: eoppa (eL 7), el - e eoppa; -es biop pa (eL 8), los -es e bioppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 'S.', NULL, 'Cl. 3', 'esterilidad: esterilidad, S. j: booppa , la - o booppa; -es beoppa , las -es e beoppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lotatáppa', 's.', NULL, 'Cl. 11', 'esterilla: esterilla, s.f. lotatáppa , boassó (eL 3), la - o lotatáppa, o boassó; -s batatáppa , beassó (el. 4), las -s a batatáppa, e beassó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyokkó', 's.', 'm.', 'Cl. 9', 'estío: tyokkó , el - e tyokkó; -s tyok kó (el. 10), los -s i tyokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('itif', 'v.', NULL, NULL, 'estirar: estirar, v. itif. o nebOlIa, o tupelolla; preso yo estiro mi pierna n la nebolla o lopollá ro [n la nebollo lopollááro], tú estiras tus dedos o la nebOlIa e bene o [o la nebOlle benéó], vosotros estiráis vuestros brazos lo la nebOlla a abbó báno, etc.; paso punto mi hermana estiró sus piernas o wet ta ro a nebOri a apollá báí [o wettaaro a nebórá apollá bááí], ellos estiraron tu brazo ba nebOri o lobbo o [ha neboro lobbóoo], etc.; paso duro tú estirabas tu dedo o nebOlessi o bOne o [o nebOles só boneeo], la jineta estiraba sus extremidades e tyippa e nebOlessi e biubé bi áe [e tSippa e nebO lesse biubé biáe], las serpientes estiraban sus huesos i bappa i nebolessi e biuhá bi áye [i bappa i nebOlesse biuhá biáyee], etc. 2. -se o nebOlea; preso yo me estiro n la nebOlea, tú te estiras o la nebOlea, ella se estira a la nebOlea, etc.; paso punto nosotros nos estiramos to nebolei, vosotros os estirasteis lo nebolei, ellos se estiraron ba nebOlei [ba nebOlei], etc.; paso duro mi abuela se estiraba o bonánna ro a nebOleseei, ellos se estiraban ba nebOleseei [ba neboleseei], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rebbá', 'S.', 'm.', 'Cl. 5', 'estómago: rebbá , buelláa , el e rebbá, o buelláa; -s bebbá (el. 6), bielláa (el. 8), los -s a bebbá, e bielláa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'estorbar: estorbar, v. inf. o tyipóbia; preso yo estorbo n la tyipóbia, tú estorbas o la tyipóbia, él estorba a la tyipóbia, etc.; paso punto yo estorbé n tyipó biia, tú estorbaste o tyipóbiia, él estorbó a tyi póbiia, etc.; paso duro yo estorbaba n tyipóbie siia, tú estorbabas o tyipóbiesiia, él estorbaba a tyipóbiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etobbí', 's.', 'm.', 'Cl. 7', 'estorbo: etobbí , el - e etobbí [eetob bí]; -s bitobbí (el. 8), los -s e bitobbí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyiétyié', 's.', 'm.', 'Cl. 9', 'estornudo: tyiétyié , etyihétyihé (el. 7), el - e tyiétyié, e etyihétyihé [eetSihétSihé]; -s tyiétyié (el. 10), bityihétyihé (el. 8), los -s i tyiétyié, e bityihétyihé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribetebette', 's.', 'f.', 'Cl. 5', 'estratagema: ribetebette , esello (el. 7), ehurí (el. 7), la - e ribetébétte, e esello [eesel lo], e ehurí [eehurí]; -s abetebétte (CI. 6), bisello (CI. 8), bihurí (el. 8), las - s a abetebétte, e bisel lo, e bihurí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('r', 's.', NULL, 'Cl. 9', 'estrella: estrella, s. r tyetyewallé , la - e tyetyewal lé; -s tyetyewallé (el. 10), las -s i tyetyewallé; las -s del firmamento i tyetyewallé í o lobákko [i tSetSe wallé yó lobákko].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''ir', 'v.', NULL, NULL, 'estremecer: estremecer, v. i''ir o kokobbia;pres. yo estremez co n la kokobbia, tú estremeces o la kokobbia, él estremece a la kokobbia, etc.; paso punto yo estre mecí n kokobiia, tú estremeciste o kokobiia, él estremeció a kokobiia, etc.; paso duro yo estreme cía n kokobiesiia, tú estremecías o kokobiesiia, él estremecía a kokobiesiia, etc. 2. -se o kokob ba; preso nosotros nos estremecemos to la kokobba; paso punto vosotros os estremecisteis lo kokobbi; paso dur. ellas se estremecían ba kokobessi [ba kokobessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buppá', 'S.', 'm.', 'Cl. 3', 'estrépito: buppá , bompá, el - o bup pá, o bOmpá; -s biuppá (el. 8), bempá (el. 4), los -s e biuppá, e bempá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'estriar: estriar, V. inf. o tyábbia; preso el calor estría el suelo de barro e húé e lá tyábbia o bobba bO e bitokko [e hué é láa tSábbio bobba bue bítokkO]. 2. -se o tyábba; preso el suelo se estría o bobba bO lá tyábba [o bobba bó la tSábba];pas. punt. las chapas de zinc se estriaron i tyallá i tyábbi. 432 / estrofa estrofa, s'' ¡: bosari (el. 3), la - o bosari; -s besa ri (el. 4), las -s e besari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribátto', 's.', 'm.', 'Cl. 5', 'estropajo: ribátto , kuttyá (els. 9 y 10), roppó (el. 5); -s abátto (el. 6), kuttyá (el. 10), bOp pó (el. 6); el - e ribátto, e kuttyá; los - a abátto, i kuttyá (el. 10).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'estropear: estropear, v. inf. o kappa; preso el perro estropea la comida e puá e lá kappa o bora''o [e puá é láa kappii bOra''o]; paso punto las ardillas estropea ron las piñas de cacao e besoppé be kappi e bimmáloto [e besoppé bé káppi e bimmálottO]; paso duro tú estropeabas el agua o kapessi a bop pé [o kapessá boppé]. 2. -se o kapea; preso el coche se estropea mucho o motóo bo lá kapea Iíkelíke. 3. - para o kapella; preso nosotros estropeamos la escoba al barrendero to la kapella a bailola e ribetye [to la kapella bailiile ribetSe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOmpá', 's.', 'm.', 'Cl. 3', 'estruendo: bOmpá , buppá , el - o bompá, o buppá; -s bempá , biuppá (el. 8), los -s e bempá, e biuppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'estrujar: estrujar, v. inf o bitta; pres. yo estrujo n la bitta, tú estrujas o la bitta, él estruja a la bitta, etc.; paso punto yo estrujé n bityi [m bitSi], tú estru jaste o bityi, él estrujó a bityi, etc.; paso duro yo estrujaba n bitessi [m bitessi], tú estrujabas o bitessi, él estrujaba a bitessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('wanapana', 's.', 'm.', 'Cl. 1', 'estudiante: wanapana , bue''áa , el - o wanapana, o bue''áa; -s banapana (el. 2), be''áa (el. 2), los -s a banapana, a be''áa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'estudiar: estudiar, v. inf o e''áa; preso yo estudio la vida de la eminencia Riokaló n la e''áa e ribotyo ri o mmeá Riokaló [n le''é ribOtSo ro mmeá riokaló]; paso punto el escolar estudió la historia de su pueblo o bokuerakueráa e''í o boatta bO e eriia áí [o bokuera kuerá e''ió bOatta buériaaí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'estufa: estufa, s. f epo''o , la - e epo''o ;-s ipo''o (el. 8), las -s e ipo''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rioom', 'S.', 'm.', 'Cl. 5', 'etrete: rioom , itoberi , koppí (el. 9), el- e rioom, e itoberi, e koppí; -s baooIÍl (el. 6), batoberi (el. 6), koppí (el. JO), los -s a baoo ''m, a batoberi, i koppí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elabba', 's.', 'm.', 'Cl. 7', 'evento: elabba , el - e elabba [eelab ba]; -s bilabba (el. 8), los -s e bilabba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'evocar: evocar, v. inf o tapánna; paso punto yo evoq ué mis recuerdos n tapán''a e betapáero m [n tapán é betapáeroom]; preso vosotros evocáis las cosas de antaño lo la tapánna e bilabba bi á mmalé [lo la tápánne bilabba biá mmalé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'evolcar: evolcar, v. inf. o papara; preso yo revuelco n la papara, tú revuelcas o la papara, él revuelca a la papara, etc.; p a so punto yo revolqué n papariia [m papariia), tú r e volcaste o papariia, él rewIcó a papariia, etc.; paso duro yo revolcaba n paparesiia [m paparesiia), tú r e volcabas o paparesiia, él revolcaba a paparesiia, etc. r', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 62 (entradas 1526 a 1550)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'evolver: evolver, v. inf. (a) o tyukka; preso yo revuelvo el agua n la tyukka a boppé, tú revuelves el aceite o la t y u kka a biitá, él revuelve el vino a la tyukka o wem [a la tJukko weem), etc.; paso punto yo revolví el agua n tyukki a boppé [n tJukkia booppé), tú revol viste el aceite o tyukki a biitá [o tJukkia bíittá), él r evolvió el vino a tyukki o wem [a tJukkíó weem), etc.; paso duro yo revolvía el agua n tyukessi a bop pé [n tJukessá boppé), tú revolvias el aceite o tyu kessi a biitá [o tJukessá biittá), etc. (b) o tukka; pas. punto tukki, nosotros revolvimos los asuntos tradi cionales r o bi tukki e bilabba bi etyo [to bi tükkl e bilabba biétyo); paso duro tukessi, ellos revolvían el arroz be ba tukessi i ressi [be bá túkessi i ressi]. (e) o pakara (pas. punto pakariia; paso duro pakaresiia), (d) o passa (pas. punto passi;pas. duro pasessi), (e) () hótella (pas. punto hótem; paso duro hótelessi), Il k a k á r a (pas. punto kakáriia; paso duro kakáresiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esori', 's.', 'm.', 'Cl. 7', 'examen: esori , eke''o , el- e eso r i [eesori], e eke''o [eeke''o]; exámenes bisori (el. 8), bike''o (el. 8), los exámenes e bisori, e bike''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('toom', 's.', 'm.', 'Cl. 13', 'excremento: toom , raa''o , botyappe (el. 3), el- o toom, e raa''o, o botyappe; -s toom (el. 13), baa''o (el. 6), betyappe (el. 4), los -s o toom, a baa''o, e betyappe. excusa, s'' ¡: ebotto (el. 7), la - e ebotto [eebotto]; -s mbotto (el. 8), las -s e mbotto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtó''i', 's.', 'm.', 'Cl. 3', 'éxito: bOtó''i , el- o bOtó''i; -s betó''i (el. 4), los -s e betó''i.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'experiencia: experiencia, s. f tyutyú''ú , la - e tyutyú''ú; -s tyutyú''ú , las -s i tyutyú''ú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botará', 'adj.', NULL, 'Cl. 3', 'experto: experto, adj. botará , el - o bOtará; -s beta rá (el. 4), los -s e betará.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'explotar: explotar, v. ir¡f o púbba, o póbba; preso el coco explota o bokóko bO lá póbba; paso punto su cabeza explotó e etue áí e póbbi [eetuáí é pÓbbi]. 2. hacer - o póbbia; preso el chico hace explotar el globo o bOllá a la póbbia e ebiilobOllóo [o bollá a la póbbiebolobollóo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'exprimir: exprimir, v. inf o anná, o bitta;pres. yo exprimo la naranja n la bitta e erelÍtya [n la bitterelÍtSa]; paso punto tu hermana exprimió el limón o wet ta o a bityi e erem [o wetta o a bitSéreem].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'expulsar: expulsar, v. inf. o hékia, o pupuálla;pres. yo expulso n la pupuálla, tú expulsas o la pupuálla, él expul sa a la pupuálla, etc.;pas. punto yo expulsé n pupuá ri, tú expulsaste o pupuári, él expulsó a pupuári, etc. ;pas. duro yo expulsaba n pupuálessi, tú expul sabas o pupuálessi, él expulsaba a pupuálessi, etc. * el alumno fue expulsado del colegio o bue''áa a hélda o o sikuella [o bue''á a hékio o sikuella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'extender: extender, v. inf. o bátyera; preso yo extiendo la ropa n la bátyera i kuua [n la bátSeri kuua], tú extiendes la lona o la bátyera e etapóllo [o la bá tSeretapóllo], él extiende las nipas a la bátyera i tyerú [a la bátSen tSerú], etc.;pas. punto yo exten dí la ropa n bátyeria i kuua [m batSeríí kuua], tú extendiste la lona o bátyeriia e etapóllo [o batSe ríétapóllo], él extendió las nipas a bátyeria i tye rú [a batSeríí tSerú], etc. extremidad / 433', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('walállo', 's.', 'm.', NULL, 'exterior: walállo (el . 3), el - o walállo; -es bialállo (el. 8), los -es e bialállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'exterminar: exterminar, v. inf. o rilláa; preso el demonio extermina mi hogar o mmo a la rilláa e tyóbbo r Í l [o mmo á la rillé tJobboorÍl], etc.; paso punto el ogro exterminó a las personas del pueblo e enokonoko e rirí a batyo ba e eriia wela [enoko noko e rirá batJo béria wella], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'extinguir: extinguir, V. inf o tokka; preso el pirómano extingue el incendio o boloppa a la tokka e riba saisso [o bOloppá a la tokke ribasaisso]; paso punto el pueblo extinguió el fuego e eriia e tokkí o boissó [eeria é tokki o bOissó], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'extirpar: extirpar, V. inf. o haa, o tokólla;pres. el médico extirpa la espina e rokútta ri lá haa o lonorí [e rokuttá ri lá hao lonorí]; paso punto nosotros extirpamos las niguas to haai e biortó [to haye bíortó], ellos extirparon los moluscos unival vos pequeños ba tokóri i tyetyélle [ba tokórí tJetJélle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bokere', 's.', 'm.', 'Cl. 1', 'extranjero: bokere , bokollé oporto (el. 1), boríbáa (el. 1), bokoé (el. 1), el o bokere, o bOkollé, o oporto [iiiiporto], o borí báa, o bokoé; -s bakere (el. 2), bakollé (el. 2), aportO (el. 2), baríbáa (el. 2), bakoé (el. 2), los -s a bakere, a bakollé, a aporto [aaportO], a barí báa, a bakoé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'extremidad: extremidad, s. f: eubé , la - e eubé [eeu bé]; -es biubé (el. 8), las -es e biubé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebaeri', 's.', 'f.', 'Cl. 7', 'fábrica: ebaeri , la - e ebaeri ; -s ibaeri , las -s e ibaeri; las - de coches e ibaeri bi e mootó [e ibaeri bie motto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opénna', 's.', 'm.', 'Cl. 1', 'fabricante: opénna , obáa (el. 1 ), (de collares) bOsokka (el. 1), el - o opénna [oopén na], o obáa [oobáa], o bosokka; -s apénna (el. 2), abáa (el. 2), basokka (el. 2), los -s a apénna [aapénna], a abáa [aabáa], a basokka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'fabricar: fabricar, v. inf. o báa, o pénna; preso yo fabrico n la báa, n la pénna, tú fabricas o la báa, o la pénna, él fabrica a la báa, a la pénna, etc.; paso punto yo fabriqué n bái [m bái], n péém [m péém], tú fabricaste o bái, o peém, él fabricó a bái, a péém, etc.;pas. duro yo fabricaba n báes si [m báessi], n pénessi [m pénessi], tú fabrica bas o báessi, o pénessi, él fabricaba a báessi, a pénessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, NULL, 'fábula: fábula, s. f . siatta (el. 12), la - e siatta; -s toatta (el. 13), las -s o toatta (el. 13).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosso', 's.', 'f.', 'Cl. 3', 'faceta: bosso , la - o bosso; -s besso (el. 4), las -s e besso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
