  ('inj', 'V.', NULL, NULL, 'hablar: hablar, V. inj: o to''ólla;pres. yo hablo el bubi n la to''ólIa e etyo [n la to''óleetSo], yo no hablo el bubi n tyá la to''ólla e etyo [n tSá la to''óleetSo]; paso punto tú hablaste el bubi o to''óm e etyo [o to''ómétSo], tú no hablaste el bubi o ta to''óm e etyo [o ta tó''omeetSo]; paso duro ella hablaba mucho a towessi líkelíke [a towessí líkelíke], ella no hablaba mucho ata towessi Iíkelíke [a ta tówessi likelíke]. 2. - con alguien o tówálla; yo hablo con mi vecino n la tówálla o bOtyo a e epatto rÍl [n la tówállo botSo épattoorÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
