  ('inf', 'v.', NULL, NULL, 'hechizar: hechizar, v. inf o isera; preso el hechicero me hechiza o bOtyiáÍltyó a la le isera [o botJiálÍtJo a la le ísera]; paso punto mi vecino hechizó a mis hijos o botyo á e epatto m a iseriia a bóllá m [o botJo épatto a iseríá bollaath].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
