  ('elabba', 'S.', 'm.', 'Cl. 7', 'hecho: elabba , eseri , - asom broso, insólito pohá (el. 9), el - e e1abba [eelab ba], e eseri [eeseri], el - asombroso, insólito e pohá; -s bilabba (el. 8), biseri (el. 8), -s asom brosos, insólitos pohá (el. 10), los -s e bilabba, e biseri, los -s asombrosos, insólitos i pohá. 2. pequeño sipénaera (el. 12), el- pequeño e sipé naera; -s pequeños topénaera (el. 13), los -s pequeños o topénaera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
