  ('f', 's.', NULL, 'Cl. 3', 'hemorragia: hemorragia, s. f (nasal) bOlo'' u , elekka (el. 7), la - o bOlo'' u, e elekka [eelekka]; -s billo''u (Cl. 4), bilekka (el. 8), las - s e belo''u, e bilekka. historia / 451', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
