  ('lobokko', 's.', 'm.', 'Cl. 3', 'hueco: lobokko (el. 1 1), bolló , el- o lobokko, o bolló; -s bokko (el. lO), beolló (el. 4), los - s i bokko, e beolló. hurto / 453', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
