  ('inf', 'V.', NULL, NULL, 'humillar: humillar, V. inf o benná; preso tú humillas a tu hermano o la benná o bobelle o [o la bennó bObelIeeo]; paso punto ellos le humillaron ba bo benní [bá bó benni]; paso duro yo humillaba o benessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
