  ('pullá', 's.', 'm.', 'Cl. 9', 'huracán: pullá , el - e pullá; huraca nes pullá (el. 10), los huracanes i pullá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sipoppi', 's.', 'm.', 'Cl. 12', 'huraño: sipoppi , el - e sipoppi; -s topoppi (el. 13), los -s o topoppi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'hurgar: hurgar, V. inf o pakara, o passa; preso yo hurgo en el baúl n la pakara o lobakka sé [n la pakaro lobakka sé], n la passa o lobakka wela [n la passo lobakka wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'hurtar: hurtar, v. inf o ubáa;pas. punto el perro hurtó la carne e puá e ubíi o bornmua [e puá úbíó bornmua).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
