  ('ribésse', 's.', 'f.', 'Cl. 5', 'iambrera: ribésse , enénée , la - e ribésse, e enénée ; -s abésse , binénée (el. 8), las -s a abéssé, e binénée. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eserubba', 's.', 'f.', 'Cl. 7', 'ibra: eserubba , la - e eserubba; -s biserubba (el. 8), las -s e biserubba. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'ichar: ichar, v. inf o i''ia; preso el policía ficha a los ladrones e eporosía e lá i''ia i húbbé [eeporosíá é lá i''ii húbbé]; paso punto el guardián fichó a los visitantes o bolotyi a i''ia a babeppoo. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
