  ('l', 's.', NULL, 'Cl. 3', 'ida: ida, s. l ohelló, boía , la - o ohelló, o bOía; y vuelta boía bohóra, o ohelló la opulló [oohelló loopúllo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
