  ('inf', 'v.', NULL, NULL, 'identificar: identificar, v. inf o anna; o tappáa; preso yo identifico mi casa n la tappáa e tyóbbo rÍl [n la tappé tSobboorh]; paso punto yo identifiqué la camisa de tu hermana n tappí e sótte sá o wet ta ó [n tappié sotte so wettaaó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
