  ('como', 's.', NULL, 'Cl. 7', 'idiota: idiota, s. como (e)ekké , eelé , seké (el. 12), el- e ekké, eelé, e seké; -s biekké (el. 8), bielé (el. 8), tueké (el. 13), los -s e biekké, e bielé, o tueké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('y', 'adj.', NULL, 'Cl. 9', 'ido: ido, adj. y s. tyoppo , el - e tyoppo; -s tyoppo (el. 10), los -s i tyoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boteríbbo', 's.', 'm.', NULL, 'ídolo: boteríbbo (el. 1/2), el- o boteríbbo, -s bateríbbo (el. 2), los -s a bateríbbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nabba', 's.', 'f.', 'Cl. 9', 'iera: nabba , la - e nabba; -s nabba (el. 10), las -s i nabba; es una - e nabba. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('hobabobbá', 'adj.', NULL, 'Cl. 9', 'iero: iero, adj. hobabobbá , el- e hobabobbá; -s hobabobbá (el. 10), los -s i hObabobbá; es muy - e hObabobbá sóté [e hobabobba sóté]. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
