  ('f', 's.', NULL, 'Cl. 3', 'imagen: imagen, s. f ehánna (CI. 7), bOtebótyo , la - e ehánna [eehánna], o borebótyo, imágenes bihánna (el. 8), birebótyo (el. 8), las imágenes e bihánna, a bitebótyo. 456 / imbécil imbécil, ad}. como eelé (el. 7), el - e celé [eellé]; -es bielé (el. 8), los -es e bielé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
