  ('inf', 'V.', NULL, NULL, 'inalizar: inalizar, V. inf o séra, o sétta, o sétya; preso yo finalizo la historia mañana n la sétya o boatta obaam [n la sétSo boatta obaam]; paso punto yo f inalicé el trabajo ayer n sétyia e elakó mpári [n setSíélakó mpári]. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
