  ('inf', 'v.', NULL, NULL, 'inclinarse: inclinarse, v. inf o kokotta; preso me inclino n la ko kotta, te inclinas ola kokotta, se inclina a la kokot ta, etc.; paso punto me incliné n kokotyi, te incli naste o kokotyi, se inclinó a kokotyi, etc.; paso duro me inclinaba n kokotessi, te inclinabas o kokotessi, se inclinaba a kokotessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'incnmplir: incnmplir, v. in{ o eólla;pres. el gobierno incum ple sus leyes e kóbinna a la eólla e biette biáí [e kóbinna a leólle biette biááí]; paso punto vosotros incumplisteis lúe lo eóri [Iue lueóri).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'incordiar: incordiar, v. inf o lehea, o tyipóbbia; preso yo te incordio n la o lehea [n lo léhea], n la o tyipóbia [n lo tSípobbia], tú me incordias o la lehea [o la le léhea], o la le tyipóbia [o la le tSípobbia], él le incordia a la b6 lehea [a la bo léMa], a la bo tyi póbia [a la bo tSípobbia], etc.; paso punto yo te incordié n o lehei [no léhei], tú me incordiaste o le lehei [o le léhei), él te incordió a o lehei [o léhei), etc.; paso duro yo te incordiaba n o lehie seei [no léhieseei], tú me incordiabas o le le hieseei [o le léhieseei], él le incordiaba a bo lellÍeseei [a bo léhieseei), etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'increpar: increpar, v. ini o obálla; preso yo increpo a mi amigo n la obálla o buéso''o IÍl [n lobállo bué so''ooIÍl), tú increpas al glotón ola obálla e kóbbe [o lobálle kóbbe], él increpa a su hermana a la obálla o wetta áí [a lobállo wettaaí), etc.; paso punto los dignatarios increparon al presidente a bariariia ba obári o botákityé [a bariaria bóbáró botakíitSé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'indagar: indagar, v. inf o ekera, o utya; preso yo indago n la utya, tú indagas ola utyaa, él indaga a la utya, etc.; paso punto yo indagué n utyiia, tú indagas te o utyiia, él indagó a utyiia, etc.; paso duro yo in dagaba n utyesiia, tú indagabas o utyesiia, él indagaba a utyesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

