  ('to', 'adj.', NULL, NULL, 'largo: largo, adj. to; boto (els. 1 y 3) persona larga (alta) botyo boto, línea larga bOlele boto; rito (el. 5) cama larga raatyé ritó; eto (el. 7) labio ebebo eto; loto (el. 1 1), brazo - lObM loto; sito (el. 12) cuento - siatta sitó; -s to; bato (els. 2 y 6) personas largas (altas) batyo bato, camas lar gas baatyé bato [baatJé bátto]; beto (el. 4) líneas largas beJele beto; bito (el. 8) labios -s ibebo bito; to (els. 9 y lO) sardinas largas kollo to; toto (el. 13) cuentos -s toatta totO.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohehé', 'S.', 'f.', 'Cl. 3', 'laringe: bohehé , la - o bohehé; -s behehé (el. 4), las -s e behehé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 'S.', NULL, 'Cl. 12', 'larva: larva, S. I sise''e , la - e sise''e; -s tose''e (el. 13), las -s o tose''e. las, 1. aum. (idem aum. los), 2. las, det. arto a, i, e, o; - mujeres a baísso (el. 2), - hermanas a bet ta (el. 2), - mejillas a bakekk:o (el. 6), - campa nas e bilebbó (el. 8), - casas i tyóbbo (el. lO), - sardinas i kollo (el. 10), hojas o tuebáám (el. 13), etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'V.', NULL, NULL, 'lastimar: lastimar, V. i''!f o tobbia; preso yo lastimo a mi perro n la tobbia e puá ro [n la tobbiépuaam], tú lastimas a mi perro o la tobbia e puáro [o la tob biépuaaro], él lastima al gato a la tobbia e sipós si [a la tobbié sipóssi], etc. 2. -se o tobba; paso punto me he lastimado n tobbi [n tobíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 'S.', NULL, 'Cl. 12', 'lata: lata, S. I sikoppo , la - e sikoppo; -s tokoppo (el. 13), las -s o tokoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosuisuií', 'S.', 'm.', 'Cl. 3', 'látigo: bosuisuií , bOsíporii , el - o bOsuisuií, o bOsíporíi; -s besuisuií , besíporíi (el. 4), los -s e besuisuií, e besíporíL', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'latir: latir, V. inf. o papabia, o pórnrna; preso mi cora zón late o botébbá ro bo lá papabia, tu corazón late o botébbá o bo la pórnrna; paso punto tu corazón latió o botébbá o bo papabiia [o botéb báo bó pápabiia];pas. duro el corazón del lagar to latía o botébbá bo e esolésóle bo papabiesiia [o botebbá buésolésóle bó pápabiesiia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buítya', 'S.', 'm.', 'Cl. 3', 'lato: buítya , el - o buítya; -s bítya (el. 4), los -s e bítya. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
