  ('looa', 'S.', 'm.', NULL, 'lavadero: looa (el. 1 1), el- o looa; -8 kooa (el. 10), los -s i kooa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'lavar: lavar, v. inf. o ooa; p�S. yo lavo mis calzoncillos n la ooa a abatyu ro [n loa abatJuurh]; paso punto tú lavaste tus bragas o ooi a abatyu o [boyába tJuuo], él lavó tu ropa ooi i kuua o [oyí kuaao]. 2. - con o oalla;pres. la abuela lava su pelo con hojas o bonánna a la oaIla e bisílla bi áí la tonta [o bonánna a loalle bisillá bíáí tónta]. 3. -se o oeea, o subbá, o subbó; pres. me lavo n la oeea [n loeea], n la subbá, n la ba subbó [n la ba súbbo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehúto', 's.', 'm.', 'Cl. 7', 'lazo: ehúto , el- e ehúto ; -s bihúto (el. 8), los -s e bihúto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
