  ('inf', 'v.', NULL, NULL, 'levantar: levantar, v. inf. o atya, o ipiira; pres. yo levanto el fardo n la atya o oo''e [n la atSo bO''e], tú levantas a tu tía o la ipora e enepó o [o la iporeenepóóo], o la ipora e eantí o [o la ipiireantíío]. 2. ayudar a - o atyalla;pres. mi hermano me ayuda a levan tar la carga o oobelle rÍl a la le atyalla o oo''e [o bobellerÍl a la le átSallo oo''e]. 3. - para alguien o atyella, o ipiira;pres. yo levanto el Cardo para mi sobrino n la atyella o oo''e e neppó rÍl [n la atSello bo''e e néppiiorÍl]. 2. -se o ipolla; preso me levan to n la ipolla, te levantas o la ipiilla, se levanta a la ipolla, etc.;pas. punto me levanté n ipori [nipO ri], te levantaste o ipori [wipiiri], se levantó a ipori [ipori], nos levantamos to ipori [tuipori], os levantasteis 10 ipori [luipori], se levantaron ba ipori [bípori]; imp. levántate ipolla [ipóllá], levantémonos to ipolle [tuípiille].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'lexionar: lexionar, V. inf o hútta; preso la monja flexiona sus rodillas e materi e lá hútta e birúu bi áe [e materi e láa hutté birú bíáe]; pas punto el empe rador flexionó sus rodillas o botákityé a hútyi e birú bi áí [o botákitSé a hútSé biru biáí]. 2. -se o hútéa; preso me flexiono cuando pasa la donce lla n la hútéa a la hettáa lá o bulla. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
