  ('inf', 'v.', NULL, NULL, 'libertar: libertar, v. inf. o solla; preso yo liberto n la solla; paso punto yo liberté n sori; paso duro yo liberta ba n solessi. 464 / libertino', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
