  ('j', 'S.', NULL, 'Cl. 5', 'limosna: limosna, S. j: rappí , la - e rappí; -s bappí (el. 6), las -s a bappí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'V.', NULL, NULL, 'limpiar: limpiar, V. inj : o ilólla, o ubolla; preso yo limpio n la ilólla, n la ubolla, tú limpias o la ilólla, o la ubolla, él limpia a la ilólla, a la ubolla, etc.; paso punto yo limpié n ilori [nilori], n uboru [nubori], tú limpiaste o ilori [wilori], o ubori [bubori], él limpió a ilori [ilóri], a ubori [ubori], etc. 2. - el ano o nta; preso yo limpio el ano del bebé n la nta o bollá [n la nto bollá]; paso punto yo limpié el ano de mi abuelo n ntyi o boyolla IÍl [ n ntSo bóyOlJaaIÍl]. 3. -se el ano o nteea; preso la tortu ga se limpia el ano e esapúsappú e lá nteea.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
