  ('m', 'S.', 'm.', 'Cl. 9', 'linaje: (materno) karítyóbbo , (pater no) itappá (el. 5), el - e karítyóbo, e itappá; -s karítyóbbo (el. 10), batappá (el. 6), los -s i kari tyóbbo, a batappá. * hay cuatro -s paternos en los bubis he batappá be bale a abóbée wela [he batappa be bale abobbé wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
