  ('f', 'S.', NULL, 'Cl. 5', 'llamada: llamada, S. f releri , ebétyi , la - e releri; - de atención ebeleri (el. 7); -s beleri (el. 6), ibétyi (el, 8), las -s a beleri, -s de atención mbeleri (el. 8), las -s de atención e mbeleri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
