  ('inf', 'v.', NULL, NULL, 'llegar: llegar, v. inf. o palláa; preso yo llego esta mañana n la palláa eló ebari [n la pallélebaril 2. - a ser o palláa;fot. él llegará a ser alguien a pallá''á bOtyo [a pallá''á bótSo]. 3. -la noche o síballa; la noche llega pronto o botyíó bó la síballa bakasso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'llenar: llenar, v. inf. o era; preso yo lleno el bidón n la era e ribetté [n la ere ribetté]; paso punto tú llenaste el vaso o eriia e etyakka [o eriétSakka], etc. 2. -se o ella; preso el bidón se llena con la lluvia e ribet té ri lá ella la o lóllá [e ribetté ri lá ella lo lollál', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'llevar: llevar, v. inf. o alláa; preso yo llevo n la alláa [n lalláa], tú llevas o la alláa [o lalláa], él lleva a la alláa [a lalláa], etc.; paso punto yo llevé n arí [narí], tú llevaste o ari [warí], él llevó a arí [ari], etc.; paso duro yo llevaba n alessi [nalessi], tú llevabas o alessi [walessi], él llevaba a alessi, etc. 2. - para o o alella; preso yo llevo agua para mis trabajadores n la alella a balakóláko m boppé [nalella balakólákom bóoppé]. 3. -se o susulla; preso el coche se lleva al camión o motóo bo lá susulla e rikotye [o motó bó lá susulle rikotSel', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'llorar: llorar, v. in! o bé''a; preso yo lloro n la bé''a, tú llo ras o la bé''a, él llora a la bé''a, etc.; paso punto yo lloré n bé''i [m bé''i], tú lloraste o bé''i, él lloró a bé''i, etc.; paso duro yo lloraba n bé''essi [m bé''es si], tú llorabas o bé''essi, él lloraba a bé''essi, etc. 2. - por alguien o por algo o bé''ela; preso yo lloro por mi madre n la bé''ela o oberii m [n la be''eIoberíím], tú lloras por mí o la le bé''éla [o la le bé''ella], él llora por su casa a la bé''ela e tyóbbo áí [a la be''éle tSobbuáí], etc. * si el niño llora, dale de mamar na o bollá a la bé''a appiá bó [na ó bóllá la bé''a appiá ból', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'lloriquear: lloriquear, v. in! o rutya;pres. el niño lloriquea o bóllá a la rutya, tú lloriqueas o la rutya, ellos lloriquean ba lá rutya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribé''í', 'adj.', NULL, 'Cl. 5', 'llorón: llorón, adj.m. ribé''í , el - e ribé''í; llorones abé''í (el. 6), los llorones a abé''í.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 11', 'lluvia: lluvia, s. l lóllá , - de agosto boratya (el. 3), la - o lóllá, la - de agosto o boratya; -s kóllá (el. lO), -s de agosto beratya (el. 4), las -s i kóllá, las -s de agosto e beratya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyoppo', 's.', 'm.', 'Cl. 9', 'loco: tyoppo , el - e tyoppo; -s tyoppo (el. lO), los -s i tyoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etokkó', 's.', 'm.', 'Cl. 7', 'lodo: etokkó , el- e etokkó ; -s bitokkó , los -s e bitokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'lor: lor, S. f ehNtyátya , kolekko , - de la palmera buebó (el. 3), - de la malanga bohNtó (el. 3), la - e ehNtyátya [eehNtSátSa], e kolekko, la - de la palmera o buebó, la - de la malanga o bOhNtó; -es bihNtyátya (el. 8), kolekko (el. 10), -es de la palmera beebó (el. 4), -es de la malanga behNtó, las -es e bihN tyátya, i kolekko, las -es de la palmera e beebó, las -es de la malanga e behNtó. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'V.', NULL, NULL, 'lorecer: lorecer, V. irif. o hMmáa; pres. este árbol florece bOló bOtté bo lá hMmáa, las hierbas florecen e biruppú bi lá hMmáa; paso punto la palmera flo reció o obílla bO hMmí [oobillá bó hMmíi]. f', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
