  ('bObbe', 'S.', 'm.', 'Cl. 1', 'macho: bObbe , el- o bobbe; -s bobbe (el. 2), los -s a bobbe. * - cabrio rinakaborii (el. 5), el - cabrio e rinakaboríi; -s cabríos bana kaboríi (el. 6), los -s cabrios a banakaboríi. * bObbe (el. 3) el ratón - o obitya bobbe; robbe (el. 5) el pájaro carpintero - e ripi''e robbe; obbe (el. 7) el ciempiés - e esokólla obbe [eesokólla obbe); kobbbe (els. 9 y 10) la ser piente - e nóóa kobbe, i nóóa kobbe; lobbe (el. 1 1) la sardina - o lokollo lobbe; sobbe (el. 12) el pájaro - e sinorí sobbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
