  ('e''ee', 's.', 'f.', 'Cl. 7', 'mación: e''ee , la - e e''ee (e''ee]; afir maciones bi''ee (el. 8), las afirmaciones e bi''ee.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rortó', 'S.', 'm.', 'Cl. 5', 'macuto: rortó , ribeki , el - e rortó, e ribeki; -s bOttó (el. 6), abeki (el. 6), los -s a bortó, a abeki.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('j', 'S.', NULL, 'Cl. 7', 'madeja: madeja, S. j: epépo , la - e epépo [eepép po]; -s ipépo (el. 8), las -s e ipépo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'madera: madera, s. f bOsekke , la - o bosekke; -s besekke (el. 4), las -s e besekke. * tabla de kalabóro (el. 9), la - de madera e kalabóro; -s de madera kalabóro (el. 10), las -s de madera i kalabóro. madre, s''¡: oberíi (el. 1), mmé (el. 1), la - o obe ríi, o mmé; -s aberíi (el. 2), bómme (el. 2), las -s a aberíi, a bómme. * si una - tiene un hijo recibe halagos na oberíi a berí bóllá e puella ó obossó [na óberi a berÍ bólla e puellóbOssóo]. 2. - criadora opowári (el. 1), la - criadora o opo wári; -8 criadoras apowári (el. 2), las -s criado ras a apowári. madriguera, bolló (el. 3), bosilla (el. 3), la - o bOlló, o bosilla; -s e beolló (el. 4), e besilla (el. 4), las -s e beolló, e besilla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'madrugar: madrugar, v. ir¡[. o pupúlla; preso yo madrugo n la pupúlla, tú madrugas o la pupúlla, él madru ga a la pupúlla, etc.; paso punto yo madrugué n pupúri [m pupúri], tú madrugaste o pupúri, él madrugó a pupúri, etc.; paso duro yo madrugaba n pupuessi [m pupuessi], tú madrugabas o pupues si, él madrugaba a pupuessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'madurar: madurar, V. inf o hótta;pres. las frutas madu ran e bihMma bi lá hórta; paso punto las frutas maduraron e bihMma bi hótyi, e bihMma bi''á hótyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
