  ('ini', 'S.', NULL, 'Cl. 3', 'maldición: maldición, S. ini bOiko , buiko , bOhullá obé (el. 3), ebéttá (el. 7), la - o bOiko, o buiko, o bohullá obé, e ebéttá [eebéttá]; maldi ciones beiko (el. 4), biiko (el. 8), behullá ebé (el. 4), ibéttá (el. 8), las maldiciones e beiko, e biiko, e béhullá ebé, e ibéttá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
