  ('bontyo', 'S.', 'm.', 'Cl. 3', 'maleficio: bontyo , kobbó (el . 9), el - o bontyo, e kobbó; -s bentyo (el. 4), kobbó (el. 10), los -s e bentyo. i kobbó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 'S.', NULL, NULL, 'maleta: maleta, S. I lobakka (el. 1 1), la - o lobakka; -s bakka (el. \O), las -s i bakka. malévolo, moif. adj. *bé; obé (el . 1) un hombre - boie obé [boie óbbe]; abé (el. 2) unas personas malévolas batyo abé [batSo ábbe]. (efr. malo).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inlo', 'v.', NULL, NULL, 'malgastar: malgastar, v. inlo kappa; pm\". yo malgasto n la kap pa, tú malgastas o la kappa, él malgasta a la kappa, etc.; paso punto yo malgasté n kappi, tú malgastaste o kappi, él malgastó a kappi, etc.; paso duro yo malgastaba n kapessi, tú malgasta bas o kapessi, él malgastaba a kapessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
