  ('bosalábbe', 'adj.', NULL, 'Cl. 1', 'malicioso: malicioso, adj. bosalábbe , el - o bosa lábbe; -s basalábbe (el. 2), los -s a basalábbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
