  ('obé', 'adj.', NULL, NULL, 'malo: malo, adj. obé (els. 1: un hombre - boie obé [óbe] y 3: un árbol- botté obé [óbbe]), ribé (el. 5: el machete - e isaké ribé), )abé (el. 6b: el asunto - a labba labé), ebé (el. 7: pacto - ehat tá ebé), bé (el. 9: biznieto - natta bé), lobé (el. J I : ascensor -Ioatya lobé), sibé (el. 12: diabli llo - siribbO sibé), habé (el. 16: lugar - habba habé); -s abé (els. 2: hombres -s baie abé y 6: machetes -s basaké abé), ebé (el. 4: plátanos-s bekobbe ebé), ibé (el. 8: poblados -s biriia ibé), bé (el. \O: los biznietos -s i natta bé), tobé (el. 1 3: diablillos -s toribbo tobé).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
