  ('bOsalábbe', 'adj.', NULL, 'Cl. 1', 'malvado: malvado, adj. bOsalábbe , el- o bosalábbe; -s basalábbe , los -s a basalábbe. mantener I 469 malversar v. inf o kappa; preso el director mal versa el dinero o bOtákka a la kappa i bonnÍ [o botakká a la kappi bonnÍ], tú malversas todo mi dinero o la kappa i bonnÍ rÍ1 kubbaa [o la kappi bonnÍrÍl kúbbaa]; paso punto el director malversó todo el dinero de la empresa o bOtákka a kappi i bonnÍ kubbaa i e bÍsinessi [o bOtakká a kappí bon nÍ kúbbaa yé bisinessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
