  ('f', 's.', NULL, 'Cl. 1', 'mamá: mamá, s. f oberii , rnrné , la - o obe rii, o mmé; -s aberíi (el. 2), bórnme (el. 2), las -s a aberíi, a bórnme.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'mamar: mamar, v. ir¡f o áppa; preso yo mamo n la áppa, tú mamas o la áppa, él mama a la áppa, etc.; paso punto yo mamé n áppi, tú mamaste o áppi, él mamó a áppi, etc.; paso duro yo mamaba n ápessi, tú mamabas o ápessi, él mamaba a ápes si, etc. 2. dar de - o áppia; preso la mujer da de mamar a su hijo o waÍsso a la áppia o bóllá áí [o waissó a la appió bollaaí], si un niño llora, dale de mamar na bóllá a la bé''a, appiá bo [na bóllá á la bé''a appiá bó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('enyankue', 's.', 'm.', 'Cl. 7', 'mamarracho: enyankue , el - e enyankue [eeJlankue]; -s binyankue (el. 8), los -s e binyankue.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
