  ('kelle', 'S.', 'f.', 'Cl. 9', 'maravilla: kelle , eriOOlla , eiera (el. 7), la - e kelle, e eribolla [eeribolla], e eie ra [eeiera]; -s kelle (el. 10), biribolla (el. 8), biiera (el. 8), las -s i kelle, e biriOOlla, e biiera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
