  ('olólló', 'adj.', NULL, NULL, 'obsoleto: obsoleto, adj. olólló (el. 7: un objeto - ollé olól ló [olle ólolló J); -s biolólló (el. 8: unos objetos -s biollé biolólló [biolle biólolló D.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
