  ('ir', 'v.', NULL, NULL, 'obstruir: obstruir, v. ir¡[. o ntá; pres. el aluvión obstruye el canalón a baoppó ba lá ntá o boakká [a baoppó bá láa ntó boakká]; paso punto la suciedad obs truyó el agujero e ke''u e ntyí o bukká [e ke''u e ntJó bukká].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'obtener: obtener, V. inl o okkáa; preso el trabajador obtiene una buena paga o bOlakóláko a la okkáa ripeám rere [o bOlakóláko a lokká ripeám rere]; paso punto el ladrón obtuvo su beneficio e húb bé okkíi e ripeám ri áe [e hubbé ókkíé ripeám rááe].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'oca: oca, S. f etoró , la - e etoró ; -s bitoró (el. 8), las -s e bitoró.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elo''á', 'S.', 'm.', 'Cl. 7', 'océano: elo''á , el- e elo''á ; -s bilo''á (el. 8), los -s e bilo''á.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'ochenta: ochenta, adj. numo batyí1la bale .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'ocho: ocho, adj. numo bale ketto pa (els. 2 y 6: - perso nas batyo be bale ketto pa, - camas baatyé be bale ketto pa), biele ketto pa (els. 4 y 8: - histo rias beatta bié biele ketto pa, - poblados biriia bié bile ketto pa), nne ketto pa (el. 10: - sardi nas kollo ié nne ketto pa [kollo yé nne ketto paJ), tuele ketto pa (el. 13: - camisas tótte tué tuele ketto pa).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
