  ('bulabulla', 'S.', 'm.', 'Cl. 3', 'octubre: bulabulla , el mes de - o buéá bo a bulabulla [o bueá buá búlabulla], los meses de - e biéá bi a bulabulla [e bieá biá búla bulla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 7', 'ocultación: ocultación, S. l eleppo , la - e eleppo [eeleppo]; ocultaciones bileppo (el. 8), las ocul taciones e bileppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'ocultar: ocultar, v. ir¡[. o leppa; preso yo oculto n la leppa., tú ocultas o la leppa, él oculta a la leppa., etc.; paso punto yo oculté n leppi, tú ocultaste o leppi, él ocultó a leppi, etc.; paso duro yo ocultaba n lepes si, tú ocultabas o lepessi, él ocultaba a lepessi, etc. * - de alguien o lepella; preso tú me ocultas la verdad o la le lepella e ette [o la le lepelle ette].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'ocupación: ocupación, s. f mpó , elakó , la - e mpó, e elakó [relakkó]; ocupaciones mpo (el. 10), bilako (el. 8), las ocupaciones i mpo, e bilako.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'ocurrir: ocurrir, v. inf o héttáa; preso ocurre algo ha lá héttáa ollé [ha lá hettá ollé], no ocurre nada ha tyá héttáa ollé [ha tJá hettá ollé]; paso punto ocu rrió una maravilla ha hétyíi kelle [ha hetJí kelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'odiar: odiar, V. inf o kooa; preso yo odio n la kooa., tú odias o la kooa, él odia a la kooa, etc.; paso punto yo odié n kooi, tú odiaste o kooi, él odió a kooi, etc.; paso duro yo odiaba n koessi, tú odiabas o koessi, él odiaba a koessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribolló', 'S.', 'm.', 'Cl. 5', 'odio: ribolló , buehe , bokoa (Cl. 3), el - e ribolló, o buehe, o bokoa; -s abolló (Cl. 6), beehe (el. 4), bekoa (el. 4), los -s a abolló, e beehe, e bekoa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oríe', 'adv.', NULL, NULL, 'oeste: oeste, adv. oríe. * en el - se pone el Sol oríe ká ho rí lá lokka há e itohí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'ofender: ofender, v. ir¡[. o lehea, o leha; preso yo ofendo n la lehea, tú ofendes o la lehea., él ofende a la lehea, etc.; paso punto yo ofendí n lehei, tú ofendiste o lehei, él ofendió a Jehei, etc.;pas. duro yo ofendía n leheseei, tú ofendías o leheseei, él ofendía a leheseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

