  ('ir', 'v.', NULL, NULL, 'ofrendar: ofrendar, v. ir¡[. o para, o para robbo; preso la doncella ofrenda una cabra al espíritu del pue blo o bulla a la para robbo ra póríi e até o mmo á e eriia [o bulla a la para robbo e até ó mmo ériia]. oprimir I 485', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('enokoookko', 's.', 'm.', 'Cl. 7', 'ogro: enokoookko , el- e eookonokko [eenokonokko); -s biookoookko (el. 8), los -s e binokonokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
