  ('ini', 'v.', NULL, NULL, 'oír: oír, v. ini o ó''a; preso yo oigo n la ó''a [o lo''áa), tú oyes o la ó''a [o lo''áa), él oye a la ó''a [a lo''áa), etc.; paso punto yo oí o ó''i [no''íi), tú oíste o ó''i [bO''íi), él oyó a ó''i [o''íi), etc.; paso duro yo oía o ó''essi [no''essi), tú oías o ó''essi [bO''essi), él oía a ó'' essi [ti'' essi), etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('if', 'v.', NULL, NULL, 'ojear: ojear, v. if!f o ekkáa; preso yo ojeo el libro o la ekkáa e ribúkku [n lekké ribúkk.u), tú ojeas la historia escrita o la ekkáa o bOatta bO ireriia bO [o lekkó boatta bó íreriaa bó), él ojea a la ekkáa [a lekkáa), etc.; paso punto yo ojeé n ekkíi [nekkíi], tú ojeaste o ekkíi [wekkíi), él ojeó a ekkíi [ekkíi], etc.; paso duro yo ojeaba n ekessi [nekessi), tú ojeabas o ekessi [wekessi), él ojeaba a ekessi [ekessi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nokkó', 's.', 'm.', 'Cl. 9', 'ojo: nokkó , el- e nokkó; -s ookkó (el. 10), los -s i nokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'ola: ola, s. f bueba , la - o bueba; -s bieba (el. 8), las -s e bieba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('biitá', 's.', 'm.', 'Cl. 6', 'óleo: biitá , el- a biitá; -s biitá , los -s a biitá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'oler: oler, v. inf o hMmua; preso las calles de la ciudad huelen e beokóo bi e ripottó be lá hMmua [e beokó bié rípotto bé láa hMmua], tú hueles o la hMmua, él huele a la hMmua, etc.; paso punto la carne olió mucho o boIÍlmua bO hMmui sóté [o bÓJÍJmua bó hMmui sóté], los cadáveres olieron e birutta bi hMmui [e birutta bi hMmui), etc.; paso duro el palacio del presidente olía mucho e rihat ta ri o botákityé ri hMmuessi [e rihatta ro bótakii tJé rí hMmuessi), tú olías mucho, o hMmuessi, etc. 2. - bien o hakkáa, preso yo huelo bien o la hakkáa, tu camisa huele bien e sóne ó si lá hakkáa, él huele bien a la hakkáa, etc.; paso punf. la colo nia olió bien e seíJ.ti si hakkí, etc.; paso duro la casa olía bien e tyóbbo e hakéssi [e tJobbó é hákessi], tú olías bien o hakessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'olfatear: olfatear, v. inf o hMmuatella; preso el perro olfa tea mi llaga e puá e lá hMmuatella e peké m [e puá é lá hMmuatelle pekéém]; paso punto yo olfa teé la carne n hMmuateri o boIÍlmua [o hMmuate ró bommua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bompo', 's.', 'm.', 'Cl. 3', 'olfato: bompo , el- o bompo; -s bem po (el. 4), los -s e bempo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etéro', 's.', NULL, 'Cl. 7', 'olla: olla, s. etéro , la - e etém [eetéérh); -s bitérh (el. 8), las -s e bitérh.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bobbó', 's.', 'm.', 'Cl. 3', 'olor: bobbó , el- o bobbó; -es beobbó (el. 4), los -es e beobbó. * el - 00 se puede soportar o bobbó bo tá pa''e o biálla ó [o bobbó bó tá pa''o bíállo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'olvidar: olvidar, v. inf o lebálla, o ótalla; preso yo olvido mi calle n la ótalla o bokóo m [n lotállo bokóóro), tú olvidas tu nombre o la lebálla e ílla ó [o la lebálle illááó], él olvida quién es a la ótalla ká be o bOtyo e bo [a lotálla ká bé ó bOtJo e bó), etc.; paso punto yo olvidé o ótáám [notáam), tú ol vidaste o ótáám [bOtáam), él olvidó a ótáám [otáam], etc.; paso duro yo olvidaba n ótálessi [notálessi], tú olvidabas o ótálessi [bOtálessi), él olvidaba a ótálessi [otálessi), etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elebári', 's.', 'm.', 'Cl. 7', 'olvido: elebári , eótári , el - e elebári [eelebári], e eótári [eeótári); -s bilebári (el. 8), biótári (el. 8), los -s e bilebári, e biótári.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyekkú', 's.', 'm.', 'Cl. 9', 'ombligo: tyekkú , el - e tyekkú; -s tyekkú (el. 10), los -s i tyekkú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'omisión: omisión, s. f elebári , la e elebári [eele bári]; omisiones bilebári (el. 8), las omisiones e bilebári.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'once: once, adj. numo bó la bulé (els. 2 y 1; 4 Y 3), bó la rié (els. 6 y 5), bió la nné (els. 8 y 7), oó la lulé (Cls. 10 Y 1 1), nó la té (els. 10 Y 4), tó la silé (els. 13 y 12).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'operar: operar, v. inf o tatáa; preso el médico opera a la persona e rokútta a la tatáa o botyo [e rokuttá a la tató botJo]; paso punf. el médico chino operó a mi madre e rokútta ri o tonokkó ri tatyíi o obé ríi m [e rokuttá ró tónokkó ri tátJó oberíím).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'opresión: opresión, s. f bopippí , la - o bopippí; opresiones bepippí (el. 4), las opresiones e bepippí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'oprimir: oprimir, v. inf o bitta, o bityobaera; preso el presidente oprime a la gente o botákityé a la bityobaera a batyo [o botakíitJé a la bitJóbaera 486 / oración batSo], tú oprimes a tus obreros o la bityobae ra a balakóláko ó [o la bitSóbaera balakólákóó], él oprime a la bityobaera, etc.; paso punto el dignatario oprimió a todos o boitta a bityobae riia a batyo ba mmaa [o bOitta a bitSobaeríá batSo bammaa], tú oprimiste o bityobaeriia, él oprimió a bityobaeriia, etc.; paso duro yo opri mía n bityobaeresiia [m bitSobaeresiia], tú oprimías o bityobaeresiia, él oprimía a bit yo baeresiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

