  ('inf', 'v.', NULL, NULL, 'orar: orar, v. inf. o étta, o resálla; paso punto todos los malvados oraron ante el hijo de Dios a basa lábbe ba mmaa ba étyi e Elalló [a basalábbé bam maa bétSélalló].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('róhiáa', 's.', 'm.', 'Cl. 5', 'oratorio: róhiáa , tyonnó , el e róhiáa, e tyonnó; -s bóhiáa (el. 6), tyonnó (el. 10), los -s a bóhiáa, i tyonnó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eette', 's.', 'f.', 'Cl. 7', 'orden: eette , la - e eette ; órde nes biette (el. 8), las órdenes e biette.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'ordenar: ordenar, v. irif. o lekkia, sótya; preso yo ordeno n la lekkia, tú ordenas o la lekkia, él ordena a la lekkia, etc.; paso punto yo ordené n lekiia, tú ordenaste o lekiia, él ordenó a lekiia, etc.; paso duro yo ordenaba n lekiesiia, tú ordenabas o lekiesiia, él ordenaba a lekiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
