  ('bolekkia', 's.', 'm.', 'Cl. 1', 'organizador: bolekkia , el- o bOlek kia; -es balekkia (el. 2), los -es a balekkia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'organizar: organizar, v. inf. o lekkia;pres. yo organizo n la lekkia, tú organizas o la lekkia, él organiza a la lek kia, etc.;pas. punto yo organicé n lekiia, tú orga nizaste o lekiia, él organizó a lekiia, etc.; paso duro yo organizaba n lekiesiia, tú organizabas o lekiesiia, él organizaba a lekiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
