  ('sing', 's.', NULL, 'Cl. 1', 'orientador: orientador, s. sing. bohuella , el - o bohuella; -es bahuella (el. 2), los -es a bahuella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'orientar: orientar, v. inf. o huella, o akátella; preso yo oriento al muchacho n la huella o boseseppe [n la huello boseseppe], tú orientas al pueblo o la huella e eriia [o la huelleeriia], él orienta a la huel la, etc.; paso punto yo orienté n huem, tú orien taste a los extranjeros o huem a baríbáa [o hue má baríbáa], él orientó a huem, etc.; paso duro yo orientaba n huelessi, tú orientabas o huelessi, él orientaba a huelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ripúríi', 's.', 'm.', 'Cl. 5', 'origen: ripúríi , ribobbo , el - e ripúríi;·e ribobbo; orígenes apúríi (el. 6), abob bo (el. 6), los orígenes a apúríi, a abobbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'originar: originar, v. inf o tokká;pres. los extranjeros ori ginan follones a baríbáa ba lá tokká beláa; paso punto he originado un problema n tokkí boláa [n tokkí bóIla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'orilla: orilla, s. f bOribba , la - o boribba; -s berib ba (el. 4), las -s e beribba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bahNneri', 's.', 'f.', 'Cl. 6', 'orina: bahNneri , la - a bahNneri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epó', 's.', 'm.', 'Cl. 7', 'orinal: epó , sitúllu , el- e epó [eeppó], e sitúllu; -es ipó (el. 8), totúllu (el. 13), los -es e ipó, o totúllu.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'orinar: orinar, v. inf. o hNnera; preso yo orino n la (ba) hNnera [n la ba hNneró], tú orinas o la (ba) hNne ra [o la ba hNneró], él orina a la (ba) hNnera [a la ba hNneró], etc.; paso punto yo oriné n ba hNneriia, tú orinaste en la cama o ba hNneriia e raatyé wela [o ba bNnené raatSe wéIla], ella orinó a ba hNne riia, etc.; paso duro yo orinaba n ba hNneresi"a, tú orinabas o ba bNneresiia, él orinaba a ba hNnere siia, etc. * quiero - n lo''á bahNneri, n la na''á o b NneTÓ.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opúríi', 's.', 'm.', 'Cl. 1', 'oriundo: opúríi , el- o opúríi; -s apú ríi (el. 6), los -s a apúríi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'ornamentar: ornamentar, v. inf. o pippa; preso el alguacil ornamenta el ayuntamiento e eporosía e lá pip pa e tyóbbo á e eriia [eeporosiá é lá pippe tSobbó ériia]; paso punto las personas ornamentaron la entrada del pueblo con ramas y flores a batyo ba pippi o bolakka bo e eriia la beasso la bihN tyátya [a batSo bá píppi o bolakka buériia la beassó lá bihNtSátSa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopippo', 's.', 'm.', NULL, 'ornamento: lopippo (el. 1 1), el- o lopip po; -s pippo (el. lO), los -s i pippo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'ornar: ornar, v. i''!f o pippa, o akabia; paso duro las flores ornaban los sombreros de los ancianos e bihN tyátya bi akabiesiia e mbuttá bi e biobéolla [e bihNtSátSa biákabiesie mbuttá bié biobéoIla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOlollo', 's.', 'm.', 'Cl. 3', 'oro: bOlollo , el - o bolollo; -s belollo (el. 4), los -s e belollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sihutétete', 's.', NULL, 'Cl. 12', 'oruga: oruga, s.f. sihutétete , la - e sihutétete;-s tohutétete (el. 13), las -s o tohutétete. * - de la palmera lotyekke (el. 1 1), tyekke (el. 9), la oyente / 487 de la palmera o lotyekke, e tyekke; -s de la pal mera tyekke (el. 10), las -s de la palmera i tyekke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

