  ('inf', 'v.', NULL, NULL, 'pacer: pacer, v. inf o lollá; pres. las cabras pacen i póríi i lá lollá [i porí í la lolláa]; paso punto las ovejas pacieron i tyoru i lorí [i tJoru í lóríi]; paso duro los bueyes pacían i pókkó i lolessi [i pokkó í lólessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
