  ('buatébisapá', 's.', 'm.', 'Cl. 1', 'pacificador: buatébisapá , el- o bua tébisapá; -es batébisapá (el. 2), los -es a batébi sapá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehattá', 's.', 'm.', 'Cl. 7', 'pacto: ehattá , el - e ehattá ; -s bihattá , los -s e bihattá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'padecer: padecer, v. inl o batyáa; o o''á roppá; preso los enfermos padecen mucho a baloari ba lá batyáa sóté [a baloari ba lá batJá sóté], a baloari ba lá o''á roppá [a baloari ba ló''á roppá]; paso punto los presos padecieron en la cárcel a batyelemán ba batyía e tyaróm [a batJelemán ba bátJía e tJa róm]; paso duro tú padecías o batyesiia, o o''essi roppá [bo''essí róppa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
