  ('I', 's.', NULL, 'Cl. 5', 'paga: paga, s. I riobbo , ripeám , la e riobbo, e ripeám; -s baobbo (el. 6), apeám (el. 6), las -s a baobbo, a apeám.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'pagar: pagar, v. i''!f o obba; preso yo pago n la obba, tú pagas o la obba, ella paga a la obba, etc.; paso punto yo pagué n obbi, tú pagaste o obbi, ella pa gó a obbi, etc.; paso duro yo pagaba n obessi, tú pagabas o obessi, ella pagaba a obessi, etc. 2. a alguien o obella, o peálla; preso tú pagas a tu trabajador o la obella o bolakóláko ó [o la obello bOlakólákóó], ella paga a su marido a la obella o bObbe áí [a la obello bobbááí], etc.; paso punto el gobierno pagó a la gente e kóbinna a oberi a batyo [e kóbinna a oberá batJo], mi jefe no me pagó o mmása rÍl a ta le oberí [o mmása rÍl a ta le oberí], etc.; paso duro yo pagaba a mi tío n obe lessi o bOióppé rÍl [n obelessó boióppéérÍl].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyé', 's.', 'm.', 'Cl. 9', 'país: tyé , eriia , etúllá , el - e tyé, e eriia , e etúllá ; -es tyé (el. 10), biriia (el. 8), bitúllá (el. 8), los -es i tyé, e biriia, e bitúlla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyo', 's.', 'm.', NULL, 'paisano: botyo a e eriia ; mi me ayuda hoy o bOtyo ériarÍl a la le hepubbia lelló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sinorí', 's.', 'm.', 'Cl. 12', 'pájaro: sinorí , el- e sinorí; -s tono rí (el. 13), los -s o tonorí. * - carpintero ripi''e (el. 5), el - carpintero e ripi''e; -s carpinteros api''e (el. 6), los -s carpinteros a api''e. * - mos ca siloppo (el. 12), el - mosca e siloppo; -s mosca tOloppo (el. 13), los -s mosca o toloppo. * - grande elorí (el. 7), el- grande e elorí [eelo rí]; -s grandes bilorí (el. 8), los -s grandes e bilorí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 's.', NULL, 'Cl. 9', 'pala: pala, s. I pálla , la - e pálla; -s pálla (el. 10), las -s i pálla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
