  ('in', 'v.', NULL, NULL, 'parar: parar, v. in!, o mmia; preso el militar para el coche o obitábítta a la mmia o motóo [oobitábítta a la mmio motóo]. 2. -se o mma; preso el coche se para o motóo bO lá mma [o motó bó láa mma], la gente se para delante de la iglesia a batyo ba lá mma e tyotyi alo [a batSo bá láa mme tSotSallo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
