  ('inf', 'v.', NULL, NULL, 'parlamentar: parlamentar, v. inf. o pobba; preso yo parla mento n la pobba, tú parlamentas o la pobba, él parlamenta a la pobba, etc.; paso punto yo parlamenté n pobbi [m pobbi], tú parlamen taste o pobbi, él parlamentó a pobbi, etc.; paso duro yo parlamentaba n pobessi [m pobessi], tú parlamentabas o pobessi, ella parlamenta ba a pobessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
