  ('mmetya', 's.', 'm.', 'Cl. 1', 'payaso: mmetya , ometya , el o rnrnetya, o ometya; -s mmetya (el. 2), ametya (el. 2), los -s a mmetya, a ametya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'paz: paz, s. f bolekko , ehoihOi , la - o bOlekko, e ehoihoi [eehoíhOi]; -ces belekko (el. 4), bihoíhoí (el. 8), las -ces e belekko, e bihóíhoí. >1< hoja de la - ehoahooa (el. 7), ehooa (el. 7), la hoja de la - e ehoahooa [eehoahooa], e ehooa [eehooa]; hojas de la - bihoahooa (el. 8), bihooa (el. 8), las hojas de la - e bihoahooa, e bihooa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boi''o', 's.', 'f.', 'Cl. 3', 'peca: boi''o , bOnánna , la - o bOi''o, o bonánna; -s bei''o (el. 4), benánna (el. 2), las -s e bei''o, e benánna.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('m', 's.', 'm.', 'Cl. 5', 'pecho: 1. (seno) ribelle , el- e ribelle; -s abelle , los -s a abelle. 2. (tórax) eatyá (el. 7), el- e eatyá [eeattJá]; -s biatyá (el. 8), los -s e biatyá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eheká', 's.', 'm.', 'Cl. 7', 'pedazo: eheká , el - e eheká [eehek ká]; -s biheká (el. 8), los -s e biheká.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'pedir: pedir, v. inf o étta; o tyúbiera; preso yo pido n la étta [n lettáa], n la tyúbiera, tú pides o la étta [o lettáa], o la tyúbiera, él pide a la étta [a lettáa], a la tyúbiera, etc.; paso punto yo pedí n étyi [netJíi], n tyúbieriia, tú pediste o étyi [wetJíi], o tyúbie riia, él pidió a étyi [etJíi], a tyúbieriia, etc.; paso duro yo pedía n étessi [netessi], n tyúbieresiia, tú pedías o étessi [wetessi], o tyúbieresiia, él pedía a étessi [etessi], a tyúbieresiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buítya', 'S.', 'm.', 'Cl. 3', 'pedo: buítya ; el - o buitya; -s bítya (el. 8), e bítya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riatte', 'S.', 'm.', 'Cl. 5', 'pedregal: riatte , el - e riatte; -es baatte (el. 6), los -es a baatte.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ite', 's.', 'm.', 'Cl. 5', 'pedrusco: ite , el - e ite; -s bate (el. 6), los -s a bate.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'pegar: pegar, V. inf o óppa; pres. tú pegas a alguien o la óppa bOtyo [o loppá botJO], no pegues a nadie we óppe botyo [we oppe botJo]; paso punto tú pegaste a alguien o óppi botyo [bOppí bótJo], tú no pegaste a nadie o ta óppi botyo [o tóppi bótJo]; paso duro ella pegaba a ópessi [opessi], ella no pegaba ata ópessi [a tópessí]. 2. - con o opálla; preso tú pegas con un cinturón o la opál la ebelette [o lopállebelette], tú no pegas con un cinturón o tyá la opálla ebelette [o tyá lopál lebelette]; paso punto yo pegué con una fusta n opári bosuisuií [nopári bósuisuíi], tú pegaste con un zapato o opári sússu [bopári sussu], etc.; paso duro yo pegaba con un libro n opálessi ribúkku [nopalessí ribukku], tú pegabas con una camisa o opálessi sotte [bopalessí sotte], etc. 3. - por o 494 / peinado opella; preso ella pega a alguien por mí a la le opel la botyo [a la lópella bOtSo]; paso punto tú pegas te al ogro por él o bo operi e enokonokko [o boperénokonokko]; paso duro yo pegaba al ogro por ti n o opelessi e enokonokko [no opelesséno konokko]. 4. -se o olálla; preso nosotros nos pe gamos to la ba olálla o [to la bólallo], ellos se pegan bá la ba olálla o [bá la bólállo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyiori', 'S.', 'm.', 'Cl. 3', 'peinado: botyiori , el - o bOtyiori; -s betyiori (el. 4), los -s e betyiori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'peinar: peinar, v. i''!f o tyiolla; preso mi hermana peina a su perro o wetta IÍI a la tyiOlla e puá áí [o wettaaIÍI a la tJiolle puááí]; paso punto ellos peinaron a sus hijos ba tyiori a bOllá babO [ba tSíora bollá bábbO]. 2. -se o tyiOleea; preso me peino n la tyioleea, te peinas o la tyioleea, se peina a la tyiOleea, etc.; pa.\''. punto me peiné n tyioleei, te peinaste o tyiOleei, se peinó a tyioleei, etc.;pas. duro me pei naba n tyiOleseei, te peinabas o tyiOleseei, se peinaba a tyioleseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyiori', 's.', 'm.', 'Cl. 7', 'peine: etyiori , kónna , el - e etyiori [eetJiori], e kónna; -s bityiori (el. 8), kónna (el. 10), los -s e bityiori, i kónna. * - de largas púas epíópíó (el. 7), el - de largas púas e epíópíó [eepíópííó]; -s de largas púas ipíópíó (el. 8), los -s de largas púas e ipíÓpíÓ.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'pelar: pelar, V. inf o itolla; preso yo pelo el plátano n la itolla o bokobbe [n litollo bokobbe]; paso punto tú pelaste el ñame o itori e ello [witóréllo];pas. duro ella pelaba la patata a ituessi e ito''a [itues sé ito''a].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOlakka', 'S.', 'm.', 'Cl. 3', 'peldaño: bOlakka , el - o bolakka; -s beIakka (el. 4), los -s e belakka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'pelea: pelea, s. f buéllo , rioppo , la - o buél lo, e rioppo; -s biéllo (el. 8), baoppo (el. 6), las -s e biéllo, a baoppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'pelear: pelear, V. inf olálla; preso yo peleo n la olálla [n 100álla], tú peleas o la olálla [o lolálla], él pelea a la olálla [a lolálla], etc; paso punto yo peleé n olári [nolári], tú peleaste o olári [bolári], él peleó a olári [olári], etc. 2. -se o olálla; preso nosotros nos peleamos to la ba olálla o [to la bólallo], ellos se pelean bá la ba olálla o [bá la bólallo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 8', 'película: película, S. f birikirikki (Cl. 8), sínne (el. (2), la - e birikirikki, e sínne; -s birikirikki , tuín ne (el. 13), las -s e birikirikki, o tuínne.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botattá', 's.', 'm.', 'Cl. 3', 'pellejo: botattá , nanakóbbo , el - o bOtattá, e nanakóbbo; -s betattá (el. 4, nana kóbbo (el. 10), los -s e betattá, i nanakóbbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'pellizcar: pellizcar, v. i''!f o pua sibíkinnó; preso tú me pellizcas o la le pua sibíkinnó [o la le pua sibíkin nó]; imp. neg. no me pellizques we le pue sibí kinnó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
