  ('ekokopíppo', 'S.', 'm.', 'Cl. 7', 'pelmazo: ekokopíppo , el - e ekoko píppo [eekokopíppo]; -s bikokopíppo (el. 8), los -s e bikokopíppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

