  ('tyaróm', 'S.', 'm.', 'Cl. 9', 'penal: tyaróm , tokussubuélla , t yélle (el. 9), el- e tyaróm, o tokussubuélla, e tyélle; -es tyaróm (el. 10), tokussubuélla (el. 13), tyélle (el. 10), los -es i tyaróm, o tokussubuélla, i tyélle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'pender: pender, v. i''!f o sora; preso mi padre pende su escopeta o boie IÍI a la sora e etataa áí [o boierÍl a la soreetataaí]; paso punto mi camisa pendió durante tres días e sotte IÍI si sori billo bié bitá [e sótteIÍI sí sóri billo bié bittá]. pendiente, s . . f (adorno) erín (el. 7), losootyó (el. (1), el - e erín [eerín], la - o losootyó; -s biedn (el. 8), besootyó (el. 4), los -s e bierÍn las -s e besootyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('booppá', 's.', 'm.', 'Cl. 3', 'pene: booppá , petepétte , sipé pe (el. 12), el- o booppá, e petepétte, e sipépe. -s beoppá (el. 4), petepétte (el. 10), topepe (C1. 13), los -s e beoppá, i petepétte, o topepe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'penetrar: penetrar, v. inf o tálla; preso yo penetro n la tálla, tú penetras o la tálla, él penetra a la tálla. etc.; paso punto yo penetré n tári, tú penetraste o tári, él penetró a tári, etc.; paso duro yo penetra ba n tálessi, tú penetrabas o tálessi, él penetraba a tálessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
