  ('botapáeró', 's.', 'm.', 'Cl. 3', 'pensamiento: botapáeró , el- o bota páeró; -s betapáeró (el. 4), los -s e betapáeró.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'pensar: pensar, v. inf. o tapánna; pres. yo pienso n la tapán na, tú piensas o la tapánna, él piensa a la tapánna, etc.; paso punto yo pensé n tapán''a, tú pensaste o tapán''a, él pensó a tapán''a, etc.;pas. duro yo pen saba n tapánesiia, tú pensabas o tapánesiia, él pensaba a tapánesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'pepita: pepita, s. f puápúa , sipúa , la - e puápúa, e sipúa; -s puápúa (el. 10), topúa (el. 13), las -s i puápúa, o topúa. pequeño, a, adj. bokóokóo (els. 1 y 3: una per sona pequeña botyo bOkóokóo, un plátano pequeño bOkobbe bOkóokóo); bakóokóo (els. 2 y 6: unas personas pequeñas batyo bakóokóo, unas camas pequeñas baatyé bakóokoo); bekóokóo (el. 4: unos plátanos pequeños be kobbe bekóokóo); ekóokóo (el. 7: un poblado pequeño eriia ekóokóo); bikóokóo (el. 8: unos poblados pequeños biriia bikóokóo); kóokóo (el. 9 y 10: un animal pequeño nabba kóo kóo, unos animales pequeños nabba kookóo); lokóokóo (el. 11 : una prenda pequeña luua 10 kóokoo); sikóokóo (el. 12: una camisa pequeña sótte sikóokóo); tokóokóo (el. 13: unas camisas pequeñas tótte tokóokóo); hakóokóo (el. 16: un lugar pequeño a habba hakóokóo).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'pera: pera, s. f eápollo , la - e eápollo ; -s biápollo , las -s e biápollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'percibir: percibir, v. inf o Oátyera; o hMmuatella; preso yo percibo el ruido n la Oátyera e nokonokko [n 10átSere nokonokko], el perro percibe tu olor e puá e lá hMmuatella o bObbó ó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perder: perder, v. inf o ribbiáa;pres. mi tía pierde la pacien cia e enepó m a la ribbiáa o bOátyeri [eenepóm a la ribbió bOátSeri]. 2. - peso o sikkáa;pres. el enfermo pierde peso o bOloari a la sikkáa; paso punto el enfermo perdió peso o bOloari a sikkí; paso duro el abuelo perdía peso con los años o bOyólla a sikessi la báa. 3. -se o ribbáa; nos perdemos con la noche to la ribbáa la o bOtyíó [to la ribbá lo bOtSíÓ].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOnná', 's.', 'm.', 'Cl. 3', 'perdigón: bOnná , el- o bonná; per digones benná (el. 4), los perdigones e benná.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyieri', 's.', 'm.', 'Cl. 7', 'perdón: etyieri , botyiáeri , el e etyieri [eetSieri], o bOtyiáeri; perdones bityieri (el. 8), betyiáeri (el. 4), los perdones e bityieri, e betyiáeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perdonar: perdonar, v. inf o tyiálella; preso yo perdono n la tyiálella, yo perdono a mi hermano n la tyiálella o bobelle ID [n la tSiálello bObelleem]; paso punto yo perdoné n tyiáleri, tú perdonaste a mi herma no o tyiáleri o bObelle ID [o tSiáleró bObelleem].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perdurar: perdurar, v. inf o oppa; preso las cosas tradicio nales perduran e bilabba bi lá oppa; paso punto el dolor perduró e roppá ri oppi [e roppá rí óppi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perecer: perecer, v. inf o buá; paso punto mucha gente pereció con la tempestad batyo bikébíke ba buéi la e pullá [batSo bikébíké bá búéi le pullá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boríbáa', 's.', 'm.', 'Cl. 1', 'peregrino: boríbáa , bosalóetyi (el. 1), boetelló (el. 1), el - o boríbáa, o bosalóetyi; -s baríbáa (el. 2), basalóetyi (el. 2), baetello (el. 2), los -s a baribáa, a basalóetyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'pereza: pereza, s. f bueppé , la - o bueppé; -s beeppé (el. 4), las -s e beeppé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eeppé', 's.', 'm.', 'Cl. 7', 'perezoso: eeppé , elo''ó , epette (el. 7), el - e eeppé [eeppé], e elo''ó [eelo''ó], e epette [eepette]; -s bieppé (el. 8), bilo''o (el. 8), ipette (el. 8), los -s e bieppé, e bilo''ó, e ipette.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perforar: perforar, v. inf o butólla; preso yo perforo la lona n la butólla e etapóllo [n la butólleeta póllo], tú perforas la copa o la butólla e akák ka [o la butólle akákka], él perfora el machete a la butólla e isaké [a la butólle isakké], etc.; paso punto yo perforé n butóri [m butóri], tú perforaste o butóri, él perforó a butóri, etc.; paso duro yo perforaba n butuessi [m butuessi], tú perforabas o butuessi, él perforaba a butuessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'perfumar: perfumar, v. inf o hakkiáa; preso la doncella perfuma su habitación o bulla a la hakkiáa e etyubbá áí [o bulla a la hakkié tSubbá ááí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('senti', 's.', 'm.', 'Cl. 12', 'perfume: senti , el- e senti; -s tuenti (el. 13), los -s o tuenti.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

