  ('inl', 'v.', NULL, NULL, 'poner: poner, v. inl o heráa; preso yo pongo mi coche en casa n la heráa o motóo ID o tyóbbo [n la heró motómó tSobbo]; paso punto tú pusiste la manta en el agua o hería o bokutta a boppé wela [o herÍó bokutta a boppé wélla]. * - huevos o mpá beheú; preso la gallina pone huevos e kario''e e lá mpá beheú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 7', 'porción: porción, S. l ebabé , eheká , la - e ebabé [eebabbé], e eheká [eehekká]; porciones ibabé (el. 8), biheká (el. 8), las porciones e iba bé, e biheká.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
