  ('i', 's.', NULL, 'Cl. 6', 'posaderas: posaderas, s. i battáa , las - a battáa. * unas -s grandes battáa botee, las -s redondas a battáa ba bi''íi [a battá bá bí''íi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'posar: posar, v. ini (a) o hera; preso tu posas el vaso sobre el asiento o la bera e akákka e empa pua [o la heré akákkeempa puá]. (b) o mma; paso punto el pájaro posó en la rama e sinorí si mmi o boasso pua [e sinorí sí lÍlmio bOassópua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
