  ('inf', 'v.', NULL, NULL, 'poseer: poseer, v. inf. o okkáa; pres. yo poseo una tinca n okkíi buáám [kokkí buáám], tú posees un coche o okkíi motóo [bokkí mótto], él posee una cabra a okkíi póríi [okkí porí], etc.; paso punto yo poseí un pueblo n ka okkíi eriia [n kokkieriia], tú poseíste una cabaña o''a okkíi wettya [o''okkí wettSa], él poseyó una serpiente a''a okkíi nóóa [a''okkí nóoa], etc.; paso duro yo poseía la fuerza n okessi o to''ú [nokessó to''ú], tú poseías la sabi duría de tu abueUo o okessi e kuppá ó boyólla ó [bookessé kuppa o bóyóllaaó], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
