  ('ini', 'v.', NULL, NULL, 'predicar: predicar, v. ini o sá boatta; preso yo predico n la sá boatta [n la sa bóatta], tú predicas o la sá boatta [o la sa bóatta], él predica a la sá boatta [a la sa bóatta], etc.; paso punto tú predicaste o séi bOarta [o seí bóarta], vosotros predicasteis lo séi bOatta [lo seí bóarta] , ellos predicaron ba séi boat ta [ba seí bóatta], etc.; paso duro ella predicaba a sessi bOatta [a sessí bóatta], vosotros predica bais lo sessi boatta [lo sessí bóatta], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'predominar: predominar, v. inf o takkáa, o ittá obo''ó [o ittóbO''ó]; preso en el pueblo predominan los pescadores e eriia wela a baobbe ba ityí obo''ó [eeria wela a baobbe bítSóbo''ó]; paso punto el presidente predominó entre todos los gober nantes o botákityé ityí obo''ó a baitta wela ba r nmaa [o bOtakíitSé itSóbO''ó a baitta wela bam maa]; paso duro ayer predominaban las cabras en las casas mpári i póríi i takessi i tyóbbo wela [mpári i porí í tákessi i tSobbó wella].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
