  ('ini', 'v.', NULL, NULL, 'pregonar: pregonar, v. ini (a) o besólla (pas. punto besóri; paso duro besólessi). (b) o bétólIa (pas. punto bétó prevaricación / 501 ri; paso duro bétólessi). Ej . expr. pregonemos el fin de las prohibiciones e ibéttá to bi betólle [e ibéttá to bí bétólle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'pregunta: pregunta, s. f eiberi , la - e eihéri; -s biihéri (el. 8), las -s e biihéri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'preguntar: preguntar, v. inf o íha, o ihéra; o íhéra; pres. yo pregunto n la íha [n !íha], n la íhéra [n !íhéra], tú preguntas o la íha [o líha], o la íhéra [o !íhé ra], él pregunta a la íha [a !íha], a la íhéra [a !íhéra], etc. pas. punto yo pregunté n íhi [níhi], n ihériia [níberiia], tú preguntaste o íhi [wíhi], o ihériia [wíhériia], él preguntó a íhi [íhi], a ihé riia [íhériia], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buihéro', 's.', 'm.', 'Cl. 1', 'preguntón: buihéro , el- o buibero; preguntones biihéro (el. 2), los preguntones a biihéro.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riobbo', 's.', 'm.', 'Cl. 5', 'premio: riobbo , el - e riobbo; -s baobbo (el. 6), los -s a baobbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, NULL, 'prenda: prenda, s. f luua (el. I 1), la - o luua; -s kuua (el. 10), las -s i kuua.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'prender: prender, v. ir¡[. (apresar) o hMmota; (fuego) o bó''ia;pres. el agente de policía prende al ladrón e eporosía e 1á hMmota e húbbé [eeporosíá é láa hMmote húbbé], tú prendes los mimbres de pal ma o la bó''ia i kubbá [o la boyí kubbá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'prensar: prensar, v. inf (a) o bitta; preso nosotros prensa mos el orujo to la bitta i tyutyú [to la bitti tJutJú]; paso punto vosotros prensasteis el orujo lo bityi i tyutyú [lo bitJí tJ utJ ú]. (b) o anná (pas. punto anní, aaÍJ.; paso duro anéssi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'preocupación: preocupación, s. f bué''é , la - o bué''é; preocupaciones bié''é (el. 8), las preocupacio nes e bié''é.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'preocupar: preocupar, v. ini o ó''ia bué''é; preso este asunto preocupa a mi hermano elo elabba e lá ó''ia o bObélle IÍ1 bué''é [elélabba e ló''íó bObélle IÍ1 bué''é]. 2. -se o ó''a bué''é; preso me preocupo n la ó''a bué''é [n lo''á bué''é], te preocupas o la ó''a bué''é [o lo''á bué''é], se preocupa a la ó''a bué''é [a lo''á bué''é], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
