  ('l', 's.', NULL, 'Cl. 3', 'putrefacción: putrefacción, s. l bo''i , ebooi , la - o bo''i, e ebooi; putrefacciones beo''i (el. 4), mbboi (el. 8); las putrefacciones e beo''i, e mbooi. qué, ínter. kó, ká, ké; ¿ - quieres? kó o la na''a é?, ¿-haces? kó o la pénna é? ¿- es esto? ké e?', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 114 (entradas 2826 a 2850)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('in', 'v.', NULL, NULL, 'quebrar: quebrar, v. in! o átta, o bettáa; preso yo quiebro la piedra n la átta e ite [n latté ite], tú quiebras tu pierna n la bet táa o lopollá ó [o la bettó IOpollááó], él quiebra el plato a la átta e ehá [a latté eháa], etc.; paso punto la tormenta quebró el árbol e pullá e atyíi o bOtté [e pullá átJó bOtté], el cansan cio quebró sus piernas o botyibíi bO bettyí a apol lá ba áí [o bOtJibí bó bettJá apollá bááí]; paso duro yo quebraba n átessi [natessi], tú quebrabas o átessi [watessi], él quebraba a átessi [atessi], etc. 2. -se o átéa, o betéa; preso la olla se quiebra con el calor e etér Í l é la átéa la e húé [eetém é látéa le húúé], las piedras se quiebran a bate bá la átéa [a bate bá látééa]; paso punto sus piernas se quebra ron a apollá ba áí bá betéi [a apollá báí bá betééi]. * me duele la cabeza e etue m e lá átéa [eeruem é látééa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'quedar: quedar, v. in! o tyiálla;pres. yo quedo mal n la tyiál la labé, tú quedas bien o la tyiálla lelle, él queda a la tyiálla, etc.; paso punto yo quedé bien n tyiáán lelle [n tJíán lelle], tú quedaste o tyiáán, él quedó a tyiáán, etc.; paso duro yo quedaba n tyiálessi, tú quedabas o tyiálessi, él quedaba a tyiálessi, etc. 2. -se o tyiálla; pr eso yo me quedo en la ciudad n la t yiálla ripottó, tú te quedas sólo o la tyiálla we bulé bála, él se queda a la tyiálla, etc. 3. - limpio o hótta; paso punto la casa quedó limpia e tyóbbo é hótyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elakó', 's.', 'm.', NULL, 'quehacer: elakó (e. 7), mpó (eL 9), el - e elakó [eelakkó], e mpó; -es bilakó (eL 8), mp6 (el. 10), los -es e bilakó, i mpó. * los -es domésticos e bilakó bi i tyóbbo wela [e bilako bí tJóbbó weIla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'quejarse: quejarse, v. in! o seppa, o ruttya; preso me quejo n la seppa, te quejas o la seppa, se queja a la sep pa, etc.; paso punto me quejé n seppi, te quejaste o seppi, se quejó a seppi, etc.; paso duro me que jaba n sepessi, te quejabas o sepessi, se quejaba a sepessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('borutyo', 's.', 'm.', 'Cl. 3', 'quejido: borutyo , el - o bOrutyo; -s berutyo (el. 4), los -s e berutyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosepaseppa', 's.', 'm.', 'Cl. 1', 'quejón: bosepaseppa , el - o bose paseppa; quejones basepaseppa (el. 2), los quejo nes a basepaseppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'quemar: quemar, v. inf o tokka;pres. yo quemo las hierbas n la tokka e biruppú [n la tokke biruppú], tú que mas el coche o la tokka o motóo [o la tokko motOO], él quema la cola de la ardilla a la tokka o oosikké 00 o oosOppé [a la tokko bOsikke bO bósOp pé], etc.;pas. punto yo quemé las hierbas n tokki e biruppú [n tokkie bíruppú], tú quemaste la caba ña o tokki o wettya [o tokkio wettJa], él quemó la r opa a tokki i kuua [a tokkí kuua], etc. paso duro yo quemaba n tokessi, tú quemabas o tokessi, él que maba a tokessi, etc. 2. -se o tokea; paso punto la casa se quemó e tyóbbo e tokei [e tJóbbo é tókeei].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'quemazón: quemazón, s. f watya , la - o watya; que mazones biatya (el. 8), las quemazones e biatya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'querella: querella, s. f bolláa , 10bááIÍl (el. 1 1), la o bolláa, o 10bááIÍl; -s belláa (el. 4), kobááIÍl (el. 10), las -s e belláa, i kobááIÍl.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'querellarse: querellarse, v. inf o obálla; preso nosotros nos querellamos con el presidente to la obálla la o bOtákityé [to lobállo botakíitJé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'querencia: querencia, S. f ehólIe , la - e ehólle [eehólle]; -s bihólle (el. 8), las -s e bihólle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'querer: querer, v. inf o hOlIáa, o na''a; preso yo quiero a la gente n la hOlláa a batyo, n la na''a a batyo, n hOrii a batyo [n hórá batJo], tú quieres pan o la na''aisi>ppo; paso punto yo quise a mi hermano n ka horii o bobel le lÍ1 [n ka hóró bObelleem]. * te quiero n o horii [no hórii], n la o na''a [n lo ná''a]. 2. -se o hóránna; preso nos queremos ro ha hóránna ó [to ha hóránno].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehólle', 'S.', 'm.', 'Cl. 7', 'querido: ehólle , el- e ehólle ; -s bihólle , los -s e bihólle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('karosíi', 'S.', 'm.', 'Cl. 10', 'queroseno: karosíi , el - i karosíi. quién, inter. ká be? ¿ - viene? ká be o botyo a lé''a púlóo?', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'quince: quince, adj. numo ó; - personas batyo be Ó, árboles batté be ó, - sardinas kollo yé Ó, - mil biera bié Ó. quinientos, a4j. numo bueráhekka; quinientas per sonas batyo be bueráhekka, quinientos plátanos bekobbe bié bueráhekka quinientos mil biera tyilla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('láppo', 'S.', 'm.', 'Cl. 9', 'quinqué: láppo , el- e láppo; -s láppo (el. 10), los -s i lappo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'quitar: quitar, V. inf o boálla, o bó''a; preso yo quito el asiento de la calle n la bó''a e empa o walállo [n la bo''émpa o walállo], tú quitas el paraguas del saco o la bó''a o lobetté e ribekki wela [o la bO''ó lobette ríbekki wella], él se quita el sombrero a la ha bó''a e ebuttá [a la ha bó''eebuttá], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lobetté', 'S.', 'm.', NULL, 'quitasol: lobetté (el. 1 1), el- o lobetté; -es betté (el. 10), los -es i betté.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('metá', 'adv.', NULL, NULL, 'quizá: quizá, adv. metá; - vaya mañana metá n la pooa obari [metá ft la pooa obari].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosikké', 's.', 'm.', 'Cl. 3', 'rabo: bosikké , bosi''e , el - o bosikké, o bosi''e; -s besikké (el. 4), besi''e (el. 4), los -s e besikké, e besi''e. Exp. el- del perro o bosikké bo e puá [o bosikke bué pua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rikikká', 's.', 'm.', 'Cl. 5', 'racimo: rikikká , el - e rikikká; -s bikikká (el. 6), los -s a bikikká. 1. - de dátiles maduros ebíla (el. 7), el- de dátiles maduros e ebíla [eebílla]; -s de dátiles maduros mbíla (el. 8), los -s de dátiles maduros e mbíla. 2. - de plátanos ebilákobbe (el. 7), ekobbe (el. 7), el de plátanos e ebilákobbe [eebilákobbe], e ekobbe [eekobbe]; -s de plátanos mbilákobbe (el. 8), bikobbe (el. 8), los -s de plátanos e mbi lákobbe, e bikobbe. 3. - de bananas enanáa (el. 7), enanákobbe (el. 7), el- de bananas e enanáa [eenannáa], e enanákobbe [eenanákobbe]; -s de bananas binanáa (el. 8), binanákobbe (el. 8), los -s de bananas e binanáa, e binanákobbe. 4. de dátiles inmaduros olió (el. 7), el- de dátiles inmaduros e olió; -s de dátiles inmaduros biiil ló (el. 8), los -s de dátiles inmaduros e biolló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'radio: radio, s. f riberi , aparato de - riberi, la e riberi; -s aberi (el. 6), las -s a aberí; - nacio nal de Guinea Ecuatorial e riberi ró bobba we Guinea Ecuatorial.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('r', 's.', NULL, 'Cl. 9', 'rafia: rafia, s. r tekka , la - e tekka; -s tekka (el. 10), las -s i tekka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rietyó', 's.', 'm.', 'Cl. 5', 'raíl: rietyó , el - e rietyó; -es baetyó (el. 6), los -es a baetyó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'raíz: raíz, s. f boakká , ribobbo , la - o boakká, e ribobbo; -ces beakká (el. 4), abobbo (el. 6), las -ces e beakká, a abobbo. * las - ces de mi tierra a abobbo ba e ribotyo rh [aabobbo be ribotSoorh].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

