  ('f', 's.', NULL, 'Cl. 7', 'raja: raja, s. f eaó , tyokké , la - e eaó [eeaaó], e tyokké; -s biaó (el. 8), tyokké (el. 10), las -s e biaó, i tyokké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'rajar: rajar, v. inf (a) o saatta; preso el cuchillo raja la piel del mono o lo'' obbá lo lá saatta o botattá !JO e po''a [o lo''obbá ló lá saatto botattá bué pó''a]; paso punto ayer rajé tu camisa mpári n saatyi e sótte ó [mpári n saatSé sotteeó]. (b) saJolla; preso la chapa de cinc raja los vestidos e tyallá e lá salOBa i kétyá [e tSallá é lá salolli kétSa]; paso punto el abuelo rajó la manta con sus uñas e obéolla e salori o bokutta la e bie''e bi áe [e obéól la e sáloro bokutta le bie''e biáe]. (e) o bebera; preso el calor raja el suelo e húé e lá bebera o bob ba [e hué é láa bebero bobba]. 2. -se o bebereea; preso la calabaza vinatera se raja e kobbí e lá bebereea [e kobbí é la bebereea].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekerétta', 's.', 'm.', 'Cl. 7', 'rallador: ekerétta , el - e ekerétta [eekerétta]; -es bikerétta (el. 8), los -es e bike rétta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'rama: rama, S. f boasso , etabbé , la - o boasso, e etabbé [eetabbé]; -s beasso (el. 4), bitabbé (el. 8), las -s e beasso, e bitabbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('m', 'S.', 'm.', 'Cl. 3', 'ramaje: !JOasso , el - o boasso; -s beasso (el. 4), los -s e beasso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 5', 'ramería: ramería, s. l ripelari , la - e ripelari; -s apelari (el. 6), las -s a apelari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('opelle', 's.', 'm.', 'Cl. 1', 'ramero: opelle , ehólolló , el o opelle, e ehólolló [eehólolló]; -s apelle (el. 2), bihólolló (el. 8), los -s a apelle, e bihólolló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etabbé', 's.', 'm.', 'Cl. 7', 'ramo: etabbé , el - e etabbé ; -s bitabbé , los -s e bitabbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'rana: rana, s. f enyeke , enyekábityi , la e enyeke [eeJ1ekke], e enyekábityi [eeJ1ekábittSi]; -s binyeke (el. 8), binyekábityi (el. 8), las -s e binyeke, e binyekábityi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sinópi', 's.', 'm.', 'Cl. 12', 'rape: sinópi , sibáka (Cl. 12), el - e sinópi, e sibáka; -s tonópi (el. 13), tobáka (el. 13), los -s o tonópi, o tobáka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 8', 'rapidez: rapidez, s. f ekasso (Cl. 7), la - e ekasso ; -ces bikasso , las -ces e bikasso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebíla', 's.', 'm.', 'Cl. 7', 'raquis: ebíla , el- e ebíla ;-s ( pI.) mbíla (el. 8), los -s e mbíla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'rascar: rascar, v. inl o apatta; preso yo rasco n la apatta, tú rascas o la apatta, él rasca a la apatta, etc.; paso punto yo rasqué n apatyi, tú rascaste o apa tyi [waapatSi], él rascó a apatyi, etc.; paso duro yo rascaba n apatessi [naapatessi], tú rascabas o apatessi [waapatessi], él rascaba a apatessi, etc. 2. -se o apatea; preso me rasco n la apatea, te rascas o la aparea, se rasca a la apatea, etc.; paso punto me rasqué n apatei, te rascaste o apatei, se rascó a apatei, etc.; paso duro me rascaba n apa teseei, te rascabas o apateseei [waapateseei], se rascaba a apateseei, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'raspar: raspar, V. inl (a) o apatta; preso yo raspo n la apatta, tú raspas o la apatta, él raspa a la apatta, etc.; paso punto yo raspé n apatyi, tú raspaste o apatyi [waapatSi], él raspó a apatyi, etc.; paso duro yo raspaba n apatessi [naapatessi], tú ras pabas o apatessi [waapatessi], él raspaba a apa tessi, etc. (b) o kanónna; pres. yo raspo la olla n la kanónna e etérh [n la kanónnetérh], tú raspas el suelo o la kanólla o bobba [o la kanónno bob ba], él raspa cl sofá a la kanónna e etetémpa [a la kanónneetetémpa], etc.; paso punto tú raspaste la pared o kanónni e eteppe [o kanónnéteppe]; paso duro ella raspaba el vaso a kanónessi e etyakka [a kanónessétSakka].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'rastrear: rastrear, v. inf o ubolla; preso los trabajadores rastrean el terreno a balakoláko ba lá ubOlla o bobba [a balakoláko bá lá ubollo bobba]. (b) o opotta; preso yo rastreo n la opotta [n lopotta], tú rastreas o la opotta [o lopotta], él rastrea a la opotta [a lopotta], etc.; paso punto yo rastreé n opo tyi [nopotSi], tú rastreaste o opotyi [bopotSi], él rastreó a opotyi [opotSi], etc.; paso duro yo rastrea ba n opotessi [nopotessi], tú rastreabas o opotes si [bopotessi], él rastreaba a opotessi [opotessi], etc. (c) o hMmuatella; pres. el perro rastrea e puá e lá hMmuatella; paso punto el perro rastreó e puá e hMmuateri; paso duro el perro rastreaba e puá e hMmuatelessi. (d) o utya; preso yo rastreo n la utya, tú rastreas o la utya, él rastrea a la utya, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 9', 'rata: rata, S. l kólló , la - e kólló; -s kólló (el. 10), las -s i kólló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obitya', 'S.', 'm.', 'Cl. 3', 'ratón: obitya , el - o obitya; ratones ebitya (el. 4), los ratones e ebitya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sibitya', 'S.', 'm.', 'Cl. 12', 'ratoncito: sibitya , el- e sibitya; -s tobitya (el. 13), los -s o tobitya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOsotyi', 'S.', 'm.', 'Cl. 3', 'rayo: bOsotyi , bOtyetyee , el- o bosotyi, o bOtyetyee; -s besotyi (el. 4), betyetyee (el. 4), los -s e besotyi, e betyetyee.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 5', 'razón: razón, S. l rMllo , taa ; tener - o okká roállo, no tener - o abbáa; la - e roállo, e taa, la - del pueblo e rMllo rá e eriia [e rMllo rériia]; razones bOállo (el. 6), taa (el. 10), las razones a bMllo, i taa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'reanimar: reanimar, V. inl o nnolla; preso yo reanimo n la nnolla, tú reanimas o la nnolla, él reanima a la nnolla, etc.; paso punto yo reanimé n nnori, tú reanimaste o nnori, él reanimó a nnori, etc.; paso duro yo reanimaba n nnuessi, tú reanima bas o nnuessi, él reanimaba a nnuessi, etc. 2. -se (a) o nnorea;pres. me reanimo n la nnorea, te reanimas o la nnorea, se reanima a la nnorea, etc.; paso punto me reanimé n nnorei, te reani maste o nnorei, se reanimó a nnorei, etc.; pas duro me reanimaba n nnueseei, te reanimabas o nnueseei, se reanimaba a nnueseei, etc. (b) o uhOlea;pres. me reanimo con el calor n la uholea la e húé [n luholea le húúé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 3', 'rebeldía: rebeldía, s. l buihó , bOnokoa , la o buihó, o bOnokoa; -s bihó (el. 8), benokoa (el. 4), las -s e bihó, e benokoa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'rebosar: rebosar, v. inl o hiia;pres. el aceite rebosa a bii tá ba lá hiia; paso punto el agua rebosó a boppé ba hii [a boppé bá híi]; paso duro el caldo rebosaba a bo''á ba hiessi [a bo''a bá híessi]. reducir / 509', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botákko', 's.', 'm.', 'Cl. 3', 'recado: botákko , lotóbbóo , el - o botákko, o lotóbbóo; -s betákko (el. 4), betóbbóo (el. 4), tóbbóo (el. lO), los -s e be tákko, e betóbbóo, i tóbbóo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
