  ('inf', 'v.', NULL, NULL, 'rechazar: rechazar, v. inf. o nakká, o ooa; preso yo rechazo n la nakká, n la ooa, tú rechazas o la nakká, o la ooa, él rechaza a la nakká, a la ooa, etc.; paso punto yo rechacé n nakkí, n ooi, tú rechazaste o nakkí, o ooi, él rechazó a nakkí, a ooi, etc.; paso duro yo rechazaba n nakessi, n oessi, tú recha zabas o nakessi, o oessi, él rechazaba a nakessi, a oessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ritáperi', 'S.', 'm.', 'Cl. 5', 'recibidor: ritáperi , el- e ritáperi; -es batáperi (el. 6), los -es a batáperi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ritáperi', 'S.', 'm.', 'Cl. 5', 'recibimiento: ritáperi , el- e ritápe ri; -s batáperi (el. 6), los -s a batáperi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'v.', NULL, NULL, 'recibir: recibir, v. inj: o tápella; preso tú recibes tu paga o la tápella e ripeárn o [o la tapelle ripeám o]; paso punto yo recibí al alcalde n táperi o botúkku [n taperó botukkúu]; paso duro nosotros recibíamos las cartas tO tápelessi e beatabeasso [to tapeles sé beatabeassó]. 2. - algo o pitta; pres. la mujer recibe un vestido o waísso a la pitta luua [o wais só la pitta luua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('isillo', 'S.', 'm.', 'Cl. 5', 'recodo: isillo , el - e isillo; -s basillo (el. 6), los -s a basillo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'recoger: recoger, V. inf. o ukka (pas. punto ukki; paso duro ukessi), o kulla (pas. punto kuri; paso duro kules si), o okka; pres. yo recojo mis cosas n la okka a lokko rn [n lokka lokkóórn], tú recoges los dáti les inmaduros o la okka e biolló [o IOkke biolló], ella recoge los dátiles a la okka i pillá [a lokki pillá], etc.; paso punto yo recogí n okki [nookki], tú recogiste o okki [bookki], él recogió a okki [ookki], etc.; paso duro yo recogía n okessi [noo kessi], tú recogías o okessi [bookessi], ella reco gía a okessi [ookessi], etc. r', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'reconciliar: reconciliar, V. inf. o betólla; preso yo reconcilio n la betólla, tú reconcilias o la betólla, él recon cilia a la betólla, etc.; paso punto yo reconcilié n betóri, tú reconciliaste o betóri, él reconcilió a betóri, etc.; pas. duro yo reconciliaba n betóles si, tú reconciliabas o betólessi, él reconciliaba a betólessi, etc. 2. -se o betólla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosakóo', 'S.', 'm.', 'Cl. 3', 'reconocimiento: bosakóo , bosákko (el. 3), el- o bosakoo, o bosákko; -s besakoo (el. 4), besákko (el. 4), los -s e besakóo, e besákko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'recordar: recordar, v. irif. o tapánna; preso yo recuerdo a mis paisanos n la tapánna a batyo bá e eriia rn [n la tapánna batJo bériaaffi], tú recuerdas las cosas del pasado o la tapánna e bilabba bi a r n r nalé [o la tapánne bilabba biá rnrnallé], ella recuerda a sus hijos a la tapánna a bóllá ba áí [a la tapánna bollá bááí], etc.; paso punto yo recordé n tapán''a, tú recordaste o tapán''a, él recordó a tapán''a, etc.; paso duro yo recordaba n tapáne siia, tú recordabas o tapánesiia, ella recordaba a tapánesiia, etc. 2. - algo a alguien o lebólla; preso a mi padre le recuerdo el pasado o boiern n la bO lebólla rnmalé [o boiern n la bO lébolla mmálle]; paso punto al alcalde le recordaron los hechos o botúkku ba bO lebóri e bilabba [o bOtukkú bá bó lebore bilabba]; paso duro ella me recordaba nuestro secreto a le lebólessi e ehat tá áó [a le lebuesséehattááó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riettyi', 'S.', 'm.', 'Cl. 5', 'recorrido: riettyi , el - e rietyi; -s baetyi (el. 6), los -s a baetyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eriko', 'S.', 'm.', 'Cl. 7', 'recoveco: eriko , el - e eriko [eerikko]; -s birikó (el. 8), los -s e biriko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esolló', 'S.', 'm.', 'Cl. 7', 'recreo: esolló , el- e esollo ; -s bisOlló , los -s e bisolló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buetákíó', 'S.', 'm.', 'Cl. 1', 'rector: buetákíó , el- o buetákíó; -es betákíó (el. 2), los -es a betákíó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolebóri', 'S.', 'm.', 'Cl. 3', 'recuerdo: bolebóri , elebóri , botapáero (el. 3), el- o bolebóri, e elebóri [eele bóri], o botapáero; -s belebóri (el. 4), bilebóri (el. 8), betapáero (el. 4), los -s e belebóri, e bile bóri, e betapáeró.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riheleri', 'S.', 'm.', 'Cl. 5', 'recurso: riheleri , el - e riheleri; -s baheleri (el. 6), los -s a baheleri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bi''í', 'adj.', NULL, NULL, 'redondo: redondo, adj. bi''í (els. 1 : esta persona está re donda OJó bOtyo a bi''í; 2: estas personas están redondas balo batyo ba bi''í; 3: el coco es re dondo o bOkóko bo bi''í; 4: los cocos son redondos e bekóko be bi''í; etc.).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'reducir: reducir, V. inf. o sikkiáa; preso el hambre reduce el vientre e tyallá e lá sikkiáa o buellá [e tJallá é láa sikkíó buelláa]; paso punto la pobreza redujo 510 / referencia mi vida e sibólló si sikía e ribOtyo m [e sibólló sí síkíé ribotSoom].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'referir: referir, v. inf o bélla (pas. punto béri; paso duro bélessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebuerabuera', 'S.', 'm.', 'Cl. 7', 'reflejo: ebuerabuera , el - e ebuera buera [eebuerabuera]; -s ibuerabuera (el. 8), los -s e ibuerabuera.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kesse', 's.', 'm.', 'Cl. 9', 'refrán: kesse , pe''o , el - e kesse, e pe''o; refranes kesse (el. 10), pe''o (el. 10), los refranes i kesse, i pe''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rileppo', 's.', 'm.', 'Cl. 5', 'refugio: rileppo , ileppo , el- e rileppo, e i1eppo; -s baleppo (el. 6), los -s a baleppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'refunfuñar: refunfuñar, V. inf (a) o ukkiáa, o ntóbba; preso yo refunfuño n la ukkiáa, n la ntóbba, tú refunfu ñas o la ukkiáa, o la ntóbba, él refunfuña a la ukkiáa, a la ntóbba, etc.; paso punto yo refunfuñé n ukía [nukía], n ntóbbi, tú refunfuñaste o ukía [bukía], o ntóbbi, él refunfuñó a ukía [ukía], a ntóbbi, etc.; paso duro mi abuelo refunfuñaba siempre o boyólla m ukÍl�siia ebéló eba, o boyól la m a ntóbessi ebéló eba. (b) o aúba; preso los niños refunfuñan cuando tienen que estudiar a bóllá ba lá aúba na ba tóri o e''áa [a bollá bá la aúba na ba tóro e''áa]; paso punto los trabajado res refunfuñaron a balakóláko ba aúbi; paso duro vosotros refunfuñabais lo aúbessi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'regalar: regalar, v. inf (a) o páa, o rásibia; preso yo regalo mi coche n la páa o motóO m [n la po mótóóm], tú regalas tu camisa o la rásibia e sótte ó [o la rásibie sótteeó], él regala su casa a la páa e tyób bo áí [a la pe tSóbbo ááí], etc.; paso punto yo rega lé n péi, n rásibiia, tú regalaste o péi, o rásibiia, él regaló a péi, a rásibiia, etc.; paso duro yo rega laba n pessi [m pessíi], n rásibiesiia, tú regala bas o pessi, a rásibiesiia, él regalaba a pessi, a rásibiesiia, etc. (b) o tyuhela; paso punto el jefe regaló dinero al niño o mmása a tyuheri o bóllá tyokko [o mmása a tSuheró bolla tSókko]; paso duro cada primero de año mi tío me regalaba una peseta o lóa ba papella o bOióppé m a le tyuhelessi bo''ollo [o luá ba papella o boióppém a le tSuhelessí bó''ollo]''', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOtuhó', 's.', 'm.', 'Cl. 3', 'regalo: bOtuhó , etyueri , ityuhó (el. 5), epityi (el. 7), etuheri (el. 7), ri''abbo (el. 5), el - o botuhó, e etyueri [eetSueri], e ityuhó, e epityi [eepittSi], e etuheri [eetuheri], e ri''abbo; -s betuhó (el. 4), bityueri (el. 8), batyuhó (el. 6), ipityi (el. 8), bituheri (el. 8), ba''abbo (el. 6), los -s e betuhó, e bityueri, a batyuhó, e ipityi, e bituheri, a ba''abbo. r', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rekeri', 'S.', 'm.', 'Cl. 5', 'régimen: rekeri , el - e rekeri; regí menes bekeri (el. 6), los regímenes a bekeri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

