  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'regocijarse: regocijarse, v. inf o hMmabi''o; preso nosotros nos regocijamos to la hMmabi''o; paso punto vosotros os regocijasteis to hMmíbí''o; paso duro ellos se regocijaban ba hMmesíbí''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehMmabi''o', 'S.', 'm.', 'Cl. 7', 'regocijo: ehMmabi''o , buello , el - e ehMmabi''o [eehMmabi''o], o buello; -s bihMmabi''o (el. 8), biello (el. 8), los -s e bihM mabi''o, e biello.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'regresar: regresar, v. inf (a) o hóra; preso los hombres regresan de la ciudad a baie ba lá hóra ripotló; paso punto las mujeres regresaron del mar a baísso ba hória e eloállo [a baissó bá hóriéloállol; paso duro los bueyes regresaban i pókkó i hórc siia. (b) o heráa; preso tú regresas pronto o la heráa bakasso [o la herá bakasso]; paso punt vosotros regresasteis tarde lo hería buatóo; pus. duro ella regresaba sola a hesiia bue bulé bála.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rihóra', 's.', 'm.', 'Cl. 5', 'regreso: rihóra , el- e rihóra; -s bahó ra (el. 6), los -s a bahóra. * ida y - bOiá bOhóra.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'regurgitación: regurgitación, S. f webba , la - o webba; regurgitaciones bebba (el. 4), las regurgitacio nes e bebba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'rehabilitación: rehabilitación, S. f riheri , la - e riheri; rehabilitaciones baheri (el. 6), las rehabilita ciones a baheri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'rehabilitar: rehabilitar, V. inf o hella; preso yo rehabilito n la he11a, tú rehabilitas o la hella, él rehabilita a la hella, etc.; paso punto nosotros rehabilita mos to heri, vosotros rehabilitasteis lo hen, ellos rehabilitaron ba heri [ba héri]; paso duro ella rehabilitaba a helessi, vosotras rehabilitabais lo helessi, etc. remo / 511', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rihattá', 's.', 'm.', 'Cl. 5', 'reino: rihattá , el- e rihattá; -s bahat tá (el. 6), los -s a bahattá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'reír: reír, v. in! o noatooa; . 2. -se o noatooa; preso me río n la noatooa, te ríes o la noatooa, se ríe a la noatooa, etc.; paso punto nosotros nos reímos to noitooa [to noitóoa], tú te reíste o noitooa [o noitóoa], etc.; paso duro ella se reía a noessitooa [a noessítóoa], tú no te reías o ta noessitooa [o ta nóessitóoa]. 3. -se de alguien o pobbá; preso te ries de mí ola le pobbá [o la le póbba], no te rías de mí we le pobbe; paso punto el mono se rió del cocodrilo e po''a e pobbí e rikettá [e po''a e pób bíé rikettá]; paso duro nosotros nos reíamos de las personas que no sabían nadar to pobessi a batyo ba tyi aan bá o be''a [to pobessá batJo ba tJí aan bó be''a].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekasokasso', 'S.', 'm.', 'Cl. 7', 'relámpago: ekasokasso , el- e ekaso kasso [eekasokasso]; -s bikasokasso (el. 8), los -s e bikasokasso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'relampaguear: relampaguear, V. inl o kasobia; preso el día relampaguea obotyo o lá kasobia; paso punto a medíodía relampagueó o bokó bOtello bo kaso biia; paso duro toda la noche relampagueaba o botyíó bo rnrnaa bo kasobiesiia [o bOtJíó bóm maa bó kásobiesiia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOsossó', 's.', 'm.', 'Cl. 3', 'relato: bOsossó , el - o bOsossó; -s besossó (el. 4), los -s e besossó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bososuella', 'S.', 'm.', 'Cl. 1', 'relator: bososuella , el- o bososuella; -es basosuella , los -es a basosuella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'relevancia: relevancia, S. f ekutyú , la - e ekutyú [eekutJú]; relevancias bikutyú (el. 8), las rele vancias e bikutyú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('isutto', 'S.', 'm.', 'Cl. 3', 'reloj: isutto (5); buátyi , el- e isutto, o buátyi; -es basutto (el. 6), biátyi (el. 8), los -es a basutto, e biátyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il', 'v.', NULL, NULL, 'relucir: relucir, v. il1:l o akabia, o erera; preso las casas relucen i tyóbbo i la erera, i tyóbbo i lá akabia; paso punto las hojas han relucido o tonta to ere riia [o tonta tuereriia], o tonta to akabiia [o tonta tuákabiia]; paso duro tus uñas relucían e bie''e ó bi ereresiia [e bie''eó biereresiia], e bie''e ó bi aka biesiia [e bie''eó biákabiesiia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribétto', 'S.', 'm.', 'Cl. 5', 'remanso: ribétto , el - e ribétto; -s abétto (el. 6), los -s a abétto.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'remar: remar, v. in! o nawera;pres. los pescadores reman deprisa a banakanakkáa ba lá nawera bakasso; paso punto el muchacho remó con la lluvia o boseseppe a naweriia la o lóllá [o bOseseppe a naweriia lo lóllá];pas duro nosotros remábamos ro naweresiia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'remediar: remediar, v. in! o hella; preso yo remedio n la bella, tú remedías ola bella, él remedia a la bella, etc. (pas. punto heri; paso duro belessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOlallo', 'S.', 'm.', 'Cl. 3', 'remedio: bOlallo , peppe , el o bolallo, e peppe; -s belallo (el. 4), peppe (el. 10), los -s e belallo, i peppe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohella', 'S.', 'm.', 'Cl. 1', 'remendador: bohella , el- o bohel la; -es bahella (el. 2), los -es a bahella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'remendar: remendar, v. ir¡[. o bella; preso tú remiendas tu pantalón o la hella e torosíssi ó [o la helle toro síssi ó]; pas. punto ella remendó su camisa a heri e sótte si áí [a here sótte sááí]; paso duro el pesca dor remendaba su red o boobbe a belessi e riot té ri áí [o boobbe a helessé riotté rááí]. 2. - para o helella (pas. punto heleri; paso duro helelessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'remitir: remitir, V. in! o ará, o arera; preso yo remito un libro n la ará ribúkku, yo remito un libro a mi hermana n la arera o wetta ID ribúkku [n larero wettam ríbúkku], tú remites un papel o la ará sipéppa, ella remite un saludo a la ará ebóallo, etc.; paso punto vosotros remitisteis un saludo lo aría ebóallo [Iuaríeboallo], vosotros remitisteis un saludo a vuestra abuela lo areriia o bonánna á nó ebóallo [Iuareríó bOnánnanueboallo]; paso duro el jefe remitía sus condolencias al pueblo o mmása a areresiia e ehe''ahe''a e eriia [o rnrnása areresíéehe''ahe''a eeriia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kappí', 's.', 'm.', 'Cl. 9', 'remo: kappí , tyákkó , el - e kappí, e tyákkó; -s kappí (el. 10), tyákkó (el. 10), los -s i kappí, i tyákkó. 512/ remolcar', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'remolcar: remolcar, v. inf o susulla;pres. el camión remol ca el coche e rikotye ri Já susulla o motóo [e rikotJe rí lá susullo motóO); paso punto el coche remolcó el cayuco o motóo bO susum o buátto [o motó bó súsumo buattóo);pas. duro yo remolcaba n susulessi, tú remolcabas o susulessi, él remol caba a susulessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

