  ('inf', 'v.', NULL, NULL, 'remover: remover, v. inf o tukka; preso el joven remueve los asuntos o boseseppe a la tukka e biJabba [o boseseppe á la tukke bilabba); paso punto tú removiste el asunto o tukki e elabba [o tukkié labba);pas. duro ella removía a tukessi, vosotros removíais lo tukessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'remunerar: remunerar, v. inf o peálla; preso neg. el gobier no no remunera a sus trabajadores e kóbinna a tyá la peálla a balakóJáko ba áí [e kóbinna a tJá la peálla balakóláko báái); paso punto yo he remunerado a la gente n peám a batyo [m peá má batJo); paso duro yo remuneraba n peálessi [m peálessi), tú remunerabas o peálessi, ella remuneraba a peálessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etuepópo', 's.', 'm.', 'Cl. 7', 'renacuajo: etuepópo , el- e etuepópo [eetuepóppo); -s bituepópo (el. 8), los -s e bitue pópO.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribolló', 's.', 'm.', 'Cl. 5', 'rencor: ribolló , botumanna (el. 3), etebebbe (el. 7), el- e ribolló, o botumanna, e etebebbe [eetebebbe); -es abolló (el. 6), betumanna (el. 4), bitebaibbe (el. 8), los -es a abolló, e betumanna, e bitebaíbbé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buiko', 's.', 'm.', 'Cl. 3', 'reniego: buiko , el - o buiko; -s biiko (el. 8), los -s e biiko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esálero', 's.', 'm.', 'Cl. 7', 'renombre: esálero , el - e esálero [eesálero); -s bisálero (el. 8), los -s e bisálero.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'reparar: reparar, v. inf (a) o lakaella;pres. nosotros repa ramos nuestro coche to la lakaella o motóo bo áó [to la lakaello motó buááó); paso punto vosotros r eparasteis vuestro barco lo lakaeri e sitímma si ánó [10 lakaeré sitimmá sánnó); paso duro ellos reparaban su error ba lakaeJessi e eityi ábó [ba lákaelesseeitJabbó]. (b) o hella (pas. punto heri; paso duro heIessi). 3. hacer - o lakaera; preso tú haces reparar tu asiento o la lakaera e empa ó [o la lakaereempaaó); paso punto ella hizo reparar el sofá a lakaeri e etetémpa [a lakéerétetémpa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boabba', 's.', 'm.', 'Cl. 1', 'repartidor: boabba , el- o boabba; -es baabba (el. 2), los -es a baabba. * clan de los -es baatuppo (el. 2).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'repartir: repartir, v. inf o abba;pres. yo reparto n la abba, tú repartes o la abba, él/ella reparte a la abba, etc.; paso punto yo repartí n abbi, tú repartiste o abbi, ella repartió a abbi, etc.; paso duro yo repartia 11 abessi, tú repartías o abessi, él repartía a abessi, etc. 2. - algo para alguien o abella; preso el maes tro reparte galletas a los alumnos o bue''iáa a la abella a bóllá bisikittí [n la abella bollá bísikittí); paso punto la mujer repartíó sardinas a la gente o waísso a aberí a batyo kollo [o waíssó a aberá batJo kollo); pas. duro yo repartía dátiles a mis herma nos n abelessi a boOOlle ro pillá [n abelessá boOOI lero pílla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riabbi', 's.', 'm.', 'Cl. 5', 'reparto: riabbi , el- e riabbi; -s baab bi (el. 6), los -s a baabbi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eleaeró', 's.', 'm.', 'Cl. 7', 'reposacabezas: eleaeró , el- e eleaeró [eeleaeró); -s bileaeró (el. 8), los -s e bileaeró.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'reposar: reposar, v. i''!f o ebbáa, o hebbáa; preso yo reposo n la hebbáa, tú reposas o la hebbáa, él reposa a la hebbáa, etc. paso punto yo reposé mi cabeza sobre tus piernas n hebbíi e etue ro e ipasso ó pua [n hebbíé etueem e ipassóópua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eheOOri', 's.', 'm.', 'Cl. 7', 'reposo: eheOOri , boebbó , el e eheberi [eeheberi), o boebbó; -s biheberi (el. 8), beebbó (el. 4), los -s e biheberi, e beebbó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'reprender: reprender, v. inf preso su hermano mayor le reprende o bonatú''ó áí a la bo tówálla; paso punto nosotros reprendimos al hechicero to tówám ü botyiáÍltyó [to towánó botJiáÍltJó); paso duro todas las personas reprendían al ladrón a batyo ba mmaa ba tówálessi e húbbé [a batJü bammaa ba towálessé hubbe]''', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('m', 's.', 'm.', NULL, 'representante: representante, s. m./f bOmmella (el. J), el - ti bOmmella; -s bammella (el. 2), los -s a barnmella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'reprobación: reprobación, s. f boiko , la - o bOiko; reprobaciones beiko (el. 4), las reprobaciones e beiko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'reprobar: reprobar, v. inf o ooa; preso yo repruebo n la ooa, tú repruebas o la ooa, él reprueba a la ooa, etc.; paso punto yo reprobé n ooi, tú reprobaste o ooi, él reprobó a ooi, etc.; paso duro yo repro baba n oessi, tú reprobabas o oessi, él reproba ba a oessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('akió', 's.', 'm.', 'Cl. 7', 'réprobo: akió , el - e akió; -s biakió (el. 8), los -s e biakió.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('nebba', 's.', 'm.', 'Cl. 9', 'reptil: nebba , el - e nebba; -es nebba (el. 10), los -es i nebba. retirar / 513', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'repudiar: repudiar, v. in! o hékia; paso punto la mujer repudió a su marido o waísso a hékía o bobbe áí [o waissó a hekíó bobbááí]; paso duro la gente del pueblo repudiaba a la doncella a batyo bá e eriia ba hékíesiia o bulla [a batSo béria ba hekíe síó bulla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'resarcir: resarcir, v. in! o obba (pas. punto obbi; paso duro obessi), o obella (pas. punto oberi; paso duro obe lessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'resbalar: resbalar, v. in! (a) o supútaIla; paso punto yo res balé n supútam, tú resbalaste o supútam, él resba ló a supútam, etc.; paso duro yo resbalaba n supú talessi, tú resbalabas o supútalessi, él resbalaba a supútalessi, etc. (b) o supútta (pas. punto supú tyi; paso duro supútessi). (c) o susúballa (pas. punto susúbam; paso duro susúbalessi). (d) sutalla ( pas. punto sutaam; paso duro sutalessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosutta', 's.', 'm.', 'Cl. 3', 'resbalón: bosutta , el- o bosutta; res balones besutta (el. 4), los resbalones e besutta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'reservar: reservar, v. inf o suppiáa; preso yo reservo un asiento n la suppiáa empa [n la suppiempa]; pas. punto yo reservé un asiento n suppía empa [n suppíempa]; paso duro tú reservabas asientos o supiesiia bimpa [o supíesíá bímpa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohorÍ', 's.', 'm.', 'Cl. 3', 'resfriado: bohorÍ1 , el - o bohorÍ1; -s behorÍ1 (el. 4), los -s e behorÍ1.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

