  ('eiábanna', 's.', 'm.', 'Cl. 7', 'resto: eiábanna , rappí , eiabara (el. 7), el- e eiábanna [eeiábanna], e rappí, e eia bara [eeiabara]; -s biiábanna (el. 8), bappí (el. 6), biiabara (el. 8), los -s e biiábanna, a bappí, e biiabara. 2. -s mortales bileppé (el. 8), los -s mortales e bileppé. 3. - animal bokkí (el. 3), el - animal o bokkí; -s animales beokkí (el. 4), los -s animales e beokkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'resucitar: resucitar, v. irif: o hNnolla, o nnolla;pres. el espi ritísta resucita al muerto o bohiammó a la nnol la o botyo e buéi ó [o bohiámmó á la nnollo botSo e buéyó]; paso punto tú resucitaste o nnori, ella resucitó a nnori, etc.; paso duro yo resucitaba n nnuessi, tú resucitabas o nnuessi, etc. 2. -se o hNnoreea, nnorea; paso punto dicen que Jesu cristo resucitó ollá a Elaló a nnorei.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'retahíla: retahíla, s. f ritOlállo , la - e ritolállo; -s batolállo (eL 6), las -s a batolállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('luua', 's.', 'm.', 'Cl. 11', 'retal: luua , elappá , el - o luua, e elappá [eelappá]; -es kuua (el. 10), bilap pá (el. 8), los -es i kuua, e bilappá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('pisíssi', 's.', 'm.', 'Cl. 9', 'retazo: pisíssi , el - e pisíssi; -s pisís si (el. 10), los -s i pisíssi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'retirar: retirar, v. inf. o bó''a; paso punto yo retiré el libro n bó''i e ribúkku [m bóyé ribúkku]; paso duro tú 514/ retiro retirabas las mantas o bó''essi e békutta [o bo''essé bekutta). 3. -se o koppia (pas. punto kopiia; paso duro kopiesiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rileppo', 's.', 'm.', 'Cl. 5', 'retiro: rileppo , el - e riJeppo; -8 baleppo (el. 6), los -s a baleppo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ripe''u', 's.', 'm.', 'Cl. 5', 'retoño: ripe''u , el- e ripe''u; -s ape'' u (el. 6), los -s a ape''u. r e torcer, v . inf. o rikkáa; preso yo retuerzo n la rikkáa, tú retuerces o la rikkáa, él retuerce a la rikkáa, etc.; paso punto yo retorcí n rikkíi, tú retorciste o rikkíi, él r e torcíó a rikkíi, etc.; paso duro yo retorcia n rikessi, tú retorcias o rikessi, él retorcia a rikessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esubari', 's.', 'm.', 'Cl. 7', 'retraso: esubari , el - e esubari [eesu bari); -8 bisubari (el. 8), los -s e bisubari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehánna', 's.', 'm.', 'Cl. 7', 'retrato: ehánna , el- e ehánna [eehán na); -s bihánna (el. 8), los -s e bihánna. r', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('riobbo', 's.', NULL, 'Cl. 5', 'retribución: retribución, s.f. riobbo , ripeám , la - e riobbo, e ripeám; retribuciones baobbo (el. 5), apeám (el. 5), las retribuciones a baobbo, a apeám. retroceder, v . in! o uéa; pres. el gobierno retro cede e kobinna e lá uéa; paso punto ellos retroce dieron ba uéi [búéi); paso duro la tempestad retrocedía e pullá ueseei [e pullá úeseei).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bokóso', 'S.', 'f.', 'Cl. 3', 'reuma: bokóso , tyollá , la - o bOkóso, e tyollá; -8 bekóso (el. 4), tyoIlá (el. 10), las -s e bekóso, i tyoJlá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eoperi', 'S.', 'f.', 'Cl. 7', 'reunión: eoperi , lokotto , riob bí (el. 5), bOkottO (el. 3), la - e eoperi [eeoperi), o IOkotto, e riobbí, o bokotto; reuniones bioperi (el. 8), bekotto (el. 4), baobbí (el. 6), las reu niones e bioperi, e bekotto, a baobbí. * - de paí ses loppó (el. 1 1).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'reunir: reunir, v. in! o okalla (pas. punto okari; paso duro okalessi), o okka (pas. punto okki;pas. duro okessi), o okanna (pas. punto okarn; paso duro okanessi), o kokkáa (pas. punto kokki, paso duro kokessi), o kót t a (pas. punto kOtyí; paso duro kotessi), o ulla (pas. punto uri; paso duro ulessD.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'reventar: reventar, v. inf. o púbbia, o póbbia;pres. el calor revienta la botella e húé e lá póbbia o bokoteri [e hué é la póbbio bOkoteri); paso punto ellos reventaron los caparazones ba póbiia e mpoppó [ba pobíé mpoppó). 2. -se o púbba, o póbba (pas. punto póbbi; paso duro póbessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

