  ('inf', 'v.', NULL, NULL, 'robar: robar, v. inf o ubáa; preso yo robo n la ubáa [o lubbáa], tú robas o la ubáa [o lubbáa], él roba a la ubáa [a lubbáa], etc.; paso punto yo robé o ubíi [oubbíi], tú robaste o ubíi [bubbíi], él robó a ubíi [ubbíi], etc.; paso duro yo robaba o ubessi [oubessi], tú robabas o ubessi [bubessi], él robaba a ubessi [ubessi], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'roca: roca, s. f ite , la - e ite; -s bate , las -s a bate. * - arcillosa siobbo , la - arci llosa e siobbo; -s arcillosas toobbo (el. 13), las -s arcillosas o toobbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribba', 's.', 'm.', 'Cl. 5', 'rocío: ribba , rubba , rimma (CL 5), riiba (el. 5), el - e ribba, e rubba, e rirnma, e riiba; -s bibba (el. 6), bubba (el. 6), barnma (el. 6), biiba (el. 6), los -s a bibba, a bubba, a bam ma, a biiba. * el - de la aurora e ribba ri a e eba r i [e ribba rébari].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'rodear: rodear, v. i''!f (a) o utta;pres. el gato rodea la casa e sipóssi si lá utta e tyóbbo [e sipóssi sí lá utte tJóbbo]; paso punto la serpiente rodeó a la galli na e nooa e utyi e kario''e [e oooá é útJe kario''e]; pas duro la riada rodeaba la cabaña a baoppo ba utessi o wettya [a baoppo bá útesso wettJa]. (b) o apála; preso tu hermano te rodea con los brazos o bObelle o a la o apála [o bobelleo a lo ápalla]; paso punto tú me rodeaste con el cinturón o le apári la e ebéleue [o le apári leebeleue]; pas duro tú me rodeabas con tus brazos o le apálessí. (c) o appa (pas. punto appi; paso duro apessi). utaerí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loutaeri', 's.', 'm.', NULL, 'rodeo: loutaeri (el. l l), el - o loutaeri; -s beutaeri (eL 4), utaeri (el. 10), los -s e beutaeri, i', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kallo', 's.', 'm.', 'Cl. 9', 'rodete: kallo , el - e kallo; -5 kallo (el. 10), los -s i kallo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, NULL, 'rodilla: rodilla, s. f eTÚu (eL 7), la - e eTÚua ; -s biTÚU (el. 8), las -5 e biTÚU.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boallo', 's.', 'm.', 'Cl. 3', 'rodillo: boallo , etetúbba (CL 7), el o bOallo, e etetúbba [eetetúbba]; -s beallo (CL 4), bitetúbba (el. 8), los -s e beallo, e bitetúbba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'rogar: rogar, v. inf (a) o tyúbiera;pres. yo ruego n la tyú biera, tú ruegas o la tyúbiera, él ruega a la tyúbie r a , etc.;pas. punto yo rogué n tyúbieriia, tú rogas te o tyúbieriia, él rogó a tyúbieriia, etc.; paso duro yo rogaba a Dios o tyúbieresiia e Ruppé [o tJu bieresíé ruppé]. (b) o étta (pas. punto étyi; paso duro étessi), o resálla (pas. punto resári; paso duro resá lessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

