  ('tolatolla', 'adj.', NULL, NULL, 'rojizo: rojizo, adj. tolatolla; expr. una tela rojiza luua lua tolatol1a [Iuua luá tolatolla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tolatolla', 'adj.', NULL, NULL, 'rojo: rojo, adj. tolatolla; expr. una camisa roja sotte sa tolatolla [sotre sa tolato11a].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribaIlá', 's.', 'm.', 'Cl. 5', 'rollito: ribaIlá , el - e riballá, el - de malanga rallada e riballá; -s aballá (eL 6), -s de malanga rallada aballá (eL 6), los -s a aballá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epéppa', 's.', 'm.', 'Cl. 7', 'rollo: epéppa , siotatyú''o (eL 12), el - e epéppa , e siotatyú''o; -s ipéppa (el. 8), tontatyú''o (el. 13), los -s e ipéppa, o too tatyú''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boátta', 's.', 'm.', 'Cl. 1', 'rompedor: boátta , el- o bOátta; -es baátta (eL 2), los -es a baátta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('if', 'v.', NULL, NULL, 'romper: romper, v. if!f (a) o átta;pres. yo rompo n la átta, tú rompes o la átta, él rompe a la átta, etc.; paso punto yo rompí n atyíi [oatJíi], tú rompiste o atyíi [watJíi], él rompió a atyíi [atJíi], etc.; paso duro yo rompía o atessi [natessi], tú rompías o atessi [watessi], él rompía a ates si [atessi], etc. (b) o saatta (pas. punto saatyi; paso duro saatessi). (c) o sana (pas. punto sari; paso duro salessi). (d) o atala (pas. punto atari; paso duro atalessi). (e) o bettáa (pas. punto betyíi; paso duro betessi). (t) o tyábba (pas. punto tyábbi; paso duro tyábessi). 2. -con o átála; preso yo rompo la piedra con un hacha o la átála e ite eaó [o latále iteeaaó]; paso 516/ rompiz punto él rompió el cuchiUo con una piedra a átá ri o lo''obbá la ite [atáró lo''obba lá ite]; pas. duro ella rompía su vaso con sus dedos a átálessi e etyakka la e bene be áí [atáh�ssétfakka le bene béááí]. 3. hacer - o betya (pas. punto betyía; paso duro betyesiia). 4. -se o átéa; paso punto el vaso se ha roto e akákka e átéi, se rompió el brazo o lobbó lo áí lo betéi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kólló', 'S.', 'm.', 'Cl. 9', 'rompiz: kólló , el- e kólló; -ces kólló (el. 10), los -ces i kólló.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'roncar: roncar, v. inf. o ukkiáa; preso yo ronco n la ukkiáa [n lukkiáa], tú roncas o la ukkiáa [o lukkiáa], él r onca a la ukkiáa [a lukkiáa], etc. paso punto yo ron qué n ukía [nukía], tú roncaste o ukía [bukía], él roncó a ukía [ukía], ete.;pas. duro nosotros ron cábamos to ukiesiia [tukiesiia], vosotros ronca bais lo ukiesiia [Iukiesiia], ellos roncaban ba ukiesiia [bukiesiia]. (b) o ikiáa (pas. punto ikía; paso duro ikiesiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'ronchar: ronchar, V. inf. o tyákobia; preso el perro roncha cuando come huesos e puá e lá tyákobia na é la rá biuhá [e puá é la tfakóbbia na é la ra bíúuhá]; paso punto tyákobiia; paso duro tyákobiesiia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'V.', NULL, NULL, 'rondar: rondar, V. ini (a) o utta; preso nosotros ronda mos la casa de la doncella to la utta e tyóbbo o bulla [to la utte tfobbó ó búlla], paso punto ellos rondaron la plaza ba utyi e riossa [ba útfe rios sal; paso duro tú rondabas el oratorio o utessi e róhiáa. (b) o utaella (pas. punto utaeri; paso duro utaelessi). (e) hokkáa (pas. punto hokkíi; paso duro hOkessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rukkió', 'S.', 'm.', NULL, 'ronquido: rukkió (el . 5), el - e rukió; -s bukió (el. 6), los -s a bukió.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('petté', 's.', 'm.', 'Cl. 9', 'ronzal: petté , el - e petté; -es petté (el. 10), los -es i petté.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('korokoroo', 's.', 'f.', 'Cl. 10', 'roña: korokoroo , la - i korokoroo;-s korokoroo (el. lO), las -s i korokoroo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lohétyá', 's.', 'f.', 'Cl. 9', 'ropa: lohétyá (el. 1 1), luua , la - o lohétyá, o luua; -s kétyá (el. 10), kuua (el. 10), las -s i kétyá, i kuua.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bossó', 's.', 'm.', 'Cl. 3', 'rostro: bossó , el - o bossó; -s bessó (el. 4), los -s e bessó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etatari', 'S.', 'm.', 'Cl. 7', 'roto: etatari , el - e etatari ; -s bitatari (el. 8), los -s e bitatari. * - en un tejido etatta (el. 7), el - en un tejido e etatta [eetatta]; -s en un tejido bitatta (el. 8), los -s en un teji do e bitatta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'roturación: roturación, s. f ekóri , la - e ekori [eekó ri]; roturaciones bikóri (el. 8), las roturaciones e bikóri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyóóm', 'S.', 'm.', 'Cl. 9', 'rubor: tyóóm , el - e tyóóm; -es tyóóm (el. 10), los -es i tyóóm.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehCleri', 'S.', 'm.', 'Cl. 7', 'ruego: ehCleri , el - e eheleri [eehele ri]; -s bihCleri (el. 8); los -s e bihe1eri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buitító', 'S.', 'm.', 'Cl. 3', 'ruido: buitító , nokonoko , kipáárn (el. 9), bompá (el. 3), buppá (el. 3), el - o bui titó, e nokonoko, e kipáám, o bompá, o buppá; -s bititó (el. 8), nokonoko (el. 10), kipáám (el. 10), bempá (el. 4), biuppá (el. 8), los -s e bititó, i nokonoko, i kipáám, e bempá, e biuppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'ruina: ruina, S. f rikappi , la - e rikappi; -s bakap pi (el. 6), las -s a bakappi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'rumiar: rumiar, v. inf. o bólláa, o nótya; preso la cabra rumia e póríi e lá bólláa [e porí é la bolláa], e póríi e lá nótya [e porí é láa notfáa]; paso punto bóríi, nótyía; paso duro bólessi, nótyesiia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('siporóko', 'S.', 'm.', 'Cl. 12', 'rumor: siporóko , el - e siporóko; -es toporóko , los -es o toporóko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'ruptura: ruptura, S. f esatta , la - e esatta ; -s bisatta , las -s e bisatta.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'rutina: rutina, S. f bOhNnó , la - o bohNnó; -s behNnó (el. 4), las -s e behNnó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

