INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('sátiré', 's.', 'm.', 'Cl. 12', 'sábado: sátiré , lokia , el - e sátiré. e lokia; -s tuátiré (el. 13), lokia (el. 10), los -s o tuátiré. i lokia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('s', 'adj.', NULL, 'Cl. 1', 'sabedor: sabedor, adj. s. buanna , buaoaburú , el - o buanna, o buanaburú; -es banna (el. 2), banabufÚ (el. 2), los -es a banna, a banabufÚ. saber, 1. v. ini o aona; preso yo sé o aao [naam], tú sabes o aan [waam], él/ella sabe a aao [aam], etc.pas. punt. yo supe o kaan [o kaam], tú supis te o aan [o''aam], él supo a aan [a''aam], etc.; paso duro yo sabía n anessi [oaoessi], tú sabías o anes si [wanessi], él sabía a anessi [anessi], etc. 2. para o anela (pas. punto aneri; paso duro aneles si). 3. - amargo o pettáa; preso esta corteza sabe amargo e\o elOlló e \á pettáa [eJo e\olló é la pet táa]; paso punto petyíi; paso duro petessi. 4. s. m. raam (el. 5), el - e raam; -es baam (el. 6), los -es a baam. Ej . expr. lo sé o láám, no quiero nada n tyá oa''a o aooa olé a mmuáae.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 3', 'sabiduría: sabiduría, S. f bokuppá , la - o bokuppá; -s bekuppá , las -s e bekuppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kuppá', 's.', 'm.', 'Cl. 9', 'sabio: kuppá , el - e kuppá; -s kuppá (el. 10), los -s i kuppá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bonotyó', 's.', 'm.', 'Cl. 3', 'sabor: bonotyó , el- o bOnotyó; -es benotyó (el. 4), los -es e benotyó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'v.', NULL, NULL, 'sacar: sacar, v. ini o bó''a; preso yo saco n la bó''a, tú sacas o la bó''a, él saca a la bó''a, nosotros saca mos to la bó''a, vosotros sacáis lo la bó''a, ellos sacan bá la bó''a [ba lá bo''áa]; paso punto yo saqué o bó''i [m bo''íi], tú sacaste o bó''i [o bo''íiJ, él sacó a bó''i [a bo''íi], etc.; paso duro yo sacaba o bó''essi [m bó''essi], tú sacabas o bó''essi, él sacaba a bó''essi, etc. 2. -la comida o tó''a (pas. punto tó''i; paso duro tó''essi). 3. - la comida a alguien o tó''ella (pas. punto tó''eri; paso duro tó''elessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohiammo', 'S.', 'm.', 'Cl. 1', 'sacerdote: bohiammo , pateri , el- o bohiammo, e pateri; -s bohiammo (el. 2), pateri (el. 10), los -s a bohiammo, ipateri. * su mo - Abba, el sumo - e Abba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribéki', 'S.', 'm.', 'Cl. 5', 'saco: ribéki , el- e ribéki; -s abéki (el. 6), los -s a abéki.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'V.', NULL, NULL, 'sacudir: sacudir, V. ini o ukká; pres. la tempestad sacude a los árboles e pullá e lá ukká a batté; paso punto el niño sacudió el sonajero o Mllá a ukkí e si tyakalébbo [o bollá ukkié sitJakalébbo]; pas. duro el aire sacudía la ropa e ehufÚru e ukessi i kuua [eehúrúru úkessíi kuua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i', 's.', NULL, 'Cl. 10', 'sal: sal, s. i srJIlo , la - i sollo. * sin - káké (el. 9).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'salar: salar, v. inf o solobbia; preso el cocinero sala el pescado o bOlappí a la sólobbia i tyué [o bOlappí a la sólobbii tJué]; paso punto mi madre saló la carne o oberíi lÍ1 a sólobiia o bolÍ1mua [ooberílÍ1 a solóbíó bolÍ1mua]; paso duro nosotros salába mos to sólobiesiia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'salida: salida, s. f buíríi , lopúríi , ripurí (el. 5), ripúla (el. 5), la - o buíríi, o lopúríi, e rípúrí, e ripúla; -s beíríi (el. 4), púríi (el. 10), apurí (el. 6), apúla (el. 6), las -s e beíríi, i púríi, a apurí, a apúla. * - de emergencia o lopúríi lo e ekasso [o 10purí luékasso].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'salir: salir, v. il''!l o púlláa; pres. yo salgo n la púlláa, tú sales o la púlláa, él sale a la púlláa, etc.; paso punto yo salí n púríi [m púríi], tú saliste o púríi, él salió a púríi, etc.; paso duro yo salía n puessi [m puessi], tú salías o puessi, él salía a puessi, etc. 2. - con alguien o puálla; preso yo salgo con Si tobOro n la puálla e Sitóboro [n la puálle sitóbO ro]; paso punto tú saliste con Rihóle o puám e Rihóle [o puámé riholle]; pas. duro ella salía con su jefe a puálessi o mmása áí [a puálessó mmá saai]. 3. - al encuentro o tóttáa; preso el presi dente sale al encuentro de los ancianos o botá kityé a la tóttáa e biobéolla [o bOtakíitJé a la totté biobéolla]; paso punto yo salf al encuentro de mi amigo n tótyíi o wéso''o 1Íl [n totJó weso''oo 1Í1]; paso duro la doncella salía al encuentro de su novio o bulla a totessi o bona''í áí [o bulla a totes só bona''íááí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 13', 'saliva: saliva, s. l tuái , la - o tuái.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('palláa', 's.', 'm.', 'Cl. 9', 'salón: palláa , epopollo (Cl. 7/8), el e palláa. e epopollo [eepopollo]; salones palláa (el. 10), bipopollo (el. 8), los salones i palláa. e bipopOllo. * - grande epopollo (el. 7), el grande e epopollo [eepopollo]; salones grandes bipopollo (el. 8), los salones grandes e bipo pollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 12', 'salsa: salsa, s. f súppu , la - e súppu; -s túppu (el. 13), las -s o túppu. * - de cangrejo súppu sá ká [súppu sá ka].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('patyípatyí', 's.', 'm.', 'Cl. 9', 'saltamontes: patyípatyí , el- e patyí patyi; -s patyípatyí (el. W), los -s i patyípatyí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'saltar: saltar, v. inf o patyíbba; preso la rana salta e enyeke e lá patyíbba; paso punto la persona saltó o bOtyo a patyíbbi; paso duro el grillo saltaba e kOlóbetté e patyíbessi [e kolóbetté é pátJíbessi]. 2. - un obstáculo o péréa; preso la gente salta la gran roca a batyo ba lá péréa e ite róte [a batJo ba lá perée ite róte]; paso punto yo salté el semáforo n péréi e tomólekke [m peréyé tomólekke], tú saltaste el coche o péréi o motóo [o peréyó motóo], etc.; paso duro la abuela saltaba el tron co o bOnánna a péreseei e ernmornmo [o bonánna a pereséyérnmornmo]. 3. - a la comba o tyubea; preso los chicos saltan a la comba a baseseppe ba lá tyubea; paso punto la muchacha saltó a la com ba o boláwáarí a tyubei; paso duro yo salté a la comba n tyubeseei. 4. - (se) (incumplir, transgre dir); preso el gobierno se salta las leyes e kóbin na a la eólla e biette [e kóbinna a leólle biette].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosorá', 's.', 'm.', 'Cl. 3', 'salto: bosorá , esórá , el- o bo sorá, e esórá [eesórá]; -s besorá (el. 4), bisórá (el. 8), los -s e besorá, e bisórá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'saludar: saludar, v. inf (a) o bóallo; preso yo saludo n la bóallo, yo te saludo n la o bóallo [n lo bóallo], yo saludo a la gente n la bóa a batyo allo [n la boá batJo allo]; pas. punt. la mujer saludó a su tío o waísso a bóyállo o boióppé áí [o waissó a bóyó boióppáyállo]; paso duro tú saludabas a las per sonas o bóesállo a batyo [o boesá batJo allo]. (b) o herállo (pas. punto heríállo;pas. duro hessiállo).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebóállo', 's.', 'm.', 'Cl. 7', 'saludo: ebóállo , el - e ebóállo [eebóállo]; -s mbóállo (el. 8), ibóállo (el. 8), los -s e mbóállo, e ibóállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'salvación: salvación, s. f riburí , la - e riburí; salva ciones aburí (el. 6), las salvaciones a aburí. * la - del pueblo e riburí ri e eriia [e riburi rériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oburó', 's.', 'm.', 'Cl. 1', 'salvado: oburó , el- o oburó; -s aburó (el. 2), los -s a aburó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obulabotyo', 'adj.', NULL, 'Cl. 1', 'salvador: obulabotyo , el- o obu labotyo; -es abulabatyo (el. 2), los -es a abula batyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'salvar: salvar, v. il''!l el bulla, o bulaella; preso yo salvo n la bulla, n la bulaella, tú salvas o la bulla, o la bulaella, ella salva a la bulla, a la bulaella, etc.; paso punto yo salvé n buri [m buril, n bulaeri [m bulaeri], tú salvaste o buri, o bulaeri, ella salvó sembrar / 519 a buri, a bulaeri, etc.; paso duro nosotros salvába mos to bulessi, to bulaelessi, vosotros salvabais lo bulessi, lo bulaelessi, ellos salvaban ba bules si [ba búlessi], ba bulaelessi [ba búlaelessi]. 2. -se o bulea; preso vosotros os salváis lo la bulea, ella se salva a la bulea, etc.; paso punto tú te sal vaste o bulei, ellos se salvaron ba bulei [ba búlei], etc.; paso duro nosotros nos salvábamos to buleseei, los niños se salvaban a bollá ba buleseei [a bollá bá búleseei], etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

