  ('bonnya', 'S.', 'm.', 'Cl. 1', 'sanador: bonnya , bosella , el o bonnya, o bosella; -es bannya (el. 2), basella (el. 2), los -es a bannya, a basella. inl o inna;pres. el médico sana e rokút ta a la inna [e rokuttá a la inna]; paso punto el sanador me sanó o bosella a le inni [o bosellá a le ínni] paso duro el sacerdote bubi sanaba al anciano o bohiammo a inessi e obéolla [o bo hiammo a inessé obéolla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boilori', 's.', 'm.', 'Cl. 3', 'saneamiento: boilori , el - o boilori; -s beilori , los -s e beilori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('enyekábityi', 'S.', 'm.', 'Cl. 7', 'sapo: enyekábityi , enyeke , el e enyekábityi [eepekábitSi], e enyeke [eepekke]; -s binyekábityi (el. 8), binyeke (el. 8), los -s e binyekábityi, e binyeke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('loantyotyo', 'S.', 'm.', NULL, 'sarampión: loantyotyo (el. 1 1), el- o loan tyotyo; sarampiones kantyotyo (el. 10), los sarampiones i kantyotyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, NULL, 'sardina: sardina, s. l lokollo (el. 1 1), la - o 10kollo; -s kollo (el. 10), las -s i kollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 7', 'sardineta: sardineta, s. l ehalle , la - e ehalle [eehalle]; -s bihalle (el. 8), las -s e bihalle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 10', 'sarna: sarna, s. l korokoroo , ribótyikka , tyori (el. 9), la - i korokoroo, e ribótyikka, e tyo ri; -s korokoróo (el. 10), abótyikka (el. 6), tyori (el. 10), las -s i korokoroo. a abótyikka, i tyori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 11', 'sarta: sarta, S. l 10tyíbbo , losibbó , lokó (el. 1 1), la - o lotyibbó, o losibbó, o lokó; -s tyíbo (el. 10), sibbó (el. 10), las -s i tyíbbo, i sibbó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 7', 'sartén: sartén, S. l ekko , la - e ekko ; sar tenes biekko (el. 8), las sartenes e biekko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohe', 'S.', 'm.', 'Cl. 1', 'sastre: bohe/la , telfáa , el- o bohella, e lelláa; -s bahella (el. 2), telláa (el. 1 0), los -s a bahel1a, i tetláa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 7', 'satisfacción: satisfacción, s. l ehMmabi''o , riokkó (el. 5), rimmarnrnabi''o (el. 5), la - e ehMmabi''o [eehMmabi''o], e riokkó, e rirnrnammabi''o; satis facciones bihMmabi''o (el. 8), baokkó (el. 6), bamrnammabi''o (el. 6), las satisfacciones e bihM mabi''o, a baokkó, a barnrnammabi''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebanda', 'S.', 'm.', 'Cl. 7', 'secadero: ebanda , el - e ebanda [eebanda]; -s ihanda (el. 8), los -s e ibanda.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'secar: secar, V. inl o héya; preso yo seco la camisa n la héya e sotte [n la heyé sotte]; paso punto tú secas te las hierbas o héía e biruppú [o heíé biruppú]; paso duro ella secaba la sábana a héyesiia o boassó [a heyesíó boassó]. * el río está seco e rie ri héi [e rié rí héi], la piscina está seca e eribba e tyetyéri [eeribba e tS yétS éri].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bookko', 'S.', 'm.', 'Cl. 3', 'secreto: bookko , ehattá , ehuáeri (el. 7), el - o bookko, e ehattá [eehattá], e ehuáe ri [eehuáeri]; -s beokko (el. 4), bihattá (el. 8), bihuáeri (el. 8), los -s e beokko, e bihattá, e bihuáe ri . * hablar en - o en voz baja o bualel1a; preso el ayudante del sacerdote habla en secreto e elotyí e lá bualella; paso punto los guerreros hablaron en secreto a abitábítta ba bualeem [abitabíttá bá buá leem]; paso duro mis padres hablaban en secreto a baiern ba bualelessi [a baiern bá buálelessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 9', 'sed: sed, S. l noberí , la - e noberí; -es noberí (el. 10), las -es i nobefí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'segar: segar, V. inf o hótya; preso yo siego n la hótya, tú siegas o la hótya, él siega a la hótya, etc.; paso punto yo segué, n hótyi, tú segaste o hótyi, él segó a hótyi, etc.; paso duro yo segaba n hótyessi, tú segabas o hótyessi, él segaba a hótyessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'seis: seis, adj. numo fa''a; - personas batyo be ra''a, historias beatta bié ra''a, - camas baatyé be ra''a, - pueblos biriia bié ra''a, - sardinas kol1o yé ra''a, - camisas tótte tué ra''a.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tomólekke', 'S.', 'm.', 'Cl. 9', 'semáforo: tomólekke , el - e tomó lekke; -s tomólekke (el. 10), los -s i tomólekke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boeppa', 'S.', 'm.', 'Cl. 1', 'sembrador: boeppa , el - o boeppa; -es baeppa , los -es a baeppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'sembrar: sembrar, V. ir¡[. o eppa; preso yo siembro n la eppa, tú siembras o la eppa, él siembra a la eppa, 520 / semejanza etc.; paso punto yo sembré n eppi, tú sembraste o eppi, él sembró a eppi, etc.; paso duro yo sem braba n epessi, vosotros sembrabais lo epessi, ellos sembraban ba epessi [ba épessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('losorá', 'S.', 'm.', NULL, 'semen: losorá (el. 1 1), el- o losorá; séme nes basorá (el. 6), los sémenes a basorá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 3', 'semilla: semilla, s. l waakká , la - o waakká; -s biaakká (el. 8), las -s e biaakká. * - grande con vaina tyappa (el. 9), -s grandes con vainas tyappa (el. 10).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('elobbe', 's.', 'm.', 'Cl. 7', 'semillero: elobbe , el - e elobbe [eelobbe]; -s bilobbe (el. 8), los -s e bilobbe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inooá', 'S.', 'm.', 'Cl. 5', 'senado: inooá , el- e inooá; -s banoOá (el. 6), los -s a banooá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosekka', 's.', 'm.', 'Cl. 3', 'sendero: bosekka , siteJle , telle (el. 9), el - o bosekka, e sitelle, e telle; -s besekka (el. 4), totelle (el. 13), telle (el. lO), los -s e besekka, o totelle, i telle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

