  ('ribelle', 'S.', 'm.', 'Cl. 5', 'seno: ribelle , el e ribelle; -s abeJle (el. 6), los -s a abeJle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 12', 'sensitiva: sensitiva, s. l soototya , la - e soototya; -s toototya , las -s o toototya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'sentarse: sentarse, V. inl o itanno, o péla''illo; preso yo me siento n la itanno [n litánno], n la péla''illo, tú te sientas o la itanno [o litánno], o la péla''illo, él se sienta a la itanuo [a litánno], a la péla''illo, etc.; paso punto nosotros nos sentamos to ityínno [tuitSínno], to pérÍl''íllo, vosotros os sentasteis lo ityínno [luitIínno], 10 pérÍl''íllo, ellos se sen taron ba ityínno [bítSínno], ba péIÍ l''íllo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 3', 'sentencia: sentencia, S. l boakko , riakkí , la o boakko, e riakkí; -s beakko (el. 4), baakkí (el. 6), las -s e beakko, a baakkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'sentir: sentir, V. inf o o''áa; preso yo siento n la o''áa [n lo''áa], tú sientes o la o''áa [o lo''áa], él siente a la o''áa [a lo''áa], etc.;pas. punto yo senti n o''íi [no''íi], tú sentiste o o''íi [bo''íi], él sintió a o''íi [o''íi], etc.; paso duro yo sentía n o''essi [no''essi], tú sentías o o''essi [bo''essi], él sentía a o''essi [O''essi], etc. 2. -se o o''áa, o o''éa (pas. punto o''éi; paso duro o''eseei).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 's.', NULL, 'Cl. 3', 'señal: señal, s. l boi''o , bui''o , esúa (el. 7), la - o boi''o, o bui''o, e esúa [eesúa]; -es bei''o (el. 4), bisúa (el. 8), las -es e Mi''o, e bisúa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'señalar: señalar, V. inl (a) o ikkia; preso yo señalo n la ikkia [n likkia], tú señalas o la ikkia [o likkia], él señala a la ikkia [a likkia], etc.; paso punto yo se ñalé n ikkiia, tú señalaste o ikkiia, él señaló a ikkiia, etc.; paso duro yo señalaba n ikiesiia, tú señalabas o ikiesiia, él señalaba a ikiesiia, etc. (b) o táppa (mostrar); paso punto táppi; paso duro tápessi. 2. - con el dedo o tokiera (pas. punto to kieriia; paso duro tokieresiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ntá', 'S.', 'm.', 'Cl. 1', 'señor: ntá , boie , rnrneá , el- e ntá, o boje, o rnrneá; -es bé ntá (el. 2), baie (el. 2), mmeá (el. 2), los -es a bé ntá, a baie, a mmeá. * -es de los pueblos móityé (el. 1), los -es de los pueblos a móityé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('l', 'S.', NULL, 'Cl. 5', 'separación: separación, S. l riatyi , riosso , rokanolla (el. 5) la - e riatyi, e riosso, e rokanol la; separaciones baatyi (el. 6), baosso (el. 6), bokanolla (el. 6), las separaciones a baatyi, a baosso, a bokanolla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'separar: separar, V. inl (a) o atyera; preso yo separo n la atyera [n latIera], tú separas o la atyera [o latSe ra], él separa a la atyera [a latSera], etc.; paso punto yo separé n atyeriia [natSeriia], tú separas te o atyeriia [watIeriia], él separó a atyeriia [atSe riia], etc.; paso duro yo separaba n atyeresiia [natSeresjia], tú separabas o atyeresiia [watSere siia], él separaba a atyeresiia [atSeresiia], etc. (b) o bo''ábi''o (pas. punto bo''íbí''o;pas. duro bo''essí bí''o); 2. - los dátiles o soppa (pas. punto soppi; paso duro sopessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tomaityi', 's.', 'm.', 'Cl. 13', 'septiembre: tomaityi , el mes de o buéá buá tomaityi, los meses de - e biéá biá tomaityi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('enno', 'S.', 'm.', 'Cl. 7', 'sepulcro: enno , ele''o , el - e enno [eenno], e ele''o [eele''o]; -s binno (el. 8), bile''o (el. 8), los -s e binno, e bile''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'sepultar: sepultar, V. inf o tyilella; paso punto el barro sepultó a los trabajadores e bitokkó bi tyileri a balakóláko [e bitokkó bí tIílerá balakólákko]; paso duro nosotros sepultábamos nuestro tesoro to tyilelessi e epopollo áó [to tIilelessépopollo ááó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyilella', 'S.', 'm.', 'Cl. 1', 'sepulturero: botyilella , el - o bo tyilella; -s batyilella (el. 2), los -s a batyilella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'ser: ser, V. ir¡[. o sá; - buena persona o sá botyo buebue, - culpable o abbáa;pres. yo soy ne, tú eres we, él es e. Ej . expr. yo soy una persona ne botyo, yo sobra / 521 soy bubi ne obóbée, yo soy de aquí m púrii hállo [m purí hállo], yo soy del pueblo de mi madre m púríi e eriia o oberíilÍl [m púrériia ó oberiffi]. 2. culpable o abbáa. 3. - capaz o pa''a (pas. punto pa''i; paso duro pa''essi), o pitta (pas. punto pityi; paso duro pitessi). 4. - de (origen) o púlláa (pas. punto púrii; paso duro puessi). Vadá''oma es de Riaba e Vadá''oma a púri Ri''ábba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('m', 's.', 'm.', NULL, 'serbal: (árbol) buekke (el. 3/6), opuppu (el. 3), ripuppu (el. 5), el - o buekke, o opuppu, e ripuppu; -es baekke (el. 6), epuppu (el. 4), apup pu (el. 6), los -es a baekke, e epuppu, a apuppu.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'serpiente: serpiente, s. f nóóa , bappa , la - e nóóa, e bappa; -s nooa (el. 10). bappa (el. 10), las -s i nMa, i bappa. * pequeña - sinMa (el. 12), sibappa (el. 12), pequeñas -s tonMa (el. 13), tobappa (el. 13).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('erísaríssa', 's.', 'm.', 'Cl. 7', 'serrucho: erísaríssa , esso , el e erísaríssa [eerísaríssa], e esso [eesso]; -s birisa ríssa (el. 8), bisso (el. 8), los -s e birísaríssa, e bisso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyubbá', 's.', 'm.', 'Cl. 7', 'servicio: etyubbá , el - e etyubbá [ee tSubbá]; -s bityubbá (el. 8), los -s e bityubbá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tokko', 's.', 'm.', 'Cl. 13', 'sesos: tokko , los -s o tokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'seta: seta, s. f boesuesu , eolóba , la - o boesuesu, e eOlóba [eeolóbba]; -s beesuesu (el. 4), biolóba (el. 8), las -s e beesuesu, e biolóba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ee', 'adv.', NULL, NULL, 'sí: sí, adv. ee, eée, áelé. * - señor ee e ntá, ee e bOie; - señora ee e mme.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'siembra: siembra, s. f rieppa , bOeppa , la - e rieppa, o boeppa; -s baeppa (el. 6), beeppa (el. 4), las -s a baeppa, e beeppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 7', 'sierra: sierra, s. f erísaríssa , esso , la e erísaríssa [eerísaríssa], e esso [eesso]; -s birísa ríssa (el. 8), bisso (el. 8), las -s e birísaríssa, e bisspo. * pez - boapíappí (el. 3), el pez o boa píappí; peces - beapíappí (el. 4), los peces - e beapíappí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 6', 'sífilis: sífilis, s. f bane''é , la - a bane''é.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

