  ('pittóo', 's.', 'm.', 'Cl. 9', 'silbato: pittóo , el - e pittóo; -s pittóo (el. 10), los -s i pittóo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buetyíi', 's.', 'm.', 'Cl. 3', 'silbido: buetyíi , el - o buetyíi; -s bie tyíi (el. 8), los -s e bietyíi. * 1. - producido con manos y boca esáporí (el. 7), el - producido con manos y boca e esáporí [eesáporí]; -s pro ducidos con manos y boca bisápori (el. 6), los-s producidos con manos y boca e bisápOrí. 2. - fuer te boseppe (el. 3), el - fuerte o bOseppe; -s fuertes beseppe (el. 4), los -s fuertes e beseppe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOhMma', 's.', 'm.', 'Cl. 3', 'silencio: bOhMma , el- o bohMma; -s behMma (el. 4), los -s e behMma.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'simpatía: simpatía, s. f rihóle , la - e rihóle; -s bahóle (el. 6), las -s a bahóle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'simpatizar: simpatizar, v. in/ o hóránna; preso nosotros dos simpatizamos tue appa ebá to ba hóránna o [tue apebá to ba hóránno]; paso punto mis padres han simpatizado con el tiempo a baie 1Íl ba''a ba hó ráán (hóránna) la e ebéló [a baielÍl bá''á bá horaan leebéló]; paso duro vosotros simpatizabais lo ba hóránesiia.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esélásélá', 's.', 'm.', 'Cl. 7', 'síncope: esélásélá , lokukke (el. 1 1), el - e esélásélá [eeséláséllá], o lokukke; -s bisé lásélá (el. 8), bekukke (el. 4), los -s e bisélásélá, e bekukke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eoso', 's.', 'm.', 'Cl. 7', 'sistema: eoso , el- e eoso ;-5 bioso (el. 8), los -s e bioso.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eruua', 's.', 'm.', 'Cl. 7', 'sitio: eruua , habba , eusso (el. 7), el- e eruua [eeruua], ahabba, e eusso [eeusso]; -s biruua (el. 8), bihabba (el. 8), biussO (el. 8), los -s e biruua, e bihabba, e biusso. * busco un para dormir n la utya habba ha lokke, n la utya eruua e lokke [n la utSeruua e lokke].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rippá', 's.', 'm.', 'Cl. 5', 'sobaco: rippá , rappáa , el - e rippá, e rappáa; -s bippá (el. 6), bappáa (el. 6), los -s a bippá, a bappáa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boseppa', 's.', 'm.', 'Cl. 1', 'soberbio: boseppa , el- o boseppa;-s baseppa (el. 2), los -s a baseppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sibotyílla', 's.', 'm.', 'Cl. 12', 'sobrenombre: sibotyílla , ribotyílla (el. 5), el - e sibOtyílla, e ribotyílla; -s tobotyil la (el. 13), abotyílla (el. 6), los -s o tobotyílla, a abotyílla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('neppó', 's.', 'm.', 'Cl. 9', 'sobrino: neppó , el - e neppó; -s nep pó (el. 10), los -s i neppó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 12', 'sociedad: sociedad, s. f sosierOO , ribotyo , orityo (el. 3), la - e sosieráa. o orityo; -es tosie roo (el. 13), las -es o tosieráa. a abOtyo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'socorrer: socorrer, v. inf o bulaella, o iálla; preso tú me socorres o la le bulaella [o la le búlaella], o la le iálla [o la le íalla]; paso punto el extranjero me socorrió o boríbáa a le bulaeri [o boribá a le bulaeri], o boríbáa a le iári [o bOribá a le íári]; paso duro el perro socorría al niño e puá e bulaelessi o bóllá [e puá é búlaelesso bollá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eiállo', 'S.', 'm.', 'Cl. 7', 'socorro: eiállo , el- e eiállo ; -s biiállo . los -s e biiállo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etetémpa', 's.', 'm.', 'Cl. 7', 'sofá: etetémpa , etetéuppa , el e etetémpa [eetetémpa], e etetéuppa [eetetéuppa]; -s bitetémpa (el. 8), bitetéuppa (el. 8), los -s e bitetémpa, e bitetéuppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('itohí', 's.', 'm.', 'Cl. 5', 'sol: itohí , el - e itohí; -es batohí (el. 6), los -es a batohí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOsobbá', 's.', 'm.', 'Cl. 1', 'soldado: bOsobbá , obitábítta , sotyáa (el. 9), el - o bosobbá, o obitábítta, e so tyáa; -s basobbá (el. 2), abitábítta (el. 2), sotyáa (el. 10), los -s a basobbá, a abitábítta, i sotyáa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'soldar: soldar, v. inf o bótanna; preso nosotros soldamos los hierros to la hOtanna e bekussú [ro la hOtanne bekussú]; paso punto la chica soldó la cuchara o boláwáari a botam e sipúúm [o bolawári a botáné sipúúm];pas. dur. la Madre Bisila soldaba todas las cosas o mmé Bisila a hOtanessi a lokko la mmaa [o mmé bisíla a bOtánéssá lokko lammaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'soledad: soledad, S. f ebákké , la - e ebákké [eebák ké]; -es ibákké (el. 8), las -es e ibákké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'solicitar: solicitar, v. ir¡f. o éttáa; preso los presos solicitan permiso a batyelemán ba lá éttáa winno [a batSelemán ba lá ettá winno]; paso punto ellos solicitaron un tiempo de descanso ba étyíi ebé ló a lohébbo [bétSébel0 a 10hébbOo];pas. duro tú solicitabas o étéssi [wetéssi], ella solicitaba a étéssi [etéssi], etc. 2. - la ayuda o colaboración de alguien o ohálla (pas. punto ohári; paso duro ohálessi). solidaridad, s''¡: rikokoo (el. 5), ritolari (el. 5), la - e rikokoo, e ritolari; -es bakokoo (el. 6), batolari (el. 6), las -es a bakokoo, a batolari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'sollozar: sollozar, V. inf. o se''úbba, o rutya; preso el bebé solloza e siné''e si lá se''úbba, e siné''e si lá rutya; paso punto yo sollocé n se''úbbi, n rutyi, tú sollozaste o se''úbbi, o rutyi, él soUozó a se''úbbi, a rutyi, etc.; paso duro nosotros sollozábamos to se''úbessi, to rutyessi, vosotros sollozabais 10 se''úbessi, lo rutyessi, ellas sollozaban ba se''ú bessi, ba rutyessi [ba rútSessi]. 2. - por alguien o rutyella; preso mi abuelo solloza por su espo sa o boyolla m a la rutyella o waísso áí [o boyol lam a la rutSello waissuááí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ese''úballa', 's.', 'm.', 'Cl. 7', 'sollozo: ese''úballa , erutya , el e ese''úballa [eese''úballa], e erutya [eerutSa]; -s bise''úballa (el. 8), birutya (el. 8), los -s e bise''ú baila, e birutya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obélle', 'S.', 'm.', 'Cl. 7', 'soltero: obélle , el - e obélle; -s bio bélle (el. 8), los -s e biobélle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebuttá', 'S.', 'm.', NULL, 'sombrero: ebuttá (Cl. 7), esokka (CI. 7), risok ká (el. 5), el - e ebuttá [eebuttá], e esOkka [ee sokka], e risOkká; -s mbuttá (el. 8), bisokka (el. 8), basOkká (Cl. 6), los -s e mbuttá, e bisOkka, a ba sOkká. * - de ala ancha etatabómbó (el. 7), el- de ala ancha e etatabómbó [eetatabómbó]; -s de ala ancha bitatabómbó (el. 8), los -s de ala ancha e bitatabómbó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

