INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('sityappa', 'S.', 'm.', 'Cl. 12', 'sonajero: sityappa , sityakalébbO (el. 12), el - e sityappa, e sityakalébbo; -s tO suegra / 523 tyappa (el. 13), totyakalébbo (el. 13), los -s o totyappa, o totyakalébbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'sonar: sonar, v. inf o katyábba; pres. la calabaza suena e etobba e lá katyábba [eetobba é la katSábba]; paso punto las campanas sonaron e bilebó bi katyábbi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOmpá', 's.', 'm.', 'Cl. 3', 'sonido: bOmpá , el- o bompá; -s bem pá (el. 4), los -s e bempá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'sonsacar: sonsacar, v. inf o haa;pres. yo sonsaco a tu her mano n la haa o bObelle o [n la hao bóbelleo]; ( pas. punto haai; paso duro haessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'soñar: soñar, v. inf o seballa; preso yo sueño n la seballa, tú sueñas o la seballa, él sueña a la seballa, noso tros soñamos con nuestro país to la seballa e eriia áó [to la seballeeriaaó], etc.;pas. punto ellos soña ron conmigo ba le sebaam, yo no soñé contigo n tá o sebaam [n to sebáárh], etc.;pas. duro tú soña bas o sebalessi, ella no soñaba con su jefe a ta sebalessi o rnmása áí [a ta sébalesso rnmásaaí].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'sopera: sopera, S. f ribésse , la - e ribésse; -s abésse (el. 6), las -s a abésse.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ehulá', 's.', 'm.', 'Cl. 7', 'soplo: ehulá , el- e ehulá ; -s bihulá (el. 8), los -s e bihulá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etupiáeri', 'S.', 'm.', 'Cl. 7', 'soporte: etupiáeri , buikka , el e etupiáeri [eetupiáeri], o buikka; -s bitupiáeri (el. 8), beikka (el. 4), los -s e bitupiáeri, e beikka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'sorber: sorber, V. inf o tyotyóbia; paso duro las ardillas sorbían las piñas de cacao e besoppé be tyotyó biesiia e bimmáloto [e besoppé bé tSótSóbíesíé bimmálotto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kinatto', 's.', 'm.', 'Cl. 9', 'sordo: kinatto , el - e kinattii; -s kinatto (el. 10), los -s i kinatto. * la asociación de -s o wallá wá i kinattii [o walla wí kinatto].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inj', 'V.', NULL, NULL, 'sorprender: sorprender, V. inj: o atyálla, o atyánna; 2. -se o atyánna.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebotyu', 'S.', 'm.', 'Cl. 7', 'sosiego: ebotyu , el - e ebotyu [eebo tyu]; -s ibotyu (el. 8), los -s e ibotyu. soso, a, S. m kokoppé (el. 9), káké (el. 9). * esta comida está - bolo bora''o bué kokoppé, bolo bora''o bué káké.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('buikka', 'S.', 'm.', 'Cl. 3', 'sostén: buikka , el - o buikka; soste nes beikka (el. 4), los sostenes e beikka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'sostener: sostener, v. inf o hMmota; preso yo sostengo n la hMmota, tú sostienes el pan o la hMmota e isoppo [o la hMmote isoppo], él sostiene el cuchi llo a la hMmota o lo''obbá [a la hMmoto lo''obbá], etc.; paso punto vosotros sostuvisteis las campa nas lo hMmotyi e bilebbó [10 hMmotSé bilebbó], tú sostuviste las gafas o hMmotyi e beleppo [o hMmotSé beleppo], etc.; paso duro los hombres sostenían los cuernos de los bueyes a baie ba hMmotessi a be''a bá i pókkó [a baie bá hMmotes sá be''a bi pókkó], etc. 2. - para alguien (ayudar) o hMmotaella; preso neg. no hay nadie que me pueda ayudar ha tyi botyo ná n ka hMmotaella le [há tSí bótSo ná n ka hMmotáelállee]; paso punto hMmotaeri; paso duro hMmotaelessi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botákkí', 's.', 'm.', 'Cl. 1', 'súbdito: botákkí , el - o botákkí; -s batákkí (el. 2), los -s a batákkí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'subir: subir, v. inf o obba; preso el gato sube las escale ras e sipóssi si lá obba e robbo [e sipóssi sí lá obbe robbo]; paso punto los ratones subieron las esca leras e ebitya be obbi e robbo [eebitSa be óbbie róbbo]; paso duro nosotros subíamos to obessi, ellas subían ba obessi [ha óbessi]. 2. - con o obal la; pres. la abuela sube con su bastón o bonánna a la oballa e sa''á si áí [o bOnánna a la oballe sa''a sááí]; paso punto yo subí con el aro n obari o lop páa [n obáró loppáa]; paso duro vosotros subíais con nosotros lo obessi la túe. 3. - para o obella ( pas. punto oberi; paso duro obelessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('epueri', 'S.', 'm.', 'Cl. 7', 'subordinado: epueri , el - e epueri [eepueri]; -s ipuéri (el. 8), los -s e ipueri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'suceder: suceder, v. inf o hettá; preso algo sucede ha lá hettá elabba [ha lá hettelabba]; paso punto los acontecimientos sucedieron esta mañana e bilabba bi hetyíi elo ebari [e bilabba bi hétSéleba ri]; paso duro algo sucedía cuando llegó ha hetes si helaba a''a pooi lá [ha hétessélabba a''a poí lá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sokko', 's.', 'm.', 'Cl. 12', 'suceso: sokko , elabba , el- e sokko, e elabba [eelabba]; -s tokko (el. 13), bilabba (el. 8), los -s o tokko, e bilabba.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 9', 'suciedad: suciedad, S. f ke''u , rintya , la - e ke''u, e rintya; -es ke''u (el. 10), batÍtya (el. 6), las -es i ke'' u, a batÍtya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('n''é', 'S.', 'm.', 'Cl. 9', 'sudor: n''é , hM''é , el- e n''é, e hM''é; -es n''é (el. 10), hM''é (el. 10), los -es i n''é, i hM''é. la', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('boiebó''o', 's.', 'm.', 'Cl. 1', 'suegro: boiebó''o , el- o boiebó''o; -s baiebó''o (el. 2), los -s a baiebó''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bobba', 's.', 'm.', 'Cl. 3', 'suelo: bobba , anno , hanno (el. 16), nno, el- o bobba, a anno; -s beobba (el. 4), los -s e beóbba; * en el - a anno.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyebbá', 's.', 'm.', 'Cl. 9', 'sueño: tyebbá , tollo , el - e tyebbá, o tollo; -s tyebbá (el. lO), tollo (el. 13), los -s i tyebbá, o tollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'suerte: suerte, s. f ri''uá , la - e ri''ua; -s ba''ua (el. 6), las -s a ba''uá. * no tengo - n ta okkíi ri''uá [11 tokki ri''uáa], n tyi ri''uá [n tSí rí''ua].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

