INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'v.', NULL, NULL, 'sufrir: sufrir, v. inf o batyáa; preso este anciano sufre mucho elo obéolla e lá batyáa; paso punto noso tros hemos sufrido mucho to''a batyía bi''o sóté [to''a batSíá bí''o sóté]; paso duro ellos sufrían ba batyésiia [ba bátSésiia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ripá''a', 'S.', 'm.', 'Cl. 5', 'sujetador: ripá''a , sosten , sitéppi (el. 12), el - e ripá''a, e sosten, e sitéppi; -es apá''a (el. 6), tosten (el. 13), totéppi (el. 13), los -es a apá''a, o tosten, o totéppi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sulufato', 's.', 'm.', 'Cl. 12', 'sulfato: sulufato , el- e sulufáto; -s tululá to (el. 13), los -s o tulujato.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'sumar: sumar, V. inf o okalla, o okanna; preso las muje res suman sus ñames a baísso ba lá okalla e billo bi ábo [a baissó bá lá okalle billo biábbo]; paso punto ellas sumaron sus vestidos ba okari i kuua i ábo [bókari kua yábbo]; paso duro nosotros sumábamos las piedras to okalessi a baté [too kal éssá batté].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'suplicar: suplicar, v. in[ o tyúbiera, o helélla; preso yo te suplico 11 la o tyúbiera [11 lo tSúbiera], n la o helélla [11 lo hélella]; paso punto tú suplicaste al policía o tyúbieriia e eporosía [o tSubíéríéporo síáa], o heléri e eporosía [o heléréporosíáa]; paso duro yo suplicaba n tyúbieresiia, 11 helélessi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosókkó', 'S.', 'm.', 'Cl. 1', 'supremo: bosókkó ; el- o bosókkó; -s basókkó , los -s a basokkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('oríe', 'S.', 'm.', NULL, 'sur: oríe; hay bubis en el- he abobée oríe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'suspirar: suspirar, v. inf o hebella; preso yo suspiro n la h1 5bella, tú suspiras o la hebella, ella suspira a la hebella, etc.; paso punto tú suspiraste o hebe ri, ellos suspiraron ba heberi [ba héberi]; paso duro nosotros suspirábamos to hebelessi, voso tros suspirabais lo hebelessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eh', 'S.', 'm.', 'Cl. 7', 'suspiro: eh15bérí , el- e ehebérí [eehe bérí]; -s bihebérí (el. 8), los -s e bihebérí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ini', 'V.', NULL, NULL, 'sustraer: sustraer, V. ini o ubáa;pres. yo sustraigo n la ubáa [n lubbáa], tú sustraes ola ubáa [o lubbáa], él sus trae a la ubáa [a lubbáa], etc.;pas. punt. yo sustra je dinero 11 ubíi tyokko [nubi tSokko], tú sustrajis te o ubíi [bubbíi], él sustrajo a ubíi [ubbíi], etc.; paso duro nosotros sustraíamos to ubéssi [tubéssi], vosotros sustraíais lo ubéssi [Iubéssi], etc. suyo, prono pos. áí (el. 1: su pariente o botyo áí [o botSo aaí], el. 7: su poblado e eriia áí [eeriaaí], el. 9: su serpiente e bappa áí [e bappaaí]); báí (el. 2: sus parientes a batyo báí, el. 6: sus mejillas a bakekko báí); buáí (el. 3: su historia o boatta bO áí [o boatta buááí]); ráí (el. 5: su mejilla e rikekko ri á í [e rikekko rááí]); biáí (el. 8: sus poblados e biriia bi áí [e biriia biááí]); yáí (el. 10: sus serpientes i bappa yáí); luáí (el. 11: su vestido o luua luáí); sáí (el. 12: su camisa e sotte sáí); tuáí (el. 13: sus cami sas o totte tuáí); háí (el. 16: su sitio a habba h á í).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('siosso', 's.', 'f.', 'Cl. 12', 'taba: siosso , si''osso , la - e siosso, e si''osso; -s toosso (el. 1 3), to''osso (el. 13), las -s o toosso, o to''ossO.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('obáka', 's.', 'm.', 'Cl. 3', 'tabaco: obáka , sibáka , el- o obáka, e sibáka; -s abáka (el. 6), tübáka (el. 13), los -s a abáka, o tübáka. * - molido sinópi (el. 12), el- molido e sinópi; -s molidos tonó pi (el. 13), los -s molidos o tünópi. * planta ción de - eberí á tübáka. * quiero - na na''a sibáka, na na''a tübáka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopásala', 's.', 'm.', 'Cl. 7', 'tábano: lopásala (el. 1 1), eputyú , el - o lopásala, e eputyú ; -8 kopásala (el. 10), los -8 i kopásala.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eteppe', 's.', 'm.', 'Cl. 7', 'tabique: eteppe , el - e eteppe [eeteppe]; -s biteppe (el. 8), los -8 e biteppe. * f ino siteppe (el. 12), el- fino e siteppe; -s finos toteppe (el. 13), los -8 finos o toteppe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'tabla: tabla, s. f bosekke , la - o bosekke; -s besekke (el. 4), las -s e besekke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bosekke', 's.', 'm.', 'Cl. 3', 'tablero: bosekke , el - o bosekke; -s besekke (el. 4), los -s e besekke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 12', 'tableta: tableta, s. f siseke , la - e siseke; -8 tose ke (el. 13), las -s o toseke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('siseke', 's.', 'f.', 'Cl. 12', 'tablilla: siseke , la - e siseke; -s tose ke (el. 13), las -s o toseke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('simpa', 's.', 'm.', 'Cl. 12', 'taburete: simpa , el - e simpa; -s tompa (el. 13), los -s o rompa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sipoppi', 's.', 'm.', 'Cl. 12', 'tacaño: sipoppi , el - e sipoppi; -s topoppi (el. 13), los -s o topoppi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOsií', 's.', 'm.', 'Cl. 1', 'taimado: bOsií , el- o bosií; -s basií (el. 2), los -s a basií.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ríkuku', 's.', 'f.', 'Cl. 5', 'tajada: ríkuku , la - e rikuku; -s baku ku (el. 6), las -s a bakuku.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'tajar: tajar, v. inf. (a) o átta; preso tú tajas o la átta [o lat táa], ellos tajan las naranjas ba lá átta e biren.tya [bá latté birentSa], etc.; paso punto ellos tajaron los cocos ba atyíi e bekóko [bátSé bekókko]; paso duro nosotros tajábamos los ñames to atéssi e billo [tuatéssé billo]. (b) o kétya (pas. punto ké tyía; paso duro kétyesiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('etyikóri', 'S.', 'f.', 'Cl. 7', 'tala: etyikóri , la - e etyikóri [eetSikó ri]; -s bityikóri (el. 8), las -s e bityikóri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ebulla', 'S.', 'm.', 'Cl. 7', 'talado: ebulla , el- e ebulla ; -s mbulla , los -s e mbulla. * - de árboles etyikori (el. 7), el - de árboles e etyikori [ee tSikori]; -s de árboles bityikori (el. 8), los -s de árboles e bityikori.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

