INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('inf', 'V.', NULL, NULL, 'taladrar: taladrar, V. inf. o butólla; preso la máquina tala dra la pared e emasÍÍn e lá butólla e eteppé [eemasín e láa butólleeteppe]; paso punto las má quinas taladraron el suelo e mmasíín bi butóri o bobba [e rnmasÍn bi butóró bobba]; paso duro vosotros taladrabais el árbol lo butólessi o bot té [lo butólessó botté].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'talar: talar, v. inf. o tyikólla; preso los blancos talan las palmeras a apanná ba lá tyikólla a abílla [a apan ná bá la tSikólla abílla]; paso punto ellos talaron los árboles ba tyikóri a batté [ba tSikórá batté]; paso duro nosotros talábamos to tyikólessi, to tyikuessi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribéki', 'S.', 'm.', 'Cl. 5', 'talego: ribéki , el - e ribeki; -s abéki (el. 6), los -s a abeki. 526 I talento', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolebóri', 's.', 'm.', 'Cl. 3', 'talento: bolebóri , el - o bOlebóri; -s belebóri (el. 4), los -s e belebóri.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOlallo', 's.', 'm.', 'Cl. 3', 'talismán: bOlallo , el- o bOlallo; talis manes belallo (el. 4), los talismanes e belallo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyikeleelé', 's.', 'm.', 'Cl. 9', 'talón: tyikeleelé , kekesse , el - e tyikeleelé, e kekesse; talones tyikeleelé (el. lO), kekesse (el. 10), los talones i tyikeleelé, i kekesse.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('álle', 'adv.', NULL, NULL, 'también: también, adv. álle, yo - quiero n la na''a álli [n la na'' alle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kunké', 's.', 'm.', 'Cl. 9', 'tambor: kunké , tamballé , el e kunké, e tamballé; -es kunké (el. lO), tamballé (el. lO), los -es i kunké, i tamballé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'tapar: tapar, v. in! o bit ya; preso la mujer tapa el bidón o waísso a la bit ya o bOlonká [o waissó la bitSo bOlonká]; paso punto ella tapó el bidón a bi tyi o bolonká [a bitSo bólonká]; paso duro voso tras tapabais el bidón lo bityessi o bolonká [lo bitSessó bOlonká].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ribatyu', 'S.', 'm.', 'Cl. 5', 'taparrabo: ribatyu , rekká , rioppa (el. 5), el - e ribatyu, e rekká; -s abatyu (el. 6), bekká (el. 6), baoppa (el. 6), los -8 a abatyu, a bekká.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rule''o', 'S.', 'm.', 'Cl. 5', 'tapón: rule''o , el - e rule'' o; tapones bale''o (el. 6), los tapones a bale''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'taponar: taponar, v. in! O bit ya; paso punto nosotros tapo namos el orificio con el incienso silvestre to bi tyi e pi''í la e behOlIá [to bitSe pí''i le behOlIá];pas. duro las personas taponaban el camino a batyo ba bityessi e telle [a batSo ba bítSesse telle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'tararear: tararear, v. in! o bella; preso los ancianos tara rean una canción e biobéolla bi lá bella loberí; paso punto las mujeres tararearon el himno a baísso ba beri e eeppó [a baissó bá béreeppóo]; paso duro ellos tarareaban todas las canciones ba belessi i berí kubbaa [ha bélessi berí kúbbaa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'tardar: tardar, V. in! o oppa; preso vosotros tardáis demasiado lo la oppa lobbó; paso punto los hom bres tardaron mucho a baie ba oppi sóté [a baie bá óppi sóté]; paso duro los caballos tardaban porque estaba lloviendo e biossi bi opessi kóri obOtyo ha séi lóllá [e biossi bí ópessi kóri obotSo há séí lóllá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('sitó''o', 's.', 'm.', 'Cl. 12', 'tarro: sitó''o , el- e sitó''o; -s totó''o (el. 13), los -s o totó''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'V.', NULL, NULL, 'tartamudear: tartamudear, V. ir¡[. o lo''úbba;pres. el niño tar tamudea o bóllá a la lo''úbba [o bollá á la ló''úb ba]; paso punto él tartamudeó delante de su padre a lo''úbbi o bosuálo bo bOie áí [a ló''úbbi o bOsuálo bó bOiááí]; paso duro yo tartamudeaba cuando hablaba contigo n lo''úbessi no towáles si lá [n ló''úbessi no towálessí lá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 11', 'tartamudez: tartamudez, S. f lo''ú , la - o lo''ú; -ces be''ú (el. 4), las -ces e be''ú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bo''ú', 's.', 'm.', 'Cl. 1', 'tartamudo: bo''ú , el- o bo''ú; -s ba''ú (el. 2), los -s o bo''ú.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyinálolláa', 'S.', 'm.', 'Cl. 9', 'tataranieto: tyinálolláa , el - e tyi nálolláa; -s tyinálolláa (CL 10), los -s tyinálolláa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kolokollo', 'S.', 'm.', 'Cl. 9', 'tataratataranieto: kolokollo , el e kolokollo; -s kolokollo (el. lO), los -s i kolo kollo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lopappo', 'S.', 'm.', 'Cl. 9', 'techado: lopappo , el- o lopappo;-s pappo (el. 10), los -s i pappo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'techar: techar, v. in! O bara; paso punto los hombres techaron la cabaña a baie ba bariia o wetya [a baie bá bário wettSa]; paso duro las mujeres techaban sus casas a baísso ba baresiia i tyóbbo i ábó [aa bais� bá báresii tSobbó yábbó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lobityo', 'S.', 'm.', 'Cl. 11', 'techo: lobityo , el- o lobityo; -s bi tyo (el. 10), los -s i bit yO.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'tejer: tejer, v. inl. o otta; preso el muchacho teje las tejas o bosescppc a la otta o lotyerú [o boseseppe láa ottO 10tSerú]; pas punto los hombres tejieron las nipas a baie ba otyi i tyerú [a baie bá ótSi tSe rú]; paso duro nosotros tejíamos el mimbre de palma to otessi o lubbá [to otessó lubbá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('luua', 'S.', 'm.', NULL, 'tejido: luua (CI. 1 1), el- o luua; -s kuua (el. 10), los -s i kuua. tela, s . .f luua (CI. 1 1 ), elappá (el. 7), la - o luua, e elappá [eelappá]; -s kuua (el. 10), bilappá (el. 8), las -s i kuua, e hilappá. * - fina suua (el. 12), la - fina e suua; -s finas tuua (el. 13), las -s f inas o tuua. * - fuerte etapóllo (el. 7), la - e etapóllo [eetapóllo]; -s fuertes bitapóllo (el. 8), las -s fuertes e bitapóllo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

-- Lote 129 (entradas 3201 a 3225)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, nominal_class,
  spanish, notes, created_by
) VALUES
  ('elabba', 'S.', 'm.', 'Cl. 7', 'tema: elabba , el- e elabba ; -s bilabba , los -s e bilabba. * -s tradicio nales bilabba (el. 8).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'temblar: temblar, V. in( (a) o tyíbella; preso los perros tiemblan porque hace frío i puá i lá tyíbella kóri obotyo he sille; paso punto ellos temblaron de miedo ba tyíberi la e esáríi [ba tSíberi leesáríi]; paso duro el bebé temblaba cuando lloraba e sine''e si tyíbelessi si be''essi lá [e sine''e sí tSíbe lessi si bé''essí lá]. (b) o kokobbia; pres. yo tiem blo n la kokobbia, tú tiemblas o la kokobbia, él tiembla a la kokobbia, etc.; paso punto tú tem blaste o kokobiia, ella tembló a kokobiia, etc.; pas duro yo temblaba n kokobiesiia, nosotros temblábamos to kokobiesiia, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('botyíberi', 'S.', 'm.', 'Cl. 3', 'temblor: botyíberi , rityíbierí (el. 5), rikokko (el. 5), el - o botyíberi, e rityíbierí, e rikokko; -es betyíberi (el. 4), batyíbierí (el. 6), bakokko (el. 6), los -es e betyíberi, a batyí bierí, a bakokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'V.', NULL, NULL, 'temer: temer, V. inl. o salláa; preso las personas temen a las serpientes a batyo ba lá salláa i nMa [a batSo bá la sallÍl nooa]; paso punto yo temí n sáríi, tú temiste o sáríi, ella temió a sáríi, etc.; paso duro yo temía n sálessi, n sessi, tú temías o sálessi, o sessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('esáríi', 'S.', 'm.', 'Cl. 7', 'temor: esáríi , el - e esáríi ; -es bisáríi , los -es e bisáríi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('werí', 'S.', 'm.', 'Cl. 3', 'temperamento: werí , bokeú , el - o werí, o bokeú; -s bierí (el. 8), bekeú (el. 4), los -s e bierí, e hekeú. tempestad, s . .f pullá (el. 9), la - e pullá; -es pullá (el. 10), las -es i pullá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'templar: templar, V. in.f o no''iáa; pres. yo templo el agua n la nó''iaa a boppé [n la no''iá boppé];pas. punto ellos templaron el aceite ba no''Ía a biitá [ba nó''íá biitá]; paso duro nosotros templábamos el agua to no''iesiia a boppé [to no''iesíá boppé].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyótyi', 's.', 'm.', 'Cl. 9', 'templo: tyótyi , el- e tyótyi; -s tyótyi (el. lO), los -s i tyótyi.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'V.', NULL, NULL, 'tender: tender, V. in.f (la ropa) o bátyera; preso yo tien do mi ropa n la bátyera i kuua IÍl [n la bátSeri kuaaIÍl]; paso punto yo tendí mi ropa n i bátye ria i kuua IÍl [ni bátSeriia i kuaaIÍl], n bátyeriia i kuua ro [m batSeríí kuaaIÍl]; paso duro ellos ten dían la manta ba bátyeresiia o bOkutta [ba batSeresíó bokutta].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('rikko', 'S.', 'm.', 'Cl. 5', 'tenedor: rikko , teneroo , riba tya (el. 5), el - e rikko, e teneroo, e ribatya; -es bikko (el. 6), teneroo (el. 10), abatya (el. 6), los -es a bikko, i teneroo, a abatya.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'tener: tener, v. inf. (a) o okkáa; pres. tengo a mi parien te n okkíi o Mtyo IÍl [nokkió botSooIÍl I kokkió botSooro], tienes una camisa o okkíi 8ótte [bokkí sotte], etc.; pas duro yo tenía un casa n ka okkíi tyóbbo [n kokkí tSóbbo]. (b) o o''áa; preso tengo frio n la o''áa sille [n lo''á sille], tengo calor n la o''áa húé [n lo''áhuué];pas.punt. yo tuve frío n o''íi sille [no''í sílle]; pas. duro tú tenías calor o o''essi húé [bo''essí húúe]. 2. - miedo o salláa; preso el niño tiene miedo o bóllá a la salláa [o bollá á la sálláa]; paso punto la gente tuvo miedo a batyo ba sáríi; pas duro los pescadores tenían miedo a baobbe ba sálessi. 3. - compasión o okella losisi ( pas. punto okeri losisi [okeri lósissi]; paso duro okelessi losisi [okelessí lósissi]). 4. - prisa o horibia; preso el cazador tiene prisa o obébá a la horibia [obebá á la hóribbia]; paso punto ellos tuvieron prisa ba horibiia; paso duro mis padres tenían prisa a baie ro ba horibiesiia. 5. - buena salud o welebba; preso tengo buena salud n welebbi, no tengo buena salud n ta welebbi; paso punto ella tuvo buena salud a''a welebbi; paso duro ella no tenía buena salud a tyí''a welebbi [a tSí''a welébbí]. 528 / tenia', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'tenia: tenia, s. f bonokólla , la - o bonokólla; -s bonokólla (el. 4), las -s o bonokólla.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('s', 'adj.', NULL, 'Cl. 9', 'tenue: tenue, adj. s. koko , huenóko .', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'terminar: terminar, v. inf o sétya; preso yo termino el tra bajo n la sétya e elakó [n la sétSeelakkó]; paso punto tú terminaste la canción o lo sétyia o lobe rí, ella terminó el trabajo a e sétyia e elakó [e sétSia eelakkó]; paso duro vosotros terminabais la historia 10 bO sétyesiia o boatta. 2. - con algo o con algnien o séra; paso punto el soldado ter minó con los prisioneros e sotyáa si séría a batyelemán [e sotSá sí séríá batSelemáán]; paso duro ellos terminaban con los ñames ba séresiia e billo [ha séresíé billo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
