  ('f', 's.', NULL, 'Cl. 3', 'tiranía: tiranía, s. f bopippí , la - o bopippí; -s bepippí (el. 4), las -s e bepippí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'tirar: tirar, v. in/. (a) o uppa;pres. ellos tiran la basura ba lá uppa o bOtyuttá [ba lá uppo botSuttá]; paso punto vosotros tirasteis los zapatos lo uppi i sús su [lo uppí sussu]; paso duro nosotros tirábamos la ropa to upessi i kuua [to upéssí kuua]. (b) o uhéra; preso ellos me tiran el balón ba la le uhe ra e suppá [bá la le úhere suppá]; paso punto tú tiraste la manta o uhériia o bokutta [o uhéríó bokutta]; paso duro los pescadores tiraban sus redes a baobbe ba uheresiia a baotté ba ábó [a baobbe búhéríá baotte bábbó].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('in', 'v.', NULL, NULL, 'tiritar: tiritar, v. in/. (a) o tyíbella; preso los niños tiri tan a bóllá ba lá tyíbella [a bollá bá la tSíbella]; paso punto tú tiritaste o tyíberi, él tiritó a tyíbe ri, etc.; paso duro vosotros tiritabais lo tyibeles si, los perros tiritaban i puá i tyíbelessi, etc. (b) o kokobbia (pas. punto kokobiia; paso duro koko biesiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'tiritera: tiritera, s. f rityíbierí , la - e rityíbierí; -s batyíbierí (el. 6), las -s a batyíbierí.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('eoppe', 's.', 'm.', 'Cl. 7', 'tísico: eoppe , el - e eoppe ; -s bioppe , los -s e bioppe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'titubear: titubear, v. inl o nekekka;pres. tú titubeas o la ne kekka, yo no titubeo n tyá la nekekka; paso punto ellos titubearon ba nekekki [ha nékekki]; paso duro ellas titubeaban ba nekekessi [ha nékekessi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 12', 'tiza: tiza, s. f sitepéppa , la - e sitepéppa; -s totepéppa (el. 13), las -s o totepéppa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('tyotyó', 's.', 'm.', 'Cl. 9', 'tizón: tyotyó , el - e tyotyó; tizones tyotyó (el. 10), los tizones i tyotyó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'toalla: toalla, s. f tábuella , la - e tábuella; -s tábuella (el. 10), las -s i tábuella.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('kekessé', 's.', 'm.', 'Cl. 9', 'tobillo: kekessé , pepenna , pepelle (el. 9), el- e kekessé, e pepenna, e pepel le; -s kekessé (el. 10), pepenna (el. 10), pepelle (el. 10), los -s i kekessé, i pepenna, i pepelle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('risopuára', 's.', 'm.', 'Cl. 5', 'tobogán: risopuára , el - e risopuára; toboganes basopuára (el. 6), los toboganes a basopuára. * los toboganes del parque a baso puára ba e rikki wela [a basopuára be ríkkí wélla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'tocar: tocar, v. inf (a) o esi''a; preso nosotros tocamos al cocodrilo to la esi''a e rikettá [to lesi''e rikettá]; paso punto ellos tocaron el libro del maestro ba 530 I tocino esi''i e ribúkku ri o bue''iáa [besi''ie ríbúkku ro bué''ia]; pas. duro las jóvenes tocaban al músico a basesepári ba esi''essi e neppí [a basesepári besi''essé neppí]. (b) o óppa; preso yo toco la gui tarra n la óppa e kittá [n loppé kittá]; paso punto los hombres tocaron las cornetas a baie ba óppi e betuttú [a baie bóppié betuttú]; paso duro mi tío Rimmá tocaba la corneta o bOióppé m e Rimmá ópessi o botuttú [o boióppémé rimmá ópessó botuttú]. 2. - para o opella; imp. tócame la gui tarra opella le e kittá [opellálé kittá]; paso punto los músicos tocaron la guitarra para la donce lla i neppí i operi o bulla e kittá [i neppí yóperó bulle kittá]; paso duro nosotros tocábamos las f lautas to ópessi i tyapelle [topessi tJapelle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bahabbáa', 's.', 'm.', 'Cl. 6', 'tocino: bahabbáa , el - a bahabbáa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('né''a', 'adv.', NULL, NULL, 'todavía: todavía, adv. né''a: - estoy comiendo né''a ressi, duermo né''a lókki, - hablo né''a towessi, etc. todo, a, mor:f indo bommaa (el. 1 : - la persona o botyo bOmmaa; el. 3: - la cara o bossó bOm m aa); rimmaa (el. 5: -la mejilla e rikekko rimmaa); ernmaa (el. 7: - el pueblo eeríia emmaa); lornmaa (el. 11 : -la sardina o lokollo lornmaa); simmaa (el. 12: - el cuento e siatta simmaa); hammaa (el. 16: -el sitio a habba hammaa). -s, mor! indo bammaa (el. 2: -s las personas a batyo bammaa; el. 6: -s las mejillas a bakekko bammaa); bemmaa (el. 4: -s las caras e bessó bemmaa); bimmaa (el. 8: -s los pueblos e biriia bimmaa); kubbaa (el. 10:-s las sardinas ikollokubbaa); tornmaa (el. 13: -s los cuentos o toatta tommaa).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('pullá', 's.', 'm.', 'Cl. 9', 'tomado: pullá , el - e pullá; -s pullá (el. 10), los -s i pullá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'tomar: tomar, v. inl (a) o bó''a; preso los sacerdotes toman sus sombreros i pateri i lá bó''a e mbuttá bi ábó [i pateri i lá bO''é mbuttá biábbó]; paso punto ellos tomaron sus cosas ba bó''i a 10kkó la ábó [ba bó''íá 10kko labbó]; pas. duro tú tomabas tu tirachinas o bó''essi e efélétya ó [o bó''es séefélétJaaó]. (b) o ráa; preso yo tomo agua n la r á a boppé [n la ra bóoppé]; paso punto los gatos tomaron las sardinas o topóssi to réi i kollo [o topóssi to réyí kollo];paspunt. antaño los niños no tomaban vino rnmalé a bóllá ba tá ressi wem [rnmalé, a bollá bá tá ressi weem].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ne''í', 's.', 'm.', 'Cl. 9', 'tomate: ne''í , el - e ne''i; -s ne''í (el. 10), los -s i ne''í.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'tomatera: tomatera, s. f bohíri , bOna''i , lone''í (el. 11), la - o bohiri, o bona''í, o lone''í; -s behíri (el. 4), bana''í (Cl. 6), bane''í (el. 6), las-s e behíri, a bana''í, a bane''í.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolonká', 's.', 'm.', 'Cl. 3', 'tonel: bolonká , lusuiánno (el. 1 1), ribetté (el. 5), el- o bolonká, o lusiánno, e ribet té; -es belonká (el. 4), kusiánno (el. 10), abetté (el. 6), los -es e belonká, i kusiánno, a abetté.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'tontería: tontería, s. f botyípótyípóO , la - o bütyí pótyípóo; -s betyípótyípóo (el. 4), las -s e be tyípÓtyípóo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekké', 's.', 'm.', 'Cl. 7', 'tonto: ekké , ekakká , seké (el. 12), enyo''o (el. 7), el - e ekké, e ekakká [eekakká], e seké, e enyo''o [eeJ1o''o); -s biek ké (el. 8), bikakká (el. 8), tueké (el. 13), binyo''o (el. 8), los -s e biekké, e bikakká, o tueké, e binyo''o.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'topar: topar, v. inf (o) o kubbáa (pas. punto kubbí; paso duro kubessi). 2. -se o tóballa; paso punto me topé con mi amigo n tóbari o wéso''o m [n tóbáró weso''oorn]; paso duro ellos se topaban siempre con el militar ba tóbalessi o obitábít ta ebéló e ba [ba tóbálessó obitábítta ebeló ebba].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('péláká', 's.', 'm.', 'Cl. 9', 'topo: péláká , el - e péláká; -s péláká (el. 10), los -s i péláká.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'toquetear: toquetear, v. inf (a) o papara (pas. punto papa riia; paso duro paparesiia) (b) o esi''a (pas. punto esi''i; paso duro esi''essi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'torcer: torcer, v. inf o rikkáa; preso yo tuerzo el brazo n la rikkáa o lobbó [n la rikkó lobbó]; paso punto nosotros torcimos sus dedos to rikkíi e bene be áí [to rikkíé bene biááí); paso duro vosotros torcíais los brazos del ogro lo rikessi a abbó bá e enoko nokko [lo rikessá abbó bénokonokko].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

