  ('ini', 'v.', NULL, NULL, 'trenzar: trenzar, v. ini o otta; preso la abuela trenza a su biznieta o bonánna a la otta e bobuella áí [o bo nánna a la otte bobuellaaí]; paso punto los hom bres trenzaron las nipas a baie ba otyi i tyeTÚ [a baie bá ótSi tSerú];pas. duro nosotros trenzába mos las nipas to i otessi i tyerú [tui ótessi i tSerú]. 2. - con o otalla; preso la abuela trenza con sus dedos o bOnánna a la otalla e bene be áí [o bonán na a la otalle bene béáí]; paso punto ellos trenza ron con hilo negro ba otari illoo kilókíllo [ba óta ri ilIo kilókíllo], ba ótari teleri kilókíllo; paso duro nosotros trenzábamos con mimbres de palma to otalessi kubbá.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
