  ('f', 's.', NULL, 'Cl. 3', 'trifulca: trifulca, s. f lobáárh (el. 1 1), bolláa , la o lobáárh, o bOlláa; -s kobáárh (el. 10), belláa (el. 4), las -s i kobáárh, e belláa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

