  ('ekúbari', 's.', 'm.', 'Cl. 7', 'tropezón: ekúbari , el - e ekúbari [eekúbari]; tropezones bikúbari (el. 8), los tro pezones e bikúbari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ekúbari', 's.', 'm.', 'Cl. 7', 'tropiezo: ekúbari , el - e ekúbari [eekúbari]; -s bikúbari (el. 8), los -s e bikúbari. in! o hilláa; preso durante todo el día nosotros trotamos o bokó bo mmaa ro la hilláa.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
