  ('bosossó', 's.', 'm.', 'Cl. 3', 'tubo: bosossó , el - o bosossó; -s besossó (el. 4), los -s e besossó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bOlebbáa', 's.', 'm.', 'Cl. 1', 'tuerto: bOlebbáa , ebOranokko , el o bOlebbáa, e ebOranokko [eebOránokko]; -s baleb báa (el. 2), biboránokko (el. 8), mbOránokko (Cl. 8), los -s a balebbáa, e bibOránokko, e mbOránokko.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bopáko''e', 's.', 'm.', 'Cl. 3', 'tulipanero: bopáko''e , el - o bopá ko''e; -s boopáko''e (el. 4), yopáko''e (el. 8), los -s e beopáko''e, e yopáko''e.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('il''', 'v.', NULL, NULL, 'tumbarse: tumbarse, v. il''!f o balabba;pres. me tumbo bajo el Sol n la balabba e itohí atá [n la balabba e itohiátta]; paso punto ella se tumbó cuando lle gué a balabbi n pooi lá [a balabbi ro poí lá]; paso duro me tumbaba n balabessi [m balabessi], te tumbabas o balabessi, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('enná', 's.', 'm.', 'Cl. 7', 'tumor: enná , eakka , el- e enná [eenná], e eakka [eeakka]; -es binná (el. 8), biak ka (el. 8), baakka (el. 6), los -es e binná, e biakka, a baakka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
