  ('f', 's.', NULL, 'Cl. 12', 'ubre: ubre, s. f sibelle , ribeBe , la - e sibelle, e ribelle; -s tobelle (el. 13), abelle (el. 6), las -s o tobelle, a abelle.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'úlcera: úlcera, s. f peké , la - e peké; -s peké (el. 10), las -s i peké. último, a, adj. s. bOsubbá (el. 1: - persona botyo bosubbá; el. 3: - dedo bone bosubbá); - lima isa''a (5) risubbá; - aplauso ebátyo (7) esubbá; iguana nebba (9) subbá; etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bolakka', 's.', 'm.', 'Cl. 3', 'umbral: bolakka , el - o bOlakka; -es belakka (el. 4), los -es e belakka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'una: una, adj. numo bulé (el. 1 : - persona botyo bulé; el. 3: - historia boatta bulé), rilé (el. 5: - meji lla rikekko rilé), nné (el. 7: - uña e''e nné), té (el. 9: - serpiente nooa té), lulé (el. 11 : - tela luua lulé), silé (el. 12: - camisa sotte silé).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('i''', 'v.', NULL, NULL, 'ungir: ungir, v. i''1f o pitta;pres. el velador unge a las don cellas con arcilla sagrada o bohiarnmo a la pitta e biulla siobbo [o bohiarnmo a la pitte biulla siobbo]; paso punto él les ungió con arciUa sagrada a ba pi t y i siobbo [a ba pítJi siobbo]; paso duro el sacerdo te ungia a los jóvenes e pateri a pitessi a baseseppe.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 5', 'unidad: unidad, S. f rokalla , rokko , la - e rokalla, e rokko; -es bokalla (el. 6), bOkko (el. 6), la - del pueblo e rokalla rá e ériia [e rokalla rériia].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 5', 'unión: unión, s. f rokka , 10''0 (el. 1 1), rikokko (el. 5), ritolari (el. 5), rokalla (el. 5) la - e roka, o 10''0, e rikokko, e ritolari; uniones bokka (el. 6), beo''o (el. 4), bakokko (el. 6), batolari (el. 6), bOkalla (el. 6), las uniones a boka, e beo''o, a bakokko, a batolari.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'V.', NULL, NULL, 'unir: unir, V. inf (a) o siaella; preso este camino une los dos pueblos elo telle e lá siaella e biriia mma lé [elo telle e lá siaelle biria mma lé]; paso punto él unió los caminos a siaeri i telle; paso duro vosotros uníais vuestras casas lo siaelessi i tyóbbo i áno [lo siaelessí i tJobbo yánno]. (b) o okanna; paso punto se unieron los trabajadores a balakoláko ba okam [a balakoláko bókaarn]; paso duro no se unían los trabajadores por que estaban cansados ba tá okanessi a bala koláko kóri na ba''a tyibbíi [ba tókanessí a balako láko kóri ná bá''a tJibbíi].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('otyé', 'S.', 'm.', 'Cl. 3', 'universo: otyé , obOtyo , el- o otyé, o obotyo. un, o, adj. numo bulé (el. 1: - hijo bOllá bulé [bollá búlle], el. 3: - dedo bone bulé), rilé (el. 5: reloj isutto rilé), nné (el. 7: - poblado eriia nné), lulé (el. 1 1 : - bofetada lopatta lulé), silé (el. 12: - hoja sinta silé).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'untar: untar, v. inf o pitta; pres. mi abuelo me unta con caolín o bOyolla IÍJ. a la le pitta peppa; paso punto las ancianas untaron a la doncella con tolla e biaríolla bi pityi o bulla tolla [e biaríolla bi pítJo bulla tolla]; paso duro nosotros untábamos el cadáver con aceite to pitessi e erutta biitá [to pitessérutta biittá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 'S.', NULL, 'Cl. 7', 'uña: uña, S. f e''e , ekke , la - e e''e, e ekke; -s bie''e , yekke , las -s e bie''e, e yekke.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('lohahá', 'S.', 'm.', NULL, 'uñero: lohahá (el. 1 1), el - o lohahá; -s behahá (el. 4), los -s e behahá. 536 / urna', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('I', 's.', NULL, 'Cl. 12', 'urna: urna, s. I sibakka , la - e sibakka; -s tobakka (el. 13), las -s o tobakka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'usar: usar, v. ir¡[. o usálla; preso tú me usas como un trapo o la le usálla la pisíssi [o la le úsalla la písíssi]; paso punto yo le usé como un trapo n bo usám la pisíssi [m bo usám lá písíssi]; paso duro tú usabas la crema o usálessi a biitá [o usálessá biittá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bohNnó', 's.', 'm.', 'Cl. 3', 'uso: bohNnó , el - o bOhNnó; -s behNnó (el. 4), los -s e behNnó. usted, prono pero úwe, o; quiero hablar con usted n la na''a o tówálla [n la na''o tówalla].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inl', 'v.', NULL, NULL, 'utilizar: utilizar, v. inl o usálla (pas. punto usám; pas. duro usálessi).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 3', 'uva: uva, s. f botokka , la - o botokka; -s betok ka (el. 4), las -8 e betokka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, 'Cl. 9', 'vaca: vaca, s. f pókkó , la - e pókkó; -s pókkó (el. 10), las -s i pókkó.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('f', 's.', NULL, NULL, 'vacación: vacación, s. f lohebbo (el. 1 1), la - o lohebbo; vacaciones bahebbo (el. 6), las vacaciones a bahebbo.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('irif', 'v.', NULL, NULL, 'vaciar: vaciar, v. irif. o haólla; preso yo vacío el bidón n la haólla o bolonká [n la háóllo bolonká], tú vacías la botella o la haólla o opoteri [o la háóllopoteri], etc.; paso punto mi madre vació la olla o oberíi m a haóri e etém [ooberímá haoree tééID]; paso duro vosotros vaciabais vuestra casa lo hawessi e tyóbbo áno [lo hawessé tSob buanno].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ir', 'v.', NULL, NULL, 'vagabundear: vagabundear, v. ir¡[. o hilláa, o hOkkáa;pres. los niños vagabundean a bOllá bá la hokkáa; paso punto ellos vagabundearon durante todo el día ba hokkíi o bokó bOmmaa; paso duro tú vagabun deabas con tu amigo o hOkessi la o wéso''o o [o hókessi )0 wéso''oo].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('ope', 's.', 'm.', 'Cl. 7', 'vagabundeo: ope , wáka , el e ope, o wáka; -s biope (el. 8), biáka (el. 8), los -s e biope, e biáka.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('bákko', 's.', 'm.', 'Cl. 9', 'vagabundo: bákko , nonowé , el - e bákko, e nonowé; -s bákko (el. 10), nono wé (el. 10), los -s i bákko, i nonowé.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('inf', 'v.', NULL, NULL, 'vagar: vagar, v. inf (a) o hokkáa; pas.punt. los guerre ros vagaron toda la noche a abitábítta ba hok kíi o botyíó bommaa [aabitábítta ba hokkió bo tSíó bómmaa]; paso duro ellos vagaban porque buscaban trabajo ba hOkessi kóri ba ná''essi elako [ba hókessi kóri ba ná''esseelako]. (b) o bákobia (pas. punto bákobiia; paso duro báko biesiia).', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi');

