  ('numo', 'adj.', NULL, NULL, 'veinticinco: veinticinco, adj. numo ityílIa la beto. Ej . expr. vasos de cristal biakákka bié ityílla la bito, sardinas kollo yé ityíIIa la tyo, - personas batyo be ityílla la bato, - camisas totte tué ityílla la toto, etc.', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'veinticuatro: veinticuatro, adj. numo ityíIIa la biele. Ej . expr. quiero - panes n la na''a basoppo be ityí1Ia la bale, tengo - dedos kokkí bene bié ityílla la bie le [kokkí béne bié itSilá la bielle].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'veintidós: veintidós, adj. numo ityíIIa la eppa. Ej . expr. hay - árboles en mi finca he batté be ityíIIa la appa obáám m [be batte be itSíla la appa oobaIÍl.IÍl.], hemos leído - historias to sossi beatta bié ityílla la eppa [to sossí béatta bié itSíla la eppa].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
  ('numo', 'adj.', NULL, NULL, 'veintinueve: veintinueve, adj. numo ityíIIa la ra''a la betá. Ej . e xpr. murieron - personas ha wéi batyo be ityíl la la bale [há wéí bátSo be itSilá la ra''a la battá], mi abuelo tenía - plátanos o boyolla m a okkíi bekobbe bié ityíIIa la ra''a la betá [o bOyollam a okkí békobbe bié itSilá la ra''a la bettá].', 'Fuente: Diccionario Español-Bubi', 'import-espanol-bubi'),
